(12, 46, 0, '$150.00 on site and $130.00 remote.', '2016-06-22 00:01:01', 'Bernard Conlon', 'A', 'bconlon@etanj.com', 71),
(13, 46, 0, 'our rate with Strenia Solutions back in 2014 was EUR 120.00 on site and as far as i remember the same rate for remote', '2016-06-23 10:08:47', 'Ulrich Hartwig', 'A', 'ulrich.hartwig@acslogistics.at', 376),
(14, 46, 0, 'Zinnovate\'s rate was EUR 135.00 remote/on site for some coding (no training)', '2016-06-23 10:15:42', 'Ulrich Hartwig', 'A', 'ulrich.hartwig@acslogistics.at', 376),
(15, 48, 0, 'Dear Bernie,\r\n\r\nwe did some simple Workflow setting like automated emails setting at some points (booking confirmation, departure confirmation etc). For example after sending pick up cartage to trucking company, shiper will receive automatically message with truck nr, estimated pik up time etc.', '2016-09-22 11:28:38', 'Jozef Bartosek', 'A', 'jozef.bartosek@balin.sk', 368),
(16, 48, 0, 'Dear Bernie,\r\n\r\nwe did some simple Workflow setting like automated emails setting at some points (booking confirmation, departure confirmation etc). For example after sending pick up cartage to trucking company, shiper will receive automatically message with truck nr, estimated pik up time etc.', '2016-09-22 12:32:07', 'Jozef Bartosek', 'RM', 'jozef.bartosek@balin.sk', 368),
(17, 48, 0, 'Thanks Jozef.  Was really looking for help with the workflow program.\r\nThanks for the idea and sharing what you have done.  ', '2016-09-22 18:16:37', 'Bernard Conlon', 'A', 'bconlon@etanj.com', 71),
(18, 48, 0, 'No problem. If you want i can send you some screens as example. Just let me know.', '2016-09-22 19:53:00', 'Jozef Bartosek', 'A', 'jozef.bartosek@balin.sk', 368),
(19, 48, 0, 'Thanks if you don\'t mind when you have a chance.', '2016-09-22 19:55:41', 'Bernard Conlon', 'A', 'bconlon@etanj.com', 71),
(20, 48, 0, 'we have done the workflow settings on our own but still developing... doing workflow settings may never end.\r\nWe could manage to create a workflow with fixed Milestones and dynamic elements based on events happened during a shipment.\r\nWe are now in contact with a german consultant (www.akquinet.de) to do some workflow coding.\r\nWe are trying e2e with an Agent, but honestly it creates some issues when Settings are not aligned.\r\n\r\nMy suggestion: try create a very general workflow with milestones that must happen and link them to an escalation team in case they do not happen (exceptions). Add more detailed Milestones Step-by-Step once they are fully implemented in your team.', '2016-09-23 09:37:51', 'Ulrich Hartwig', 'A', 'ulrich.hartwig@acslogistics.at', 376),
(21, 48, 0, 'ThanksUlrich..we will hire someone.', '2016-09-26 20:03:48', 'Bernard Conlon', 'A', 'bconlon@etanj.com', 71),
(22, 48, 0, 'ThanksUlrich..we will hire someone.', '2016-09-26 20:03:54', 'Bernard Conlon', 'A', 'bconlon@etanj.com', 71),
(23, 48, 0, 'Does anyone put POD\'s onto a file that then can appear on web tracking?', '2016-09-26 20:04:34', 'Bernard Conlon', 'A', 'bconlon@etanj.com', 71),
(24, 49, 0, 'Jan,\r\nWe are on Cargowise.  Express Transport.', '2016-11-28 22:51:45', 'Bernard Conlon', 'A', 'bconlon@etanj.com', 71),
(25, 49, 0, 'ACS Logistics Austria is on CW1', '2016-11-29 00:27:04', 'Ulrich Hartwig', 'A', 'ulrich.hartwig@acslogistics.at', 376),
(26, 49, 0, 'Dear Jan, Balin Logistics is on CW1 too :)', '2016-11-29 12:52:36', 'Jozef Bartosek', 'A', 'jozef.bartosek@balin.sk', 368),
(27, 49, 0, 'Cargo Brokers is also on CW1  ', '2016-11-29 21:44:10', 'Nicole Steinmetz', 'A', 'nsteinmetz@cargobrokers.com', 83),
(28, 49, 0, 'Powerhouse Logistics in Australia are with WiseTech Global (CargoWise)', '2016-11-30 04:56:16', 'Peter Brueckner', 'A', 'peter.brueckner@powerhousensw.com.au', 2),
(29, 49, 0, 'Powerhouse Logistics in Australia are with WiseTech Global (CargoWise)', '2016-11-30 04:56:21', 'Peter Brueckner', 'A', 'peter.brueckner@powerhousensw.com.au', 2),
(30, 49, 0, 'Powerhouse Logistics in Australia are with WiseTech Global (CargoWise)', '2016-11-30 04:56:26', 'Peter Brueckner', 'A', 'peter.brueckner@powerhousensw.com.au', 2),
(31, 49, 0, 'we are tracking agents who are on Cargowise within their organization profile.\r\nWe have added a customized Marketing Option tick box called \"Cargowise\" under the organizations Sales tab > Client Summary. When flagging the box, it becomes reportable. ;-)', '2016-11-30 12:36:56', 'Ulrich Hartwig', 'A', 'ulrich.hartwig@acslogistics.at', 376),
(32, 49, 0, 'Hi Jan,\r\nITN is on Cargowise\r\n', '2016-11-30 20:43:59', 'Rebecca Nielsen', 'A', 'rebeccan@itn-logistics.com', 262),
(33, 50, 0, 'we would like to give our overseas agents the ability to add the signature as well as upload a hard copy.', '2017-04-07 20:46:09', 'Ulrich Hartwig', 'A', 'ulrich.hartwig@acslogistics.at', 376),
(34, 51, 0, 'we would like to have this feature as well, but not on WebTracker as it would require the supplier to Login. Our Truckers would not do that...\r\n\r\nAs a Workaround you can still grant them rights to upload documents and let them upload a POD hardcopy.', '2017-04-07 19:42:35', 'Ulrich Hartwig', 'A', 'ulrich.hartwig@acslogistics.at', 376),
