(46, 0, 'Set Fees for HTFN Cargowise Users', '2016-06-21 23:57:07', 'We would like to negotiate set reduced fees with CargoWise COnsultants.   Can you please let me know what hourly rate you paid your consultants for on site and remote services.', 'Angela Flynn', 'aflynn@etanj.com', 71, '2016-06-30', NULL, NULL, NULL),
(47, 0, 'E2E', '2016-08-08 20:47:14', 'does anyone have any experience with implementing E2E. We will soon undertake this with our HKG agent and I am looking for some input.\r\nThanks, Bernie', 'Bernard Conlon', 'bconlon@etanj.com', 71, '2016-08-31', NULL, NULL, NULL),
(48, 0, 'workflow in Cargowise1', '2016-09-21 21:56:32', 'Has anyone done any workflow in regards to E2E or any workflow at all.  Or hired a WiseService Partner to do any.\r\nThanks', 'Bernard Conlon', 'bconlon@etanj.com', 71, '2016-09-29', NULL, NULL, NULL),
(49, 0, 'Agents on Cargowise', '2016-11-30 20:48:01', 'Could we have a list made out with the Company names within HTFN using CW. I would like to be able to prioritize these agents in order to optimize our operation.\r\n\r\nCheers Jan/Airland ', 'Jan Jensen', 'jjensen@airlandlogistics.com', 304, NULL, '2016-11-30', 'Jan Jensen', NULL),
(50, 0, 'Where are the active discussions in this section', '2017-04-07 19:24:02', 'I have seen notifications of postings but after logging into the discussion board I only get the Add A New Topic option. Where are the active discussions on CW?', 'Douglas W. Meadows', 'dmeadows@ram-intl.com', 78, '1967-01-01', NULL, NULL, NULL),
(51, 0, 'Signatures for POD on webtracker', '2017-04-07 18:53:34', 'Does anyone have the need to have signatures for pod\'s on webtracker?  Apparently that is not possible now.  Cargowise have offered to quote on making that happen.\r\nIf there is enough interest and the cost can be split I will ask for a quote.', 'Bernard Conlon', 'bconlon@etanj.com', 71, '1967-01-01', NULL, NULL, NULL),
