(32, '2009-01-25 00:00:00', '2009-02-01 00:00:00', 'LUNAR NEW YEAR HOLIDAYS', '299', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: ANC\n	Member Email: opmanager@ancshipping.com\n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear All Valued Partners,\r\n\r\nWe would like to express our sincere thanks to all of you for the support\nand cooperation to us during the year of 2008.\r\n\r\nAccording to our tradition, we will take a long holidays in occasion of\nLUNAR NEW YEAR. \r\n\r\nOur Offices will close from 25th January 2009 to 1st February 2009. We\nwill resume working on 2nd February 2009.\r\n\r\nFor any consignment to us during these holidays, please kindly send\npre-alert and shipping documents to us latest on 22 January 2009.\nOtherwise, extra charges and fines will occur such as fine of late\nregistration of cargoes manifest,...\r\n\r\nIn necessary or urgent case during our holidays, please feel free to\ncontact with us by hand phone No. 84 90 3546 300 - Daniel Ve.\r\n\r\nHAPPY NEW YEAR 2009\r\n\r\nThanks and Best Ragrds,\r\nDaniel Ve - OP Manager\r\n================================\r\nANC CO., LTD.\r\n35 tRan Quoc Hoan, Ward 4,\r\nTan Binh Dist., HoChiMinh City, Vietnam\r\nTel: 84 8 38116909  Fax: 84 8 38115048</font></pre>'),
(33, '2009-02-03 00:00:00', '2009-02-09 00:00:00', 'Thailand- National Holiday, Monday Feb 10', '18', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: East-West\n	Member Email: michael@ewl.co.th\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Friends, \r\n\r\nPlease take note of the forthcoming National Holiday in the Kingdom of\nThailand on Monday, February 10th – in observation of Makha Bucha Day as\nall East-West offices will be closed.\r\n\r\nFor any urgent matters you may contact the following East-West staff on\ntheir mobile phones:\r\n\r\nAirfreight- \r\nMr. Narong Supanakorn            +66-81-923-4472\r\n\r\nSeafreight-  \r\nMr. Somchai Boonsaisub           +66-81-920-1829\r\n\r\nManagement- \r\nMr. David Grant                  +66-89-896-8067\r\n\r\nBest regards, \r\nMichael \r\nEast-West BKK\r\n</font></pre>'),
