(62, '2009-04-01 00:00:00', '2009-04-15 00:00:00', 'Thailand - April Long Holidays', '18', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: East-West\n	Member Email: Michael@EWL.co.th\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Partners and Friends-\r\n\r\nI would like to bring to your attention of the upcoming long holidays in\nthe Kingdom of Thailand.\r\n\r\nMonday the 6th of April – Chakri Memorial Day\r\n\r\nMonday the 13th to Wednesday the 15th of April- Songkran (Thai New Year)\r\n\r\nNote that many people take extended leave during this period, therefore,\nif you are planning on imports/exports during this period, please check\nwith us prior to commencing with any movements.\r\n\r\nThe following staff can be contacted on their mobile phones for any urgent\nmatters:\r\nAirfreight- \r\nMr. Narong Supanakorn           +66-81-923-4472\r\n\r\nSeafreight-  \r\nMr. Somchai Boonsaisub           +66-81-920-1829\r\n\r\nManagement- \r\nMr. David Grant                  +66-89-896-8067\r\n\r\n\r\nBest regards, \r\n\r\nMichael Parham\r\n\r\nEast-West Logistics Co., Ltd.\r\n10/1 Soi Farm Watana, Rama IV Rd\r\nPrakhanong, Klongtoey, Bangkok 10110\r\nTel: +66-2-712-0130 ext 614\r\nFax: +66-2-712-0156\r\nMobile: +66-89-206-2065\r\nEmail: michael@ewl.co.th\r\nSkype: MichaelParham\r\n\r\n</font></pre>'),
