(192, '2010-06-16 00:00:00', '2010-06-16 00:00:00', 'Holiday Notice', '313', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: Trust\n	Member Email: david.wu@trust-logistics.com\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Partners,\r\n\r\nKindly take note that our offices would be closed on 16th June for\ncelebration of a national holiday Dragon Boat Festival.\r\n\r\nNormal office hour will be resumed from June 17th, should you have any\nurgent inquiry during the break,\r\nplease call David WU \r\n+886 983008276\r\n\r\nThanks for your attention.\r\n\r\nBest regards,\r\nDavid WU\r\n \r\n</font></pre>'),
