(207, '2010-09-22 00:00:00', '2010-09-24 00:00:00', 'Holiday Notice', '322', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: DAS Beijing\n	Member Email: vivian@daslog.com\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Partners,\r\n \r\nPlease note our office will be closed for Mid-Autumn Festival and\nNational\r\nDay Holiday, here below is the holiday schedule.\r\n \r\nMid-Autumn Festival:  2010.09.22 - 2010.09.24\r\nNational Day Holiday: 2010.10.01 - 2010.10.07\r\n \r\nShould there be any urgent issues during the holiday, please feel free to\r\nsend your e-mail to richard@daslog.com.cn\r\n \r\nOr you could call my mobile +86 13916111721 for help.\r\n \r\nThank you for your attentions.\r\n \r\nBest regards,\r\nRichard Cheng\r\nMarketing Executive\r\nDAS Logistics Beijing Co., Ltd.\r\n</font></pre>'),
(208, '2010-10-03 00:00:00', '2010-10-08 00:00:00', 'FIATA World Congress - Bangkok 2010', '18', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: East-West\n	Member Email: david@ewl.co.th\n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear HTFN partners,\r\n\r\nEast-West Logistics Co., Ltd would like to inform you that we are actively\nparticipating in the FIATA 2010 World Congress, in Bangkok from 3-8th\nOctober.\r\n\r\nIn order to make the most from this event, we would like to share with you\nall the information on the website.  There is a already a full delegate\nlist, summary of sponsors, as well as a meeting scheduler.\r\n\r\nFrom what I have studied, there are 74 countries represented and almost\nwithout exception by their freight association, as well as other\nforwarding/logistics groups.     If you are close to your country freight\nforward association and would like to suggest that EWL have set up a\nbilateral discussion to discuss trade between your market and Thailand,\nplease communicate this with me directly, so that I can set up on the FIATA\nscheduler.\r\n\r\nPlease browse the complete attendee list and let me know if there is also\nany other company or group that you believe would give us an opportunity to\ndevelop business together.   Please make use of the following links and I\nthank you in advance for your support to us, ensuring that we can bring the\nmost business opportunties for HTFN from this event.\r\n\r\nhttp://www.fiata-networking.com/\r\nhttp://www.fiata2010.org/Exhibition_Layout.pdf\r\nhttp://www.fiata2010.org/DelegateListWeb.pdf\r\n\r\nWith Best Regards\r\n\r\n\r\nDavid Grant\r\nGeneral Manager\r\nEast-West Logistics Co., Ltd</font></pre>'),
(209, '2010-09-22 00:00:00', '2010-09-22 00:00:00', 'DDU assistance in Guinea Bissau', '333', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: GAASH\n	Member Email: yaniva@gaash-customs.co.il\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\n\r\nHello,\r\n\r\nI need a rate quote for the following;\r\n\r\n\r\nCommodity: TURBO PROP ENGINE\r\nWeight: 1 ton  Gross including case\r\nNON DANGEROUS – No C02 inserted\r\n\r\nOrigin: Bangor, Maine, USA   International airport   BGR\r\n\r\nDestination: Bissau International airport OXB      Guinea Bissau     DDU\r\n\r\nSpecial requirements:\r\n\r\n•	At destination, engine must be transferred to ENGINE REPAIR HANGAR\ninside the airport\r\n•	Need an agent that can handle all customs and duties \r\n•	Customer will be there to accept the goods \r\n\r\nPlease advise cause they are now ready to ship.\r\n\r\nHave a good day\r\n\r\n\r\nYaniv Abitan\r\nSales & Marketing\r\n\r\nPOB 53, B.G. Airport 70100, Israel \r\n&#61479;: 972 (0)3 5391800\r\n&#61640;: 972 (0)52 8694417\r\n&#61642;  972 (0)3 9793003\r\n@: yaniva@Gaash-Customs.co.il   \r\n      www.gaash-customs.co.il  \r\n</font></pre>'),
