(223, '2010-11-01 00:00:00', '2010-11-03 00:00:00', 'HOLIDAYS IN ECUADOR', '361', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: LOGISTICA Maseni s.a\n	Member Email: a.flores@logistic.com.ec\n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nNos permitimos informales que los dias Lunes 1, Martes 2 y Miercoles 3\nNoviembre son feriado en Ecuador por lo que nuestras oficinas permaneceran\ncerradas. Nos reintegraremos a nuestras actividades el dia Jueves 4\nNoviembre en horario normal. Para emergencias favor contactar con: Jose\nHernandez - (5938)730 2444. Gracias por su atencion.\n**********************************************************************We\nare pleased to inform you that Monday 1st, Tuesday 2nd and Wednesday 3rd of\nNovember is holiday in Ecuador, therefore our offices will be closed. We\nwill return on Thursday 4th November to our regular activities. For\nemergencies please contact: Jose Hernandez (593-8) 730 2444. Thanks for\nyour attention.\r\n \r\n\r\nSaludos / Regards / MFG\r\n \r\nMauricio Becerra A.\r\nDirector General\r\nLOGISTICA\r\nMaseni S.A.\r\n-------------------------------------------------------------------------------------\r\nCalle B la del Pepe N. 37 y las Lomas. Cumbaya-Ecuador.\r\nPBX: (5932) 600 7686 FAX: (5932) 246 7575. Mobile: (593)9 811 5070\r\nE-mail: m.becerra@logistic.com.ec Web Site: www.logistic.com.ec\r\n\r\n</font></pre>'),
