(228, '2010-11-05 00:00:00', '2010-11-06 00:00:00', 'HOLIDAY NOTICE - INDIA 5-6 NOV 2010', '301', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: Amrit SeAir Express Pvt Ltd\n	Member Email: INDER.KHOKHAR@GMAIL.COM\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nPlease be advised that our office will be closed in celebration of Diwali\nFestival on 5 - 6 Nov 2010 \r\n\r\nWill re-open and resume work from 8 Nov, Monday.\r\n\r\nAMRIT SEAIR EXPRESS PVT. LTD\r\nINDIA.</font></pre>'),
(229, '2010-11-14 00:00:00', '2010-11-17 00:00:00', 'Re: Kuwait Office Closure During Eid Al Adha', '59', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: Enkay\n	Member Email: sajith.sreedharan@logistica-group.com\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear All,\r\n        Wishing you all a Happy Eid Al Adha. We would like to inform you\nthat we will be closed from 14th of November 2010 to 18th of November 2010\nduring the occasion of Eid Al Adha. For any urgent requirement,during this\nperiod you can contact(\r\nMr. Ismael Al Attrach - 00965 95624059, \r\nMs.Ajitha 00965 95647195 Kuwait. \r\n\r\nRegards to all\r\nEnkay Logistica\r\n </font></pre>'),
