(242, '2010-12-31 00:00:00', '2011-01-02 00:00:00', 'HOLIDAY', '361', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: LOGISTICA Maseni s.a\n	Member Email: a.flores@logistic.com.ec\n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\n***EL DIA VIERNES 31 DE DICIEMBRE ES FERIADO EN ECUADOR, VOLVEREMOS EL DIA\nLUNES 3 DE ENERO EN NUESTRO HORARIO NORMAL ***\r\n\r\n*** FRIDAY 31ST. DEC IS HOLIDAY IN ECUADOR, WE WILL RETURN ON MONDAY 3RD.\nJAN WITH OUR NORMALLY SCHEDULE*****\r\n\r\nHAPPY NEW YEAR TO ALL OF YOU!!!\r\n\r\nREGARDS</font></pre>'),
