(260, '2011-04-22 00:00:00', '2011-04-24 00:00:00', 'EASTERN HOLIDAYS ECUADOR', '361', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: LOGISTICA Maseni s.a\n	Member Email: a.flores@logistic.com.ec\n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Partners,\r\nDue to eastern holidays our offices will be closed from Friday 22APR -\nSUNDAY 24APR.\r\nUp monday 25APR will work normally.\r\nEmergency contact: m.becerra@logistic.com.ec or +5939 8115070\r\nregards\r\nLOGISTICA - Maseni Team \r\n</font></pre>'),
(261, '2011-04-23 00:00:00', '2011-04-25 00:00:00', 'Eastern Hoilliday', '365', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: ABAR Co. Ltd.\n	Member Email: hmovsessian@abarlogistics.com\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Colleagues/Partners, \r\n\r\nPlease be advise that our offices will be closed for Eastern holliday\r\nStarting April 23th until 25th, we will resume to work on April 26th.\r\n\r\nHrair Movsessian - Director \r\n \r\nABAR Co. Ltd.\r\nGlobal Logistics \r\n5 Arshakunyats Ave.\r\nAM - 0023 Yerevan | Armenia \r\nTel: +374(10)526 302 | Fax: +374(10)527 673 \r\nE-Mail: hmovsessian@abarlogistics.com \r\nwww.abarlogistics.com</font></pre>'),
(262, '2011-04-21 00:00:00', '2011-04-26 00:00:00', 'HAPPY HOLIDAYS', '292', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: Willfreight\n	Member Email: lindaowiti@willfreight.co.ke\n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Esteemed partners,\r\n\r\nPlease be informed that our offices will be closed for Easter holidays\nstarting 22nd April to 25th April.  Normal operations will resume on 26th\nApril.\r\n\r\nFor any urgent matters pls be sure to contact us on emergency numbers\nbelow:\r\n\r\nAIRFREIGHT IMPORTS\r\nCUSTOMER SERVICE: JOY NAMATSI  +254 726 815141\r\n\r\nAIRFREIGHT EXPORTS:\r\nCUSTOMER SERVICE: SUSAN ODHIAMBO +254 736 608335\r\n\r\n\r\nWe wish you all a happy Easter.\r\n\r\nThanks and regards,\r\n\r\nLinda Owiti\r\nBusiness Development Manager</font></pre>'),
