(273, '2011-05-27 00:00:00', '2011-05-27 00:00:00', 'Holiday Ecuador', '361', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: LOGISTICA Maseni s.a\n	Member Email: a.flores@logistic.com.ec\n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nWe are pleased to inform you that Monday 7th and Tuesday 8th of March is\nholiday in Ecuador, therefore our offices will be closed.  We will return\non Wednesday  9th with our regular schedule. For emergencies please contact\nMauricio Becerra -E-MAIL: m.becerra@logistic.com.ec - Mobile: (593-9) 811\n5070.  Thanks for your attention.\r\n\r\n\r\nNos permitimos informarles que el dia Lunes 7 y Martes 8 de Marzo es\nferiado en Ecuador, por lo que nuestras oficinas permaneceran cerradas,\nretornado el dia Miercoles con horario regular.  Para emergencias favor\ncontactar a Mauricio Becerra -E-MAIL: m.becerra@logistic.com.ec - celular:\n(593-9) 811 5070.  Gracias por su atencion.\r\n</font></pre>'),
