(282, '2011-08-09 00:00:00', '2011-08-09 00:00:00', 'Holiday Notice', '212', 'Dear Partners\r\n\r\nPlease note that our office will be closed on the 09 August due to the national holiday.\r\n\r\nWe will resume work on the 10 August\r\n\r\nThanks & Regards\r\nSwiftair International cc\r\nSouth Africa'),
