(284, '2011-10-20 00:00:00', '2011-10-20 00:00:00', 'RE: HOLIDAY NOTICE', '292', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: Willfreight\n	Member Email: johnsonmwamba@willfreight.co.ke\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Colleagues,\r\n\r\nThis is to inform you that Thursday, 20th October 2011 has been gazetted\nas a National Holiday in Kenya. Therefore we shall remain closed on that\nday. Business resumes on Friday, 21st October 2011.\r\n\r\nThanks and Kind Regards,\r\nJohnson\r\nWillfreight Express Cargo Services</font></pre>'),
(285, '2011-11-02 00:00:00', '2011-11-06 00:00:00', 'Holidays in Ecuador', '361', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: LOGISTICA Maseni s.a\n	Member Email: a.flores@logistic.com.ec\n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Partners,\r\nDue to Holidays in Ecuador, our offices will be closed from Wednesday\n02NOV until Sunday 06NOV.\r\nUp Monday 07NOV will work normally.\r\nEmergency contact: m.becerra@logistic.com.ec or +593 9 8115070 (Mauricio\nBecerra)\r\nRegards\r\nLogistica - Maseni Team</font></pre>'),
