(295, '2011-12-05 00:00:00', '2011-12-05 00:00:00', 'East-West Logistics, public holiday', '18', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: East-West\n	Member Email: david@ewl.co.th\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear HTFN Members, \r\n\r\nPlease note that East-West Logistics Co., Ltd will be closed on Monday 5th\nDecember, for the national celebration of The Kings birthday (also Fathers\nday in Thailand).\r\n\r\nWe will return back to work on Tuesday 6th December.\r\n\r\nFor urgent matters, do not hesitate to contact the management team, all\ncontact details can be found on the HTFN directory.\r\n\r\nWith Kind Regards\r\n\r\n\r\nDavid Grant\r\nGeneral Manager</font></pre>'),
