(300, '2011-12-31 00:00:00', '2012-01-09 00:00:00', 'New Year and X-mas Holidays in Armenia', '365', 'Dear Partners,\r\n \r\nABAR EVN will be closed during following days:\r\n \r\nNew Year and X-mas Holidays: Dec. 31/2011 to Jan. 08/2012\r\n \r\nOffice will resume on Jan. 9, 2011 \r\nWe wish our colleagues and Partners HTFN all the best for X-mas and New Year Holidays.\r\n \r\nBst rgds\r\n\r\nHrair Movsessian'),
