(303, '2011-12-27 00:00:00', '2012-01-19 00:00:00', 'Holiday Notice ', '0', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: \n	Member Email: Yang@ancshipping.com\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear HTFN member,\r\n\r\nHoliday Notice\r\nPlease be informed that our office will be closed \r\nfrom 21 Jan 2012 to 29 Jan 2012 for Lunar New Year Holiday \r\nWe will resume work as normal from 30 Jan 2012.\r\n\r\nPlease let us know in advance if you have any urgent shipments during our\nholiday . In the case you have necessary docs to be sent , please send to\nus   BEFORE 19 JAN 2012 because most of our offices in VietNam  will be\nclosed from 21 Jan 2012 to 29 Jan 2012.\r\nThank and best regards</font></pre>'),
(304, '2012-01-02 00:00:00', '2012-01-02 00:00:00', 'HOLIDAYS IN QUITO - ECUADOR // LOGISTICA MASENI S.A.', '361', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: LOGISTICA Maseni s.a\n	Member Email: a.flores@logistic.com.ec\n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Partners,\r\nDue to National holiday our offices will be closed on Monday 02JAN2012.\r\nUp Tuesday 03JAN will work normally.\r\nEmergency contact: m.becerra@logistic.com.ec or +5939 8115070\r\nregards\r\nLOGISTICA - Maseni Team \r\n\r\nHAPPY NEW YEAR TO ALL OF YOU!!!!!</font></pre>'),
