(310, '2012-03-03 00:00:00', '2012-03-04 00:00:00', 'Asia Pacific Meeting', '284', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: Sailors Shipping\n	Member Email: Rezaul@sailorsshipping.com\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Partners,\r\n\r\nIt is a great pleasure to inform every member that we at Sailors Shipping\nLtd., Bangladesh are hosting \"3rd Asia Pacific Meeting\" in Dhaka,\nBangladesh on 3 - 4 March, 2012. Just to remind you that the 1st & the 2nd\nAsia Pacific meeting were held in Bangkok, Thailand & Ho Chi Minh City,\nVietnam respectively & those were a real successful meeting.\r\n\r\nAccording to the members confirmation this year, we are expecting over 95%\nattendance in Dhaka City, Bangladesh with a great leadership of Asia\nPacific regional Board of Director. We the APAC members wish to set an\nexample of good success again.\r\n\r\nAnyone outside the region is more than welcome to attend if you want to or\nplan to be in the area.\r\n\r\nWe look forward to seeing you all in worldwide conference in the States\nafter the successful  Asia Pacific Meeting in Bangladesh.\r\n\r\nYours sincerely\r\n\r\nRezaul Karim\r\nSailors Shipping Ltd.\r\nBangladesh</font></pre>'),
