(315, '2012-02-20 00:00:00', '2012-02-21 00:00:00', 'HOLIDAYS ECUADOR // LOGISTICA MASENI S.A.', '361', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: LOGISTICA Maseni s.a\n	Member Email: a.flores@logistic.com.ec\n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Partners\r\nDue to National Holiday in Ecuador, our offices will be closed from 20FEB\nto 21FEB. \r\nUp Wednesday 22FEB will work normally.\r\n\r\nEmergency contact: Mr. Mauricio Becerra (+593 9) 8115070\r\n\r\nBest Regards</font></pre>'),
