(317, '2012-04-06 00:00:00', '2012-04-06 00:00:00', 'Public Holiday Notice, Chakri Day', '18', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: East-West\n	Member Email: david@ewl.co.th\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear HTFN Partners,\r\n\r\nPlease note that Friday 6th April is a public holiday for the occasion of\nCHAKRI DAY.   We will have back up operational staff and will resume work\nas normal on Saturday 7th April (1/2 day operations support) and our full\noperations and management team return to work on Monday \r\n\r\nPlease manage your shipments in / out of Thailand, considering this public\nholiday, as all clients will also be closed on this day.\r\n\r\nWith Best Regards\r\n\r\n\r\n\r\nDavid Grant\r\nGeneral Manager</font></pre>'),
(318, '2012-04-03 00:00:00', '2012-04-09 00:00:00', 'THU/05 FRI/06 HOLIDAYS IN COLOMBIA', '47', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: Royal Cargo\n	Member Email: operations@royalcargo.net\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Colleagues:\r\n\r\nLet us inform you, THU/05 and FRI/06 are religious holidays in Colombia.\nOur offices will be closed. For any emergency please call to mobiles\n573-108800498 or 573-118101596.\r\n\r\nOur offices will be open again Monday 09.\r\n\r\nBest Regards.\r\n\r\nLeidy Sanchez\r\nDepartamento  de Operaciones\r\nRoyal Cargo de Colombia Ltda\r\nCll 39 No. 19-15 Bogota\r\nTel (571)2879520 Ext 112\r\nFax (571)2856468-2887553\r\n</font></pre>'),
(319, '2012-04-05 00:00:00', '2012-04-07 00:00:00', 'EASTER HOLIDAYS IN PANAMA', '254', 'Our offices will be closed due to Easter Holiday from April 5 to April 7. We will return to work on Monday April 9, 2012'),
(320, '2012-04-06 00:00:00', '2012-04-08 00:00:00', 'Eastern Holidays', '361', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: LOGISTICA Maseni s.a\n	Member Email: a.flores@logistic.com.ec\n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDue to Eastern Holidays our offices will be closed from April 6th to April\n8th 2012.\r\nEmergency contact Mr. Mauricio Becerra (+593 9 8115070)\r\nBest regards\r\nAracelly\r\n</font></pre>'),
(321, '2012-04-09 00:00:00', '2012-04-10 00:00:00', 'Easter Holiday', '26', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: AllFreight\n	Member Email: gunter@allfreight.be\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Friends,\r\n\r\nPLease note that our office will be closed on 09.04.2012 due to Easter\nMonday. We will resume work on 10.04.2012.\r\n\r\nHappy Easter from the All Freight team. </font></pre>'),
(322, '2012-04-09 00:00:00', '2012-04-11 00:00:00', 'AGENT IN MONGOLIA', '354', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: Radius International\n	Member Email: JOEM@RADIUSCARGO.COM\n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nGood day,\r\n\r\nDoes anyone know of a good agent in Ulan Baatar\r\nmongolia?\r\n\r\nThank you</font></pre>'),
(323, '2012-04-13 00:00:00', '2012-04-16 00:00:00', 'Thai New Year Announcement.', '18', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: East-West\n	Member Email: david@ewl.co.th\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear all,\r\n\r\nPlease note that East-West Logistics Co., Ltd will be closed for the\ncelebration of THAI NEW YEAR (Songkran Festical).   Our last working day\nwill be Thursday 12th April and full operations will resume on Tuesday 17th\nMay.\r\n\r\nDuring the period of Thai New Year, Thai Customs, the banks and airlines\nwill be closed.  Please therefore plan your shipments to Thailand,\nconsidering this holiday period.\r\n\r\nFor emergency contact numbers, please refer to the HTFN directory, which\nis up to date.\r\n\r\nWith Kind Regards\r\n\r\n\r\nDavid Grant\r\nGeneral Manager\r\n\r\n</font></pre>'),
