(352, '2012-08-12 00:00:00', '2012-08-13 00:00:00', 'Thailand Holiday', '18', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: East-West\n	Member Email: sasiprpha@ewl.co.th\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nThis is to inform you that Thailand celebrate Queen Sirikit Birthday on 12\nand13 August 2012. East West Logistics will be closed on these days.\r\n\r\nWe will resume work on 14 August 2012. </font></pre>'),
(353, '2012-08-07 00:00:00', '2012-08-10 00:00:00', 'Red alarm typhoon Haikui attacked SHA', '268', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: ORILOGIC\n	Member Email: julianzhu@orientil.com\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear All Friends,\r\n\r\nNow that typhoon Haikui is attacking SHA,local authorities have closed WGQ\nand YangShan terminals and PVG AIRPORT.\r\nOur office will have a few staffs on duty, pls contact with me if you have\nany urgency.\r\nGood Bless~\r\nCheers!\r\nJulian</font></pre>'),
(354, '2012-08-07 00:00:00', '2012-08-10 00:00:00', 'Red alarm typhoon Haikui attacked SHA', '268', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: ORILOGIC\n	Member Email: julianzhu@orientil.com\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear All Friends,\r\n\r\nNow that typhoon Haikui is attacking SHA,local authorities have closed WGQ\nand YangShan terminals and PVG AIRPORT.\r\nOur office will have a few staffs on duty, pls contact with me if you have\nany urgency.\r\nGood Bless~\r\nCheers!\r\nJulian</font></pre>'),
(355, '2012-08-07 00:00:00', '2012-08-10 00:00:00', 'Red alarm typhoon Haikui attacked SHA', '268', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: ORILOGIC\n	Member Email: julianzhu@orientil.com\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Friends,\r\n\r\nNow that typhoon Haikui is attacking SHA,our local authorities have closed\nWGQ and YangShan terminals and PVG AIRPORT. Road transport is also\nlimited.\r\n\r\nOur office will have a few staffs on duty, pls contact with me if you have\nany urgency.\r\n\r\nGood Bless~US~\r\n\r\nCheers!\r\n\r\nMr.Julian\r\nSKYPE: JulianZYC\r\nCell: 86-13321958365\r\nhttp://www.orientil.com/\r\n</font></pre>'),
(356, '2012-08-10 00:00:00', '2012-08-10 00:00:00', 'HOLIDAY IN  ECUADOR // LOGISTICA MASENI S.A.', '361', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: LOGISTICA Maseni s.a\n	Member Email: a.flores@logistic.com.ec\n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Partners,\r\n\r\nOur offices will be closed on 10th August 2012, due to National Holiday in\nEcuador.\r\n\r\nEmergency contact: Mr. Mauricio Becerra(+593 9)8115070\r\n\r\nBest regards\r\nLogistica Maseni Team</font></pre>'),
(357, '2012-08-14 00:00:00', '2012-08-14 00:00:00', 'Independence Day - Holiday Notification', '363', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: RIL Logistics (Pvt) Ltd.\n	Member Email: faisal.nazar@raaziq.com.pk\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear All,\r\n\r\nThis is to inform that our offices at all locations will remain closed on\nTuesday, 14th August 2012\r\n On account of public holiday for \r\n“Independence Day of Pakistan”\r\n\r\nAll official activities will resume on Wednesday, 15th August,2012 </font></pre>'),
