(359, '2012-08-20 00:00:00', '2012-08-22 00:00:00', 'EID Holiday notice from RIL LOGISTICS PVT.LTD , PAKISTAN', '363', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: RIL Logistics (Pvt) Ltd.\n	Member Email: faisal.nazar@raaziq.com.pk\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear All,\r\nThis is to inform all that our offices at all locations in Pakistan will\nremain closed from\r\n20th August to 22nd August, 2012 On account of public holiday for\r\n“EID UL FITAR”\r\nAll official activities will resume on Thursday, 23rd August,2012 \r\n\r\nBEST REGARDS\r\nFAISAL NAZAR\r\n0092-321-482-8008\r\n</font></pre>'),
