(361, '2012-08-20 00:00:00', '2012-09-01 00:00:00', 'Company Logo', '999', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: HTFN Corp\n	Member Email: kennedy.s@htfn.com\n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Members:\r\n\r\n       Preparation has begun for the Barcelona Conference in March of\n2013. As per Member Suggestion, one of many things we are working on is\ncreating a company poster for each Member. This poster will assist members\nto identify each other during the networking sessions.\r\n\r\n       We have tried to download the current logo from the website, but\nthey lose their clarity. We are, therefore,asking that each member send\ntheir current logo in a PDF format to my attention:  kennedy.s@htfn.com by\nSeptember 1, 1012. \r\n\r\n\r\nStephanie Kennedy\r\nProfessional Consultant\r\nTHINK MEMBERS FIRST!!!!\r\nHTFN Global Logistics Partners\r\n71 Gloria Drive\r\nAllendale New Jersey 07401\r\nkennedy.s@htfn.com\r\nwww.htfn.com\r\n\r\n\r\n</font></pre>'),
(362, '2012-09-30 00:00:00', '1969-12-31 00:00:00', 'Holiday Notice', '278', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: Ritzy\n	Member Email: derek-wang@ritzy.com.cn\n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear All\r\n\r\nKindly be noted that our office will be closed for 8 days from 30 Sep 2012\n(Sunday) to 07 Oct 2012 (Sunday) because of the holiday of Mid-Autumn and\nNational Day. 29 Sep 2012 (Saturday) will be adjusted as working day. We\nwill resume work on Monday, 08 Oct 2012\r\n\r\nIf you have something urgent,you can send email to the following person.\r\n\r\nQingdao office:derek-wang@ritzy.com.cn\r\nShanghai office:candy_tan@ritzy-sha.com\r\n\r\nThans and best regards.\r\n\r\nDerek</font></pre>'),
(363, '2012-10-17 00:00:00', '2012-10-20 00:00:00', 'Agent in Trinidad Tobago', '47', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: Royal Cargo\n	Member Email: operations@royalcargo.net\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nI am looking for a reliable agent in Trinidad Tobago \r\n\r\nIf anyone has access to a suitable agent, please let me know.\r\n\r\nThank you\r\n\r\nLeidy Sanchez\r\nROYAL CARGO DE COLOMBIA                        \r\nROYAL AGENCIA DE ADUANAS\r\nCalle 39 No. 19 – 15\r\nBogotá, Colombia\r\nEmail: operations@royalcargo.net\r\nTel:  (571)  287 9520\r\nFax: (571)  288 5753\r\n \r\n \r\n\r\n</font></pre>'),
