(370, '2012-11-29 00:00:00', '2012-11-29 00:00:00', 'New UK Office', '271', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: Norman Global Logistics\n	Member Email: gde@norman.co.uk\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nWe are very pleased to annouce that we have opened a new office near\nLiverpool in the North West of England.\r\n\r\nThe new office increases our coverage and the 2 senior managers Nick\nBrannan and John Peden bring with them a wealth of knowledge and\nexperience. They have particaulr expertise in the UK export ocean market.\r\n\r\nThey will be pleased to help with any ocean enquiries from their area and\nthey will be in contact with various members over the coming months, as\nthey look to develop the business.\r\n</font></pre>'),
