(389, '2013-01-16 00:00:00', '2013-01-25 00:00:00', 'LEIDY SANCHEZ HOLIDAYS', '47', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: Royal Cargo\n	Member Email: operations@royalcargo.net\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Colleagues:\r\n\r\nI start to take some holidays, from January/17. I will be returning to my\noffice January/25. While these holidays please send copy of all your\nmessage to:\r\n\r\nJorge.herrera@royalcargo.net\r\nFernando.herrera@royalcargo.net\r\ncartera@royalcargo.net (This email attended for Viviana Moreno).\r\n\r\nIn fact is that all your business will be attended satisfactorily.\r\n\r\nThanks for your cooperation\r\n\r\n\r\nLeidy Sanchez\r\nROYAL CARGO DE COLOMBIA                        \r\nROYAL AGENCIA DE ADUANAS\r\nCalle 39 No. 19 – 15\r\nBogotá, Colombia\r\nEmail: operations@royalcargo.net\r\nTel:  (571)  287 9520\r\nFax: (571)  288 5753\r\n</font></pre>'),
