(391, '2013-02-09 00:00:00', '2013-02-15 00:00:00', 'Chinese New Year Holiday', '322', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: DAS Beijing\n	Member Email: vivian@daslog.com\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear fellow HTFN members and friends,\r\n\r\nIn celebration of Chinese New Year, our offices will be closed from Feb 9th\nto Feb 15.  Normal business hours will resume on Feb 16 (Saturday).  \r\n\r\nShould there be any urgent matters during the holiday, please contact:\r\n\r\nAir Freight: Ms. Kathy Gu kathy@daslog.com.cn/+86 13761482289\r\n\r\nSea Freight: Ms. Candy Shu  candy@daslog.com.cn/+86 13816811883\r\n\r\nThank you for everyone\'s kind attention! \r\n\r\nWish you all a wonderful weekend! \r\n\r\nWarmest Personal Regards,\r\nVivian/DAS Logistics (Beijing) Co. Ltd. </font></pre>'),
