(394, '2013-02-19 00:00:00', '2013-02-20 00:00:00', 'INFORMATION REGARDING NEW AEROPUERTO QUITO ECUADOR', '361', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: LOGISTICA Maseni s.a\n	Member Email: a.flores@logistic.com.ec\n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear colleagues:\r\n\r\nThe new Mariscal Sucre International Airport (IATA code: UIO, OACI code:\nSEQM), is an airport located in the Tababela parish, about 20 km east of\nQuito, Ecuador, it will replace the Old Mariscal Sucre International\nAirport. Work on the facility began in 2006 and, after several delays, is\nexpected to be operational on February 20th, 2013.\r\nThe Old Mariscal Sucre A/P will finish its operations on February 19th at\n00:00GMT and the new airport will open the operations on February 20th at\n12h00 GMT.\r\n\r\nThe way to the new airport will be btw 1 ½ and 2 ½ hours, due to the poor\ninfrastructure from the roads; new roads are still in construction and will\nbe ready by the end of this year.\r\nCargo trucks have to take a long way to the airport, that will take more\nthan 2 hours, this is because they have to take the north or south way to\nthe airport until the new roads are ready; therefore we expect big\nincreases in the transportation.  \r\n\r\nThe passenger side is ready but the cargo side is still under\nconstruction:\r\n•	Export facilities are in 50% ready.\r\n•	Import facilities are in 30% or less ready; at the moment only one\nwarehouse (EMSA) will be operative and  will receive all the import cargo;\nthe warehouse is not ready yet and all the cargo will be placed on the\nfloor; Customs and EMSA employees will operate in provisional facilities\n(20ft containers).  \r\n\r\nDue to this irregular operation, we expect to have several inconveniences\nand delays in the pick up and delivery of the cargo to the consignees.\r\n\r\nIn relation to the Courier shipments, the authorities decided to stop the\nreception of Courier from February 20th until February 27th.\r\n\r\nAccording to the situation new charges will be apply for cargo delivery,\ncustoms brokerage, warehousing, etc. as soon as we get more information in\nrelation to the new operators companies we will let you know.\r\n\r\nThank you for your attention and understanding.\r\n\r\nKind  regards\r\n\r\nMauricio Becerra\r\nGeneral Manager</font></pre>'),
