(399, '2013-04-01 00:00:00', '2013-04-01 00:00:00', 'Holiday announcement', '243', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: KDS\n	Member Email: operations@kds-cargo.com\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Colleagues, Partners and Friends,\r\n\r\nWe wish to inform you Monday, April 1st 2013 is a public holiday in the\nNetherlands and therefore our office is closed that day.\r\n\r\nIn urgent matters during holidays, you can contact us at the telephone\nnumbers mentioned in the Emergency Contact List, under Member Support at\nthe Members Only Section of the HTFN website.\r\n\r\nHTFN Netherlands,\r\nManagement and staff of KDS Cargo\r\n</font></pre>'),
(400, '2013-06-04 00:00:00', '2013-06-08 00:00:00', 'Ekol is attending the Transport Logistic 2013 !', '317', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: EKOL LOGISTICS\n	Member Email: devrim.koray@ekol.com\n	To Region: All Regions\n\nlists:\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nGood afternoon all,\r\nBeing the fastest growing Turkish logistics company in Europe, we will be\nrepresenting our country and company at the Transport Logistic 2013, the\nmost important exhibition of the logistics sector worldwide. More than\n50.000 professionals from transportation and logistics service providers\nwill attend the exhibition which will be held during the 4th – 7th June in\nMunich/Germany. \r\n\r\nYou will be informed about the details of the exhibition in the upcoming\ndays.\r\n\r\nDate: 4th – 7th June 2013 \r\nVenue: Messe Munchen Halle A5, No: 208 – 311\r\n</font></pre>'),
