(405, '2013-05-01 00:00:00', '2013-05-01 00:00:00', 'HOLIDAY NOTICE - JAMES FORWARDING CORP, KOREA', '238', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: James\n	Member Email: brandon@james.co.kr\n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear All\r\n\r\nWe are going to close our office on May.1st due to Labour Holiday, and\nresume to work from May.2nd!\r\nPlease call me at 82-10-3688-1763 if you have any urgent matter on that\ntime.\r\nTherefore, I can assist you if possible!\r\n\r\nThank you\r\nBest Regards\r\nBrandon Cheong</font></pre>'),
