(422, '2013-06-01 00:00:00', '2013-06-30 00:00:00', 'EUROPEAN ADHOC RATES GUIDE JUNE 2013', '18', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: East-West\n	Member Email: Kris@ewl.co.th\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear All,\r\n\r\nWe would like to take this opportunity to offer our A/F buying rates to\nEuropean ports for the month of June for you kind perusal as attached.\nPlease use the given A/F rates as your guideline sheet to get the idea of\nhow the rates are possible during this month. Note that all rates are based\non loose cartons at +1000 kilos as you will see that the rates are much\nlower than what airlines really publishing these days. \r\n\r\nLet us know if there are any feedback or target rates you have in mind for\nany specific business and we can talk in more detail with the airlines.\r\n\r\nWe are confident the attached rates can give you the great advantage, if\nyou have any questions please do not hesitate to contact us.</font></pre>'),
(423, '2013-06-01 00:00:00', '2013-06-30 00:00:00', 'USA ADHOC RATES JUNE 2013', '18', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: East-West\n	Member Email: Kris@ewl.co.th\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear All,\r\n\r\nWe would like to take this opportunity to offer our A/F buying rates to USA\nports for the month of June for you kind perusal as attached. Please use\nthe given A/F rates as your guideline sheet to get the idea of how the\nrates are possible during this month. Note that all rates are based on\nloose cartons at +1000 kilos as you will see that the rates are much lower\nthan what airlines really publishing these days. \r\n\r\nLet us know if there are any feedback or target rates you have in mind for\nany specific business and we can talk in more detail with the airlines.\r\n\r\nWe are confident the attached rates can give you the great advantage, if\nyou have any questions please do not hesitate to contact us.</font></pre>'),
