(449, '2013-07-04 00:00:00', '2013-07-04 00:00:00', 'Plane Cargo Inc. closed for Independence Day.', '293', 'Plane Cargo Inc. is closed for Independence Day.'),
(450, '2013-07-22 00:00:00', '2013-07-22 00:00:00', 'Buddhist Lent - 22nd July 2013', '18', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: East-West\n	Member Email: david@ewl.co.th\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Fellow HTFN Members,\r\n\r\nPlease note that East-West Logistics will be closed on Monday 22nd July for\nBuddhist Lent, resuming to work as normal on Tuesday 23rd July.\r\n\r\nFor any shipments over this weekend, please consider that we will not be\nable to clear goods on Monday, so please plan the arrival of your\nshipments, considering this public holiday.  \r\n\r\nFor any urgent matters, please refer to the HTFN directory, which contains\nout of hour contact names for all key staff.\r\n\r\nWith Best Regards\r\n\r\nDavid Grant</font></pre>'),
