(452, '2013-08-13 00:00:00', '2013-08-14 00:00:00', 'Holiday Notice from \"RIL LOGISTICS\" Pakistan \" INDEPENDENCE DAY', '363', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: RIL Logistics (Pvt) Ltd.\n	Member Email: faisal.nazar@raaziq.com.pk \n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear All!\r\n                                   \r\nThis is to inform all concerned that our offices at all locations will\nremain closed on 14th August,2013\r\nOn account of public holiday for  “INDEPENDENCE DAY”\r\n \r\nAll official activities will resume on Thursday 15th August, 2013 as per\nscheduled timings.\r\n\r\n\r\nFaisal Nazar \r\nRIL Logistics (Pvt) Ltd. Pakistan | www.raaziq.com   \r\nfaisal.nazar@raaziq.com.pk  \r\nCell +92 0334-4234021\r\nTEL | (+92) 111-RAAZIQ EXT (2017)\r\n</font></pre>'),
