(461, '2013-09-19 00:00:00', '2013-09-21 00:00:00', 'Holiday in Beijing/China', '322', '<pre><font face=Arial>\r\n----------------------------------\r\nThis email broadcast was sent by:\r\n	Member Company: DAS Logistics\r\n	Member Email: vivian@daslog.com\r\n	To Region: All Regions\r\n\r\nlists:\r\n	HTFN Coordinator\r\n	HTFN Email Broadcast\r\n----------------------------------\r\n\r\n\r\nDear fellow members and friends,\r\n\r\nPlease kindly note that DAS Logistics/China will be closed from September\r\n19th till September21th in celebration of the Mid-Autumn FestivalB\r\n\r\nNormal Office hour will resume on September 22th.\r\n\r\nShould you have any urgent issues/enquiries during the holiday, please call\r\nbelow contacts for assistance.\r\n\r\nAir Freight: Ms. Kathy Gu\r\nkathy@daslog.com.cn / +86 13761482289\r\n\r\nSea Freight: Ms. Candy Shu  \r\ncandy@daslog.com.cn / +86 13816811883\r\n\r\nThank you for your kind attention.\r\n\r\nWarmest Regards,\r\nVivian/DAS Logistics (Beijing) Co., Ltd\r\n\r\n</font></pre>'),
(462, '2013-10-01 00:00:00', '2013-10-07 00:00:00', 'Chinese National Holiday', '322', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: DAS Logistics\n	Member Email: vivian@daslog.com\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear fellow HTFN partners and friends, \r\n\r\nPlease kindly note that DAS China offices will be closed from October 1th\nto October 7th in celebration of our Chinese National Holiday.\r\n\r\nNormal Office hour will resume on Tuesday, October 8th.\r\n\r\nShould you request any urgent assistance during the holiday, please\ncontact:\r\n\r\nAir Freight: Ms. Kathy Gu \r\nkathy@daslog.com.cn / +86 13761482289\r\n\r\nSea Freight: Ms. Candy Shu\r\ncandy@daslog.com.cn / +86 13816811883\r\n\r\nThank you for your kind attention.\r\n\r\nWarmest Personal Regards,\r\nVivian/DAS </font></pre>'),
