(484, '2014-01-31 00:00:00', '2014-02-06 00:00:00', 'Chinese New Year Holiday (DAS Logistics) ', '322', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: DAS Logistics\n	Member Email: vivian@daslog.com\n	To Region: All Regions\n\nlists:\n	\n----------------------------------\n\n\nDear Friends & Fellow HTFN partners,\r\n \r\nKindly be informed that our China offices will be closed in observance of\nChinese Lunar New Year Holiday from 31 Jan to 6th Feb, normal office hours\nwill resume on 7th Feb. \r\n \r\nShould you have any urgent matter during the holiday, please call below\ncontacts for assistance.\r\n\r\nAir Freight: Ms. Kathy Gu  \r\nkathy@daslog.com.cn / +86 13761482289\r\n\r\nSea Freight: Ms. Candy Shu\r\ncandy@daslog.com.cn / +86 13816811883\r\n\r\nThank you very much!\r\n\r\nWarmest Personal Regards,\r\nVivian/DAS \r\n\r\n</font></pre>'),
(485, '2014-01-27 00:00:00', '2014-03-15 00:00:00', 'HTFN 2014 Conference', '229', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: NDO America, Inc.\n	Member Email: Diane.hofman@norbert-dentressangle.com\n	To Region: All Regions\n\nlists:\n	\n----------------------------------\n\n\nDear Members,\r\nIt is with regret that NDO AMERICA,INC. will not be able to attend this\nyears conference due to a corporate scheduling conflict. We wish everyone a\nsuccessful and enjoyable conference in Panama.\r\n\r\nRegards\r\nDiane Hofman\r\nChief Operating Officer\r\nNDO AMERICA INC.</font></pre>'),
(486, '2014-02-13 00:00:00', '2014-02-15 00:00:00', 'Agent in Havana,Cuba ', '268', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: ORILOGIC\n	Member Email: julianzhu@orientil.com\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Friends,\r\n\r\nWe have some import goods mainly coffee beans from Cuba China. Is anyone\nhave office there, or you have any reliable agents at Havana to recommend\nus.\r\n\r\nThank you in advance!\r\nAll the best~\r\nJulian Zhu \r\n\r\nORIENT INTERNATIONAL LOGISTICS (HOLDING) CO., LTD.\r\n\r\nAddress: 3 Floor, #1040 Bei Suzhou Road, Shanghai,200085\r\nT:021-26024224 F:021-63093769\r\nSKYPE: JulianZYC\r\nCell: 86-13321958365\r\nMail: Julianzhu@orientil.com\r\nhttp://www.orientil.com/\r\n\r\n</font></pre>'),
