(595, '2015-10-01 00:00:00', '2015-10-08 00:00:00', 'National Holiday Notice (DAS Logistics)', '322', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: DAS Logistics\n	Member Email: vivian@daslog.com\n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear HTFN Partners & Friends,\r\n\r\nPlease kindly note that DAS China offices will be closed from October 1st\nto October 7th in celebration of our Chinese National Holiday.\r\n\r\nNormal Office hour will resume on October 8th.\r\n\r\nShould you have any urgent issues during the holiday, please call below\ncontacts for assistance.\r\n\r\nAir Freight: Ms. Kathy Gu  \r\nkathy@daslog.com.cn / +86 13761482289\r\n\r\nlSea Freight: Ms. Candy Shu  \r\ncandy@daslog.com.cn / +86 13816811883\r\n\r\nThank you very much\r\n\r\nBest Regards,\r\nVivian/DAS Logistics (Beijing) Co. Ltd.\r\n\r\n\r\n</font></pre>'),
