(599, '2015-10-20 00:00:00', '2015-10-20 00:00:00', 'MASHUJAA DAY IN KENYA (HEROES\' DAY)', '292', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: Willfreight\n	Member Email: berylogondah@willfreight.co.ke\n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear All,\r\n\r\nPlease be advised that tomorrow 20th October 2015 will be a holiday in\nKenya. Willfreight Express Cargo Services will be closed on 20th October\n2015 in observation of Mashujaa/Heroes\' Day.\r\nWe will resume normal business hours on Wednesday 21st October 2015.\r\n\r\nCritical and A.O.G services will continue 24/7 as usual.\r\nPlease see below contacts,\r\nemail alert to ; info@willfreight.co.ke\r\nHotline: 0733315555\r\n\r\nThank you.\r\n\r\n</font></pre>'),
