(612, '2015-12-22 00:00:00', '2015-12-28 00:00:00', 'MERRY CHRISTMAS', '47', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: Royal Cargo\n	Member Email: operations@royalcargo.net\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nThe growth of our company is the result of the support that you give us\neach day as clients and friends, it is why, in this important date we want\nto thank you the confidence that deposited in AGENCIA DE ADUANAS ROYAL and\nROYAL CARGO DE COLOMBIA LTDA. \r\n\r\nWe wish you a merry Christmas and a prosperous 2016.\r\n\r\nLEIDY SANCHEZ\r\nROYAL CARGO DE COLOMBIA                        \r\nROYAL AGENCIA DE ADUANAS\r\nCalle 39 No. 19 – 15\r\nBogotá, Colombia\r\nEmail: operations@royalcargo.net\r\nTel:  (571)  287 9520\r\nFax: (571)  288 5753\r\n \r\n \r\n</font></pre>'),
