(617, '2016-01-25 00:00:00', '2016-02-02 00:00:00', 'AGENT IN CUBA', '47', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: Royal Cargo\n	Member Email: jorge.herrera@royalcargo.net\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Friends:\r\n\r\nWe have a business to hand a business  air import from Bogota to La Havana\n/ air export from La Havana  to Bogota.\r\n\r\nWe thanks any suggestion to know an agent to support this business.\r\n\r\nBest Regards, Thanks Again.  \r\n\r\n\r\nJORGE HERRERA\r\nROYAL CARGO DE COLOMBIA\r\nROYAL AGENCIA DE ADUANAS\r\nCalle 39 No. 19 – 15 \r\nBogotá, Colombia\r\nEmail: jorge.herrera@royalcargo.net\r\nTel:  (571)  287 9520\r\nCelular: (57)  310 880 0498\r\n \r\n \r\n</font></pre>'),
(618, '2016-02-07 00:00:00', '2016-02-13 00:00:00', 'Chinese New Year Holiday', '322', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: DAS Logistics\n	Member Email: vivian@daslog.com\n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear friends and fellow HTFN members,\r\n\r\nPlease kindly note our offices in China will be closed on Sunday, Feb. 7th\nto Saturday, Feb 13th.  \r\n\r\nNormal business hours will resume on Sunday, Feb 14th.  For any urgent\nmatter during the holiday, please kindly contact:\r\n\r\nMs. Kathy Gu @ +86 21 63255636 (Airfreight)\r\nMs. Candy Shu @ +86 21 36255633 (Seafreight)\r\n\r\nThank you for your kind attention.  \r\n\r\nWishing everyone a happy and prosperous year of the Monkey :)\r\n\r\nWarmest Personal Regards,\r\nVivian Leung/DAS Logistics (Beijing) Co. Ltd.</font></pre>'),
