(620, '2016-02-06 00:00:00', '2016-02-14 00:00:00', 'Public Holiday in Taiwan (Feb 06-14)', '367', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: Taiwan Express\n	Member Email: overseas@t3ex-tec.com\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear  Friends, \r\n \r\nPlease be advised that Taiwan Express Co., Ltd. will be closed from 6th\nFebruary to 14th February, 2016 for Chinese Lunar New Year in Taiwan and\nwill resume operation on Monday, 15th February 2016.\r\n\r\nDuring this time, airlines, shipping lines and\r\ncustoms officials will be completely closed. When you arrange the shipments\nto/from Taiwan, kindly consider the arrival/departure date. Thanks for your\nattention to it. \r\n\r\nWish you have a prosperous Chinese Lunar New Year.\r\n\r\nKindest regards, \r\n\r\nP.S. As of January 1, 2016, our company¡¦s domain name will be changed to\n¡§t3ex-tec.com¡¨.\r\n\r\nGracia Chen / Oversease Agent Dept.\r\nTaiwan Express Co., Ltd. \r\n3FL., No. 16, Sec. 1, Nanjing East Road, Taipei City 104, Taiwan \r\nWeb : www.t3ex-tec.com \r\n</font></pre>'),
