(626, '1969-12-31 00:00:00', '2016-06-30 00:00:00', 'Shipment Inspection at Origin', '292', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: Willfreight\n	Member Email: jacklinewangari@willfreight.co.ke\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear All.\r\n\r\nI trust that you have been keeping well.\r\n\r\nThis is a reminder on the requirement to inspect all shipments destined for\nKenya before loading.We are having a major challenge clearing shipments\nwithout the Certificate of Conformity and as a result,we end up paying huge\namounts in Penalties(15% of the invoice value)not to mention the long time\nit takes to get clearance documents for the same from our Revenue\nAuthority.Please advise clients accordingly to ensure a smooth clearance\nprocess for our mutual benefit.\r\n\r\nRegards,\r\nJackline Wangari.</font></pre>'),
