(634, '2016-04-03 00:00:00', '2016-04-07 00:00:00', 'Holiday notice East West Logistics Co.,Ltd ( 6th April 2016 ) ', '18', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: East-West Logistics Co Ltd\n	Member Email: kris@ewl.co.th \n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear  Friends, \r\n \r\nPlease be advised that East West Logistics Co.,Ltd will be closed on 6th\nApril, 2016 celebrating the Chakri Memorial Day  and will be reopened on \n7th April 2016 .During this time, airlines, shipping lines and customs\nofficials will be completely closed. So please kindly arrange your\nshipments to/from Thailand, considering given date. \r\n\r\nBest Regard,\r\n\r\nKris Larppimpun \r\n( Business Development Executive )\r\nEast West Logistics \r\nwww.ewl.co.th \r\n</font></pre>'),
(635, '2016-04-08 00:00:00', '2016-04-17 00:00:00', 'Holiday notice East West Logistics Co.,Ltd ( Songkran festival Day ) ', '18', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: East-West Logistics Co Ltd\n	Member Email: kris@ewl.co.th\n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear HTFN Partners,\r\n\r\nFor your information, East West Logistics Co.,Ltd will be closed from  13th\nApril, 2016 to 15th  April, 2016 celebrating the  Songkran festival Day and\nnormal work will resume on 16th April 2016.\r\n\r\nDuring this given time, Thai Customs, Airlines and, shipping lines will be\ncompletely closed therefore please kindly arrange your shipments to/from\nThailand, considering given date. \r\n\r\nRegard,\r\n\r\nKris Larppimpun \r\nEast West Logistics \r\n\r\n\r\n</font></pre>'),
(636, '2016-04-10 00:00:00', '2016-04-18 00:00:00', 'Holiday notice East West Logistics Co.,Ltd ( Songkran Festival Day  ) ', '18', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: East-West Logistics Co Ltd\n	Member Email: kris@ewl.co.th\n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Friends, \r\n\r\nWe would like to remind you that our office will be closed from 13th April,\n2016 to 15th  April, 2016 celebrating the  Songkran festival Day (Thailand\ntraditional New Year\'s Day) and normal work will resume on 16th April\n2016.\r\n\r\nAs pre mentioned, Thai Customs, Airlines and, shipping lines will be\ncompletely closed therefore please kindly arrange your shipments to/from\r\nThailand, considering given date. \r\n\r\nRegard,\r\n\r\nKris Larppimpun\r\nEast-West LOGISTICS CO.,LTD.\r\n\r\n\r\n\r\n</font></pre>'),
