(657, '2016-07-12 00:00:00', '2016-07-20 00:00:00', ' East West Logistics Holiday Notice 19th July 2016  ', '18', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: East-West Logistics Co Ltd\n	Member Email: kris@ewl.co.th \n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear HTFN Partners, \r\n\r\nPlease be advised that East West Logistics Co.,Ltd will be closed on\nTuesday 19th July 2016 celebrating the Asarnha Bucha Day and will be\nreopened on Wednesday 20th July 2016. During this given time, airlines,\nshipping lines and customs officials will be completely closed. So please\nkindly arrange your shipments to/from Thailand, considering given date. \r\n\r\nRegard,\r\n\r\nKris Larppimpun\r\nEast-West LOGISTICS CO.,LTD.\r\n\r\n</font></pre>'),
(658, '2016-08-08 00:00:00', '2016-08-13 00:00:00', ' East West Logistics Holiday Notice 12th August 2016', '18', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: East-West Logistics Co Ltd\n	Member Email: kris@ewl.co.th \n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Partners, \r\n\r\nGood day to you all.\r\nPlease be advised that East West Logistics Co.,Ltd will be closed on Friday\n12th August 2016 celebrating The Queen’s Birthday Day and will be reopened\non Saturday 13th August 2016. During this time, airlines, shipping lines\nand customs officials will be completely closed. Therefore, please kindly\narrange your shipments to/from Thailand, considering given date\naccordingly. \r\n\r\nRegard,\r\n\r\nKris Larppimpun\r\nEast-West LOGISTICS CO.,LTD.\r\n\r\n</font></pre>'),
(659, '2016-08-12 00:00:00', '2016-08-12 00:00:00', 'NATIONAL HOLIDAY IN ECUADOR AUG 12', '361', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: LOGISTICA \n	Member Email: a.flores@logistic.com.ec\n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Friends,\r\nDue to National Holiday in Ecuador, our offices will be closed on Friday\n12AUG.\r\nEmergency contact:\r\nMr. Mauricio Becerra\r\nTel (593 9) 98115070\r\nEmail: m.becerra@logistic.com.ec\r\n\r\n</font></pre>'),
