(665, '2016-10-17 00:00:00', '2016-10-26 00:00:00', ' East West Logistics Holiday Notice 24th October 2016', '18', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: East-West Logistics Co Ltd\n	Member Email: kris@ewl.co.th \n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Friends, \r\n\r\nPlease be advised that East West Logistics Co.,Ltd will be closed on Monday\n24th, October 2016  for Substitution on King Chulalongkorn Memorial Day and\nwill be reopened on Tuesday 25th, October 2016. During this time, airlines,\nshipping lines and customs officials will be completely closed. Therefore,\nplease kindly arrange your shipments to/from Thailand, considering given\ndate. \r\n\r\nRegard, \r\n\r\nKris Larppimpun\r\nEast-West LOGISTICS CO.,LTD.\r\n\r\n\r\n</font></pre>'),
(666, '2016-11-02 00:00:00', '2016-11-06 00:00:00', 'Holidays in Ecuador', '361', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: LOGISTICA \n	Member Email: a.flores@logistic.com.ec\n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear friends,\r\nDue to National Holidays in Ecuador, our offices will be closed from\nNovember 2nd to November 6th.\r\nEmergency contact:\r\nMr. Mauricio Becerra\r\nemail: m.becerra@logistic.com.ec\r\nMobil: +593 9 98115070\r\nBest regards,\r\nLOGISTICA ECUADOR TEAM</font></pre>'),
