(684, '2016-12-07 00:00:00', '2016-12-09 00:00:00', 'THURSDAY 08 HOLIDAY IN COLOMBIA', '47', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: Royal Cargo\n	Member Email: operations@royalcargo.net\n	To Region: All Regions\n\nlists:\n	\n----------------------------------\n\n\nDear Colleagues:\r\n\r\nPlease be advised that our offices will remain closed next Dec. 8th for a\nlocal holiday.\r\n\r\nwill be open again Friday/09.\r\n\r\n\r\nBest Regards\r\n\r\nLeidy Sanchez\r\nROYAL CARGO DE COLOMBIA                        \r\nROYAL AGENCIA DE ADUANAS\r\nCalle 39 No. 19 – 15\r\nBogotá, Colombia\r\nEmail: operations@royalcargo.net\r\nTel:  (571)  287 9520\r\nFax: (571)  288 5753\r\n</font></pre>'),
(685, '2016-12-07 00:00:00', '2016-12-09 00:00:00', 'THURSDAY 08 HOLIDAY IN COLOMBIA', '47', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: Royal Cargo\n	Member Email: operations@royalcargo.net\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Colleagues:\r\n\r\nPlease be advised that our office will remain closed next Dec. 8th for a\nlocal holiday.\r\n\r\nwill be open again Friday/09.\r\n\r\nBest Regards\r\n\r\n\r\nLeidy Sanchez\r\nROYAL CARGO DE COLOMBIA                        \r\nROYAL AGENCIA DE ADUANAS\r\nCalle 39 No. 19 – 15\r\nBogotá, Colombia\r\nEmail: operations@royalcargo.net\r\nTel:  (571)  287 9520\r\nFax: (571)  288 5753\r\n \r\n</font></pre>'),
(686, '2016-12-31 00:00:00', '2017-01-04 00:00:00', 'East West Logistics Holiday Notice \"New Year 2017\" ', '18', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: East-West Logistics Co Ltd\n	Member Email: kris@ewl.co.th \n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear All HTFN members, \r\n\r\nPlease be advised that our office will be closed from December 31st, 2016\nto January 3rd, 2017 celebrating 2017 New Year\'s holiday and will be\nreopened on Wednesday 4th January 2017.During this given time customs,\nairlines, and shipping lines will not be fully operate until 4th January.\nTherefore, please kindly arrange your shipments to/from Thailand,\nconsidering given date. \r\n\r\nOn behalf of East West Logistics, we would like to wish you a prosperous,\nhealthy,and Happy New Year.\r\n\r\nHappy New Year 2017  ƒº 	\r\n\r\nRegard,\r\n\r\nKris Larppimpun \r\nEast West Logistics \r\n\r\n</font></pre>'),
(687, '2016-12-28 00:00:00', '2017-01-01 00:00:00', 'THANKS..................... HAPPY NEW YEAR', '47', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: Royal Cargo\n	Member Email: jorge.herrera@royalcargo.net\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear colleagues,\r\n \r\nAt the end of this year we consider it opportune to send you some\ncomments:\r\n\r\nFirst, thanks to HTFN directives for their efforts to make this network\nmore and more vigorous, more useful, more important\r\n \r\nTo those members who allowed us to do business, either because they gave us\nthe opportunity to attend to their business in Colombia, or because they\nserved our countries, THANK YOU. It was nice to work with you all.\r\n \r\nTo those members with whom we did not have business during the current\nyear, we reiterate our offer in our commercial, operational, accounting and\ncustoms areas so next year we can develop businesses for mutual benefit. We\nare ready to give all our support.\r\n \r\nTo all, our best wishes for a successful 2017, both in business and\npersonally, and we will like to extend it to your appreciated families.\r\n\r\nJORGE HERRERA\r\nROYAL CARGO DE COLOMBIA\r\nROYAL AGENCIA DE ADUANAS\r\nCalle 39 No. 19 – 15 \r\nBogotá, Colombia\r\nEmail: jorge.herrera@royalcargo.net\r\nTel:  (571)  287 9520\r\nCelular: (57)  310 880 0498\r\n</font></pre>'),
(688, '2017-01-07 00:00:00', '2017-01-09 00:00:00', 'HOLIDAY IN COLOMBIA', '47', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: Royal Cargo\n	Member Email: operations@royalcargo.net\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n----------------------------------\n\n\nDear Colleagues:\r\n\r\nPlease be advised that our office will be closed next Jan. 9th due to local\nholiday.\r\n\r\nWill be open again Tuesday/10. When will be ready to attend your request.\r\n\r\nOnce again, happy new year \r\n\r\nBest Regards\r\n\r\nLEIDY SANCHEZ\r\nROYAL CARGO DE COLOMBIA                        \r\nROYAL AGENCIA DE ADUANAS\r\nCalle 39 No. 19 – 15\r\nBogotá, Colombia\r\nEmail: operations@royalcargo.net\r\nTel:  (571)  287 9520\r\nCel: (57) 3118101596\r\nFax: (571)  288 5753</font></pre>'),
(689, '2017-03-02 00:00:00', '2017-03-05 00:00:00', 'HTFN APAC CONFERENCE - SEOUL 2 - 5th MARCH 2017', '18', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: East-West Logistics Co Ltd\n	Member Email: david@ewl.co.th\n	To Region: Asia Pacific\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear fellow APAC Members,\r\n\r\nReferring to the e-mail bulletin from Evelin on 11th January, I would like\nto thank those who have responded, most of which have confirmed their\nparticipation and support of the APAC conference. \r\n\r\nThere are a number of HTFN partners who have yet to acknowledge the e-mail\nand confirm their participation or not.  A copy of that mail, is attached\nwithin this message.\r\n\r\nWe are trying to finalize the numbers, so that the final decision can be\nmade with regards to host hotel, and in order to block rooms/make\narrangements for the event.\r\n\r\nIf you have not responded to the original mail, please give your urgent\nattention to confirm if a representative from your Company will be\nattending.\r\n\r\nYou can confirm to myself at david@ewl.co.th with copy to Evelin\n(evelin@ewl.co.th).\r\n\r\nMany thanks for your immediate attention in this matter.\r\n\r\nBest Regards\r\n\r\nDavid Grant\r\nGeneral Manager\r\nEWL / Bangkok - Thailand.</font></pre>'),
