(697, '2017-04-02 00:00:00', '2017-04-04 00:00:00', 'Ching Ming Festival Holiday in China (DAS Logistics/Beijing)', '322', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: DAS Logistics\n	Member Email: vivian@daslog.com\n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Fellow HTFN Friends and Partners,\r\n\r\nIn observance of Ching Ming Festival, our offices will be closed on Sunday,\nApril 2nd to Tuesday, April 4th.\r\n\r\nNormal business hours will resume on Wednesday, April 5th. \r\n\r\nFor all urgent matter please contact:\r\nMs. Betty Sun\r\nPh#: +86 1380 171 8471\r\n\r\nThank you for your kind attention.\r\n\r\nBest Regards,\r\nVivian Leung\r\nDAS Logistics (Beijing) Co., Ltd</font></pre>'),
(698, '2017-03-31 00:00:00', '2017-04-07 00:00:00', ' East West Logistics Holiday Notice 6th April 2017', '18', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: East-West Logistics Co Ltd\n	Member Email: kris@ewl.co.th \n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear HTFN members, \r\n\r\n   Please be advised that East West Logistics Co.,Ltd will be closed on\nThursday 6th April,2017 celebrating the Chakri Day and will be reopened on\nFriday 7th April,2017. During this time airlines, shipping lines, and\ncustoms officials will be completely closed. Therefore, please kindly\narrange your shipments to/from Thailand, considering given date\naccordingly.\r\n\r\nKris Larppimpun\r\nEast-West LOGISTICS CO.,LTD.\r\n\r\n\r\n</font></pre>'),
(699, '2017-04-13 00:00:00', '2017-04-16 00:00:00', ' East West Logistics Holiday Notice 13th-15th April 2017', '18', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: East-West Logistics Co Ltd\n	Member Email: kris@ewl.co.th \n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Partners, \r\n   Please be advised that East West Logistics Co.,Ltd will be closed from\n13th to 15th April 2017 for  Songkran Festival Day (Thailand New Year) and\nwill resumed to normal work day on Monday 17th April 2017. During this\ntime, airlines, shipping lines and customs officials will be completely\nclosed. Therefore please kindly arrange your shipments to/from Thailand,\nconsidering given date accordingly.\r\n\r\nKris Larppimpun\r\nEast-West LOGISTICS CO.,LTD.\r\n\r\n</font></pre>'),
