(708, '2017-04-25 00:00:00', '2017-05-02 00:00:00', ' East West Logistics Holiday Notice (1st May 2017 National Labour Day )', '18', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: East-West Logistics Co Ltd\n	Member Email: kris@ewl.co.th \n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Friends, \r\nPlease be advised that East West Logistics Co.,Ltd will be closed on 1st\nMay, 2017 celebrating the National Labour Day and will be resumed to normal\nwork day on Tuesday 2nd May 2017. During this time airlines, shipping\nlines, and customs officials will be completely closed. Therefore please\nkindly arrange your shipments to/from Thailand, considering given date\naccordingly.\r\n\r\nKris Larppimpun \r\n(East West Logistics)\r\n \r\n\r\n\r\n</font></pre>'),
