(710, '2017-04-28 00:00:00', '2017-05-02 00:00:00', 'HOLIDAY NOTICE - May 1st - Labor Day', '47', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: Royal Cargo\n	Member Email: operations@royalcargo.net\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Colleagues, \r\n\r\nOur offices in Colombia will be closed on Monday May 1st due to Labor Day -\nNational Holiday. We will resume to work as normal on Tuesday May 2nd. \r\n\r\nBest Regards and Happy weekend to all, \r\n\r\nLEIDY SANCHEZ\r\nROYAL CARGO DE COLOMBIA                        \r\nROYAL AGENCIA DE ADUANAS\r\nCalle 39 No. 19 – 15\r\nBogotá, Colombia\r\nEmail: operations@royalcargo.net\r\nTel:  (571)  287 9520\r\nCel: (57) 3118101596\r\n</font></pre>'),
