(713, '2017-04-29 00:00:00', '2017-05-02 00:00:00', 'HOLIDAY NOTICE - ANC VIETNAM', '299', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: ANC\n	Member Email: import2@ancshipping.com.vn\n	To Region: All Regions\n\nlists:\n	Sales Contact\n	HTFN Coordinator\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear HTFN Members,\r\n\r\nPlease be noticed that ANC CO., LTD will be closed from 30th April 2017 to\n02nd May 2017 for Liberty Day & Labor Day. We will resume working on 03rd\nMay 2017.\r\n\r\nShould you have any shipments coming into Vietnam during above mentioned\ntime, please kindly send the pre-alert/shipping advice to our office before\n30th April 2017 to avoid penalty for late submission of e-manifest.\r\n\r\nMany thanks for your kind attention & cooperation.\r\n\r\nBest Regards,\r\nANC CO., LTD\r\n</font></pre>'),
