(742, '2017-11-19 00:00:00', '1969-12-31 00:00:00', 'ECUADOR - NEW CUSTOMS REGULATIONS', '361', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: LOGISTICA \n	Member Email: m.becerra@logistic.com.ec\n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear colleagues:\r\n\r\nPlease be informed that since November 13th, a new customs regulations was\nestablished for the imports arriving to our country.\r\n\r\nThe new Customs Control Rate will come into force for imports arriving in\nour country. According with customs this resolution is based on the need to\nstrengthen the customs control service, to combat smuggling and fraud. This\nrate will be applied to all products that enter the country with exceptions\nsuch as: personal effects of the traveler, technical aids, donations,\nrelief shipments, among others.\r\n\r\nTo determine this new rate, three data must be taken into account: the net\nweight of the merchandise for each item (in grams), the control unit (in\ngrams) and the fixed value of the customs control service for each imported\nunit (ten cents).\r\n\r\nThen the following formula will be applied:\r\n\r\n               Gross weight per item (gr)\r\nUSD 0,10   X   --------------------------\r\n                                                                           \n               .               Unit control (gr) according with the HS\r\n\r\n\r\n \r\nTo know which is the control unit, you must access the Ecuapass application\nor system, from customs, since this unit is for each customs tariff heading\nand will be applied at the time of the import declaration.  The shipments\nin transit which the B/L or AWB dated before November 13th will not be\naffected.\r\n\r\nFor this reason and as an urgent and necessary measure to face this new\nmeasure of tariff policy and at the same time that allows such calculation\nto be as accurate as possible and that in this way does not influence the\nunnecessary payment of values of taxes and duties, suppliers should include\nin their commercial invoices a box that indicates the gross weight of each\nitem, in addition to the total weight of the shipment, number of packages\nand measures that we had previously requested. If this information is not\navailable, the weight of each item will be prorated, depending on the value\nof the merchandise, and there may be large differences in said prorating.\r\n\r\nFor any additional questions please do not hesitate to contact our offices\nand your executive when you believe it is appropriate.\r\n\r\nThanks for your attention.\r\n\r\nSincerely\r\n\r\n\r\nMauricio Becerra \r\nManager</font></pre>'),
(743, '2017-12-04 00:00:00', '2017-12-12 00:00:00', 'East West Logistics Holiday Notice (5th & 11th December 2017) ', '18', '<pre><font face=Arial>\n----------------------------------\nThis email broadcast was sent by:\n	Member Company: East-West Logistics Co Ltd\n	Member Email: kris@ewl.co.th\n	To Region: All Regions\n\nlists:\n	HTFN Email Broadcast\n----------------------------------\n\n\nDear Friends, \r\nPlease be advised that East West Logistics Co., Ltd will be closed on 5th \nDecember, 2017 \"The birthday of His Majesty the late King Bhumibol\nAdulyadej\" and  11th December, 2017 \"Substitution for Constitution\nDay\".During these given times airlines,shipping lines, and customs\nofficials will be completely closed. Therefore please kindly arrange your\nshipments to/from Thailand, considering given date accordingly.\r\n\r\nKris Larppimpun\r\nEast-West LOGISTICS CO.,LTD.\r\n \r\n\r\n</font></pre>'),
