INSERT INTO `profiles` (`recno`, `memid`, `descript`, `servlist`, `services`, `cbranch`, `aemail1`, `aemail2`, `contact1`, `contact2`, `contact3`, `contact4`, `hours1`, `hours2`, `itContactName`, `itContactEmail`) VALUES
(3, '999', 'For over 25 years, companies around the world have relied on HTFN\'s network of highly-regarded, reliable, independent forwarding agents to provide essential freight transportation and logistics services. It\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\'s a unique global alliance that combines the capabilities of multinational forwarders with the personal service of locally owned companies. The best of both worlds, worldwide.', 'In addition to traditional freight services, HTFN members provide a wide range of value-added logistics options, quality processes and industry expertise. Our pooled resources and buying power ensure shippers crucial air and shipping line capacity and dramatic cost savings door to door.', 'HTFN Corporate																																																														', '', 'corporate@htfn.com', 'kaur.n@htfn.com', '', '', '', '', '', '', '', 'kennedy.s@htfn.com'),
(4, '68', 'Reilly International is a full service global logistics provider firmly committed to customer satisfaction. In business since 1984, the company has expanded its operations in direct response to the increasing needs of its clientele. With innovation, creativity and consistent open communication with clients, comprehensive transportation and logistics solutions are specifically designed on a customer by customer basis. Highly trained professional staff include licensed Customs brokers, cargo transport agents, international documentation specialists and information management consultants whose standard is to provide exceptional, customer driven service. Reilly International is an International Air Transportation (IATA) and Cargo Network Services (CNS) approved air freight agent and Federal Maritime Commission (FMC) licensed ocean freight forwarder and Non-Vessel Operating Common Carrier (NVOCC).\r\n\r\nReilly International is Woman\'s Business Enterprise Certified (WBENC).', 'Air Freight Imports and Exports \r\nSea Freight Imports and Exports \r\nWarehouse Facilities including Bonded Container Station \r\nFull Distribution Facilities \r\n\r\nUS Customs Brokerage \r\nSpecialized Documentation Services \r\nDuty Drawback Services \r\nForeign Trade Zone (FTZ) Consulting Services', 'Comprehensive Information Technology services assist Reilly International in effectively managing clients\\\' shipments. Electronic Data Interchange (EDI) capabilities and a Network-wide global email system ensure quick access to critical transport and logistics information.  Customers can track their shipments on-line and access a wide variety of customized reports. Reilly International\\\'s modern, purpose built facility has sophisticated security systems which include video monitoring, giving customers confidence that their cargo is being handled safely. \r\n												', '', 'vickie@reillyinternational.com', 'Joem@reillyinternational.com', '', '', '', '', '08:00 - 18:00 Monday through Friday \r\n08:00 - 14:00 Saturday \r\n08:00 - 12:00 Sunday \r\nAfter hours assistance available upon request', '', 'John@reillyinternational.com', ''),
(118, '378', 'Prima Air Sea, s.r.o.\r\nU Prioru 1076/5\r\n16100 Prague 6\r\nCzech republic', 'Ocean Freight - FCL\r\nOcean Freight - LCL\r\nAir Freight\r\nCourier services\r\nCustoms clearance\r\nInsurance\r\nWarehousing\r\nZero Waste Environment\r\nV.A.S', 'OCEAN FREIGHT - We are oriented on export and import sea freight shipments all over the world with specialization to Middle and Far East, North and South America. We are directly connected to biggest shipping lines worldwide and we cooperate with several independent agents all over the world that give us independency in decision about cooperating partners.\r\n\r\nAIR FREIGHT - We offer worldwide export and import shipments from envelopes to heavy cargo. We are connected directly to the world biggest airlines and we cooperate with several independent agents all over the world that give us independency in decision about cooperating partners.\r\n\r\nWHY WITH US?\r\nPersonal approach on project basis,\r\nStandard and Non standard transports,\r\nConsulting service free of charge,\r\nQuality of services,\r\nSimply and direct solutions,\r\nProfessionality', '', 'premysl.hanak@primalogistics.cz', 'sales@primalogistics.cz', '', '', '', '', '8.00 AM - 5.00 PM', '', 'tomas.zadrazil@primalogistics.cz', ''),
(5, '254', 'Founded with one truck and a five person team in 1975, Aeroservicios is now a leader in its market, ranked the number two company in Panama by IATA. The company remains family owned, is known for its professional and efficient service and has an excellent reputation for providing reliable, comprehensive logistics operations. Aeroservicios works to maintain constant communication with clients with the goal of providing \"the best cargo service\". Customers include Sony Corp. of Panama, Pioneer International Latin America, Citizen Latinamerica, Chanel Products and Schering Plough.', 'Air Freight Imports and Exports \r\nOcean Freight Imports and Exports \r\nBy Land to Central America\r\nInventory Management \r\nCompany Owned and Operated Vehicles Including Bonded Trucks \r\nDangerous Goods Handling \r\nWarehousing and Distribution Featuring Customs Bonded Area and Cool Storage \r\nBroker Service', 'Operating in both the Colon Free Zone and the capital Panama City Aeroservicios can guarantee customers a full range of services from merchandise purchasing and handling to warehousing, inventory and inland trucking. Staff are familiar with laws and procedures and work to ensure smooth clearance and processing of all freight: the company can move goods between the Atlantic and Pacific coasts in under two hours. The company specializes in handling imports and exports from the Colon Free Zone, including fresh seafood and live animals as well as perfume products. Warehouse facilities include a 20,000 lb. capacity scale, 1400 feet of cold storage and customs bonded area. Aeroservicios is linked electronically with Panamanian customs and offers on-line communication with customers and shippers. \r\n', '', 'aeroservicios@pa.inter.net', 'jessyyoung@aeroservicioslogistics.net', '', '', '', '', '08:00 - 17:00 Monday through Friday\r\n08:00 - 12:00 Saturday \r\nAfter hours and weekend assistance available upon request', '', '', ''),
(6, '304', 'Airland Logistics A/S acts as an independent logistical provider in a dynamic and competitive market, where quality and personal effort makes the difference. We all know the distance and have the same goal. We would like to be the perfect partner, in relation to you, to our suppliers, and not least to each other. We make a difference.', 'Air Imports and Exports \r\nOcean Imports and Exports \r\nProject Forwarding \r\nNVOCC \r\nLive Animals \r\nVehicle Logistics \r\nDoor to Door Deliveries \r\nAid and Development Projects', 'Airland Logistics A/S was founded in 1975. We are specialists in the African market as well as other Aid and Development markets. For our key customers today, we are logistical providers of 4x4 vehicles, vaccine, and gold mining businesses.', '', 'jjensen@airlandlogistics.com', '', '', '', '', '', '08:00-16:30 Monday through Friday - Weekend assistance available upon request.', '', '', ''),
(7, '26', 'All Freight prides itself on its personalized customer service and flexible logistics solutions to all its customers\' needs. The company is dedicated to supporting the unique service requirements of high-tech clients with a tracking software package which can be customized for each client. As a smaller company All Freight has the flexibility to suggest new, creative solutions to customers\' logistics challenges; the company is committed to providing personalized service through its superior staff who work as a team to successfully navigate customers through the shipping process.', 'Freight Imports and Exports \r\nOcean Freight Imports and Exports \r\nLicensed Customs Brokers \r\nCharter Services \r\nLetters of Credit Services \r\nDocumentation Services \r\nWarehousing, Packing and Distribution \r\nLogistics Services\r\nProject Cargo\r\nNationwide and European Pick up and Delivery \r\nCourier Services \r\nInsurance Consulting', 'The professional, knowledgeable staff can provide services above and beyond standard customs brokerage to include insurance consulting and legalization of documents. All Freight is electronically linked to Belgian Customs, which allows the company\'s import department to pre-clear shipments around the clock. Additional global email and automated tracking systems permit the company and the customer to have a clear picture of shipment status. All Freight\'s airport warehouse features a customs-bonded area and allows for secure storage, packing and automated inventory control and distribution. Company-owned vehicles enable the company to deliver freight anywhere in the country and within Europe quickly and efficiently. \r\n																																																', '', 'gunter@allfreight.be', '', '', '', '', '', '08:00 - 21:00 Monday -Friday\r\nOn standby via mobile phone after hours and weekends', '', 'Gunter De Greef ', ''),
(8, '18', 'East-West Logistics was founded in 1977 to provide personalized professional forwarding service to the growing number of exporters in Thailand. At this time, East-West Logistics handles airfreight and seafreight shipments to the same professional extent, both for export and for import cargo.', 'Air Freight Imports and Exports \r\nOcean Freight Imports and Exports \r\nCompany Owned Trucks \r\nIn-House Customs Brokerage Department with EDI link to Thai Customs\r\nPacking, Warehouse and an Express Distribution Center \r\nExhibitions, concerts.', 'General cargo, project cargo, perishables, time-sensitive goods, urgent hand carry shipments and special customs clearances.', '', 'management@ewl.co.th', '', '', '', '', '', '08:30 - 17:00 Monday through Friday · 08:30 - 12:00 Saturday \r\nAssistance available 24 hours, 7 days a week', '', '', 'david@ewl.co.th'),
(126, '389', 'Ken Hamanaka Co Inc is a full-service transportation and logistics provider that has served the Logistics Industry for over 50 years.\r\n\r\nEstablished in 1962, Ken Hamanaka Co Inc has continued to develop and maintain a highly satisfied international clientele of shippers, importers and worldwide agents. \r\n\r\nWe take great pride in our exemplary reputation with Customs & Border Protection and other governmental agencies and continuously strive to meet the challenges of ever-evolving technologies and regulations.\r\n\r\nAs a family-owned and –operated company, our motivation to provide superior service, efficient and cutting-edge logistics solutions, expeditious clearance procedures, friendly and knowledgeable staff, personalized and responsive attention to clients’ individual needs – is paramount:  we stake our name on it.', '', '', '', 'brigit@kenhamanaka.com', 'linda@kenhamanaka.com', '', '', '', '', '', '', '', 'timbird@kenhamanaka.com'),
(128, '401', 'The expert of special services - AIRMAX Cargo Budapest Zrt. is among the market leaders in air, sea and road forwarding of products requiring special care as well as specialized expertise and precision. Owing to the experience, flexibility and careful attention of our colleagues, the customer base and turnover of our company has been steadily growing for years. Airmax Cargo meets extra challenges with tailor-made solutions in the field of project cargo and logistics services as well.\r\n\r\nAn approach ensuring harmony - Our experienced, coordinated team is managed by key people who are also shareholders of our company. Airmax Cargo has been characterized by an economic approach and solution-oriented mindset from the very beginning; by means of our reliable, permanent and committed team of professionals we can maintain our flexibility, efficiency and personal style.\r\n\r\nAnything -anywhere, in the best possible way! - Airmax Cargo forwards your goods from anywhere to anywhere in the world with air, sea or road based solutions. Irrespective of the size of the goods (overweight and/ or oversized) or their fragility (live, dangerous or perishable goods), our company will find the optimal mode of transport. Airmax offers you tailor-made solutions for special requirements and provides excellent value for money.', 'Worldwide Comprehensive export-import forwarding\r\nDoor-to-door service\r\nCustoms clearance with our own customs team\r\nVarious fiscal- and taxation representation solutions\r\n500.000 SDR forwarder liability insurance and cargo insurance on demand\r\nIn-house bonded warehouse - storage of normal, refrigerated or frozen goods as well as live animals\r\nComplex pharmaceutical logistics center, including an in-house tempered pharmaceuticals warehouse with all required medical authority permits\r\nOwn light truck fleet for distribution services, including reefer trucks\r\nStandard and customized packaging solutions\r\nIATA Cargo Agent, ISO 9001:2009 and AEO certification, FIATA and IPATA membership\r\nOwn weekly LCL service from Hong-Kong and Shanghai to Budapest with favorable pre-carriage options', '', '', 'mail@airmaxcargo.com', '', '', '', '', '', 'Standard working hours are Monday-Friday 08:00-17:00 GMT+1 (DST is observed in Hungary). AOG Desk is available after-hours, on weekends and national holidays.', '', '', ''),
(88, '334', 'IFL SPEDIZIONI SPA is a young and dinamic company founded in April 2001  to satisfy the needs of customers who wanted increasingly comprehensive and structured forwarding services.\r\n \r\nIFL is strategically located near Linate airport and close to the most important thoroughfares and means of communication ( road ,rail and seafreight groupages  terminals ). \r\n \r\nCompany philosophy has been an important part of IFL   success during this born period and policy has also helped to always remain prepared to tackle the incredible developments that have transformed our sector.\r\n \r\nWith 3 branches in Milano, Brescia and Genova, IFL is well equipped to cather to the specific needs of different clients (trucking, ocean, air, perishable, dangerous goods, customs clearance, warehousing and distribution)   \r\n\r\nIFL is IATA accredited, ENAC (security) approved and FIATA member.', 'Import Customs consulting. License request with ministries. Air, sea and land shipment estimates. Development of combined imports/logistics/distribution solutions. Clearance at all major airports/ports and borders. \r\nIFL warehouse has a refrigerated area for perishable cargo as well as X-RAY machine for security checking. \r\nExport Daily consolidations by air and  sea . Analysis and solutions for shipments of non-standard sized goods. Analysis of credit letters, export licenses, consular legalizations. Door-to-door shipment coordination. Goods insurance. Goods storage. Full capability  in Handling DANGEROUS goods.', '', '', 'roberta.suardi@iflsped.it', 'adriano.sina@iflsped.it', '', '', '', '', 'our office hours from Monday to Friday:\r\nfrom 09.00 am to 01.00 pm\r\nfrom 02.00 pm to 06.00 pm', '', '', ''),
(11, '299', 'ANC was founded in 1996 as An Nhon Service Co., Ltd. in Ho Chi Minh, Vietnam. ANC is the first company in Vietnam to complete ISO 9001 certification for their Customs Brokerage division. ANCï¿½s ISO accreditation in January 2003 is upheld with excellent customer service and attention to detail. They provide full multi-modal and door delivery service, as well as, manage their own 21000sqf warehouse built in 2001.', 'Air Import and Export \r\nOcean Import and Export \r\nInternational Consolidation / Deconsolidation \r\nLogistics and Distribution Services \r\nCustoms Brokers', 'ANC specialize in several weekly consolidation/deconsolidation services to major trading lanes of Vietnam including South East Asia, the United States and Europe. ANCï¿½s clients are offered full transportation and logistics options in order to ensure a custom fit with their supply chain requirements. ANC are members of the Vietnam Freight Forwarder Association, FIATA and the Vietnam Chamber of Commerce Industry. \r\n', '', 'anc@ancshipping.com.vn', 'lisa@ancshipping.com.vn', '', '', '', '', '08:00 - 17:30 Monday through Friday\r\nAfter hours assistance available upon request', '', 'Thang', 'it@ancshipping.com.vn'),
(131, '413', 'About us\r\n\r\nKompas International Transport Company Ltd. was founded in 1994. The basic activities of our companty are the business of international freight forwarding and international transportation services.\r\n\r\nKompas interanational Ltd. is an international freight forwarder of goods. We operate in the international market in road transport since our founding in 1994. Also, since the foundation of our company, we nurture and invest in our reputation with providing competitive services, building loyal local and international relations with clients, providing safe and quality service and complete geographical coverage of their presence in the whole EU territory.\r\n\r\nBecause of the logistics services we provide, and thanks to many years of experience in working in the international market we have gained good reputation among our clients.\r\n\r\nVision\r\n\r\nWith continuing our educational and learning process, we want to stay on top, and continue providing high quality service to our committees. The development of our company needs to be natural and balanced, based on monitoring the growth of our oldest partners and attract new clients from the market. The experience and knowledge gained in the business that are already developed in the European Union market, should strive to be applied in Serbia.\r\n\r\nStrategy\r\n\r\nBy constantly upgrading the quality of our business development, we want to provide our committees with a continuous growth in the market. The long-term partnership relations that are based on mutual trust, and loyalty and mutual respect can benefit everyone. Our strategy is to constantly pay attention to the wishes and taste of clients and have our employees and managers provide collectivism in the groups and build teamwork within our company. We insist on high responsibility parallel to significant investments in professional education and motivation.', '- Organization of transport with our vehicles from and to EU countries\r\n- Transportation of cargo from 1kg up to 22000kg\r\n- Collective Transport\r\n- Logistics Services\r\n- Freight Forwarding', '', '', '', '', '', '', '', '', '', '', '', ''),
(132, '414', 'Founded in 1997 and headquartered in TORONTO, CANADA, Colbeck & Clarke Inc. is Canadaâ€™s premier logistics service provider.  We offer a full-range of freight forwarding and total logistic management services suited to meet the individual needs of our clients. We understand that each client has their own specific requirements. Being able to adapt to these requirements is what makes us industry leaders.', 'â€¢	Air Freight\r\nâ€¢	Ocean Freight (LCL/FCL)\r\nâ€¢	Trucking throughout North America\r\nâ€¢	Rail/Intermodal service\r\nâ€¢	Break-bulk and oversize cargo\r\nâ€¢	Consulting\r\nâ€¢	Cargo Insurance\r\nâ€¢	Warehousing\r\nâ€¢	Customs Clearance', 'Air Freight\r\nâ€¢	Ocean Freight (LCL/FCL)\r\nâ€¢	Trucking throughout North America\r\nâ€¢	Rail/Intermodal service\r\nâ€¢	Break-bulk and oversize cargo\r\nâ€¢	Consulting\r\nâ€¢	Cargo Insurance\r\nâ€¢	Warehousing\r\nâ€¢	Customs Clearance', '', 'cgoodman@colbeck-clarke.com', 'tcolbeck@colbeck-clarke.com', '', '', '', '', '8:30 - 5:00 PM', 'Emergency calls: 416 938 2380 - Caryn Goodman', 'cgoodman@colbeck-clarke.com', ''),
(133, '412', 'With more than two decades\' experience in providing responsive and customised solutions,FEI today is an internationally -acclaimed logistics group-at par with the best in the business and a leader in terms  of cost-effectiveness\r\nWith its corporate office in Mumbai, FEI enjoys an impressive clientele,serviced and  supported from twenty five offices across the  country.Multi-location, multi-faceted and backed by a strong cohesive team of more than 300 experts, FEI is on a mission to provide excellence and value-addition to its customers.', 'Air freight and Sea freight (Imports &Exports)\r\nCentralised Communication  and accounting system\r\n350 plus professionals with the expertise in handling of any type of cargo\r\nIn house customs broking division\r\nTotal logistics solutions and supply chain management systems \r\nHandles OBC and Time critical shipments\r\n24x7 help desk connected to the Centralised Business Desk', 'FEI Cargo Limited enjoys the expertise and facilities to handle an impressive range of different cargo from diverse industries. Heavy cargo with odd sizes require specialised equipment and  specifically trained staff. FEI Cargo Limted has both. Thus the consignment is safely handled and efficiently delivered to /picked up from anywhere across the world through the company\'s vats global network.\r\nAs a complete logistics solution provider, FEI establishes vital links in the supply chain/ freight forwarding/ customs broking functions for our customers.Our comprehensive range of services encompasses the entire gamut of customer\'s shipping requirements including full charters.', '', 'abhijeet.nair@feicargo.com', 'sheen.thomas@feicargo.com', '', '', '', '', '9.30 am -6.30 pm Monday-Saturday \r\nAfter hours assistance available.', '', 'Abhijeet Nair', 'intlsales@feicargo.com'),
(14, '143', 'BWI is a full service broker offering clients a complete range of logistics services from domestic or international imports and exports to expedited trucking and customs brokerage. The friendly, professional staff, which include the owners of the company, are happy to offer assistance concerning any part of the transportation process and guide customers through each step. All staff are trained in every facet of the transportation cycle and customers always speak directly with an individual who can answer questions quickly and knowledgeably. In an industry where trust is of the utmost importance, BWI has formed lasting relationships with customers, who know that even when their freight is out of sight, it is never out of mind.', 'Air Freight Imports and Exports \r\nSea Freight Imports and Exports \r\nDoor to Door Pickup and Delivery \r\nLocal cartage and handling\r\n\r\n\r\nLetters of Credit and Banking Services', 'BWI is a truly \\\"hands on\\\" operation providing incomparable service. Customers are assured that their goods will arrive safely, when and where they need them. In house EDI-capable computer systems allow for client access to the most current tracking information, and BWI\\\'s use of Automated Broker Interface (ABI) assures immediate notice of customs clearance of freight. Customers can dial into the system from any PC to monitor shipment status. BWI\\\'s company owned trucks allow for pick up and door to door delivery and give the company complete flexibility and control when handling urgent or specialized freight. HAZMAT certified personnel are on hand to oversee the handling of hazardous materials. BWI aims to handle freight quickly, efficiently and cost-effectively every time. \r\n', '', 'operations@bwicorp.com', 'jean@bwicorp.com', '', '', '', '', '08:00 - 18:00 Monday through Friday', '', '', ''),
(15, '264', 'PT. Cardig Logistics Indonesia is an independent provider of Integrated logistics solution distributing goods throughout Indonesia.  \r\n\r\nFrom its origins more than three decades ago as a forwarding and distribution company.  Cardig Logistics Indonesia has been helping companies get their products to customers quicker and more cost effectively.\r\n\r\nCardig Logistics Indonesia specializes in integrated logistics solutions.  Through its expertise as a third party logistics specialist and its focus on utilizing advanced information technology. Cardig Logistics Indonesia assists its clients to increase service while reducing costs. Cardig Logistics Indonesia (formerly GoTrans) tailors solutions to specific clients needs, involving clients staff in the development of effective atternatives, as well as the formulations of recommendations.\r\n\r\nCardig Logistics Indonesia is a member of the Cardig International Group of companies.  It is one of Indonesia\'s leading logistics provider in the Electronic, Retail, and Telecommunications industry.', '- Warehousing\r\n  * Warehouse management and its system \r\n- Freight Forwarding\r\n  * International Freight Forwarding\r\n  * Domestic Freight Forwarding \r\n  * Project Cargo for oil, gas, power plant and mining\r\n- Project Specialist for Military equipments\r\n- Customs Handling\r\n  * Customs Clearance\r\n  * Customs Documentation\r\n  * Customs Consultancy\r\n  * Duty Drawback\r\n- Distribution and Transport Management\r\n- Contract Logistics', '', '', 'mahendra@cardiglogistics.com', 'hermawan@cardiglogistics.com', '', '', '', '', 'Monday to Friday : 08.00 - 17.00\r\nSaturday (airport office): 08.00 - 14.00 \r\nFor any inqueries, pls call below contact number for further assistances.\r\n1. Hermawan N.W/Business Development Manager (HQ)\r\n   Mobile Phone: 62-811210905 (24 hrs stand by)', '2. Suryanto / Airport Branch Manager  \r\n   Soekarno-Hatta International Airport Office\r\n   Mobile Phone : 62 87809782565\r\n   \r\n3. Mahendra Rianto / Commercial Deputy Director\r\n   Mobile Phone: 62-811942023 (24 hrs stand by)', 'agungpamungkas@cardiglogistics.com', ''),
(109, '367', 'Founded in 1992, Taipei, Taiwan.\r\nTAIWAN EXPRESS, CO.,LTD. believes that Services-oriented leads to success in service industry.\r\n\r\nConventional airfreight forwarders or customs brokers merely focus on import, export, or manage business solely on customs-related services. In order to consolidate and fulfill customers¡¦ various requirement ,TAIWAN EXPRESS in the very early stage has clearly established it position as an International ¡§one-stop shopping¡¨ logistics to satisfied clients¡¦ need and desire. This is TAIWAN EXPRESS\' ever remarkable achievement and a reflection of our dedication to quality service.  \r\n  \r\nThe process of generating know-how of service industry is inextricably people-oriented, for the reason that service can never be separated from humanity. Many service providers failed in the process of expansion results from being unable to build up good relationship with the customers the first time they meet. Hence, either top or out, there is no other alternatives in ¡§the service industry\". \r\n  \r\nApart from maintaining and developing its existing business TAIWAN EXPRESS has recently set up affiliates and branches across the Taiwan Strait by taking a lead to promote the new pioneer of ¡§Dual-Way Operation Center¡¨ in the field of logistics. We have also acquired the franchise of to Central Taiwan Science Park¡¦s Logistics Centre, allowing us to provide tailor-made services to our customers. The world is flat. There are no boundaries upon the competition between enterprises and talented. In view of globalization and our goal towards ¡§On top of Asia, eye on the world,¡¨ TAIWAN EXPRESS is committed to the provision of quality services, reinforcement of e-business functions, establishment of strategic alliances, and expansion of operation.', 'Air/Ocean Freigh Forwarding, Air/Ocean customes clearance, Courier service, delievery & logistics, warehousing, Airline GSA & Co-Load.', 'Air/Ocean Consolidations,Oversized/Perishable/Dangerous Cargo handling, Worldwide LCL and FCL services, Sea / Air combined transport, Bonded & Non bonded customs clearance,\r\nPart or Full chartered services,Temperature controlled trucks,Reefer /FR/OT containers, Express service\r\n\r\n', '', 'joyce.liou@t3ex-tec.com', 'sammi.ting@t3ex-tec.com', '', '', '', '', '', '', 'claudia.lin@t3ex-tec.com', 'tom.huang@t3ex-tec.com'),
(16, '83', 'Cargo Brokers was founded in 1982 in South Carolina, and has since expanded geographically throughout the southeastern US, and expanded the range of services offered to customers. CBI\\\'s mission is to provide the international trade community with the highest value services in all areas of international logistics, thereby enabling customers to focus on their core business activity. CBI\\\'s commitment to quality is clearly demonstrated by being the first freight forwarder in the US to have all operations and locations ISO 9002 certified (1994). Today, Cargo Brokers is a one-stop solution provider for the best in import and export services.', 'Air Freight Imports and Exports \r\nSea Freight Imports and Exports \r\nExpedited (Emergency) Services \r\nCustoms Brokerage \r\nWarehousing and Inventory Management \r\nTransportation Insurance', 'CBI is committed to quality and customer service and strives to find the right logistics solution to customers\\\' problems. Multilingual experts in every field are available to clients at all times, and all staff receive thorough ongoing training based on a program developed in Germany. Use of Automated Broker Interface (ABI) customs link and Electronic Data Interchange (EDI) capable email systems as well as a global network facilitate customer shipment inquiries and allow for real time shipment tracking. The staff provides specialized insurance and logistics consulting services as well as expertise in customs regulations. CBI\\\'s team has the knowledge and flexibility to guarantee effective management of each link in the supply chain and ensure customer satisfaction. \r\n																								', '', 'cbihtfn@cargobrokers.com', '', '', '', '', '', '08:00 - 17:00 Monday through Friday\r\nAfter hours assistance available', '', 'Nicole Steinmetz', 'nsteinmetz@cargobrokers.com'),
(75, '317', 'EKOL LOJISTIK IS THE LEADING COMPANY AT LOGISTICS SECTOR IN TURKEY WITH BRANCHES IN ISTANBUL, ANKARA,BURSA,IZMIR,ADANA,DENIZLI AND MERSÝN', '-INTERNATIONAL&NATIONAL LAND,AIR,SEA,MULTI-MODAL TRANSPORTATION\r\n-CUSTOMS CLEARANCE\r\n-INSURANCE\r\n-BONDED&NONBONDED WAREHOUSING\r\n-ORDERMANAGEMENT\r\n-VENDORMANAGEMENT\r\n-WAREHOUSEMANAGEMENT\r\n-TEXTILLOGISTICS\r\n-PHARMALOGISTICS\r\n-AUTOMOTIVLOGISTICS\r\n-VALUE ADDED SERVICE', '', '', 'rasim.ciftci@ekol.com', 'fatma.demirkapi@ekol.com', '', '', '', '', 'Monday to Friday 08:30-18:30', '', 'murat.cevikbas@ekol.com', 'gokhan.kucuktopuzlu@ekol.com'),
(28, '59', 'ENKAY is dedicated to meeting customer needs with unparalleled service and competitive rates on shipments from anywhere to anywhere in the world. Established in 1981 in Kuwait as Naqeeb & Khattar; NK now has offices in Dubai, Jebel Ali, Bahrain and Syria and the capability to cover the entire Middle East and North African region. The professional staff is composed of specialists from each country who are familiar with the culture and language and experts on law and procedure. NK strives to maintain the highest standards for its employees by encouraging independence and professional development and utilizes the most appropriate technology to deliver state of the art operational, logistical, and marketing solutions.', 'Air Import and Export \r\nOcean Import and Export \r\nFull Warehousing and Distribution Services Including Customs Bonded Area \r\nProject Forwarding \r\nDoor-to-Door Delivery \r\nInventory Management \r\nNon-Vessel Operating Common Carrier (NVOCC)', 'ENKAY\'s professionally trained staff aims to provide customers with a \"total logistics solution\". Offices in the busiest air and sea ports in the Middle East allow NK to offer logistics services of greatest use to customers including customs brokerage, packing and re-distribution, consolidation and break-bulk, and door to door service using its regional network of freight forwarders and a fleet of company owned and operated vehicles. With Electronic Data Interchange (EDI) capable systems and on line links with all ports and airports, NK can offer just in time deliveries and shipment information 24 hours a day. The company competently handles every phase of imports into the Gulf region and exports or re-exports out of the region, acting as a client\'s branch office in the Middle East and allowing the clients to concentrate on their own business. \r\n																								', '', 'andrew.granger@logistica-group.com', '', '', '', '', '', '08:00 - 17:00 Saturday to Thursday\r\nAfter hours assistance available upon request', '', '', ''),
(29, '71', 'Express Transport is independently owned and operated and has earned industry recognition for exceptional performance and customer satisfaction. The entire staff works to offer personalized, one-on-one service to even the most demanding clients, including flavor, fragrance, pharmaceutical, textile and wearing apparel companies. Express Transport is one of the few specialists in handling perishable and hazardous freight, providing on-site bonded cold storage until freight has cleared customs, and final delivery using company owned and operated vehicles.', '*Air Freight Imports and Exports \r\n*Ocean Freight Imports and Exports \r\n*FMC License\r\n*Warehousing 78,000 sq ft. \r\n*Licensed Custom Broker\r\n*Automated Tracking System\r\n*In-House Logistics Center (Pick/Pack)\r\n*Bonded Truck Services \r\n*Bonded Cold Storage On-Premises\r\n*Perishable and Hazardous Cargo Specialists\r\n*Bonded CFS Station\r\n*Complete Documentation Services\r\n*Complete Distribution Services\r\n*Bar Code Scanning\r\n*EDI Interface', 'Express Transport \r\n*bonded refrigeration facility offers maximum protection for perishable cargo and immediate access to freight for distribution, on-forwarding and repacking. \r\n*The company has HAZMAT certified personnel authorized to handle hazardous freight document preparation and shipping, as well as present on-site customer training and individual assistance. \r\n*With its completely automated tracking system including Electronic Data Interchange (EDI) customer interface and automated status reports, Express Transport guarantees that clients can monitor shipments using up to the minute information. The entire staff\\\'s knowledge and experience guarantee prompt and efficient handling of all freight. \r\n* Operate CFS Station (On premises)\r\n* Bonded CFS / Bonded Warehouse (On premises)\r\n\r\nSpecialized Services:\r\n\r\n* Haz Mat\r\n* Pharmaceuticals\r\n* DEA (Controlled Substances)\r\n*', '', 'bconlon@etanj.com', 'aflynn@etanj.com', '', '', '', '', '08:00 - 22:00 Monday through Friday \r\n08:00 - 16:00 Saturday \r\nAfter hours assistance available', '', '', ''),
(73, '320', 'FREIGHT FORWARDING AGENCY', '-AIR FREIGHT AND CONSOLIDATION\r\n-SEA FREIGHT, LCL,FCL\r\n-LAND FREIGHT\r\n-CUSTOMS CLEARANCE, DOCUMENTATION.\r\n-STORAGE, PACKING,REMOVALS, & DOOR TO DOOR SERVICES.\r\n\r\n', '-AIR FREIGHT AND CONSOLIDATION\r\n-SEA FREIGHT, LCL,FCL\r\n-LAND FREIGHT\r\n-CUSTOMS CLEARANCE, DOCUMENTATION.\r\n-STORAGE, PACKING,REMOVALS, & DOOR TO DOOR SERVICES.\r\n\r\n', '', 'm.suhimat@translinkest.com', 'a.hermas@translinkest.com', '', '', '', '', 'Sat-Thu 0830-1830\r\nFri OFF.', '', '', ''),
(74, '319', 'More than 20 years of international forwarding corporation expertise worldwide, EASY FREIGHT managers, team and international partners bring certitude to face of every situation.\r\n\r\nEASY FREIGHT head quarter, just located at CDG a Freight centre, acts evry time with fastest own concept, flexibility and to more than 150 foreign countries.\r\n\r\nEASY FREIGHT agents, partners dedicate a particular network to provide a really freight strong service in airfreight and ocean freight about customs logistic and warehousing.\r\n\r\n\r\nEASY FREIGHT AND ITS ASSETS\r\n\r\n-	20 years experience serving the transport \r\n-	Customs specialist\r\n-	Customs agreement\r\n-	IATA member, FIATA member, TLF member 		\r\n-	Logistics master\r\n-	Reliability, Professionalism, Adaptability, Flexibility, Reception, Security, Confidence \r\n\r\nEASY FREIGHT,\r\na company of confidence, for adapted solutions and answers.', 'Air Freight (Import - Export)\r\nSea Freight (Import - Export)\r\nLogistics\r\nCustoms clearance', 'AIR FREIGHT\r\nSelect with certitude the best airfreight panel companies to propose a high quality service with the best market prices: those are the master cards that EASY FREIGHT has got to assume the shipment\'s ways till destinations.\r\n\r\nMain keys\r\n-	Real door to door service\r\n-	International consolidation capacity\r\n-	Air-Sea flexibility access\r\n-	Certitude direct shipments assumed\r\n-	Rush deliveries in case of supply chain breaking\r\n-	Customers assistance 24H/24H\r\n-	Financial customs agreement access\r\n-	Computerized network connections with the French customs allow to instantly handle:\r\n-	Import and export customs clearance\r\n-	Active goods improvement or passive follow up\r\n-	ATA carnet, temporary admissions or exportations\r\n-	Product harmonized code classifications\r\n\r\nSEA FREIGHT\r\nFrom Paris to Le Havre Pier, Marseille, Antwerp or all other European countries, EASY FREIGHT is really involved to respect transit time, costs, carriage quality on each modality on full loads or on consolidation loads basis. \r\n\r\nMain keys\r\n-	Real door to door service\r\n-	Services capacity FCL, LCL, LCL/FCL et LCL/FCL\r\n-	Customs formality exigence\r\n-	Flexible pick up and deliveries in France and in Europe\r\n-	Warehousing capacity\r\n-	Quality of stocks controls\r\n-	Distribution knowledge\r\n-	Customers assistance 24H/24H\r\n-	Computerized network connections with the French customs allow to instantly handle:\r\n-	Import and export customs clearance\r\n-	Active goods improvement or passive follow up\r\n-	ATA carnet, temporary admissions or exportations\r\n-	Product harmonized code classifications\r\n																								', '', 'franck@easy-freight.fr', '', '', '', '', '', 'From Monday to Friday\r\n8:30 AM to 6:00 PM', 'Express/AOG - Hotline available 24/24 and 7/7', '', ''),
(110, '368', 'Balin Logistics s.r.o. is a young, dynamic, private owned forwarding company, established in 2007. The ground for founding a new forwarding company was more than 15 years of professional experience of the owner in forwarding business. Our main focus is on developing air / sea business together will all relating services like customs procedures, handling and domestic delivery / pick-up. We are also able to offer other transportation services like partial loading, full track loadings or warehousing.', '- AIR export / import\r\n- SEA LCL export / import\r\n- SEA FCL export / import\r\n- Inland transportation within Europe\r\n- Domestic distribution\r\n- Customs formalities', 'Our main scope is on air / sea forwarding from / to Slovakia. We are able to arrange complete services for air / sea shipments but also partial services like just pick-up / delivery or customs formalities. \r\nFor Inland transportation we do offer full track and partial loadings within Europe.\r\nWe offer personal approach to the clients and its needs together with our knowledge of global forwarding and ability to offer full service exactly following clients needs.\r\nWe can also arrange shipments from / to Czech Republic by ourself or together with our long-time partners.', '', '', '', '', '', '', '', '', '', '', ''),
