(34, '238', 'James Forwarding(50 employees) is an international transportation and logistics service provider, one of leading worldwide market in fields of Air Freight, Sea Freight and Warehousing as well as Distribution service. \r\n\r\nFounded in 1987, James has developed incoming and outgoing\r\nLogistics Service to satisfy customers demanding SCM, VMI and 3PL, 4PL as well.', 'Air Freight \r\nSea Freight \r\nSEA & AIR Traffic\r\nCustoms Brokerage \r\nProject Cargo Traffic\r\nBulk Cargo Traffic\r\nChartering Service\r\nDangerous Goods Packing/Transportation', '', '', 'brandon@james.co.kr', 'seanoh@james.co.kr', '', '', '', '', '09:00 - 18:30 Monday through Friday \r\n09:00 - 13:00 Saturday\r\nAfter hours assitance available upon request', '', '', ''),
