(35, '6', 'Founded in 1983, Jets Express is a total logistics provider long recognized for its capabilities in the transportation industry. The company aims to provide fast and efficient service to meet any client need. Dedicated professional staff respond quickly to client inquiries and are qualified to give advice on all transportation matters, including customs brokerage, project forwarding, warehousing and distribution, and insurance. Staff are highly experienced and are experts in their respective specialties. Clients include 3Com Corporation, Dell, Sony, ChipPac, Tenba, Western Digital, Acer, STAR, Nike, Samsung, Medline, Broadline, Robert Borch, Pillsbury, Matsushita, the Malaysia Tourism Board and Foreign Affairs Department. Jets achieved ISO 9001-2000 certification in 2001.', 'Air Freight Imports and Exports \r\nOcean Freight Imports and Exports \r\nProject Forwarding \r\nSourcing and Customs Consulting \r\nWarehousing and Distribution Including Inventory Management \r\nDoor to Door Pickup and Delivery', 'Jets Express strives to develop strong relationships with customers and offers comprehensive services for both domestic and foreign companies. Its Container Freight Service allows for entire containers to be quickly cleared through customs, delivered directly to Jets\\\\\\\\\\\\\\\' warehouse, and broken down into consignments at the warehouse, which saves customers money and guarantees the security of shipments. For foreign clients such as Dell Computer, Jets offers warehousing, inventory management, and distribution services from its own facilities. On the leading edge of technology, the company features Electronic Data Interchange (EDI) links with customs and automatic electronic payment of duties, computer links with airlines, Internet tracking system and global email network so that staff and clients know the exact location of freight at any time. ', '', 'info@jets.express.com', 'jets@jets-express.com', '', '', '', '', '08:30 - 20:00 Monday through Friday · 08:30 - 15:00 Saturday \r\nAfter hours and weekend assistance available upon request', '', '', 'jetkl@jets.com.my'),
(36, '34', 'Jenkinson Logistics provides global transportation services as well as value added management and information services to customers and business partners. The company considers its competitive advantage to be its ability to offer flexible specialized automation capabilities and full global supply chain management. Flexibility allows Jenkinson Logistics to constantly adapt service and solutions to customer requirements. Its strong reputation is built on its personalized service which has fostered long term, solid relationships with many domestic and multinational clients whose business needs demand customized solutions. Specialized logistics services include vendor hub and assembly programs and third party logistics management.', 'Air Freight Imports and Exports (Direct and Consolidated Services) \r\nOcean Freight Imports and Exports (Bulk, FCL and LCL Services) \r\nVendor Hub Service Featuring Line Item Stocking and Direct Line Feed Programs \r\nLicensed Customs Brokers \r\nIn-House Information Technology (IT) Specialists \r\nEuropean Air and Road Distribution Services \r\nWarehousing and Distribution Including Online Inventory Management Systems', 'Jenkinson Logistics considers itself a specialist in Information Technology. In house IT consultants have expert knowledge of various electronic communication protocols and the company is fully Electronic Data Interchange (EDI) capable. The team can also design and implement flexible effective systems for clients. All offices are linked via 64k voice and data compatible lines and the company is online with customs and airlines so customers have direct access to up to the minute shipment tracking information through a variety of communication channels. Jenkinson Logistics is one of the first companies in Ireland to obtain an \"E license\" for its bonded warehouse, allowing import and export procedures without customs present on the premises, subject only to administrative audits by customs. Jenkinson Logistics is also ISO 9001:2008 and A.E.O. certified.', '', 'htfnteam@jenkinson.ie', '', '', '', '', '', '08:30 - 19:00 Monday -Friday\r\n\r\nAfter hours assistance available.', '', '', ''),
(37, '243', 'For over 260 years KDS, originally founded in 1756 as a shipping agency, has had a presence in the Dutch transport industry. Now offering air and seafreight, warehousing, distribution, and trucking services, KDS has survived because of its flexibility in the face of change. The company constantly works to provide the best service to customers. KDS owes its growth and success to its network of loyal agents and clients and to the enthusiastic, experienced staff. The company has been ISO 9002 certified in 1994, proof that they place a high priority on quality.', 'Air Freight Imports and Exports \r\nOcean Freight Imports and Exports \r\nCustoms Brokerage (Fully Licensed by Dutch Customs) \r\nIntra-Europe Trucking & Distribution \r\nCourier and Remail Services \r\nWarehousing and Distribution Including Customs Bonded Area', 'Through its advanced automation network, including EDI capable systems, KDS Cargo increases efficiency in both financial and operational administration and has access to Schiphol\'s EDI airline status messaging information and Dutch Customs. Customers can receive timely shipment updates via computer immediately after they enter the system. The extensive range of services that the company offers demands careful planning and flexibility on the part of KDS staff; they are encouraged to work as a team to continually evaluate and improve procedures. KDS Cargo is a capable and reliable partner with the knowledge and experience customers need.																																																												', '', 'info@kds-cargo.com', 'administration@kds-cargo.com', '', '', '', '', '08:30 - 17:30 Monday -Friday\r\nAfter office hours assistance available, on call staff', '', '', ''),
(40, '271', 'Norman Global was founded in 1970. The current Directors joined the Board in 1992 and completed a Management Buyout in 2000. Therefore whilst the Company has a strong pedigree and over 40 years of trading, the business is led by a young and aggressive team actively involved in day to day operations. \r\n\r\nAnnual revenues are around £23m, and the company has approximately 95 employees nationwide.', 'Airfreight Imports and Exports\r\nOcean Imports and Exports\r\nCustoms Brokerage\r\nNVOCC\r\nMarine Insurance\r\nLogistics and Inventory Management\r\nUK & EU distribution', 'The Company has benefitted from non-specialisation and is therefore able to offer a one-stop-shop to importers and exporters, right through to warehouse management, stock inventory, and order processing.  As well as operating its own warehouses, a fleet of trucks ranging from transit van to articulated trailers, maintains the Companys’ desire to retain as much control of shipments as possible from door to door. Each of the vehicles is satellite tracked From this foundation and utilising these facilities, NGL is able to offer a formidable service, which is flexible, comprehensive, competitive and reliable, and with a caring attitude continues to ensure we grow and prosper.												', '', 'gde@norman.co.uk', 'kmc@norman.co.uk', '', '', '', '', 'Office:  Mon to Fri 0830 - 1730hrs  Saturday: 0900-1200\r\nWhse:    Mon to Fri 0600 - 2100hrs  Saturday: 0800-1200\r\n\r\nOut of Hours arranged as required', '', '', ''),
(41, '169', 'Ocean Express was founded in 1984 and has now grown to reach an outstanding position among the most reputable freight forwarders and Customs Brokers in Brazil.\r\nAs part of its commitment to superior operations and service Ocean Express has implemented company-wide quality and standardization programs and was awarded ISO 9001 international quality certification in October 1999. The company also operates an NVOCC service to major US, Canadian and Northern European destinations from all Brazilian ports.', 'Air Freight Imports and Exports \r\nOcean Freight Imports and Exports \r\nCustoms Brokerage \r\nNon-Vessel Operating Common Carrier (NVOCC) \r\nLetters of Credit, Currency Exchange and Duty Drawback Consulting \r\nWarehousing and Distribution Including Door to Door Pick-up and Delivery', 'Ocean Express\'s staff are highly qualified and committed to providing customers with superior service throughout the transportation process. The company closely manages each step from document preparation, customs clearance and brokerage to delivery worldwide. Ocean Express also offers trucking services throughout Brazil. With 50,000 square feet of warehouse space, the company can accommodate any shipment. Computer links with Brazilian Customs allow faster customs clearance and online customs regulation and shipment status updates. 																																																												', '', 'Mauricio.Fisch@oceanexpress.com.br', 'rates@oceanexpress.com.br', '', '', '', '', '08:00 - 18:00 Monday through Friday\r\nAfter hours and weekend assistance available upon request', '', '', '');
