(43, '293', '', 'Air Imports and Exports \r\nOcean Imports and Exports \r\nLogistics and Distribution Including Pick and Pack \r\nDangerous Goods Transport \r\nCourier Service \r\nDomestic Door to Door service2', 'PCI Logistics was formerly Plane Cargo Inc.\r\nPlane Cargo was the original HTFN member in Dallas Texas and returned to the Network to capitalize on an opportunity to rejoin the group. Their excellent relationship with local carriers ensures the best rates available while still offering the best personal customer service to their clients. With experience handling all types of commodities including high tech equipment, oil industry supplies, medical supplies, aviation equipment, apparel, perishable goods, live animals and hazardous cargo your freight will be well looked after by Plane Cargo. 																								', '', 'pci@pci.world', '', '', '', '', '', '08:00 ï¿½ 20:00 Monday through Friday \r\nAfter hours and weekend assistance available upon request\r\nOn call 24 hours a day.', '', 'jroyall@planecargo.com', ''),
(107, '352', 'new profile', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(44, '2', 'Formed in 1989, Powerhouse has quickly earned a reputation for excellent service and knowledge within the logistics industry and is now one of the largest independently owned forwarders in Australia. The company aims to put quality of work before profits and to maintain a competitive advantage through reliable service to clients. Powerhouse employees are given the flexibility and independence to develop innovative programs and solutions to better meet customers\' needs and maintain long term trusting relationships.', 'Air Freight Imports and Exports \r\nSea Freight Imports and Exports \r\nCustoms Consulting \r\nProject Management \r\nCompany Owned and Operated Vehicles \r\nWarehousing and Distribution Including Temperature-Controlled Areas (outsourced)\r\nMining Inventory Logistics Management', 'Powerhouse is Electronic Data Interchange (EDI) capable and computerised operations, from airwaybills, customs clearance, and accounting, ensure that customers receive up to the minute shipment status information and guarantee efficient management of all steps of the shipping process. All airwaybills are barcoded and entered into the system for easier tracking and customs links increase the speed of export clearances. Planned Forward Waybill (FWB) EDI links will speed US Customs clearance by 48 hours. The company also specializes in the handling of mining and exploration equipment for both import and export purposes.', '', 'tony.daniels@powerhousensw.com.au', 'matt.baker@powerhousensw.com.au', '', '', '', '', '08:00 - 17:00 Monday through Friday ·', '', 'Matt Baker', ''),
(108, '366', 'Dragon Logistics is a subsidiary of Globelink China Logistics Co., Ltd, specializing in international air & sea transport, multimodal transportation, logistics distribution, 3PL, large project transport, exhibition logistics & private effects transport etc, with extensive business network and 18 branch offices in China, with framework covering railway, highway network station, international airport and major coastal ports all over China, and thus forms a comprehensive Shanghai-centered sea-air-land transportation service network basing on Dalian, Beijing, Tianjin, Qingdao, Ningbo, Fuzhou, Xiamen, Guangzhou, Shenzhen, Wuhan, Chengdu, Chongqing, Urumuqi, Hong Kong etc.\r\n\r\nWith its strong and professional team, the company is a pioneer in the Airfreight, Projects Logistics, Inbound Distribution, CIS Railway and Multimodal Transportation and GSA business.', 'Air freight (BSA & GSA) \r\n Air Chartering\r\n Ocean freight\r\n Multi-Modal transportation service\r\n Project Services \r\n Contract Logistics\r\n Sourcing Service', '', '', 'vinnyl@dragon-logistics.com', 'candyc@dragon-logistics.com', '', '', '', '', '24/7', '', '', ''),
(119, '376', 'ACS Logistics Austria was founded in 01/2011 with it’s HQ at Linz/LNZ Airport as a 100% independent LSP, focussed on overseas transportation as well as integrated logistics.\r\n\r\nThe very special on ACS Logistics is, that the company is built on the most modern structures focusing the development of value added services based on state of the art technologies and lean processes. Thus ACS Logistics is the first Austrian LSP who has implemented ediEnterprise from CargoWise as a Transport- and Logistics Software. With this truly fully integrated piece of software ACS Logistics supplies end-to-end visibility and advanced information logistics to it\'s customers as an added value. This in mind we simply have no limit in servicing our customers with complete solutions from typical freight forwarding via warehouse and/or order management providing outstanding visibility as well. Using the technological capabilities enables us to get much deeper involved to the customers supply chains as well as to compete even better with the multinationals.', 'Air Cargo\r\nSea Cargo\r\nRoad Transportation\r\nLogistics \r\nSupply Chain Management', '', '', 'office@acslogistics.at', 'accounting@acslogistics.at', '', '', '', '', '', '', 'Ulrich Hartwig', 'invoicing@acslogistics.at'),
(120, '377', 'Zephyr Logistics China, was born from Supreme Logistics Ltd\r\noriginally, and established by Mr. Wayne Sun as whollyowned\r\nindependent company in 1993.\r\nOver past two decades, led by Mr. Wayne Sun, who has over\r\n30 years experience in 3rd party logistics and supply chain\r\nmanagement, will together with our team of professionals\r\ngives more dynamic to our projects and ambitions.\r\nZephyr quickly became an approved IATA and IFATA cargo\r\nagent, serves its customers and meet their every need by\r\nproviding flexible, programs, efficient, reliable service, and\r\nstriving to consistently exceed expectations. This philosophy\r\nhas earned Zephyr award of excellence from HANJIN,\r\nCOSCO, CMA, MSC, and so on, as well as CX/KML/CA/AF\r\ntop sales agent award, and additional outstanding service\r\nawards from companies such as CAC Group, Whirlpool and\r\nChina national Coal Development Co., Ltd.\r\nZephyr has solid experience working with high technology\r\ncompanies, garment industry, as well as heavy industry.\r\nZephyr offers tailored solutions in Chengdu.', '&#1048698; Air Freight Imports and Exports\r\n&#1048698; Sea Freight Imports and Exports\r\n&#1048698; Sea-Air Combined Services\r\n&#1048698; Land and railroad Transportation\r\n&#1048698; Customs Brokerage\r\n&#1048698; Warehousing and Distribution\r\n&#1048698; Project Handling\r\n&#1048698; Insurance Coverage\r\n&#1048698; Packing and Crating\r\n&#1048698; Fair Exhibition Forwarding\r\n&#1048698; Supply chain management consultant', '', '', '', '', '', '', '', '', '', '', '', ''),
(46, '266', 'Quickflo Logistics Pte. Ltd., established in 1984, credits its success and growth to the professional and personalized manner in which the company handles any cargo, regardless of size or value. Quickflo staff treat each shipment as if it were their own, and are committed to the efficiency and quality standards that clients demand. The company is currently working towards the international ISO 9002 quality certification, and has received Top Agent awards from Emirates Airlines and Asiana Airlines for the past ten years. Long term clients include APPLE, IBM, Hermes, Lexmark and Times Printers.', 'Air Freight Imports and Exports \r\nOcean Freight Imports and Exports \r\nProject Handling \r\nCustoms Brokerage and Worldwide Transshipment \r\nDistribution and Warehousing of Direct Marketing Materials \r\nValuable and Perishable Cargo Handling \r\nRemail Services\r\nHousehold removals & relocation services\r\nLast Mile Fulfillment', 'Quickflo\\\\\\\\\\\\\\\'s fully computerized operations increase efficiency of shipment handling and customer communication. Links with airlines and customs allow for shipment tracking and pre-clearance of import freight; seaport links provide incoming status and schedules of arriving vessels. Quickflo also provides full logistics handling and inventory fulfillment with automatic weekly stock reports. The company specializes in time sensitive cargo and remail and direct marketing services using the company owned fleet of vehicles and distribution department with all equipment for sorting and preparing mail shipments. Quickflo can also manage valuable goods such as gold bars and bank notes, and perishable cargo, including live fish.', '', 'enquiry@quickflo.com.sg', 'sales@quickflo.com.sg', '', '', '', '', '08:00 - 18:00 Monday through Friday\r\n08:00 - 13:00 Saturday \r\nAfter hours assistance available upon request', '', 'administrator@quickflo.com.sg', 'finance@quickflo.com.sg'),
(47, '78', 'Ram International is located in St. Louis, Missouri. Established in 1980, this independently owned and operated company has built a solid reputation for the careful handling of hazardous materials and perishables such as live fish, diagnostic reagents and frozen agricultural products.  The St. Louis office occupies 30,000 square feet of space, including a fully heated warehouse. Ram International was honored in 1996 and 2000 as the HTFN Member of the Year.', 'Air Freight Imports and Exports \r\nSea Freight Imports and Exports \r\nHazardous Materials Shipping \r\nExport Crating and Packing Services \r\nContainer Loading and Unloading \r\nDefined Warehouse Storage Services \r\nLocal Trucking \r\nLicensed Customs Broker \r\nBonded Container Freight Station \r\nAutomated Broker Interface (ABI)\r\nAutomated Invoice Interface (AII)(Remote Location Filing) \r\nSaint Louis Centralized Exam Station\r\nSaint Louis General Order Warehouse \r\nClass 3 Public Bonded Warehouse', 'Ram International offers customers additional services including Ram Banker Service, an automated letter of credit program and ISPM-15 compliant export packing. Tracking status of shipments is made easy through EDI links with all major air carriers. 																	', '', 'ram@ram-intl.com', 'dmeadows@ram-intl.com', '', '', '', '', '08:00 - 22:00 Monday to Friday \r\nAfter hours assistance available', '', 'Marilyn Josten', 'mjosten@ram-intl.com'),
(114, '2003', 'new profile', '', '', '', 'jroyall@jdroyall.com', '', '', '', '', '', '', '', '', ''),
(115, '373', 'PHOENIX is a freight forwarding corporation established in 1991. Its success is attributed to market appreciated skills and capabilities to serving company growth and the industry.\r\n\r\nA differentiated organisation in terms of Compliance, Quality, Environmental Respect, Business Ethics, technological innovation and Human Resources development.\r\nPHOENIX is AEO accredited and IATA Cargo Agent. It is the first forwarder in Greece to obtain ISO Certification for Quality and Environmental Control (ISO-9002:1994, ISO-9001:2008, ISO-14001:2004).\r\nAlso the first certified for its Business Ethical Code by the European Business Ethics Network, and the first to receive accreditation to GDP (EU mandatory Good Distribution Practice)for Ambient and Cool temperature shipments. It is also certified for conducting business with Govermental bodies. \r\nMaintains offices in Piraeus, Athens Airport and Thessaloniki, its own container terminal and trucking company off the port of Piraeus and has organised European and bonded warehouses.\r\nBusiness is conducted under Forwarder liability and Professional (E&O) insurance policies.\r\nApart from mainstream general cargo freight has identified and actively developed a number of niche transportation and logistics markets like temperature controlled logistics, chemicals, exhibition logistics, dangerous goods and ship spare parts.', '-Airfreight: harmless general crgo, temperature controlled and DG goods\r\n-Ocean freight: FCL/LCL, ISO Containertanks\r\n-European Overland transport: Weekly FTL/LTL departures\r\n-Multimodal transport\r\n-Project transport\r\n-Warehousing\r\n-Logistics (3rd party)\r\n-Keep cool transportation logistics\r\n-Exhibition logistics\r\n-Ship spare part logistics\r\n-Chemicals logistics\r\n-Transport consulting\r\n-Fiscal representations\r\n-Supply Chain Management\r\n-Cargo insurance brokerage', 'We are 24/7 available to support your business. We address globally all modes of Freight and Transport and any type of cargo. We organize ocean freight, airfreight, land transportation, railway transport or multimodal arrangements as necessary. Whether General Cargo, Specialty Freight or Project Logistics we have knowledge and competence to handle. To augment our service product we offer value adding services essential to seamless movement.\r\n\r\nWe engage in customs clearance, storage, packing, warehousing, 3PL, Collections FCA & EXW, Deliveries DAP & DDP. We accommodate Land transportation (FTL/LTL) of dry packaged general cargo and ADR shipments, Ocean Freight (FCL/LCL) harmless and IMO Classes 2-9, Intermodal 45\' PW HC Containers, Airfreight and DG shipments, ISO Container-Tanks, Road Tanks, Temperature Controlled Freight (RF Trailers, RF Containers, RF warehousing, RF Airfreight), Ro/Ro, Break-Bulk shipments and Project Transports. We provide cargo insurance and transport consulting.\r\n\r\nWe serve Freight & Logistics of specific industries engaged in trade of Foodstuffs, Marble, Yacht Transportation, Ship Spare Parts, Pharmaceuticals, Time Critical Goods, Perishables, Relocations, Exhibition Logistics, Art & Performance, Diplomatic & Military Cargo, Chemicals and OOG& OWT shipments\r\n\r\nWe have our services designed in such a way as to allow for bespoke tailoring to customer needs. ', '', 'info@phoenixglobalgroup.com', '', '', '', '', '', 'Offices: MON-FRI 09:00-19:00\r\nSSHEX (Saturdays, Sundays, Holidays excluded)\r\nSSHINC (Saturdays, Sundays, Holidays included) on remote access to PHOENIX servers', 'Operations, Warehouse & Container terminal: MON-FRI 08:00-18:00\r\nSSHEX (Saturdays, Sundays, Holidays excluded)\r\nSSHINC (Saturdays, Sundays, Holidays included) on request', 'Vassilis Fassolis', 'v.fassolis@phoenixglobalgroup.com'),
(49, '278', '													Qingdao Ritzy International Cargo Transport is approved for a Class A license by both the Ministry of Foreign Economics and Trade (MOFTEC) and the Civil Aviation Administration of China (CAAC). Ritzy has also been authorized by the Shandong Province Transportation Department to handle international container inland transport. With offices in the Qingdao Economic Development Zone, Jining and Weifang, Ritzy covers China\'s 3rd largest oceanfreight port, which handles annual volumes of over 2 million TEUs. Ritzy\'s more than twenty business divisions include those managing ocean, air and inland transport as well as customs brokerage, commodity inspection brokerage, insurance and a container vehicle fleet. The team of 200 professionals is committed to the principles of providing customers with cost efficient, fast and accurate service.												', '													Air Freight Imports and Exports \r\nOcean Freight Import and Export \r\nCustoms Brokerage \r\nWarehousing and Distribution Including Inland Transportation \r\nAircraft Charters \r\nInsurance and Document Consulting \r\nOn-Site Customer Management 												', '													Ritzy is one of the few companies exempt from inspection by the Qingdao Business Executive Management Bureau, a mark of its reliability and status in the market. The company specializes in all aspects of ocean freight, and has over 150 staff dedicated to this business. As a result, Ritzy is among the top ocean forwarders in its market. For airfreight shipments, a dedicated team of 40 oversees everything from charters and bookings to insurance, customs brokerage and transport inspections. Significant investment has been made in up to date information systems and equipment to maximize efficiency and ease of access for customers.												', '', 'tom@ritzy.com.cn', 'derek-wang@ritzy.com.cn', '', '', '', '', '													08:00 - 19:00 Monday through Friday\r\nAfter hours assistance available upon request												', '																									', '', ''),
(51, '47', '													Royal Cargo de Colombia is a privately owned independent organization which operates as an international Freight Forwarding agent, and has more than 19 years of experience in the industry, offering solutions to all international transport needs, by air, ocean and land. \r\n\r\nWe are exclusive representatives for Colombia for the HIGH TECH FORWARDER NETWORK; our main office is located in Bogotá; we have offices at the principal sea ports of Cartagena and Buenaventura and are capable of attending operations nation wide through the main airports of the country. \r\n\r\nKnowing that the success of our business depends on pleased customers and over-seas associates, as well as competitive rates, we will strive for satisfying your specific needs as well as those of your clients. We offer flexible and rapid solutions delivering quality in every service.\r\n\r\nWe also run another business unit: Royal SIA, which operates as a Customs Broker Agent. Even though Royal Cargo started its operations as a Freight Forwarder and Customs Broker, due to changes in Colombian regulations, since 1995 we have been operating separate business units, that allow us to offer solutions to all customs operations, from cargo release all the way through delivery at your facilities; we operate according to current legislation. The synergy developed by our two business units allow us to offer fast solutions to customs transactions, as well as the transportation of your goods.\r\n												', '													Air Freights for Imports and Exports \r\n\r\nOcean Freights for Imports and Exports\r\n\r\nGuidance for your imports and exports processes. \r\n\r\nGuidance in costs optimization, lead times and itineraries.\r\n\r\nReceipt and handling of documents, redispatch and/or receipt abroad.\r\n\r\nWarehousing\r\n\r\nInland transport within the national territory  \r\n\r\nAffirmative answers to the most particular requests\r\n\r\n\r\n												', '													Royal Cargo\\\\\\\'s staff is well-informed regarding import and export handling and regulations, including duties and taxes arrangements. The company can guarantee that with its experience handling all variety of freight, customers can feel completely secure entrusting all types of goods to Royal Cargo. Personalized service guarantees that a staff member will be assigned to each shipment to handle all the procedures involved with good’s transport and customs clearance. Goods are stored in a customs warehouse which only licensed customs brokers has access to, ensuring the security of freight. The company offers automation services including a tracking system providing customers with the latest shipment information.												', '', 'operations@royalcargo.net', 'royalcargo@royalcargo.net', '', '', '', '', '													08:00 - 18:00 Monday to Friday. \r\n09:00 - 12:00 Saturday \r\n24 Hours mobile 57 3 10 880 0498												', '																									', '', ''),
(71, '312', 'J & G Freight Forwarders C.A. was established on September 07, 2004 with a group of professionals with more than 12 years of experience in the forwarder area.\r\nOur core activity is to provide complete transportation and logistics solutions to their customers and fellow HTFN members.\r\nThis service is backed by many years of experience in the air, ocean and inland transportation industry.\r\nJ & G Freight Forwarders C.A thinks big, but we never forgot that our traditional personalized service has been the key to the success.', 'Air Import and Export\r\nOcean Import and Export\r\nDoor to Door Pickup and Delivery\r\nProjects\r\nCustoms Brokerage\r\nWarehousing and Distribution\r\nOcean and Air Break Bulk Service', 'With our headquarters in Caracas, J&G Freight Forwarders handle project cargo as well as containers, break-bulk, heavy equipment and air freight. They additionally offer first class multi-modal services with storage and staging facilities for their customers’ convenience. We begin with freight follow up from vendors at origin through its final destination anywhere in the world. The company takes pleasure in providing complete transportation services for cargo originating in Venezuela and abroad. J & G Freight Forwarders C.A handles industrial projects, exhibits, heavy machinery, personal effects, automobiles, containers or refrigerated freight to and/or from any destination worldwide.																																				', '', 'jgfreight@jgfreight.com', 'jennylago@jgfreight.com', '', '', '', '', '08:00 - 17:00 Monday – Friday', 'After hours and weekend assistance - Mobile: (+507) 62721809 (Mr Giancarlo Fernandini)', 'Jenny Lago', ''),
(53, '284', 'Although Sailors Shipping was founded in 1998, the managing partners bring extensive transportation industry experience to the company. Sailors specializes in handling garment and textile shipments, but has also gained clients in the pharmaceutical and biomedical equipment industries as those specialties develop in Bangladesh. The aggressive sales team continually works to tap new markets and determine new transportation and logistics needs; the company is committed to providing superior, timely service to clients. Constant communication is a priority, and satisfied clients include Berene Apparels, Wilford, Bernus, Zero-Ten, Alexandra, Ivory, Low Land, GMG Airlines, etc.', 'Air Freight Imports and Exports \r\nSea Freight Import and Export \r\nPurchase Order Tracking \r\nWarehousing and Distribution Including Pick and Pack \r\nTrucking Service Throughout Bangladesh \r\nCustoms Brokerage and Documentation', 'Sailors considers its professional staff one of its biggest assets. Employees are well versed in import and export regulations and international trade requirements and offer shipment-specific consulting. The company has invested in its information systems to take advantage of the latest technology; all offices are connected via remote network and an in house accounting system increases efficiency. Company owned and hired vehicles can provide customers with secure delivery throughout Bangladesh, allowing clients the confidence that goods are handled safely and professionally.', '', 'rezaul@sailorsshipping.com', 'saiful@sailorsshipping.com', '', '', '', '', '09:00 - 17:00 Saturday through Thursday, Friday and\r\nAfter hours assistance available upon request', '', '', ''),
(91, '336', 'Our main area of expertise lies within air & ocean freight to and from global destinations. We believe that personal service, experience and the ability to utilise the good in new technology is still sought after. \r\n\r\nSpedman Global Logistics operates in Sweden, Norway, Finland, Denmark, Estonia, Latvia, Lithuania, Belarus and in Poland. \r\n\r\nWe have strong financial background and ownership. The Spedman brand is equal to competitive solutions and quality in the Nordic market since 1982. We are on line with customs, fully licensed for brokerage and access excellent direct agreements with the most air- and ocean lines. Our core business is air- and ocean freight as well as project shipments between the Nordic areas and overseas markets.  \r\n\r\nOur fundamental objective is to provide a quality service on a personal level to our clients and partners.', 'Airfreight, Oceanfreight, LCL, FCL, Consolidation, Customs clearance, Brokerage, Distribution, Logistics, Projects 																																																																	Airfreight, Oceanfreight, p/u, delivery, customs clearance, LCL consolidation, Nordic Hub (LCL), projects.', '', '', 'sales@spedman.se', '', '', '', '', '', '', '', '', ''),
(92, '331', 'Harmony was set up in 2003\'. It has 6 offices with over 600 staff. It has own bonded warehouse, bonded trucking team to perform the guaranteed service to the clients.', 'airfreight export import\r\nseafreight export import\r\ncustoms clearance\r\npick up and delivery\r\nwarehousing and packing', '', '', '', '', '', '', '', '', '', '', '', ''),
(55, '212', 'Swiftair is a family owned company committed to providing quality customized service to clients. The company\'s management is involved in all aspects of the business and their attention to customers sets Swiftair apart from the competition. As one of the fastest growing forwarders in South Africa and with offices in Cape Town, Durban and Johannesburg, Swiftair manages both air and seafreight imports and exports, specializing in fast customs clearance and delivery of goods. Customers include Shell S.A., Engen Petroleum, Otis Elevators, and Maersk South Africa.', 'Air Freight Imports and Exports \r\nOcean Freight Imports and Exports \r\nAirfreight Charter Service \r\nProject Forwarding \r\nRoad and Rail Transport to Inland Destinations and Southern African Countries \r\nWarehousing and Distribution Including Customs Bonded Area', 'Swiftair\'s management and staff pride themselves on effectively managing any kind of freight or logistics transaction. All customs and accounting documentation is computerized and the company arranges pre-clearance of airfreight imports to minimize unnecessary delays and maximize efficiency. A large portion of Swiftair\'s business is the customs clearance and delivery of ship spares to vessels docked in Durban, Africa\'s busiest port. Dedicated staff are on duty twenty-four hours a day to manage this time critical process. Swiftair also specializes in project forwarding, especially for the petroleum industry. The company stays ahead of the competition by always keeping customers\' needs in mind. ', '', 'swiftair@eastcoast.co.za', '', '', '', '', '', '08:00 - 17:00 Monday through Friday \r\nAfter hours and weekend assistance available upon request', '', '', ''),
(56, '305', 'SPEDYCARGO is much more than an International Forwarder Agent, we are a leading provider of end-to-end supply chain solutions demonstrating core competencies in domestic and international freight transportation. We provide support to trade industry in the global exchange of goods-in land transportation, worldwide air and sea freight and in all the associated logistics services. Our team provides complete solutions tailor-made for the requirements of industry today and tomorrow. We offer to our customers and business partners \"SOLUTIONS THAT WORK\".', 'Air Transport \r\nOcean Transport \r\nRoad Transport \r\nComplete FCL and LCL service \r\nFCL contract management \r\nLCL container consolidation / deconsolidation \r\nThrough service single bill of lading/LI> \r\nForwarding services \r\nIn House Brokerage Services Export / Import \r\nSingle or multiple vendor consolidation and distribution/LI> \r\nFull document services \r\nMulti-modal services\r\nHand Carry\r\nCharter', 'Our air transport services are called Spedycargo Express, Spedycargo Regular and Spedycargo Economy. We have redefined our air products to respond to our new image and to the demands of our customers needs.\r\n\r\nAs both a traditional ocean freight forwarder, and an Ocean Transportation intermediary, Spedycargo offers its customers flexible service options for ocean freight transportation. Our ocean services encompass capabilities for handling less-than-container load (LCL) and full-container load (FCL) shipments, break bulk cargoes, and charter services.\r\n\r\nSpedyCargo performs road haulage services in all European countries. The actual transport network ensures that goods can be transported efficiently using the internal networks of each country.																																																', '', 'artur.moutinho@spedycargo.pt', 'emidio.moutinho@spedycargo.pt', '', '', '', '', 'Monday to Friday 09:00-18:00 \r\n24/ service available \r\nPlease contact the Emergency team', '', '', ''),
(58, '272', 'TRANSBER prides itself on being one of the very few forwarders in the Peruvian market able to offer a range of services including cargo handling, customs brokerage, logistics, warehousing and distribution to delivery anywhere in Peru. The company was founded in 1983 and strives to remain on the cutting edge of technological advances and to provide professional and personalized service. TRANSBER\'s management is closely involved in all company operations. The experienced staff are considered the company\'s greatest assets and are continually challenged to increase their industry knowledge and develop innovative solutions to customers\' transportation needs. Clients include Tyco Electronics, Procter & Gamble and Pluspetrol.', 'Air Freight Imports and Exports \r\nOcean Freight Imports and Exports \r\nCustoms Brokerage \r\nCompany Owned Warehouse and Trucking Fleet \r\nProject Cargo and International Moves \r\nDistribution and Door to Door Delivery Nationwide\r\nAircraft Charters ', 'TRANSBER has the equipment and capabilities to efficiently handle each step of the transportation process. Company owned cargo handling equipment ensures secure and efficient loading and unloading of air freight, and a 32,300 square foot warehouse protected by 24 hour security and video surveillance is available for transit cargo or export consolidations. A computerized inventory control system helps TRANSBER manage inventory and logistics for several textile companies, freeing clients to focus on their core business. The company\'s in-house licensed customs broker manages all paperwork and clearance procedures and guides clients through complicated customs regulations. TRANSBER also offers aircraft and boat charters for project cargo and other shipments to and from Iquitos, in the petroleum-rich Amazon region. ', '', 'cgil@transberperu.com', 'rdiaz@transberperu.com', '', '', '', '', '08:30 - 17:30 Monday through Friday · 08:30 - 12:00 Saturday\r\nAfter hours assistance available upon request\r\nOperations personnel accessible 24 hours a day', '', NULL, NULL),
(95, '355', 'The company was established in 1997 with head office in Buenos Aires City, Argentina.\r\n\r\nSpecialized in international logistics services with the support of a flexible and highly experienced staff, our organization meets the expanding needs of our customers and partners acting in a global and changing world.', 'Air Freight: Import & Export. Dangerous Goods, Perishables, Chartering, Sample Programs, Door to Door services.\r\nOcean Freight: Import & Export. FCL, LCL shipments, Outsized and Heavey Lift Cargo, Transhipment Operations, Chartering. \r\nSpecial Services: Fairs & Exhibitions, Works of Art, Artistic Shows and Sport Events, International Movings. Leading Logistics Provider in Fresh and Frozen Foods shipments.\r\nAccesorial Services: Customs Brokerage, Cargo Insurance, Packing, Warehousing & Distribution, Local Pick Up & Inland Trucking, International Ground Transportation.', '', '', 'edgardo@lynx.com.ar', 'guillermo@lynx.com.ar', '', '', '', '', 'Monday to Friday - 09:00 to 18:00.', 'Overtime and weekend assistance available upon request.', 'Guillermo Mendes', 'buemg@lynx.com.ar'),
(89, '321', 'CORPORATE NAME \r\n BHA CARGO LOGISTICS SA( Head Office ) \r\n Av. Nueva Providencia 2134 floor 8 \r\n Providencia, Santiago - Chile\r\n Tel : 56-2- 2335 6517 ( Central ) \r\n FAX  56-2- 23356670 ( Central Fax )\r\n Web: www.bhacargo.cl', '•	Air freight import / export \r\n•	Ocean Transport / import/ export\r\n•	Insurance\r\n•	Project cargo transportation\r\n•	Planning cargo event internacional\r\n•	Inland freight\r\n•	Custom clearen\r\n•	Distribution\r\n•	Warehouse  the transfer\r\n•	Weekly consolidation Brasil & USA\r\n•	Ship`s Agency', 'BRANCH OFFICES\r\nIQUIQUE – ANTOFAGASTA - SAN ANTONIO – VALPARAISO \r\nNEW BHA WAREHOUSE & DISTRIBUTION CENTER \r\nAv. CERRO SAN LUIS  9971 GALPON 5\r\nCENTRO DE BODEGAS SAN ANDRES\r\nQUILICURA - SANTIAGO\r\nTel : 56-2- 376 5042\r\nFAX: 56-2- 376 5043\r\n', '', '', '', '', '', '', '', '', '', '', ''),
(80, '327', 'STI can handle the most complex transport projects. With an international network, a tried-and-tested infrastructure and a team of customer-focused, talented people at your service 24 hours a day.\r\n\r\nSTI manages all aspects of your shipment including\r\ntransport insurances and all customs clearances.', 'Main Service Portfolio:	\r\nPlanning and execution of:\r\na) European Road Transport (temperature controlled, \r\n   pharmaceuticals, cruise supplies and dry goods)\r\nb) Global Ocean Freight and Airfreight\r\nc) Customs Clearance (incl. INTRASTAT-Notification)\r\nd) Warehousing\r\ne) Transport Insurance\r\n\r\nMore details on Customs Clearance Services\r\n• Import Customs Clearance in Germany “online” by Atlas with more than 300 customs offices\r\n• Single/Summary Customs Procedures/Customs declaration (period entry)\r\n• Bonded warehouse (Type D)\r\n• Application of BTI’s (binding tariff information)\r\n• Import licences\r\n• Fiscal agent/Fiscal customs clearance\r\n• Intrastat Entries\r\n• Export Customs Clearance\r\n• Issuing of customs/pro forma invoices\r\n• Issuing of export declarations\r\n• Issuing of certificates of origin\r\n• Issuing of movement certificates (EUR.1/A.TR/T2L)\r\n• Application/Administration of supplier’s declarations\r\n• Intrastat dispatch\r\n• EU-organisation of the market of agricultural products (export refund) issuing and handling of all customs documents and licences.\r\n \r\n• NCTS (New Computerized Transit System)\r\n• Issuing of transit documents T1/T2\r\n• Principal (in transit operation)\r\n\r\n• Miscellaneous\r\n• complete taking-over of all customs clearance activities\r\n• customs projects on international level incl. fiscal agent\r\n• consultant in the entire area of customs and foreign trade, incl. ”connections” to the chamber of commerce and veterinary authorities, etc.', '', '', 'kerstin.bijmholt@sti-fm.com', '', '', '', '', '', 'PLEASE NOTE OUR HELPDESK-No. +49 2065 6953020 In case of urgent matters we are available under this number 7 hrs week/24 hrs day.', '', 'Kerstin Bijmholt', ''),
(100, '360', 'Bon Marine Logistics Ltd. is a fast moving, customer and market oriented organization. By establishing long-term relations based upon mutual interest and co-operation, we strive to be the preferred partner in the Transport, Freight Forwarding and Logistics sectors. We create added value through offering comprehensive logistic service from the consulting to the actual realization of sophisticated and complex logistic solutions.', 'Logistics Operator\r\nLogistics Outsourcing of Industrial Enterprises\r\nFreight Forwarding\r\nTransport\r\nWarehousing and Management of Bonded Warehouses\r\nCustoms Clearance\r\nStevedoring\r\nPort Operations\r\nConsultancy\r\nAirfreight', 'Full transportation and logistics support for all operations related to:\r\n\r\n&#9679; Oil/gas research 2D/3D seismic operations on both onshore and offshore territory of Bulgaria;\r\n\r\n&#9679; Oil/gas exploration and drilling on both onshore and offshore territory;\r\n\r\n&#9679; Construction of gas pipelines (sea and land sections);\r\n\r\n&#9679; Infrastructural projects outside the territory of the Republic of Bulgaria; \r\n\r\n&#9679; Construction of large industrial sites (plants, thermal and nuclear power plants); \r\n\r\n&#9679; Providing complex logistics service outsourcing to the operation of industrial enterprises;\r\n\r\n&#9679; Organizing sea, river, railway, road and air transport, including combined transport;\r\n\r\n&#9679; Organisation of loading and unloading operations and transportation of heavy and oversize cargo;  \r\n\r\n&#9679; Complete customs agency services;\r\n\r\n&#9679; Warehousing and management of bonded warehouses;\r\n\r\n&#9679; Port operations;\r\n\r\n&#9679; Consulting with regard to all the aforementioned activities;\r\n\r\n&#9679; Complete “one stop” logistics service;\r\n\r\n&#9679; Port operator of Danube river port Belene NPP. Port has the biggest lifting capacity in the lower part of Danube river (480 ton per unit) and is convenient in creating cost effective delivery schemes for heavy/oversized project cargoes from main EU ports Antwerp/Rotterdam or from any EU country located on Rhine, Main or Danube rivers to Bulgaria, Black sea and Caspian Sea region, as well as to Russian/Ukrainian river ways and vice versa without using geared transport.\r\n\r\n&#9679; Airfreight', '', '', '', '', '', '', '', '', '', '', ''),
(62, '165', '													Founded in Memphis, Tennessee in 1946 to serve the export community in the southern US, V. Alexander has expanded to offer a broad range of import and export services to clients. The company firmly believes that its primary business is service. Because of its unique independent position V. Alexander has the flexibility to work directly with any carrier, Non-Vessel Operating Common Carrier (NVOCC), or consolidator to best accommodate client needs. The company aims to be a \\\\\\\"total logistics partner\\\\\\\" to its clients, who include Jack Daniel\\\\\\\'s, Bridgestone/Firestone, Toshiba America, and Sea Ray Boats. 												', '													Air Freight Imports and Exports \r\nOcean Freight Imports and Exports \r\nLicensed Customs and Property Brokers \r\nLetter of Credit Consulting Services \r\nFully Automated Tracing Systems \r\nPurchase Order and Part Number Tracking 												', '													As an inland forwarder and customs broker V. Alexander recognizes the importance of tracking customers\\\\\\\' freight. Each shipment is logged into an automated Electronic Data Interchange (EDI) capable shipment tracing system which is directly linked both to US Customs via Automated Broker Interface (ABI) and to customers. The staff closely monitors the progress of each shipment from pickup to final destination via daily \\\\\\\"exception reports\\\\\\\", which allow quick follow up to investigate any delays. The company also offers electronic management information programs which enable clients to download tracking data directly to any PC twenty four hours a day. V. Alexander\\\\\\\'s staff is dedicated to quality in managing all aspects of trade including customs clearance, import and tariff regulations, export cost information and sales quotations. 												', '', 'cschmid@valexander.com', 'hbuscher@valexander.com', '', '', '', '', '													08:00 - 17:00 Monday through Friday \r\nAfter hours and weekend assistance available												', '																									', 'Davd Swett', 'dswett@valexander.com'),
(63, '292', 'Willfreight was founded in 1996 and is a medium-sized company specializing in the handling of aircraft parts and their spares for companies with interest in the East African region,as well as a freight forwarder of all commodities across borders worldwide.We currently command over 70% of aviation freight business in Kenya.\r\n\r\n\\\\\\\\\\\\\\\"We are committed to providing proactive relationship services to our clientele, and encourage creativity and innovation.We appreciate that optimum results can only be achieved by co-operating with each other in pursuit of explicitly defined /communicated objectives.We want to be winners,both individually and as an organization,forge and develop mature partnerships with our clientele and together face common challenges\\\\\\\\\\\\\\\".\r\n                                  Bryan Wanyande\r\n                                  President', 'Air Freight Imports and Exports \r\nOcean Freight Imports and Exports \r\nRegional Road/Air Transport \r\nCustoms Brokerage \r\nTransshipment Services\r\nCargo Consolidation (sea & air) \r\nWarehousing and Distribution\r\nInsurance Consulting\r\nInventory Management Systems\r\nWorldwide door-to-door delivery', 'Willfreight has the personal touch,strength,resources,experience and a capable team to provide tailor-made logistical solutions to its clients.Our staff are highly trained and motivated,have a professional attitude and live up to our slogan \\\\\\\\\\\\\\\"Willfreight Means Service\\\\\\\\\\\\\\\".\r\nWe have in place the necessary infrastructure to monitor the movement of all shipments at all times.Our state-of-the-art extensive communication network comprising of telephones,two-way radios,email/internet and on-line tracking facility permits round-the-clock update on postion of shipments.												', '', 'lindaowiti@willfreight.co.ke', 'bryanwanyande@willfreight.co.ke', '', '', '', '', '07:30 –17.30 Monday through Friday and 08:00 – 13:00hrs on Saturday\r\nAfter hours and weekend assistance available upon request on 254 722 511055 & 254 735 511055(Mobile)', '', '', ''),
(69, '309', 'Banking on more than a decade of experience in the freight industry, one of the Philippines\' fastest growing forwarding companies has metamorphosed into a new company with renewed vigor and commitment. With its vast and proven experience in international cargo handling, the company (formerly known as Palaris and Options Logistics) started operations in 1986 and since then consistently posted significant growth onward through the 90s with its aggressive marketing services in the U.S.\r\nToday, AEROMAX carries this experience in the export/import trade business with the rest of the world in any way possible. Through AEROMAX\'S contacts with major international carriers, you can adjust your shipment schedules with greater flexibility among several options any time at your convenience. Translating into regular consolidations with faster transit time at the most reasonable rates.', 'Air and Sea freight forwarding \r\nFCL and LCL \r\nCustoms Clearance / Brokerage \r\nNeutral Break Bulk \r\nDoor to Door Delivery Commercial Cargo \r\nPacking and Warehousing \r\nTransshipment facilities \r\nFreight Service', 'Known for its expert personalized service, AEROMAX\'S assistance does not begin or end at ports alone. It offers a two-way service that moves cargo not just through air and sea, but likewise through land. This is made possible by its network of destination services that include fast, economical, door-to-door delivery in any major city throughout the globe. 												', '', 'rachel.contini@aeromax.com.ph', '', '', '', '', '', '', '', '', ''),
(70, '310', 'Newport Express is a Hong Kong based air and ocean freight forwarder founded in 1989. We have a team of highly experienced staff to handle shipping inquiries from customer and worldwide partners. Our close relationships with the major airlines and steamship lines ensure we can obtain the best possible freight rates. We are dedicated to providing efficient and qualified cargo forwarding services by working closely with our network partners to ensure shipments run smoothly worldwide.', 'Air Freight (Inbound & Outbound)\r\nOcean Freight (LCL & FCL)\r\nTrucking Services (HK and Southern China)\r\nWarehouse Management Systems \r\nComplete Documentation Services', '', '', '', '', '', '', '', '', 'Office Hours: Mon to Fri 09:00 to 18:00  \r\nAfter hours and weekend assistance available', '', '', ''),
(103, '363', 'RIL Logistics is a rapidly growing company that offer its customers a full range of Logistics Services. Our Group has more then three decades of experience and exposure in this Industry. Our staff maintaines the highest professional standards working with our customers as a team. We promote and exhibit the qualities of diligence, commitment as well as immediate follow up and feed back. Our philosophy has earned us a strong clientele as we believe in offering long term relationships with our clients through our superior service, competitive rates, digital record keeping and information management.', 'Air Freight Imports and Exports\r\nSea Freight Imports and Exports\r\nLicensed Custom House Brokerage\r\nInland transportation\r\nAfghan Transit Trade\r\nDoor to Door Services\r\nProject and Heavy cargo handling\r\nWarehousing & Distributions\r\nCold Chain Solutions\r\nAir Chartering', 'we have been consistently recongnised by our peers and customers as an Industry leader. With a network of 13 branches in Pakistan and Afghanistan, our group has become one of the largest and most trusted full-service supply chain firm in the region. Our group has received numberous awards from business associations at the local, national and regional level including the Best Export Performance Awards for the last three years from the Federation of Pakistan Chamber of Commerce and Industries. Our group have been ranked among top three custom clearance companies by Pakistan Customs, top five air freight forwarder by the International Air Transport Association (IATA).', '', 'tahir.mughal@raaziq.com.pk', 'rehan@raaziq.com.pk', '', '', '', '', '0900 to 1700 hours Monday to Friday.\r\n0900 to 1300 hours on Saturday', '', 'Rehan Rizvi', 'rehan@raaziq.com.pk'),
(129, '410', 'ABOUT US\r\n\r\nInteramerica Group is a business group dedicated to logistics leader in the Paraguayan foreign trade market.\r\n\r\nWe have over a decade of presence in the market and with a team of over 35 highly skilled professionals, establishing as a leading company and leader in the field both locally and regionally.\r\n\r\nOUR MISSION\r\n\r\nProviding a flexible service of high quality, reliable and efficient, in order to achieve customer satisfaction and contribute to the success of your business', 'International Maritime Transport, River, Land and Air, FCL and LCL\r\nInternal Transportation throughout Paraguay\r\nCoordination and logistics for filling containers\r\nConsolidation and deconsolidation services\r\nHandling of dangerous cargo\r\ntracking and monitoring loads\r\nInsurance of Goods\r\nDoor to Door Services\r\nCustoms Clearance\r\nWarehousing and distribution\r\nInspection of load\r\nAnalysis and development of project cargo', '', '', 'carol@iamerica.com.py ', '', '', '', '', '', '', '', '', ''),
