(85, '330', 'MULTITRADE SPAIN,S.L. started in Barcelona in 1986 as a Freight Forwarding Company dedicated to the air, sea, project cargo and wine logistics.\r\nActually the owners are BGP, Amadeo Zaragoza Project Manager and Carlos Guimet General Manager.\r\nWe are located in Castelldefels Barcelona, very close to the port and airport, covering any requirement in Spain.\r\nMultitrade Spain, S.L. certified with ISO 9001, ISO 14001,AESA; AEO and is member of FIATA, IATA, FETEIA and HTFN with a team of 40 professionals that cover all logistical affairs.\r\nIt is important to mention that we are a leading company in the world in train transport, actually moving rolling stock to China, USA, Italy, Turkey, Tunez and Israel.', 'Airfreight Worldwide\r\nSeafreight Worldwide. \r\nTurnkey Projects with oversized transport Worldwide.\r\nWine logistics.', 'India,Mauritius, Mediterranean, Latin America export/import\r\n\r\n																																				', '', 'carlos.guimet@multitrade-spain.es', 'roxana.venturo@multitrade-spain.es', '', '', '', '', '0830 1330\r\n1500 1800', '', 'Carlos Guimet', '');
