(86, '333', 'SECURITY SURVEY\r\nCUSTOMS TRADE PARTNERSHIP AGAINST TERRORISM\r\n(C-TPAT)\r\nDESTINATION FACILITY NAME: Gaash Customs Clearing & International Forwarding Service Ltd.\r\nAddress: P.O.BOX. 53 B.G. Air-Port Zip-Code 70100 Israel\r\nName and Title of person providing information: Ronen Simgi, CEO\r\nPhysical Security\r\n1. Are there cameras and if so, who monitors them?\r\nYes, the security company.\r\n2. Are locks installed on all windows and doors?\r\nYes\r\n3. Are locks installed on gates and fences?\r\nYes\r\n4. Is there a means of controlled access? If yes, please explain.\r\nNo.\r\n5. Do you have an alarm system and/or employ the services of a security guard during non-operating hours? Please give details.\r\nYes alarm system that connected to the security company + security patrol.\r\n6. Once unladen, is cargo stored in a segregated area?\r\nYes\r\n7. If cargo is stored in a segregated area, describe means of segregation.\r\nCargo always Stord at the government warehouse at the airport or seaport (government security responsibility)\r\n8. Are there designated security personnel or devices in the cargo area? Please describe.\r\n9. Cargo always Stord at the government warehouse at the airport or seaport (government security responsibility)\r\n10. Is private vehicle parking separate from the shipping, unloading and cargo areas?\r\nNo\r\n11. Are there communication systems in place to contact internal security or local law enforcement personnel in the event of suspicious activity?\r\nCargo always Stord at the government warehouse at the airport or seaport (government security responsibility)\r\n12. Describe the lighting in place inside and outside the facility including parking areas?\r\nNeon light day and night + security flash light outside the facility\r\n13. Is facility in Free Trade Zone/Industrial Park or other compound that provides additional security features? Please describe?\r\nCargo always Stord at the government warehouse at the airport or seaport (government security responsibility)\r\n14. Are containers/trailers, etc. properly sealed so tampering would be evident and/or locked prior to departure?\r\nYes\r\n15. Are seal numbers recorded on the shipping instructions and records kept of seal numbers and verified at arrival point?\r\nYes\r\n16. Are international, domestic, high value and dangerous goods properly segregated by fence, safe or cage with access restricted to need and properly marked?\r\nYes\r\n17. Are procedures in place to notify law enforcement agencies in cases where illegal activities are detected or suspected?\r\nYes (government security responsibility)\r\n18. Is the transfer of container to forwarder/carrier/or airport made by your own company trailer? If no, have you ensured that your carrier has a Pre-Carriage/ road transportation Security Program in place?\r\nWe do not have our own trailers – we use a company\'s that have security program (we use FEDEX)\r\nPersonnel Security\r\n1. Do you conduct pre-employment screening and interviewing of prospective employees?\r\nYes\r\n2. Do you conduct background checks and application verifications where permitted by law?\r\na. If yes, specify methods used.\r\nYes – we ask for criminal record from the ministry of justice\r\nb. If no, will you be implementing any form of personnel checks in the near future?\r\nEducation & Training\r\n1. Do you have written security policies, procedures and practices to guard against the inserting of illegal or unauthorized material into shipment?\r\nWe have no written security policies – in that matter we fallow the Israeli low which forbid inserting of illegal or unauthorized material into shipment\r\n2. If yes, is this documented and available if requested by DHS?\r\n3. Does your company provide a security awareness program to employees?\r\na. If yes, please give details of your program.\r\nb. If no, will you be implementing any form of security training in the near future?\r\nNo & No\r\n4. Is there an electronic identification system and are photos and fingerprints maintained?\r\nElectronic identification system\r\n5. Is the packing area restricted to those employees assigned to work there?\r\nYes\r\n6. Are there designated security personnel or devices in the packing area? Please describe?\r\nOnly authorized personal in the Packing area (as for security - government responsibility)\r\n7. What are the procedures for drivers?\r\nNeed to be listed and authorized by the security departments at the airport or seaport\r\n8. Where do they wait and is it segregated?\r\nAt the designated area controlled and monitored by government security responsibility.\r\nProcedural Security\r\n1. Is there an employee and/or security officer designated to supervise the introduction or removal of cargo?\r\nThat is been done by the port authorities + security officer designated to supervise the introduction or removal of cargo.\r\n2. Describe the method by which all outgoing finished merchandise is marked, counted, weighed and documented.\r\nThat is been done by the port authorities,\r\n3. Is tamper-proof tape used to secure boxes?\r\nYes\r\n4. Are all cartons/merchandise weighed?\r\nYes\r\n5. Describe the procedures for affixing, replacing, recording, tracking and verifying seals on containers or trailers. (Are security seals compliant with ISO 17712:2013 standards?)\r\nOur employee will approach the port authorities – they will authorize and the replace the ISO 17712:2013 seal\r\n6. Are shortages or overages detected and reported? Are they investigated? If so, by whom?\r\nYes – by customs and by port authorities\r\n7. Describe the procedures for reporting timely movement of incoming and outgoing freight.\r\nWe transfer all info by our customs software directly to customs + port authorities + carrier.\r\n8. Are storage areas secured? How often are these areas inspected?\r\n(Government security responsibility)\r\n9. What are the procedures for reporting any abnormalities in the movement of cargo?\r\n(It is the government security responsibility)\r\n10. How are containers (full or empty) stored? Describe method by which unauthorized access is prevented or the introduction of un-manifested and unauthorized material.\r\n(It is the government security responsibility)\r\n11. Describe the transportation tracking system in place?\r\n(It is the government security responsibility)\r\n12. Are containers searched?\r\nYes\r\n13. Are all containers/trailers, etc. of solid walled construction and in good condition?\r\nYes\r\n14. Is your company aware of and practicing the following:\r\na. 7 – Step Container Inspection\r\nb. 17-Step Tractor Trailer Inspection (Applies to Canada and USA Members)\r\nc. Seal Inspection (Are security seals compliant with ISO 17712:2013 standards)\r\nd. Compromised seals and/or containers must be reported to CBP or the appropriate foreign authority.\r\nYes', '', '', '', '', '', '', '', '', '', '', '', '', ''),
