(94, '338', 'Meiko Air Cargo Service is the air cargo division of Meiko Trans Co., Ltd. \r\nAs advances in electronics and the development of new materials achieve lighter weight and greater compactness, demand is growing for rapid transportation, by air, for a full range of industrial products. To meet these needs, Meiko Trans has launched our air-freight transportation service MAX (Meiko Air Cargo Service) as an IATA-authorized agent and an independent mixed-cargo carrier providing comprehensive cargo-handing services. We have established our Air Freight Department headquartered in the Chukyo area of central Japan, at the Central Japan International Airport (Centrair) Sales Office. An additional sales office is located in Nakagawa-ku, Nagoya. In the Keihin area of eastern Japan, the Tokyo Branch\\\\\\\\\\\\\\\'s Air Freight Department is supporting operations centered at the Narita Airport Sales Office. We have also established sales office for air-cargo handling in western Japan and Kyushu.', 'Air Import and Export\r\nLicense Customs Agents\r\nWarehousing and Distribution (Bonded)\r\nPick up and Delivery by owned vehicles\r\nRepacking\r\nULD build up and break down', '', '', 'naoki.ishii@meiko-trans.co.jp', 'isao.arakawa@meiko-trans.co.jp', '', '', '', '', '', '', '', ''),
