(102, '361', 'LOGISTICA – Maseni S.A. is based in Quito-Ecuador, and is legally formed since December 2000, with all the legal and tax requirements of Ecuador.\r\nWe offer our services in Quito, Guayaquil, Manta, Cuenca, Esmeraldas or any point from Ecuador\r\nSince the beginning of the company it was created to represent International Companies related with the transportation and logistics services as well for the supply of different products required for the Ecuadorian market.\r\nFor this purposes we made several contacts with important local and  international companies worldwide (joint venture) which allow us to complement our services and satisfied the customers.\r\nThe flexibility of our company allowed us to attend any service individually with the expertise, knowledge and necessary background of our executives, as well with the infrastructure and logistic required with the principles of honesty, professionalisms and compromise.\r\nWe found that the market is looking for new services and new companies with a different standard of quality and, which should be cover by new companies with a personalized, technical and professional service and with the necessary knowledge of the market and the environment as well of the necessities of the customers.', '1.	TRADING\r\n2.	LOGISTICS\r\n3.	TRANSPORTATION\r\n4.	CUSTOMS BROKERAGE\r\n5.	DISTRIBUTION\r\n6.	IMPORT AND EXPORT\r\n7.	COMPANY REPRESENTATIONS', '1.	Purchase and quotes of  products, equipment and machinery for industry in general\r\n2.	Pick up and Cargo Reception from origin point and consolidation for dispatch\r\n3.	Air, Ocean, Land, Courier and Intermodal transport\r\n4.	Previous documentation for imports and exports\r\na.	Customs brokerage and special process\r\n5.	Products distribution for the whole industry \r\n6.	Handling of imports and exports to and from any part of the world.\r\n7.	National and international Representations of companies related with Logistics and Transportation; as well as  products related with the industry in general.\r\n\r\n', '', 'a.flores@logistic.com.ec', 'm.becerra@logistic.com.ec', '', '', '', '', 'Duty Hours Monday - Friday:\r\n08h30 - 17h30\r\n24hrs:\r\n+(593 9) 9811 5070', '', '', ''),
(96, '354', 'Radius International Inc.\r\n580 Chelsea Street\r\nEast Boston MA 02128', 'International Air and Ocean Exports/Imports \r\nPerishable NEXT FLIGHT out service\r\nHazardous Goods Certified/ Warehousing and Distribution Service.   Domestic Air and Trucking Service', 'We are IATA Registered\r\nWe are an NVOCC \r\nWe are C-TPAT Certified \r\n', '', 'kirkk@radiuscargo.com', 'johnd@radiuscargo.com', '', '', '', '', 'We are open MONDAY through Thursday 8:30am to 5:30pm\r\nFridays from 8:30am to 9:30pm \r\nWeekends upon request', '', 'johnd@radiuscargo.com', ''),
(104, '362', 'Founded in 1957 by a visionary fulfilling a dream, Continental Carriers Pvt. Ltd. India stands out as one of the first IATA accredited Freight Forwarding Agencies and continues to be rated amongst the top companies as per the IATA ranking for the Indian freight forwarders over the past many years.  Through generational legacy Continental Carriers continues the high quality consciousness service standards established in the beginning. \r\n \r\nA member of FIATA and ACAAI, a MultiModal Transport Service Operator, and an ISO 9001-2008 certified company; it has established non exclusive agency association within all major cities globally to deliver timely and efficient services all the time.\r\n\r\nContinental Carriers Pvt.Ltd. is the recipient of many awards given by various Government/ Non Government Commerce and Export related organizations, for the performance excellence in the SERVICE category including the \"Best Forwarder\" Confederation of Industry Associations for 3 consecutive years', 'Continental Carriers Pvt. Ltd.provides following specialized services including, but not limited to;  \r\nCustom Clearance: \r\nAir/ Sea Export and Import cargo.\r\nSpecial Projects: Odd Dimensional Project Cargo Handling through Air/Sea\r\nAvionics Cargo Handling involving sensitive, time bound, emergency /AOG situations.\r\nDangerous Goods Handling\r\nExpress Delivery Service Global and Domestic\r\nDomestic Cargo: \r\nCompany handles domestic cargo movement by road, rail and domestic airlines.\r\nConsolidation: \r\nAirfreight/Seafreight Import & Export\r\nTrucking: \r\nOwn fleet of full bodied trucks with a capacity of 3 to 13 tons, collections and deliveries from/to the customer\'s premises smooth and hassle free. Transportation of Domestic Cargo through Trucking, Railways and domestic Airlines helps Continental Carriers to move cargo with ease and on time.\r\nMultiModal Transportation:  \r\nProvides multi model transportation solutions. Company is a member of Association of Multi model Transport Operators of India.\r\nWarehousing:\r\nAn essential link in the logistics supply chain, our warehouses are designed to handle large volume of freight and are situated in close proximity to the gateways, well laid out, open around the clock and supervised by the experienced personnel exercising the latest inventory management, security and specialized storage systems. \r\nInformation Technology:\r\nState of the art Information Technology set up with integrated software is being used in all the departments with EDI connectivity with Airlines, Customs and overseas Agents including Track and Trace facility for all shipments', '', '', 'vaibhav@continentalgroup.com', 'vvohra@continentalgroup.com', '', '', '', '', '', '', '', ''),
(105, '364', 'Thomas International Services Company Limited is a Well-Experienced International Freight Forwarder and logistics Services provider. We offer a wide range of transportation and logistical solutions worldwide through our extensive agent network. Currently located in Cambodia with a wealth of knowledge and experiences in connecting the Asian market to the world. We are expert with the emerging market and devoted to our mission to provide professonal freight forwarding and sustainable logistics solutions as an one-stop service partner. Thomas International Services with its vision is successfully working to be a New Type of Tailor-Made Logistic Company assisting our clients overcome the global trade challenges of tomorrow.', 'Complete Logistics Package With World-Wide Coverage\r\nImport/Export of SEA & AIR Freight\r\nCross Boarder/Domestic Trucking Services\r\nSea & Air or Air & Sea Combination\r\nImport and Export Customs Clearance Services - Sea & Air\r\nCargo Consolidation\r\nWarehouse consolidation and distribution\r\nSpecialized Cargo Handling\r\nExpress Consignments and Door to Door delivery\r\nSpecial Handling of Museum Artifacts\r\nSpecial Packing and crating of valuable cargoes\r\nProject Cargoes and Heavy lifted cargoes handling', '', '', 'chongjua@thomas-cambodia.com', 'huot@thomas-cambodia.com', '', '', '', '', '', '', '', ''),
(113, '371', 'transmaritim international GmbH', '', '', '', '', '', '', '', '', '', '', '', '', '');
