(1, '', '0', 'shipping instructions pending', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(3, '999', '0', 'shipping instructions pending2', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'special'),
(4, '8', '0', 'Should be consigned to Mondiale Freight Services', 'Should be consigned and notified to Mondiale Freight Services', 'The HAWB should be consigned to the end consignee.', 'HB/L should be consigned to the final consignee. ', 'Please include:\r\nMAWB\r\nHAWB\r\nFLIGHT DETAILS\r\nSHIPPER\r\nCONSIGNEE\r\nNO. OF PIECES, WE\r\nTERMS OF SHIPMENT\r\n', 'Please include:\r\nMB/L\r\nHB/L\r\nVESSEL DETAILS INCLUDING CONTAINER NUMBER\r\nSHIPPER\r\nCONSIGNEE\r\nNO. OF PIECES, WEIGHT, VOLUME\r\nTERMS OF SHIPMENT\r\nPORT OF DISCHARGE AND PLACE OF DELIVERY\r\nANY SPECIAL INSTRUCTIONS\r\n', 'No Special Instructions', 'Mondiale must be shown as the Consignee and Notified party.\r\n\r\nIf cargo has been coloaded with another forwarder, the Master B/L must show full contact details of the local New Zealand freight agent as the delivery agent\r\n\r\nThe Master B/L must be Express Released with the shipping line where original Master B/Ls are not received prior to vessel arrival in New Zealand.', 'No Special Instructions', 'Please include:\r\nFull Shipper and consignee details\r\nManifest information\r\nDetails of any split consignments', 'Please send Pre-Alerts as soon as possible after vessel has sailed load port and include the following:\r\nMAWB NUMBER\r\nHAWB NUMBER\r\nCOMMERCIAL INVOICES\r\nCONSOLIDATION MANIFEST\r\nPIECES AND WEIGHT\r\nSHIPPER AND CONSIGNEE\r\nFLIGHT AND ARRIVAL DATE\r\nGOODS DESCRIPTION\r\nFREIGHT / PROFIT SHARE INVOICES AS AGREED', 'Please send Pre-Alerts before Sailing of Vessel and include the following:\r\nMB/L NUMBER\r\nHB/L NUMBER\r\nCOMMERCIAL INVOICES\r\nCONSOLIDATION MANIFEST\r\nPIECES AND WEIGHT\r\nSHIPPER AND CONSIGNEE\r\nVESSEL\r\nCONTAINER NUMBER\r\nGOODS DESCRIPTION\r\nFREIGHT / PROFIT SHARE INVOICES AS AGREED', 'We can Customs Clear for any shipment', 'No Special Instructions', 'No Special Instructions', 'Bills of Lading, Manifests and cargo must be clearly marked with Dangerous Goods details', ''),
(5, '254', '0', 'The MAWB must be consigned to the receiving forwarder.\r\n', 'The Master B/L must be consigned to consigned to the receiving forwarder.\r\n', 'It applies same as above. HAWB must indicate consignee\'s name, full address, phone number and contact. Consignee\'s address must correctly indicate site of ultimate destination of shipment. Amending errors result in high extra charges and serious delays.', 'It applies same as above. HB/L must indicate consignee\'s name, full address, phone number and contact. Consignee\'s address must correctly indicate site of ultimate destination of shipment. Amending errors result in high extra charges and serious delays. ', 'Agent\'s Name/Address \r\nMAWB No. \r\nHAWB No. \r\nConsignee\'s name and address \r\nNumber of packages, weight, nature of goods\r\n', 'Agent\'s Name/Address \r\nMB/L No. \r\nHB/L No. \r\nConsignee\'s name and address \r\nNumber of packages, weight, nature of goods\r\n', '', '', '', '', 'Pre-Alerts must contain full information of shipment, ETD, ETA, and be sent as early as possible, via fax or e-mail.', 'Pre-Alerts must contain full information of shipment, ETD, ETA, and be sent as early as possible, via fax or e-mail', 'We can Customs clear for any shippment, be it air or Ocean.', 'Clearly indicate on documents that it is a transshipment through Panama, with final destination (country). ', 'ORIGINAL Commercial invoice must be duly signed and sworn. For the Colon Free Zone the F.O.B. value is require. For the rest of the Republic of Panama, where duties are paid, CIF VALUE is required .', 'At all times, shipment must be accompanied with Dangerous Goods Shipper\'s Declaration. ', 'We recommend forwarding copies of documents.'),
(6, '18', '0', 'Consigned to our Company as per the details in the HTFN Company directory. (For Transit Cargo additional note has to be mentioned: \"In Transit to ......... via Bangkok\") ', 'Consigned to our Company as per the details in the HTFN Company directory. (For Transit Cargo additional note has to be mentioned: \"In Transit to ......... via Bangkok\") ', 'In general as per the Commercial Documents. \r\nFor shipments in Transit the FINAL destination has to be mentioned \r\nThe HAWB has to be RATED! (Do not mention: \"As Agreed\") \r\nIn order to avoid any kind of mistakes, our partner should first (before the Departure of any cargo) advise the Consignee\'s details (Company Name, Contact Person, Tel, Fax, e-mail and address) and in case on hand also a copy of the HAWB in order for us to double check and confirm back the correctness (some Consignees have different Company names and addresses and they might wish to use their customs card for a specific one). ', 'In general as per the Commercial Documents. \r\nFor shipments in Transit the FINAL destination has to be mentioned \r\nIn order to avoid any kind of mistakes, our partner should first (before the Departure of any cargo) advise the Consignee\'s details (Company Name, Contact Person, Tel, Fax, e-mail and address) and in case on hand also a copy of the HB/L in order for us to double check and confirm back the correctness (some Consignees have different Company names and addresses and they might wish to use their customs card for a specific one).', 'Required without any special instructions.\r\n(Manifest has to mention the FINAL destination and the note: \"In Transit to ....... via Bangkok\") ', '', 'The HAWB has to be RATED (Do not mention: \"As Agreed\") ', '', 'The HAWB has to be RATED (Do not mention: \"As Agreed\") ', '', 'Copy of HAWB, Commercial Invoice and Manifest to be sent to air.imp@ewas.co.th or fax +66-2-712-0156.\r\nIf possible, please mention also the Contact details of the Consignee (Contact Person, tel, fax, e-mail)', 'Copy of HAWB, Commercial Invoice and Manifest to be sent to seafreight@ewas.co.th or fax +66-2-712-0158. We have to declare final consignee to customs 24 hours before vessel arrival, otherwise customs penalties occur.\r\n', 'We can do customs clearance for any air and ocean shipments. For DDP shipments please note that we do not advance any Duty/VAT above US$ 250.-/HAWB', 'For MASTER: additional note has to be mentioned: \"In Transit to ......... via Bangkok\" \r\nFor HOUSE: the FINAL destination has to be mentioned \r\nFor MANIFEST: the FINAL destination and \"In Transit to ....... via Bangkok\" has to be mentioned \r\n', 'Must mention the correct Consignee\'s details (Company, Address etc.):\r\nIn order to avoid any kind of mistakes, our partner should first (before the Departure of any cargo) advise the Consignee\'s details (Company Name, Contact Person, Tel, Fax, e-mail and address) and in case on hand also a copy of the HAWB in order for us to double check and confirm back the correctness (some Consignees have different Company names and addresses and they might wish to use their customs card for a specific one).\r\nPlease note that the value mentioned in the Commercial Invoice is subject to be accepted by the Customs Officers. Any under-valuation might delay the Importation (storage charges may occur) and will cause a penalty fee to be paid. \r\n', 'As per IATA rules and regulations. For DDU and DDP shipments our partner has to advise the Consignee\'s details before the Departure of any cargo (Company Name, Contact Person, Tel, Fax, e-mail and address) in order for us to double check and confirm back the correctness (some Consignees have different Company names and addresses and they might wish to use their customs card for a specific one). ', 'For DDU and DDP shipments our partner has to advise the Consignee\'s details before the Departure of any cargo (Company Name, Contact Person, Tel, Fax, e-mail and address) in order for us to double check and confirm back the correctness (some Consignees have different Company names and addresses and they might wish to use their customs card for a specific one). '),
