(8, '26', '0', 'The MAWB must be consigned to Allfreight Co-ordinators and always on a prepaid base.', 'The Master B/L must be consigned to Allfreight Co-ordinators and always on a prepaid base.', 'The HAWB can be consigned as shipper wants PPD/EXW and if there are special instructions must be mentioned clearly on HAWB ', 'The HB/L can be consigned as shipper wants PPD/EXW and if there are special instructions must be mentioned clearly on the HB/L ', 'No Special Instructions but please include the following:\r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION\r\n', 'No Special Instructions but please include the following:\r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION\r\n', 'No Special Instructions\r\n', 'No Special Instructions\r\n', 'No Special Instructions\r\n', 'No Special Instructions\r\n', 'Always pre-alert by fax or by e-mail and please include the following:\r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION\r\n', 'Always pre-alert by fax or by e-mail and please include the following:\r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION\r\n', 'We can do customs clearance for any air and ocean shipments. ', 'Full details of cargo and clear instructions to move cargo must be included. \r\n', 'For India if a \'Form A\' is attached to shipment there are no import duties. For the rest of the world there are no special requirements.', 'Standard International Requirements', ''),
(9, '229', '0', 'Shipper should be indicated as the foreign forwarder, including their address, city, and country', 'Shipper should be indicated as the foreign forwarder, including their address, city, and country ', 'House Bills should be consigned from actual shipper to actual consignee, with the US Broker/forwarder listed as a notify party. ', 'House Bills should be consigned from actual shipper to actual consignee, with the US Broker/forwarder listed as a notify party. ', 'Manifest should be specific and include the following: \r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION\r\n', 'Manifest should be specific and include the following: \r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION\r\n', 'No special requirements ', 'No special requirements ', 'No special requirements ', 'No special requirements ', 'Pre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips', 'Pre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips ', 'We can do customs clearance for any air and ocean shipments. However, a Power of Attorney is required in order to clear Customs for any importer/shipper. If a Power of Attorney has been issued to another broker, then the cargo will be turned over to that broker for clearance. \r\n\r\nIMPORTANT NOTE: New security regulations make distinctions between known and unknown shippers. Shipments from unknown shippers ( essentially new clients to your HTFN partner ) are subject to special scrutiny which may delay the air routing by 7 or more days.\r\n\r\nWhen issuing an urgent routing order to your USA HTFN partner, please ask them to advise you if your routing may be subject to such delays so that you may advise your importer accordingly of the options available. \r\n', 'No special requirements ', 'No special requirements ', 'A copy of the HazMat or MSDS sheets must accompany shipments. ', ''),
(10, '301', '0', 'Shipper should be indicated as the foreign forwarder, including their address, city, and country. Consignee all shipments to DELHI, MUMBAI or CHENNAI depending upon final Destination', 'Shipper should be indicated as the foreign forwarder, including their address, city, and country. Consignee MBL to DELHI, MUMBAI or CHENNAI depending upon final Destination. ', 'House Bills should be consigned from actual shipper to actual consignee, with the full style address and contact details with a contact person name if possible. ', 'House Bills should be consigned from actual shipper to actual consignee, with the full style address and contact details with a contact person name if possible.', 'Manifest should be specific and include the following: \r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION ', 'Manifest should be specific and include the following: \r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION ', 'Must mentioned “CONSOLIDATION CARGO” on the face of the MAWB. ', '', 'DESTINATION MUST BE SAME AS ON MAWB, AS I.T BY A FORWARDER TO INLAND DESTINATION NOT POSSIBLE. ', 'DESTINATION MUST BE SAME AS ON MB/L AS I.T BY A FORWARDER TO INLAND DESTINATION NOT POSSIBLE.', 'Complete set of documents MAWB, HAWB along with copy of Commercial invoice / Packing list to be sent via email or fax.', 'Complete set of documents MB/L, HB/L along with copy of Commercial invoice / Packing list to be sent via email or fax. ', 'Custom clearance can be performed at our branch offices, however it should be reconfirmed by the agent with Local office prior to consigning the shipment. Always a brief description of goods, and having an cataloge / panflit always helpful. ', 'Must check on case to case basis, normally transshipments are not possible through India port. ', 'Please revert to \"Customs Clearance\" above.', 'A copy of the HazMat or MSDS sheets must accompany shipments.', ''),
(11, '299', '0', 'Shipper :  YOUR COMPANY\'S NAME\r\nAdd     :   YOUR ADDRESS \r\nTel/Fax :   YOUR TEL/FAX\r\nEmail address (if possible)\r\n\r\nCnee    :  A.N.C CO.,LTD\r\nAdd     : 35 TRAN QUOC HOAN ST., TAN BINH  DIST., HOCHIMINH CITY.\r\nTel     : 848 8116905   Fax   : 848 8115048\r\n', 'Shipper :  YOUR COMPANY\'S NAME\r\nAdd     :   YOUR ADDRESS \r\nTel/Fax :   YOUR TEL/FAX\r\nEmail address (if possible)\r\n\r\nCnee    :  A.N.C CO.,LTD\r\nAdd     : 35 TRAN QUOC HOAN ST., TAN BINH  DIST., HOCHIMINH CITY.\r\nTel     : 848 8116905   Fax   : 848 8115048\r\n', 'Shipper :  SHIPPER\'S NAME\r\nAdd     :   SHIPPER\'S ADDRESS \r\nTel/Fax :   SHIPPER\'S TEL/FAX\r\n\r\nCnee    :   CNEE\'S NAME\r\nAdd     :   CNEE\'S ADDRESS \r\nTel/Fax :   CNEE\'S TEL/FAX\r\n\r\nDelivery Agent   :   A.N.C CO.,LTD\r\nAdd      :   35 TRAN QUOC HOAN ST., TAN BINH DIST., HCMC, VN.\r\nTel/Fax  :   848 8116905 / 848 8115048', 'Shipper :  SHIPPER\'S NAME\r\nAdd     :   SHIPPER\'S ADDRESS \r\nTel/Fax :   SHIPPER\'S TEL/FAX\r\n\r\nCnee    :   CNEE\'S NAME\r\nAdd     :   CNEE\'S ADDRESS \r\nTel/Fax :   CNEE\'S TEL/FAX\r\n\r\nDelivery Agent   :   A.N.C CO.,LTD\r\nAdd      :   35 TRAN QUOC HOAN ST., TAN BINH DIST., HCMC, VN.\r\nTel/Fax  :   848 8116905 / 848 8115048\r\n\r\nMUST SHOW CLEARLY CY/CY OR CFS/CFS OR CFS/CY', 'MAWB NO.\r\nFLIGHT NO.\r\nETD ORIGIN:\r\nETA DEST:\r\nAIRPORT OF DEPARTURE\r\nAIRPORT OF DESTINATION\r\nAIR LINES\r\n--------------\r\nEACH SHPT: 	\r\nHAWB NO.\r\nSHIPPER:\r\nCNEE:\r\nQTY:\r\nDESCRIPTION OF GOODS\r\nG.W\r\nC.W\r\nAIR FREIGHT: COLLECT OR PREPAID\r\n--------------\r\nTOTAL: QTY , G.W , C.W\r\n', 'MB/L NO.\r\nVESSEL/VOYAGE:\r\nCONTAINER/SEAL#:\r\nPOL:\r\nPOD:\r\nETD POL:\r\nETA POD:\r\nCARRIER\r\n--------------\r\nEACH SHPT: 	\r\nHB/L NO.\r\nSHIPPER:\r\nCNEE:\r\nNOTIFY:\r\nQTY:\r\nSHIPPING MARKS\r\nDESCRIPTION OF GOODS\r\nG.W\r\nCBM:\r\nDESTINATION:\r\nO/F: COLLECT OR PREPAID\r\nORIGINAL HB/L OR SURRENDERED HB/L\r\n--------------\r\nTOTAL: QTY , G.W , CBM\r\n\r\n', 'QTY, G.W, CBM ON MAWB MUST EQUAL TO  TOTAL QTY, G.W, CBM OF ALL HAWBS ', 'QTY, G.W, CBM ON MB/L MUST EQUAL TO TOTAL  QTY, G.W, CBM OF ALL HB/LS ', 'SHOULD SHOW CONSIGNEE \r\n- NAME\r\n- ADDRESS\r\n- TEL ( FAX IF ANY)\r\n- PIC (IF ANY)', 'SHOULD SHOW CONSIGNEE \r\n- NAME\r\n- ADDRESS\r\n- TEL ( FAX IF ANY)\r\n- PIC (IF ANY)', 'SCAN OR  FAX US ALL DOCS RELATED TO THAT SHPT ( HAWB, MAWB, CARGO MANIFEST, INVOICE, PACKING LIST , CERTIFICATE OF ORIGIN, CREDIT NOTE, DEBIT NOTE, ETC...) NOT LATER THAN 1-2 DAY BEFORE CARGO ARRIVES.', 'SCAN OR  FAX US ALL DOCS RELATED TO THAT SHPT ( HBL, MBL, CARGO MANIFEST, CREDIT NOTE, DEBIT NOTE, ETC...) NOT LATER THAN 2 DAYS BEFORE CARGO ARRIVES.', 'ALL DOCS RELATED TO THAT SHPT (HOUSE BILL, MASTER BILL, SALES CONTRACT,  INVOICE, PACKING LIST, HEALTH CERTIFICATE, CERTIFICATE OF ANALYSIS, C/O, ETC...) SHOULD BE SCANNED TO US FIRST AND LATER SENT ORIGINAL DOCS TO US .\r\n', 'IF ANY REQUEST, PLS INFORM US IN PRE-ALERT.', 'SHIPPER\'S NAME, CNEE\'S NAME, DESCRIPTION OF GOODS, QTY, G.W, CBM, VESSEL,...ON HB/L, ON INVOICE, ON PACKING LIST, ON C/O MUST BE THE SAME . ORIGINAL INVOICE, PACKING LIST, ETC.. MUST HAVE SHIPPER\'S SIGNATURE & STAMP.', 'ASK OUR CONFIRMATION BEFORE LOADING THE DG CARGO. PLS BE ADVISED THAT THERE WILL BE SOME ADDITIONAL CHARGES OCCURRED. ALSO PLS SHOW IT ON CARGO MANIFEST & HB/L OR HAWB', 'IF PRE-ALERT IS SENT TO US LATE , CUSTOMS\' PENALTY WILL BE APPLIED USD 30/ HOUSE BILL.\r\nWE, IN TURN, WILL INVOICE YOU THIS AMOUNT.'),
(81, '306', '0', 'The MAWB must be consigned to Transports Internationaux Philippe Peschaud, Casablanca ', 'The MAWB must be consigned to  Transports Internationaux Philippe Peschaud, Casablanca\r\n•  Discharge Port of Preference: CASABLANCA (unless it is constrained to be shipped to Port  AGADIR) \r\n', 'The HAWB must be consigned to the Final Receiver ', 'The HB/L must be consigned to the Final Receiver', '•  Master AWB will be consigned to Transports Internationaux Philippe Peschaud \r\n•  Several HAWB to correspond to the MAWB \r\nNumber of packages / weight volume of all Houses should total and be equal to the details on MAWB \r\n•  Each consolidation manifest to show shipper / actual consignee / number of packages / net and gross weight / DGR etc / freight terms, collect or pre-paid ', 'Ask for specific instructions before creating consolidation manifest.\r\n•  Master B/L will be consigned to Transports Internationaux Philippe Peschaud\r\n•  Several HB/L to correspond to the MB/L \r\nNumber of packages / weight volume of all Houses should total and be equal to the details on MB/L \r\n•  Each consolidation manifest to show shipper / actual consignee / number of packages / net and gross weight / DGR etc / freight terms, collect or pre-paid ', '•  Master MAWB should be consigned to Transports Internationaux Philippe Peschaud, showing freight terms: pre-paid \r\n•  Original documents, namely Invoice, packing list and COO a must, for clearance for countries having agreements with Morocco.', '•  Master B/L should be consigned to Transports Internationaux      Philippe Peschaud, showing freight terms: pre-paid \r\n•  Original documents, namely Invoice, packing list and COO a must, for clearance for countries having agreements with Morocco.\r\n• CIF does not hold in Morocco because Insurance has to be paid inside the country.', '•  HAWB to be consigned to final receiver, showing freight terms, collect, details of amount \r\n•  Copy of Invoice, packing list and COO to accompany the shipment ', '•  HB/L to be consigned to final receiver, showing freight terms, collect, details of amount \r\n•  Copy of Invoice, packing list and COO to accompany the shipment ', 'Always pre-alert to be received prior to shipment arrival, indicating B/L or AWB / flight details, ETA, number of packages, shipper consignee, DGR, special handling, if any', 'Always pre-alert to be received prior to shipment arrival, indicating B/L or AWB / flight details, ETA, number of packages, shipper consignee, DGR, special handling, if any', 'We can do customs clearance for any air and ocean shipments.\r\nWe need the original invoice (either in Euros or Dollars) and packing list', 'Ask for specific instructions before loading.\r\nCopy of Invoice and packing list to accompany shipment, along AWB / BL instructions from Casablanca to final destination to be advised ', '•  For Ocean : Original Invoice / Packing list and certificate of origin issued by chamber of commerce is a must ', 'DGR / IMCO class number and nature of goods should be advised on all documents ', ''),
(12, '68', '0', 'Shipper should be indicated as the foreign forwarder, including their address, city, and country', 'Shipper should be indicated as the foreign forwarder, including their address, city, and country', 'House Bills should be consigned from actual shipper to actual consignee, with the US Broker/forwarder listed as a notify party. ', 'House Bills should be consigned from actual shipper to actual consignee, with the US Broker/forwarder listed as a notify party. ', 'Manifest should be specific and include the following: \r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION', 'Manifest should be specific and include the following: \r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION\r\n', 'No special requirements ', 'No special requirements ', 'No special requirements ', 'No special requirements ', 'Pre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips', 'Pre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips', 'We can do customs clearance for any air and ocean shipments. However, a Power of Attorney is required in order to clear Customs for any importer/shipper. If a Power of Attorney has been issued to another broker, then the cargo will be turned over to that broker for clearance. \r\nIMPORTANT NOTE: New security regulations make distinctions between known and unknown shippers. Shipments from unknown shippers ( essentially new clients to your HTFN partner ) are subject to special scrutiny which may delay the air routing by 7 or more days.\r\n\r\nWhen issuing an urgent routing order to your USA HTFN partner, please ask them to advise you if your routing may be subject to such delays so that you may advise your importer accordingly of the options available. \r\n', 'No special requirements ', 'No special requirements ', 'A copy of the HazMat or MSDS sheets must accompany shipments. ', ''),
(13, '268', '0', 'MAWB alone issued without a HWAB should include the following:\r\nShipper: exporter \r\nConsignee: importer with address and phone number \r\nissuing carrier: sending agent of origin \r\nnotify party: Bestway Int\'l Transportation Co., Ltd \r\n\r\nMAWB and HAWB issued (back to back) should include the following:\r\nMAWB-notes \r\nShipper: sending agent \r\nConsignee: Bestway Int\'l \r\n\r\n\r\nOne MAWB and more than one HAWB issued should include the following: \r\nMAWB-notes \r\nShipper: sending agent \r\nConsignee: Bestway int\'l \r\nNature and quantity of goods: consolidation shipment as per attached cargo manifest. \r\n\r\nIf co-loaded with another sending agent (hereafter named non-HTFN agent) it should include the following: \r\nMAWB issued by non-HTFN sending agent \r\nShipper: the name and address of non-HTFN sending agent \r\nConsignee: the name and address of non-HTFN receiving agent \r\n', 'For LCL Shipments please include: \r\nShipper: sending agent \r\nConsignee: Bestway Int\'l \r\nIn the field \"For delivery please apply to:\" Bestway with contact details must be added. \r\n\r\nIn the case of co-loaded with non-HTFN sending forwarder for LCL, please include: \r\nShipper: sending agent \r\nConsignee: Bestway Int\'l \r\nnon-HTFN receiving agent must be shown in the field \"For delivery apply to:\" \r\n\r\nFor FCL Shipments please include:\r\nShipper: sending agent of origin \r\nConsignee: Bestway Int\'l \r\n', 'MAWB and HAWB issued (back to back) should include the following:\r\nHAWB-notes \r\nShipper: exporter \r\nConsignee: importer (include current phone number)\r\nIf DDP service or Door service is required, \"DDP service is required\" or \"Door service is required\" must be printed in handling information field. Please note the requirement of door service or DDP service means sending agent\'s responsibility for the corresponding expenses, unless otherwise specified. \r\n\r\nOne MAWB and more than one HAWB issued should include the following: \r\nMAWB-notes \r\nShipper: exporter \r\nConsignee: importer (include current phone number)\r\n\r\n\r\nIf co-loaded with another sending agent (hereafter named non-HTFN agent) should include the following:\r\nHAWB issued by the non-HTFN sending agent \r\nShipper: HTFN sending agent \r\nConsignee: Bestway Int\'l \r\nHAWB issued by HTFN sending agent \r\nShipper: exporter \r\nConsignee: importer (include current phone number) \r\nPlease note HAWB issued by non-HTFN sending agent just serves as a notice with which notify the non-HTFN receiving agent to advise Bestway upon cargo arrival. Bestway performs the customs clearance against the original copy of HTFN sending agent\'s HAWB with a confirmation chop of the non-HTFN receiving agent. \r\n', 'For LCL shipments please include: \r\nHB/L \r\nShipper: exporter \r\nConsignee: importer (include current phone number)\r\nIn the field \"For delivery please apply to:\" Bestway with contact details must be added. \r\n\r\nIn the case of co-loaded with non-HTFN sending forwarder for LCL please include: \r\nHB/L \r\nShipper: exporter \r\nConsignee: importer (include current phone number) \r\n\r\nFor FCL shipments please include: \r\nHB/L\r\nShipper: exporter \r\nConsignee: importer (include current phone number) \r\n', 'Pre-alert instructions and cargo manifest can be combined into one with notes as per below:\r\n\r\nCarrier \r\nMAWB number \r\nFlight no/date (better with last flight no/date produced) \r\nAirport of origin \r\nAirport of destination \r\nHAWB number \r\nNumber of pieces \r\nGross weight \r\nCommodity \r\nConsignee \r\nShipper \r\nNotify party \r\nMethod of payment \r\nPre-alert or cargo manifest must reach us prior to cargo arrival. ', 'Pre-alert instructions and cargo manifest can be combined into one with notes as per below:\r\n\r\nCarrier \r\nMAWB number \r\nFlight no/date (better with last flight no/date produced) \r\nAirport of origin \r\nAirport of destination \r\nHAWB number \r\nNumber of pieces \r\nGross weight \r\nCommodity \r\nConsignee \r\nShipper \r\nNotify party \r\nMethod of payment \r\nPre-alert or cargo manifest must reach us prior to cargo arrival. ', '', '', '', '', 'Pre-alert instructions and cargo manifest can be combined into one with notes as per below:\r\n\r\nCarrier \r\nMAWB number \r\nFlight no/date (better with last flight no/date produced) \r\nAirport of origin \r\nAirport of destination \r\nHAWB number \r\nNumber of pieces \r\nGross weight \r\nCommodity \r\nConsignee \r\nShipper \r\nNotify party \r\nMethod of payment \r\nPre-alert or cargo manifest must reach us prior to cargo arrival. ', 'Pre-alert instructions and cargo manifest can be combined into one with notes as per below:\r\n\r\nCarrier \r\nMAWB number \r\nFlight no/date (better with last flight no/date produced) \r\nAirport of origin \r\nAirport of destination \r\nHAWB number \r\nNumber of pieces \r\nGross weight \r\nCommodity \r\nConsignee \r\nShipper \r\nNotify party \r\nMethod of payment \r\nPre-alert or cargo manifest must reach us prior to cargo arrival. ', 'Documents necessary for customs clearance: \r\n1.oringinal bill of lading \r\n2.commercial invoice \r\n3.packing list \r\n4.sales contract \r\nIf consignee is a foreign investment enterprise such as joint-venture, cooperative business operation and sole proprietorship, hence enjoying duty-free, a duty free certificate must be submitted by importer to Bestway for customs clearance. \r\n\r\nIn case of bonded goods within the framework of processing with imported material and compensation trade, importer must hold the corresponding customs book. Bonded goods is cleared against the customs book. \r\n\r\nWhen goods belong to the categories of mechanism and electronics such as auto, battery pack and computer, importer must produce a certificate of mechanism and electronics, which can be applied for at local authority. Exporter must be aware of this requirement before effecting shipment. \r\n\r\nImported goods like rubber, iron & steel and non-ferrous metals, a certificate of heavy industrial products must be beforehand procured by importer. \r\n\r\nThere are lots of merchandise subject to all types of certificates needed for customs clearance. Bestway can provide such information at request. Normally, so long as 8-digit commodity code is provided, we can retrieve the corresponding necessary documentation requirements. \r\n\r\nAbove mentioned documentation requirements are applicable for inbound air and ocean freight.\r\n\r\nCustoms fines for sea freight \r\n\r\n\r\nCustoms fine for delaying clearance:\r\nCustoms clearance must be performed within 14 days from the date of vessel entrance registration. When overdue, customs fine will be levied on importer. Fine amount=CIF value of goods x 0.05% x overdue days. \r\n\r\nCustoms fine for delaying duty payment:\r\nDuty must be paid to the customs within 10 days from the issuing date of duty memo. Being overdue is subject to such fine. Fine amount = total duty unpaid x 0.1% x overdue days. \r\n\r\nHarbour dragging fee\r\nContainers must be picked up by consignee within 6 days of vessel arrival. Otherwise, it will be dragged to a remote container yard. The expense thus incurred is usd100 for 20\' container and usd135 for 40\' container. \r\n\r\nAs a general rule, penalties and fines are billed to importer\'s account. But if problems with clearance arises due to reason of sending agent or exporter, such additional charges will be assumed by sending agent. \r\n', '', '', '', ''),
(14, '256', '0', 'Master Airwaybill has to be consigned to Bofill y Arnan S.A.', 'To Bofill y Arnan office at the port of discharge', 'House has to be consigned as per shipper instructions. Important to know all details of consignee, full address , contact person and phone number in case this is a new account. ', 'As per consignee\'s instructions - Notify Bofill y Arnan at the port of discharge', 'No special instructions but please include:\r\n\r\nMAWB number \r\nHAWB number \r\nFlight number \r\nArrival Date \r\nNumber of pieces \r\nGross weight \r\nNature of goods \r\n', 'Consolidation manifest to mention :\r\nPort of loading,Port of discharge,name of vessel,date of shipment, container number/seal number, House B/L number , shipper\'s name,consignee\'s name,notify,marks and numbers,number of packages,description of goods,gross weight (Kgs),volume(m3) \r\nMB/L number \r\nHB/L number \r\nPort of loading,Port of discharge \r\nName of vessel \r\nArrival Date \r\nContainer number/seal number \r\nShipper\'s name,consignee\'s name \r\nMarks and numbers \r\nNumber of packages \r\nDescription of goods \r\nGross weight (Kgs) \r\nVolume(m3) \r\n', 'No special instructions ', '\"Express release\" is acceptable', 'Indicate Incoterm in case of Free domicile,DDU,DDP. Also indicate contact person , address , Tel Number in case of new account ', 'No special instructions ', 'Pre-Alert has to be sent on time. Pre-Alerts must be sent to the following contact information: \r\nBarcelona : 34-93-3709501 mj.gomez@bofill-arnan.com\r\nMadrid : 34-91-3937406 - jl.campanario@bofill-arnan.com\r\nValencia: 34-96-3671854 - j.torrent@bofill-arnan.com \r\n\r\nPlease include the following:\r\n\r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION\r\nCONTACT PERSON AND TEL NUMBER IN CASE OF NEW ACCOUNT', 'Pre-Alerts to be sent to Bofill y Arnan at Port of discharge, respectively to the office which controls the shipment and should include the following:\r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nDATE OF SAILING and ETA \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION\r\n', 'Air: \r\n- Import side, if we receive a shipment for an unknown consignee and we have to clear goods, we do it under cash advance of funds for duties and taxes. Export side no special problems to clear goods.\r\n- Temporary imports, we require an ATA quardern or warranty of duties and taxes from consignee.\r\n- Guns ammunition \r\n- Perishable goods. Contact us for any concrete shipment, overall for human consumption goods. \r\n\r\n\r\nOcean:\r\nClearance to be effected in the name of a company established in Spain, the importer or fiscal representative in Spain. \r\n', 'Air - No special requirements \r\n\r\nOcean - Final port/point of destination and country to be mentioned on Master B/L and House B/L \r\n', 'Air: all documents must be original .Depending on country and kind of goods customs may require license or certificate of origin. \r\n\r\nOcean: No Special Requirements\r\n', 'Air-Air IATA requirements : ADR Sheet attached to shipment and AWB and HAWB must show all IATA requirements regarding dangerous goods \r\nOcean-IMDG code and UN to be mentioned on all shipping documents. ', ''),
(15, '143', '0', 'Shipper should be indicated as the foreign forwarder, including their address, city, and country', 'Shipper should be indicated as the foreign forwarder, including their address, city, and country ', 'House Bills should be consigned from actual shipper to actual consignee, with the US Broker/forwarder listed as a notify party. ', 'House Bills should be consigned from actual shipper to actual consignee, with the US Broker/forwarder listed as a notify party. ', 'Manifest should be specific and include the following: \r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION', 'Manifest should be specific and include the following: \r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION\r\n', '', '', '', '', 'Pre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips', 'Pre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips ', 'We can do customs clearance for any air and ocean shipments. However, a Power of Attorney is required in order to clear Customs for any importer/shipper. If a Power of Attorney has been issued to another broker, then the cargo will be turned over to that broker for clearance. \r\nIMPORTANT NOTE: New security regulations make distinctions between known and unknown shippers. Shipments from unknown shippers ( essentially new clients to your HTFN partner ) are subject to special scrutiny which may delay the air routing by 7 or more days.\r\n\r\nWhen issuing an urgent routing order to your USA HTFN partner, please ask them to advise you if your routing may be subject to such delays so that you may advise your importer accordingly of the options available. \r\n', 'No special requirements ', 'No special requirements ', 'A copy of the HazMat or MSDS sheets must accompany shipments. ', '');
INSERT INTO `pubship` (`recno`, `memid`, `branch`, `cma`, `cmb`, `cha`, `chb`, `ccma`, `ccmo`, `iimawb`, `iimbl`, `iihawb`, `iihbl`, `pria`, `prio`, `cust`, `trans`, `legal`, `dang`, `special`) VALUES
(16, '264', '0', 'Back to Back shipment\r\n\r\nShipper HTFN member name and address at origin. \r\n\r\nConsignee to be addressed to (if destination is Jakarta) : \r\nPT. CARDIG EXPRESS NUSANTARA\r\nT.P.S Taman Soewarna Unit B 3\r\nSoekarno - Hatta International Airport\r\nCengkareng - Tangerang Indonesia\r\nTel. 62-21-559 116 20\r\nFax. 62.21.550.2127 \r\nAtt : Mr. Arthur\r\n\r\nDeclared as \" Consolidated Shipment as per attached HAWB\" (or manifest if issued)\r\n\r\nFreight must be Prepaid only\r\n\r\nConsolidation Shipment\r\n\r\nShipper, Consignee (same as for back to back shipment)\r\n\r\nDeclare as \" Consolidated Shipment as per attached Manifest\"\r\n\r\nFreight must be prepaid only\r\n', 'Back to Back shipment\r\n\r\nShipper HTFN member name and address at origin.\r\n\r\nConsignee to be addressed to (if destination is Jakarta) :\r\nPT. CARDIG EXPRESS NUSANTARA\r\nHalim Perdana Kusuma Airport\r\nJakarta 13610 - Indonesia\r\nTel. 62-21-800 744 1 - 744 4\r\nFax. 62.21.809.3916\r\nAtt : Mr. Ilyas\r\n\r\nMark and Number as per shipping instruction and as put on boxes, etc.\r\n\r\nContainer and seal number in case of consolidated / loaded FCL - NVOCC B/L . Express Bill of Lading is recommended.\r\n\r\nFreight to be Prepaid only.\r\n\r\nConsolidation Shipment \r\n\r\nShipper , Consignee (same as back to back shipment) \r\nDeclaration : \" As per attached Statement \" \r\nContainer and seal number, type of container, weight and measurment etc. as normal procedure. \r\nAttached to master B/L a statement with container and seal number, type of container, weight of container, all each individual HB/L with full detail (Number of HB/L , Marks , number of packages , description of goods , weight , measurment) and total packages , weight. \r\nFreight to be prepaid. \r\n', 'Never state \"AS AGREED\" to declare the freight. Customs will calculate the duties and taxes based on the higher rates, and they will use rates in MAWB or MBL that higher than the real freight cost.\r\n\r\nShipper, Consignee, etc as per shipping instruction / LC / Purchase order plus telephone number. \r\n\r\nFreight may as Prepaid or Collect, agreed amount of selling rate must be mentioned or confirm by destination agent.\r\n\r\nIn case of Coload Shipment / Consolidation where HAWB use as agent to agent shipping document, freight must be prepaid and the final importer shipping document may as collect. \r\n', 'Never state \"AS AGREED\" to declare the freight. Customs will calculate the duties and taxes based on the higher rates, and they will use rates in MAWB or MBL that higher than the real freight cost.\r\n\r\nShipper, Consignee, etc. as per shipping instruction / LC / Purchase Order plus telepone number. \r\nFreight may as Prepaid or Collect. \r\nIf loaded into a FCL include Container and seal number. \r\n', 'House Manifest form not specified, normal form can be used but please include the following:\r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND DEPARTURE DATE \r\nGOODS DESCRIPTION \r\nCOLLECT OR PREPAID \r\n', 'Sea Cargo manifest where as form not specified, normal form can be use, include the folowing information:\r\n\r\nMB/L \r\nPort of Loading \r\nPort of Discharge \r\nConsolidator name \r\nDestination agent name (Cardig Express Nusantara) \r\nVessel \r\nVoyage \r\nETS/ETA \r\nContainer and seal no. \r\nAll per individual HB/L number \r\nNumber and type of packages \r\nGross weight \r\nMeasurement \r\nDescription of goods \r\nShipper / consignee and notify party full address \r\nFreight prepaid or collect but not the freight amount itself \r\nShipping marks \r\nTotal of package, weight, measurement at the bottom \r\n\r\nThis manifest must be stamped and signed. \r\n', 'Master Final destination\r\nCargo under Back to Back and Consolidation can only be accepted with Master final destination Jakarta, Surabaya, Semarang and Denpasar where as CEN has its international inbound traffic offices. For other destination within Indonesia, please consult CEN Jakarta office prior shipping arrangement \r\n', 'Master Final destination Cargo under Back to Back and Consolidation can only be accepted with Master final destination Jakarta, Surabaya, Semarang and Denpasar where as CEN has its international inbound traffic offices. ', 'Please note instruction in \'How to consign a HAWB\' above. ', 'Please note instructions in \'How to consigne a HB/L\' above. ', 'Pre-advice is a must, earliest or prior to ship and send by any communication method to our Airfreight office fax No. 62-21-550 2127: \r\ne-mail to : fery@cardig-express.com, uut@cardig-express.com BR> cc to : ashraf@cardig-express.com\r\nAn advice must include complete shipping detail:\r\n\r\n\r\nMAWB \r\nHAWB \r\nFlight \r\nDate \r\nPieces \r\nWeight \r\nConsignee \r\nImporter Name and Full Address telephone etc. (PO. Box or Bank Address is not sufficient). \r\n\r\n', 'Pre-Advice is a must, earliest, immediately after shipment and send by any communication method to our Seafreight office fax No. 62-21-809 391 6:\r\ne-mail to : ilyas@cardig-express.com, windu@cardig-express.com \r\ncc to : ashraf@cardig-express.com\r\nAn advice must include complete shipping detail;\r\n\r\n\r\nOBL \r\nHBL \r\nVessel \r\nVoyage \r\nETS \r\nETA \r\nImporter name and full address / telephone , PO. Box or Bank address is not sufficient \r\nShipping agent full address in Indonesia.\r\n\r\nBack to Back Shipments \r\nShipping Document Copies must be sent by any method and received by CEN prior to vessel\'s arrival. Master B/L as Express Bill Of Lading is recommended instead to courier original. \r\n\r\nConsolidation Shipments\r\nShipping Document Copies (complete) must be sent by any method and received by CEN 7 working days prior to vessel\'s arrival. Master B/L as Express Bill Of lading is recommended instead to courier original. \r\n', 'Indonesian Customs only receives and process the complete docs, means\r\n- Cnee Original Letter of Authority\r\n- Original Airwaybill (Master/House) \r\n- Original Invoices (means with SHIPPER\'S SIGNATURE, SHIPPER\'S COMPANY STAMP, WITH SHIPPER\'S COMPANY HEAD LETTER)\r\n- Cnee must have this following license ; SRP (Customs Registration Letter), API (Importers Identification Number) and NPWP (Company Number Tax Identification)\r\n- Cnee must have NPIK (for specific items), POM (for durgs and food)\r\nIt means before you send the cargo to Indonesia, make sure give us alerts in advance so we can check to the consignee whether they have the mention requirement or not.\r\n\r\nOriginal invoice means not sent by fax, not computer generated invoice, and not copies.\r\n\r\n\r\nCEN can arrange permanent customs clearance on behalf of shipper if CEN is mentioned as consignee and or notify party in the shipping and other documents. This mean CEN will acting as importer and all nessesary import permit must be provided by CEN and import duty/tax will be registered under the name and risk of CEN. We would not recommended this practise. In normal case consignee will provide Authorizartion Letter, their Tax Registration Number and Import Lisence.\r\n\r\nAverage clearance time for air freight without physical customs inspection 1-2 days and with customs inspection 2-3 days, for sea freight without inspections 2-3 days and with inspection 3-5 days counted as working days and subject to complete documents without discrepancy(s) on the goods and document(s), to be accepted by Indonesian Authority/regulation. \r\n\r\nOriginal Commercial Invoice must be provided for customs clearance. For airfreight must be attached to the relevant Air Waybill. Failure to comply original, consignee must make a legal statement that invoice value is correct and need customs approval.Please avoid providing only copies.\r\n\r\nCertificate of Analysis is required for chemicals.\r\n\r\nSpecial permits from relevant government departement / institution for telecommunication device, any kind of medicine / food / beverage (consider as commercial), and any media materials, also see Tact Rules. \r\n\r\nOriginal passport is required for removal / personal effect goods to get free import duty / tax if Indonesian citizen , plus resident and working permit if non Indonesian citizen.Please contact us before shipping this kind of cargo. \r\n', 'Generally no transhipment facilities, cargo to be customs cleared at port/airport of destination mentioned on Master shipping document. Otherwise importer have to put guarantee 100% of total Import Duty and Tax before onforward to next Indonesian Customs port/airport. ', 'Please revert to \"Customs Clearance\" above.', 'No special requirement for customs clearance of dangerous goods however a shipper\'s declaration for dangerous goods is nessesary for carrier and warehouse operators. \r\n\r\n\r\nSPECIAL INSTRUCTIONS\r\nNEVER ATTACH THE INVOICE or any LABEL PRICE to the shipment. If customs finds a difference between the real documents in pouch and the goods they will charge an administration penalty and accuse the consignee of smuggling. \r\nTotal package/piece(s), gross weight on Master shipping document must agree with all other documents (House shipping documents / manifest, etc. )\r\n\r\nA minimum Customs penalty of Rph 5 million will occurred for any errors (weight, marking, labels, etc.). Beside that will cause delay on clearance, higher storage / demurrage cost which will be for account of origin station.\r\n\r\nRe-export / re-route of a shipment is a problem, takes time (average 1-2 months) and reason must be accepted by customs. Please try to avoid.\r\n\r\nShort landed of cargo per document will delay clearance.\r\n\r\nMaster Final destination\r\nCargo under Back to Back and Consolidation can only be accepted with Master final destination Jakarta, Surabaya, Semarang and Denpasar where as CEN has its international inbound traffic offices.\r\n\r\nINDONESIAN IMPORT REQUIREMENT AND PROCEDURES \r\n\r\nA. Requirements 1. Original Invoice / Packing List must be accompanied with each shipment and attached to the relevant AWB. Failure to comply, statement from c’nee to state the correct invoice value is required for customs clearance purpose.\r\n\r\n2. Gross Weight on MAWB must be equal with Gross Weight on HAWB or total HAWB (S). Custom penalty of IDR 1.000 or USD 0.10 / kg for weight different is applied and to be charged back to the origin sender.\r\n\r\n3. Consignee complete address, preferably with phone number is required . PO Box number allowed.\r\n\r\n4. Telecommunication device, all kind of foods / beverages regardless of small or big quantity, second hand goods / spareparts / machines all required permit from relevant department / institution.\r\n\r\n5. Maize (corn), Rice, Soya beans, whether or not broken, cane or bit sugar and chemically pure sucrose, in solid form; textile and textile articles; Footwear; Electronics and its components and Toys, to import all of these items, consignee / importer required to have Registered Number of Special Importer (NPIK), issued by industrial and Trade Department. \r\n\r\n6. Certificate of Analysis is required for Chemicals.\r\n\r\n7. Duty / Taxes free for removal goods if consignee able to provide with Original Passport, temporary / permanent resident permit and working permit. Custom only accept all three documents. Otherwise 100 % of duty amount to be put as a guarantee, which can be refunded once documents completed.\r\n\r\n8. Generally no transshipment facilities, cargo to be cleared in port of destination mentioned on MAWB. Otherwise importer have to apply model H.\r\n\r\n9. Double check all issued documents, such as MAWB, HAWB, master label, house label and manifest for possible typing errors. Even the slightest deviations are considered as improper documentation and the worse the custom authorities will regard them as smuggled merchandise. Subsequently penalties will be issued to the forwarder handling, respectively receiving the goods.\r\n\r\n10. Cross labeling / wrongly sent shipment is considered as well as improper documentation and attempt to smuggle. Same procedures applies like to point 9.\r\n\r\n11. There is no tariff or guidelines when it comes to levy penalty and charges. The Indonesian Custom tariff leaves it wide open for the individual Officials. It is up to them to decide how offensive and/or how serious the “mistake” was. And accordingly they will levy the penalty.\r\n\r\n\r\nB. Procedures.\r\n\r\n1. Airlines document and cargo handled by two Operators depending on carriers used.\r\n\r\n2. Storage applies day of arrival. One day for first three days. \r\n\r\n3. Breakbulk can be closed only once shipment arrived completely. \r\n\r\n4. Custom approval for breakbulk is needed for custom clearance. \r\n\r\n5. Agent / person who perform custom clearance must have consignee Authorization Letter, unless PT Cardig Express Nusantara appear on AWB and document. \r\n\r\n6. Custom working hour : Mon – Thu 08.00 – 12.00 and 13.00 – 17.00 Fri 09.00 – 11.30 and 13.30 – 17.00 Sat 08.00 - 12.30 \r\n\r\n7. Normal Clearance time 2 – 3 working days counted the days of all necessary documents on hand and duty / taxes are paid. \r\n\r\n', 'NEVER ATTACH THE INVOICE or any LABEL PRICE to the shipment. If customs finds a difference between the real documents in pouch and the goods they will charge an administration penalty and accuse the consignee of smuggling. \r\nTotal package/piece(s), gross weight on Master shipping document must agree with all other documents (House shipping documents / manifest, etc. )\r\n\r\nA minimum Customs penalty of Rph 5 million will occurred for any errors (weight, marking, labels, etc.). Beside that will cause delay on clearance, higher storage / demurrage cost which will be for account of origin station.\r\n\r\nRe-export / re-route of a shipment is a problem, takes time (average 1-2 months) and reason must be accepted by customs. Please try to avoid.\r\n\r\nShort landed of cargo per document will delay clearance.\r\n\r\nMaster Final destination\r\nCargo under Back to Back and Consolidation can only be accepted with Master final destination Jakarta, Surabaya, Semarang and Denpasar where as CEN has its international inbound traffic offices.\r\n\r\nINDONESIAN IMPORT REQUIREMENT AND PROCEDURES \r\n\r\nA. Requirements 1. Original Invoice / Packing List must be accompanied with each shipment and attached to the relevant AWB. Failure to comply, statement from c’nee to state the correct invoice value is required for customs clearance purpose.\r\n\r\n2. Gross Weight on MAWB must be equal with Gross Weight on HAWB or total HAWB (S). Custom penalty of IDR 1.000 or USD 0.10 / kg for weight different is applied and to be charged back to the origin sender.\r\n\r\n3. Consignee complete address, preferably with phone number is required . PO Box number allowed.\r\n\r\n4. Telecommunication device, all kind of foods / beverages regardless of small or big quantity, second hand goods / spareparts / machines all required permit from relevant department / institution.\r\n\r\n5. Maize (corn), Rice, Soya beans, whether or not broken, cane or bit sugar and chemically pure sucrose, in solid form; textile and textile articles; Footwear; Electronics and its components and Toys, to import all of these items, consignee / importer required to have Registered Number of Special Importer (NPIK), issued by industrial and Trade Department. \r\n\r\n6. Certificate of Analysis is required for Chemicals.\r\n\r\n7. Duty / Taxes free for removal goods if consignee able to provide with Original Passport, temporary / permanent resident permit and working permit. Custom only accept all three documents. Otherwise 100 % of duty amount to be put as a guarantee, which can be refunded once documents completed.\r\n\r\n8. Generally no transshipment facilities, cargo to be cleared in port of destination mentioned on MAWB. Otherwise importer have to apply model H.\r\n\r\n9. Double check all issued documents, such as MAWB, HAWB, master label, house label and manifest for possible typing errors. Even the slightest deviations are considered as improper documentation and the worse the custom authorities will regard them as smuggled merchandise. Subsequently penalties will be issued to the forwarder handling, respectively receiving the goods.\r\n\r\n10. Cross labeling / wrongly sent shipment is considered as well as improper documentation and attempt to smuggle. Same procedures applies like to point 9.\r\n\r\n11. There is no tariff or guidelines when it comes to levy penalty and charges. The Indonesian Custom tariff leaves it wide open for the individual Officials. It is up to them to decide how offensive and/or how serious the “mistake” was. And accordingly they will levy the penalty.\r\n\r\nB. Procedures.\r\n\r\n1. Airlines document and cargo handled by two Operators depending on carriers used.\r\n\r\n2. Storage applies day of arrival. One day for first three days. \r\n\r\n3. Breakbulk can be closed only once shipment arrived completely. \r\n\r\n4. Custom approval for breakbulk is needed for custom clearance. \r\n\r\n5. Agent / person who perform custom clearance must have consignee Authorization Letter, unless PT Cardig Express Nusantara appear on AWB and document. \r\n\r\n6. Custom working hour : Mon – Thu 08.00 – 12.00 and 13.00 – 17.00 Fri 09.00 – 11.30 and 13.30 – 17.00 Sat 08.00 - 12.30 \r\n\r\n7. Normal Clearance time 2 – 3 working days counted the days of all necessary documents on hand and duty / taxes are paid. '),
(17, '83', '0', 'Shipper should be indicated as the foreign forwarder, including their address, city, and country', 'Shipper should be indicated as the foreign forwarder, including their address, city, and country', 'House Bills should be consigned from actual shipper to actual consignee, with the US Broker/forwarder listed as a notify party. ', 'House Bills should be consigned from actual shipper to actual consignee, with the US Broker/forwarder listed as a notify party. ', 'Manifest should be specific and include the following: \r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION', 'Manifest should be specific and include the following: \r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION\r\n', '', '', '', '', 'Pre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips', 'Pre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips ', 'We can do customs clearance for any air and ocean shipments. However, a Power of Attorney is required in order to clear Customs for any importer/shipper. If a Power of Attorney has been issued to another broker, then the cargo will be turned over to that broker for clearance. \r\nIMPORTANT NOTE: New security regulations make distinctions between known and unknown shippers. Shipments from unknown shippers ( essentially new clients to your HTFN partner ) are subject to special scrutiny which may delay the air routing by 7 or more days.\r\n\r\nWhen issuing an urgent routing order to your USA HTFN partner, please ask them to advise you if your routing may be subject to such delays so that you may advise your importer accordingly of the options available. \r\n', 'No special requirements ', 'No special requirements ', 'A copy of the HazMat or MSDS sheets must accompany shipments. ', ''),
(116, '309', '1', 'Please refer to Manila Shipping instructions. Except when shipment is transhipment via Manila. If this is the case, MAWB should show Options Logistics, Inc. as Consignee and Manila as final destination.', 'Please refer to Manila Shipping instructions. Except when shipment is transhipment via Manila. If this is the case, MBL should show Options Logistics, Inc. as Consignee and Manila as final destination.', 'Please refer to Manila Shipping instructions. Except when shipment is transhipment via Manila. If this is the case, HAWB should show Actual Consignee as Consignee and Cebu as final destination.', 'Please refer to Manila Shipping instructions. Except when shipment is transhipment via Manila. If this is the case, HBL should show Actual Consignee as Consignee and Cebu as final destination.', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(26, '257', '0', 'A. To CTS/XMN, please show: \r\nConsignee: CTS International Transportation Co., Ltd. Xiamen Branch \r\nGaoqi International Airport Xiamen P.R.China\r\nTel: 0086 592 573 0888\r\nFax: 0086 592 603 7928\r\n\r\n\r\nB. To CTS/FOC, please show:\r\n\r\nConsignee: CTS International Transportation Co., Ltd. Fuzhou Branch\r\n18F, A Hua Kai Fu Gui No.8 Dong Da Rd. Fuzhou City, 350001, P.R.China\r\nTel: 0086 591 750 1044\r\nFax: 0086 591 760 3439\r\n\r\n', 'A. To CTS/XMN, please show:\r\nConsignee: Actual Consignee (without Tel. & Fax No.)\r\n\r\nNotify Party: CTS International Transportation Co., Ltd. Xiamen Branch\r\nA, B. 8th Floor, Bonded Goods Market Building Huli, Xiamen, 361006, P.R.China\r\nTel: 0086 592 565 6228\r\nFax: 0086 592 565 6218\r\n\r\nB. To CTS/FOC, please show:\r\n\r\nConsignee: Actual Consignee \r\n\r\nNotify Party: CTS International Transportation Co., Ltd. Fuzhou Branch\r\n18F, A Hua Kai Fu Gui No.8 Dong Da Rd. Fuzhou City, 350001, P.R.China\r\nTel: 0086 591 750 1044 \r\nFax: 0086 591 760 3439\r\n\r\n', 'To CTS/XMN, CTS/FOC, please show the actual shipper and consignee on the HAWB whatever for air shipments. ', 'To CTS/XMN, CTS/FOC, please show the actual shipper and consignee on the HAWB whatever for ocean shpts. ', 'For air shpts, pls kindly find the form by clicking here', 'No manifest for Ocean shipments. ', 'MAWB & HAWB Preparation for Air Import Shipment \r\nA) MAWB PREPARATION\r\n\r\n1) Shipper box: Please fill the full name, full address, telephone number & fax number of your company in English.\r\n2) Consignee box: Please fill the full name, full address, telephone number & fax number of our company in English as following.\r\nCTS INTERNATIONAL TRANSPORTATION CO., LTD XIAMEN BRANCH\r\nCTS BULIDING, GAOQI INTERNATIONAL AIRPORT, XIAMEN, CHINA\r\nTEL: 0086-592-5730888 \r\nFAX: 0086-592-6037928\r\n\r\n3) Nature of goods box: Please fill it as “CONSOLIDATION SHIPMENT”.\r\n\r\nB) HAWB ISSUE\r\n\r\n1) Shipper box: Please fill the full name, full address, attention, telephone number & fax number of real shipper in English.\r\n2) Consignee box: Please fill the full name, full address, telephone number & fax number of real consignee in English.\r\n3) Please mark the payment of freight, CC or PP, and the amount of it.\r\n\r\nC) Please attach all the following documents with the cargo for any shipments. \r\n\r\n1) Five copies of cargo manifest.\r\n2) Four copies of HAWB\r\n3) Invoice. (Please attach the original one for dutiable goods.)\r\n4) Packing list. (Please attach the original one for dutiable goods.)\r\n5) If the freight will be collected, please attach the debit note.\r\n\r\nD) If the freight will be collected, please advise the amount and the details of the shipment before it arrives. \r\n\r\n', '', 'Please note instruction in \'How to consign a MAWB\' above. ', '', 'MAWB & HAWB Preparation for Air Import Shipment \r\nA) MAWB PREPARATION\r\n\r\n1) Shipper box: Please fill the full name, full address, telephone number & fax number of your company in English.\r\n2) Consignee box: Please fill the full name, full address, telephone number & fax number of our company in English as following.\r\nCTS INTERNATIONAL TRANSPORTATION CO., LTD XIAMEN BRANCH\r\nCTS BULIDING, GAOQI INTERNATIONAL AIRPORT, XIAMEN, CHINA\r\nTEL: 0086-592-5730888 \r\nFAX: 0086-592-6037928\r\n\r\n3) Nature of goods box: Please fill it as “CONSOLIDATION SHIPMENT”.\r\n\r\nB) HAWB ISSUE\r\n\r\n1) Shipper box: Please fill the full name, full address, attention, telephone number & fax number of real shipper in English.\r\n2) Consignee box: Please fill the full name, full address, telephone number & fax number of real consignee in English.\r\n3) Please mark the payment of freight, CC or PP, and the amount of it.\r\n\r\nC) Please attach all the following documents with the cargo for any shipments. \r\n\r\n1) Five copies of cargo manifest.\r\n2) Four copies of HAWB\r\n3) Invoice. (Please attach the original one for dutiable goods.)\r\n4) Packing list. (Please attach the original one for dutiable goods.)\r\n5) If the freight will be collected, please attach the debit note.\r\n\r\nD) If the freight will be collected, please advise the amount and the details of the shipment before it arrives. \r\n', 'For ocean shipments, Pre-alert should include the following information:\r\n\r\nshipper \r\nconsignee \r\nMAWB No./HAWB No. \r\ncarrier \r\nETD \r\nvessel \r\nvoyage \r\ncontainer No., \r\nseal No.for FCL/Pacakge, \r\nvolume for CFS/payment \r\n', 'CTS Xiamen Branch can clear both Air and Ocean shipments. \r\n', 'It still has not been permitted in Xiamen to do the Transshipment whatsoever; air or ocean shipments. ', '', 'Xiamen is not permitted to operate any dangerous goods whatsoever; air or ocean shipments. ', ''),
(27, '279', '0', 'Master AWB should be consigned to:\r\nDelta Shipping Company\r\nP.O. Box KA 30658, K.I.A.\r\nAccra - Ghana', 'Master B/L should be consigned to:\r\nDelta Shipping Company\r\nP.O. Box KA 30658, K.I.A.\r\nAccra - Ghana', 'House AWB should be consigned in the name of the actual consignee.', 'House B/L should be consigned in the name of the actual consignee.', 'The consolidation manifest should be in the same format as an ordinary manifest and include:\r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nname(s) and address(es) of the actual consignee(s) \r\nweight \r\nvolume \r\ndescription of goods \r\nitemized quantity', 'The consolidation manifest should be in the same format as an ordinary manifest and include:\r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nname(s) and address(es) of the actual consignee(s) \r\nweight \r\nvolume \r\ndescription of goods \r\nitemized quantity', 'No special instructions', 'No special instructions', 'The freight column should not indicate the actual freight paid, but should only contain a statement: \"As agreed.\" ', 'The freight column should not indicate the actual freight paid, but should only contain a statement: \"As agreed.\" ', 'Pre-alert necessary, but no special instructions.', 'Pre-alert necessary, but no special instructions.', 'We can customs clear for any shipper at all, both by air & by sea.', 'None, except for constant update, if possible.', 'The commercial invoice should be in 2 forms:(both): (A) Supplier\'s letterhead & (B) Attested (C61) invoice, and it should be broken down to C&F (CIF). \r\nNo legal requirements for certificates of origin. \r\n', 'Standard dangerous goods requirements applicable in Ghana as well. ', 'All imports are subject to an Destination Inspection. Please contact Delta Shipping for further questions. '),
(28, '171', '0', 'The MAWB must be consigned to \r\nDFX TRANSPORTE INTERNACIONAL\r\n( our local address -)\r\n\"CNPJ: 00.626.887/0001-92\" \r\nNOTE: CNPJ number is our registration number for our central bank. Without it we cannot transfer fund to you. \r\n\r\n\"Nature and Quantity of goods\" field you must write:\r\n\"Consolidation as per attached manifest. HAWB ...\" \r\nFreight must be declared - cannot show freight \"As Arranged\" \r\nFreight must always be prepaid on MAWB \r\n', 'DFX TRANSPORTE INTERNACIONAL ( our local address -) \"CNPJ: 00.626.887/0001-92\" \r\nONE ( 1 ) Original Master B/L (Prepaid / No express release allowed) \r\nTWO ( 2 ) Non-negotiable Master B/L (No photocopies allowed) \r\nFOUR ( 4 ) Non-negotiable copies of each house B/L (No photocopies allowed) \r\nTWO ( 2 ) Manifests \r\nshould be pouched to Brazil \r\n', 'Consignee\'s name and address:\r\nCNPJ (CNEE\'S CGC) \r\nNOTE: The CNPJ number here must be the consignee CNPJ number, not DFX\'s. \r\n\"Nature and Quantity of goods\" field you must write:\r\n(Describe name of goods and write the MAWB number) \r\nFreight -must be declared (collect or prepaid) - Must not show \'As arranged or As Agreed\"', 'Consignee\'s name and address: CNPJ (CNEE\'S CGC) NOTE: The CNPJ number here must be the consignee CNPJ number, not DFX\'s. \r\nONE ( 1 ) Original Master B/L (Prepaid / No express release allowed) \r\nTWO ( 2 ) Non-negotiable Master B/L (No photocopies allowed) \r\nFOUR ( 4 ) Non-negotiable copies of each house B/L (No photocopies allowed) \r\nTWO ( 2 ) Manifests \r\nshould be pouched to Brazil \r\n', 'MAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION\r\n\r\nSPECIAL INSTRUCTIONS - AIR\r\nLabeling\r\n1 Cargo must be labeled according to description of MAWB and HAWB \r\n2 LABEL must contain MAWB No. AND HAWB no. \r\n3 ALL VOLUMES must be labeled.\r\n4 LABEL must be written with waterproof ink\r\n5 IF NOT LABELED IN ACCORDANCE - There is a customs penalty fee of USD 100.00 per customs process and will take approximately 7 working days for customs to allow DFX to re-label\r\n\r\n\r\nInvoices / Credit Notes\r\nCollect freight should come with an invoice against DFX in the same currency as shown in the HB/L.\r\nFOB CHARGES - Normally it should come on the HB/L together with the freight value as a lump sum. We accept FOB charges out of the HB/L when it is clearly written and requested by yourselves or by us. In this case you should also invoice separately to DFX and send this detailed invoice together with vessel documents. DFX will not be responsible to collect FOB charges invoiced / sent on a later date. \r\n\r\nCREDIT NOTES - A credit note must be issues for every shipment according to our profit share agreement sent to you along with the sample of appointment letters or with any specific agreement that we may have. This will facilitate out financial departments and consequently the flux of funds transfers between our companies. \r\n\r\n\r\nCO-LOADS / CO-CO-LOADS: \r\nCO-LOADS - are accepted in Brazil but please note: \r\n- Coloader must have an appointed agent in Brazil \r\n- Our HB/L (Co-loader MB/L) should come prepaid. \r\nCO-CO-LOADS - Are accepted in Brazil except for the Port of Santos.\r\n\r\nWhy do we need at least four non-negotiable HB/L copies? \r\nthe first copy goes to customs, Second to the central bank, third to the client and fourth id kept in our files.\r\n\r\nWhy must the master be prepaid?\r\nOur central bank only allows one remittance per shipment. If master comes collect, the shipping line has the right over us to remit their freight and we will consequently be stuck with the House(s) freight in our account. The government will charge us 30 percent in tax over the difference from (the sum of) House B/L less the master, which we will be forced to deduct from our profit share and leave your share here as a credit to you.\r\n\r\nWhy must the freight on the house be greater than on the master?\r\nDuties and taxes are paid over C.I.F. value of the merchandise: consequently the freight rate of the house cannot be lower than the Master or customs will believe that we are under declaring freight to benefit Brazilian importers. Customs will stop the clearance process if it finds this situation.\r\n\r\nWhy the demurrage clause for FCL cargo?\r\nMost shipping lines only allow us to keep their containers for seven running days after arrival. Due to all the bureaucracy around customs to register cargo and clear it, we are often running into the demurrage problem. Therefore, in order to protect us from S/S charges, we request not only to write the clause on the HB/L as well as let us know your agreement regarding demurrage to every S/S line, and always try to push it to 15 running days. \r\n\r\nPENALITIES and EXTRA COSTS\r\n- For not registering a vessel within 24hrs after its operation at any Brazilian port, Brazilian customs will charge DFX USD 6.00 per piece count with a minimum of USD 300. DFX will not assume this fee and will invoice the agent for this.\r\n-For documentation discrepancies that are declared on this procedure and not followed by agents, any consignee claim, such as extra storage costs or demurrage fees will be directly retransmitted to the agent.\r\n\r\n\r\n', 'A cargo manifest must come with documents. Where one manifest may contain several houses or containers, break it by houses. There is information requested by customs in the manifest. Please download the following document for an example of a very basic manifest: HREF \"http://www.htfn.com/profiles/Latin_America/DFX/.rtf\" sample manifest ', '', 'Express Releases:\r\nThere is no express releases in Brazil. What some shipping lines do is to authorize their agents in Brazil to issue a Master direct at port of discharge. Please make sure that the S/S line used may offer this service in Brazil. Otherwise please send original via courier. \r\n\r\nShipper: \r\nShipper on the Master B/L must always show your registered company in Brazil on the first line. \r\nConsignee:\r\nConsignee must always show on the first line \"DFX TRANSPORTE INTERNACIONAL LTDA\". Then you will complete with our address or our sub-agent name (using below DFX (...) \"C/O sub agent name\" according to the port of discharge from Brazil. \r\n\r\nFREIGHT: \r\nFreight must always be declared. It cannot come \"As arranged\" \r\nFreight should come prepaid\r\nFreight on Master B/L must always be less than House B/L\r\n\r\n\r\nDescription of goods and number of Pieces: \r\nFor FCL shipments - Must be described identical to description on House B/L. Same applies to number of pieces and package described. Must show harmonized code - preferably the brazilian ncm code given by cnee - if not the standard international 6 digit numbers. \r\n\r\n\r\nFor LCL shipments: \r\nTo Rio de Janeiro - use only \"Consolidated Cargo\"\r\nTo other offices - may use FAK, Gen.Dept.Store Mer. and Consolidated Cargo. \r\n\r\n\r\nAttached rider / description of goods - For LCL cargo:\r\nS/S line are requested by customs to present along with their documentation a customs list, broken down by HB/L, describing what are the goods inside the container, which may be either described in the body of the Master B/L or attached to it ( on S/S letterhead paper). ( ON S/S LETTERHEAD PAPER ). ', 'Credits and debits Must be sent inside the consolidation document pouch. ', 'Express Releases\r\nThere are no express releases in Brazil as explained for Master B/L. What DFX can do is to issue an original House B/L (only upon written authorization - fax or email) and given that you have remitted blank HB/L\'s to us and that there is no bank or letter of credit involved.\r\n\r\nShipper: \r\nShipper must be original shipper or trading company\r\n\r\nConsignee:\r\nFinal Consignee, or to the order where the original house must be endorsed by shipper\r\n\r\nFreight: \r\nFreight must always be declared. It cannot come \"As arranged\" \r\nFreight should come prepaid\r\nFreight on House B/L must always be greater than Master B/L \r\n\r\nDescription of goods and number of pieces:\r\nFor FCL shipments: must be described identical to description on Master. The same applies to number of pieces and package described.\r\nFor LCL shipments; description of goods.\r\nMust show harmonized code - preferably the brazilian ncm code given by cnee - if not the standard international 6 digit numbers.\r\n\r\nDemurrage clause - only for FCL shipment:\r\nThe following Portuguese wording must be written on the body of the HB/L: \r\n\" A DEMURRAGE DESTE CONTAINER DEVERÁ SER PAGA PELO CONSIGNATÁRIO NO DESTINO. ESTA UNIDADE TEM 7 (SETE) DIAS LIVRES DE DEMURRAGE APÓS A DATA DA OPERAÇÃO DO NAVIO, INCLUINDO FERIADOS E FIM DE SEMANA. DEPOIS DOS 7 DIAS LIVRES SERÁ COBRADO USD40.00 / 20\' & USD 80.00 / 40\' POR CONTAINER POR DIA.\" \r\nWhich means: \r\nContainer demurrage payable by consignee at destination 7 clear days free standing including weekend and public holidays allowed, thereafter the following charges apply per container per day: $40.00/ 20\' & $80.00 /40\'. \r\n', 'A Pre-alert of a master AWB and HAWB must be sent 24hrs (working days) before shipment and you must wait for our \"green light\" to ship cargo.', 'MB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION\r\n', 'No. DFX can not clear for any shipper. In order for DFX to clear cargo consignee must give to DFX a power of attorney which will enable us to clear the shipment. Normally most consignees in Brazil have their own broker, therefore you must check with shipper/consignee if they want our services.', 'No transshipments requirements ', 'Commercial invoices are required by customs in order to consignee clear cargo. Shipper must always send it to consignee. Certificates only when requested by consignee.', 'Some dangerous goods are not accepted in most warehouses in Brazil or only with previous permission. Please always consult us when shipping dangerous good and declare the immo class. ', 'Special Instructions - AIR:\r\nLabeling\r\n1 Cargo must be labeled according to description of MAWB and HAWB \r\n2 LABEL must contain MAWB No. AND HAWB no. \r\n3 ALL VOLUMES must be labeled.\r\n4 LABEL must be written with waterproof ink\r\n5 IF NOT LABELED IN ACCORDANCE - There is a customs penalty fee of USD 100.00 per customs process and will take approximately 7 working days for customs to allow DFX to re-label\r\n\r\nInvoices / Credit Notes\r\nCollect freight should come with an invoice against DFX in the same currency as shown in the HB/L.\r\n\r\nFOB CHARGES - Normally it should come on the HB/L together with the freight value as a lump sum. We accept FOB charges out of the HB/L when it is clearly written and requested by yourselves or by us. In this case you should also invoice separately to DFX and send this detailed invoice together with vessel documents. DFX will not be responsible to collect FOB charges invoiced / sent on a later date. \r\n\r\nCREDIT NOTES - A credit note must be issues for every shipment according to our profit share agreement sent to you along with the sample of appointment letters or with any specific agreement that we may have. This will facilitate out financial departments and consequently the flux of funds transfers between our companies. \r\n\r\nCO-LOADS / CO-CO-LOADS: \r\nCO-LOADS - are accepted in Brazil but please note: \r\n- Coloader must have an appointed agent in Brazil \r\n- Our HB/L (Co-loader MB/L) should come prepaid. \r\nCO-CO-LOADS - Are accepted in Brazil except for the Port of Santos.\r\n\r\nWhy do we need at least four non-negotiable HB/L copies? \r\nthe first copy goes to customs, Second to the central bank, third to the client and fourth id kept in our files.\r\n\r\nWhy must the master be prepaid?\r\nOur central bank only allows one remittance per shipment. If master comes collect, the shipping line has the right over us to remit their freight and we will consequently be stuck with the House(s) freight in our account. The government will charge us 30 percent in tax over the difference from (the sum of) House B/L less the master, which we will be forced to deduct from our profit share and leave your share here as a credit to you.\r\n\r\nWhy must the freight on the house be greater than on the master?\r\nDuties and taxes are paid over C.I.F. value of the merchandise: consequently the freight rate of the house cannot be lower than the Master or customs will believe that we are under declaring freight to benefit Brazilian importers. Customs will stop the clearance process if it finds this situation.\r\n\r\nWhy the demurrage clause for FCL cargo?\r\nMost shipping lines only allow us to keep their containers for seven running days after arrival. Due to all the bureaucracy around customs to register cargo and clear it, we are often running into the demurrage problem. Therefore, in order to protect us from S/S charges, we request not only to write the clause on the HB/L as well as let us know your agreement regarding demurrage to every S/S line, and always try to push it to 15 running days. \r\n\r\nPENALITIES and EXTRA COSTS\r\n- For not registering a vessel within 24hrs after its operation at any Brazilian port, Brazilian customs will charge DFX USD 6.00 per piece count with a minimum of USD 300. DFX will not assume this fee and will invoice the agent for this.\r\n-For documentation discrepancies that are declared on this procedure and not followed by agents, any consignee claim, such as extra storage costs or demurrage fees will be directly retransmitted to the agent.'),
(29, '59', '0', 'The MAWB must be consigned Enkay Express, Dubai', 'The Master B/L must be consigned Enkay Express, Dubai \r\nDischarge Port of Preference: JEBEL ALI (unless it is constrained to be shipped to Port Rashid)', 'The HAWB must be consigned to the Final Receiver', 'The HB/L must be consigned be consigned to the Final Receiver', 'Master AWB will be consigned to Enkay Express \r\nSeveral HAWB to correspond to the MAWB \r\nNumber of packages / weight volume of all Houses should total and be equal to the details on MAWB \r\nEach consolidation manifest to show shipper / actual consignee / number of packages / net and gross weight / DGR etc / freight terms, collect or pre-paid.', 'Master B/L will be consigned to Enkay Express \r\nSeveral HB/L to correspond to the MB/L \r\nNumber of packages / weight volume of all Houses should total and be equal to the details on MB/L \r\nEach consolidation manifest to show shipper / actual consignee / number of packages / net and gross weight / DGR etc / freight terms, collect or pre-paid.', 'Master MAWB should be consigned to Enkay Express, showing freight terms: pre-paid \r\nOriginal documents, namely Invoice, Packing list is a must, for Customs Clearance.', 'Master B/L should be consigned to Enkay Express, showing freight terms: Pre-paid \r\nOriginal documents, namely Invoice, packing list and COO a must, for clearance.', 'HAWB to be consigned to final receiver, showing freight terms, collect, details of amount \r\nOriginal HAWB ,Shipper Invoice and packing list  to accompany the shipment.', 'HB/L to be consigned to final receiver, showing freight terms, collect, details of amount \r\nOriginal HBL ,Original Shipper Invoice, Packing list and COO to accompany the shipment.', 'Always pre-alert to be received prior to shipment arrival, indicating B/L or AWB / flight details, ETA, number of packages, shipper consignee, DGR, special handling, if any.', 'Always pre-alert to be received prior to shipment arrival, indicating B/L or AWB / flight details, ETA, number of packages, shipper consignee, DGR, special handling, if any.', 'We provide Customs Clearance for both air and sea freight shipments.', 'Copy of Invoice and packing list to accompany shipment, along AWB / BL instructions from Dubai to final destination to be advised.', 'For Ocean : Original Invoice / Packing list and Certificate of origin issued by chamber of commerce is a must.\r\nShipper Invoice must reflect HS CODE number of the products.', 'DGR / IMCO class number should be advised on all documents.', ''),
(105, '278', '', 'shipping instructions pending', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(30, '71', '0', 'Shipper should be indicated as the foreign forwarder, including their address, city, and country', 'Shipper should be indicated as the foreign forwarder, including their address, city, and country', 'House Bills should be consigned from actual shipper to actual consignee, with the US Broker/forwarder listed as a notify party. ', 'House Bills should be consigned from actual shipper to actual consignee, with the US Broker/forwarder listed as a notify party. ', 'Manifest should be specific and include the following: \r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION', 'Manifest should be specific and include the following: \r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION', '', '', '', '', 'Pre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips', 'Pre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips ', 'We can do customs clearance for any air and ocean shipments. However, a Power of Attorney is required in order to clear Customs for any importer/shipper. If a Power of Attorney has been issued to another broker, then the cargo will be turned over to that broker for clearance. \r\nIMPORTANT NOTE: New security regulations make distinctions between known and unknown shippers. Shipments from unknown shippers ( essentially new clients to your HTFN partner ) are subject to special scrutiny which may delay the air routing by 7 or more days.\r\n\r\nWhen issuing an urgent routing order to your USA HTFN partner, please ask them to advise you if your routing may be subject to such delays so that you may advise your importer accordingly of the options available. ', 'No special requirements ', 'No special requirements ', 'A copy of the HazMat or MSDS sheets must accompany shipments. ', ''),
(31, '51', '0', 'Should be consigned to: \r\nFernandez Hinojosa y Cia S.C. \r\nSoles # 56 Penon de los Banos \r\n15520 Mexico, D.F. ', 'SHIPPER: Broker in origin\r\nCONSIGNEE: FERNANDEZ HINOJOSA Y CIA. S.C. \r\nSoles 56, Col. Penon de los Banos,\r\nMéxico, D.F. 15520\r\nTel. (52) 55 751-1111 / Fax (52) 55 760-7819\r\nCtc. Ramon Acevedo / Ericka Domínguez', 'The HAWB should be consigned to the consignee, and the shipper should be the real shipper. ', 'SHIPPER: Supplier in origin \r\nCONSIGNEE: Customer in destination\r\nNOTIFY: as customer wish', 'Please include :\r\n\r\nMAWB \r\nHAWB \r\nFLIGHT DETAILS \r\nSHIPPER \r\nCONSIGNEE \r\nCOMMODITY AND NO. OF PIECES \r\nGROSS WEIGHT \r\nCHARGEABLE WEIGHT', 'Please include :\r\n\r\nMB/L \r\nHB/L \r\nVESSEL DETAILS \r\nSHIPPER \r\nCONSIGNEE \r\nCOMMODITY AND NO. OF PIECES \r\nGROSS WEIGHT \r\nCHARGEABLE WEIGHT', 'No Special Instructions', 'Specify the place of delivery if it has a different port of discharge.', 'No Special Instructions', 'House BL: must show the freight if it\'s collect since this document is an invoice too. Also include the Consignee\'s phone number ', 'Please fax Pre-Alerts and include the following:\r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nCOPY OF COMMERCIAL INVOICES \r\nCOPY OF THE CERTIFICATE OF ORIGIN \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION', 'Please send Pre-Alerts by fax or email and include the following:\r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nMANIFEST \r\nCREDIT NOTE \r\nCOPY OF COMMERCIAL INVOICE AND PACKING LIST \r\nCOPY OF THE CERTIFICATES \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION', 'Air:\r\nIt is VERY IMPORTANT that BEFORE anybody sends a FREE DOMICILE or a shipment for a trade show to Mexico send us a full description of what is being imported as well as Phone number and contact information of consignee to check that they comply with all requirements to import the goods. \r\n\r\nOcean:\r\nWe are not a broker at any Mexican port, therefore we cannot clear customs on Ocean shipments. \r\n', 'Air: \r\nThere are no transshipments allowed in Mexico. The cargo has to be cleared in the 1st port of entry, unless the final destination is specified in the MAWB. In the case of Mexico City, if the MAWB shows MEX as final destination it will have to be cleared here, regardless if it is going to Monterey or Guadalajara.\r\n\r\nOcean:\r\nTransshipments are not allowed by Mexican Laws. Only if the shipments arrive to any American port with place to deliver to Laredo, TX, USA. ', 'Commercial Invoices must have: Data from the exporter name and address & country, Importer name and address, quantity, unit price, total price, description of freight, date and place where it was issued The Certificates of origin have to be filled correctly ', 'AIR:\r\nThe dangerous goods have to be properly identified according to IATA regulations.\r\n\r\nOCEAN:\r\nAccording to International Rules.', 'Always include the Consignee\'s phone number and show the amount on the house when freight collect.');
INSERT INTO `pubship` (`recno`, `memid`, `branch`, `cma`, `cmb`, `cha`, `chb`, `ccma`, `ccmo`, `iimawb`, `iimbl`, `iihawb`, `iihbl`, `pria`, `prio`, `cust`, `trans`, `legal`, `dang`, `special`) VALUES
(32, '280', '0', 'It must be consigned to : \r\nGollcher Co Ltd.\r\n19, Zachary Street.\r\nValletta VLT10\r\nMalta\r\nTel: ++356 25 691300 \r\nFax: ++356 234195', 'It must be consigned to : \r\nGollcher Co Ltd.\r\n19, Zachary Street.\r\nValletta VLT10\r\nMalta\r\nTel: ++356 25 691300 \r\nFax: ++356 234195', 'House Airwaybills should be cosigned to the consignee with full address( no P.O. Box numbers.) a contact person and a telephone/fax number. ', 'House B/L\'s should be cosigned to the consignee with full address( no P.O. Box numbers.) a contact person and a telephone/fax number. ', 'Manifests should show both pieces, weight, volume and commercial value of each consignment, along with the terms of shipment. \r\n\r\nMAWB number \r\nHAWB numbers with individual number of pieces and weight \r\nNumber and total pieces and weight \r\nShould indicate if the hawb is collect or prepaid and amount to be collected \r\nCommodity of each shipment \r\nFlight details \r\nOrigin Station ', 'Manifests should show the following:\r\n\r\nMaster B/L No. \r\nHouse B/L No. \r\nCnee\'s details \r\nNo. of Packages / Gross Weight / Container No. \r\nIf Freight charges are Prepaid or Collect \r\nIf Freight charges are collect. Amount to be collected \r\nVessel details \r\nPort of Loading ', 'When issuing a MAWB with only one HAWB (Back to Back). do not write the words \"Consolidation\" anywhere on the MAWB. ( This reduces local airport handling charges.) ', 'If possable HTFN agents should alswys instruct Shipping Line to issue Express Master B/L\'s. This helps us with quicker delivery of cargo. ', 'No Special Instructions ', 'House B/L\'s should should clearly state that \" Port Destination charges are not included\" unless shipments are on a Door to Door basis. ', 'Pre-Alerts should be accompanied by:\r\nMAWB number \r\nHAWB number \r\nManifest \r\nInvoices\r\nFlight and Arrival Date ', 'Pre-Alerts should be accompanied by:\r\nMB/L number \r\nHB/L number \r\nManifest ', 'Customs Clearance available for any client on both Air and Sea.', 'For transhipments All invoices must show consignee at final destination. HAWB / House B/L should have the words \" Shipment in Transit to ( indicate final destination).\" written in the handling information box. ', 'Airfreight \r\nFor Air Transhipments to LIBYA we require the following:\r\na. Original Invoice\r\nb. Packing List\r\nc. Certificate of Origin validated by Chamber of Commerce / Libyan Peoples Bureau at origin country.\r\nd. Import License .\r\ne. Arabic translation of all documents.\r\nf. All shipments should be on prepaid basis only. \r\n\r\nSeafreight \r\na. All Import shipments have to be accopanied by an Original Invoice declaring the total Gross Weight / CBM of the shipment if possable. The supplier has to state that the amont shown on the invoice is the correct amount and that no other invoices will be issued.\r\nb. All cargo originating from EEC countries or any other countries who have special agreements with the EEC have to be accompanied by a EUR 1 certificate or T2L document.', 'AIR:\r\nNo special requirement for D.G.R. except for a pre alert preferably with a copy of the D.G. R. certificate. Special handling charges apply. \r\n\r\nOCEAN:\r\nAll Hazardous Cargo has to be accopanied by a Hazardous Decleration showing the IMCO Class & UN No. Also all Chemicals have to be accompanied by a Certificate of Analysis as these would be required for customs clearance procedures. ', 'No special instructions for General cargo but other types of cargoes may require special handling. In these cases we suggest one should contact our office for instructions and assistance. \r\nContact persons:-\r\nManager Airfreight - Mr. Walter Micallef e-mail: \"Mailto:wmicallef@gollcher.com\" wmicallef@gollcher.com \r\nManager Seafreight - Mr. Peter Fleri Soler email: \"Mailto:pflerisoler@gollcher.com\" pflerisoler@gollcher.com '),
(33, '262', '0', 'Shipper: origin forwarder \r\nConsignee: ITN Logistics Group Canada office \r\nExcept for \"to order\" bills of lading\r\nITN does not accept collect MAWBs ', 'Shipper: origin forwarder \r\nConsignee: ITN Logistics Group Canada office \r\nExcept for \"to order\" bills of lading \r\nITN does not accept collect MAWBs ', 'Shipper: actual exporter \r\nConsignee: actual importer-of-record \r\nDeliver to: only if delivery is to an address different than the consignee\'s \r\nPlease ensure freight collect shipments are rated - so we know what to collect ', 'Shipper: actual exporter \r\nConsignee: actual importer-of-record \r\nDeliver to: only if delivery is to an address different than the consignee\'s \r\nPlease ensure freight collect shipments are rated - so we know what to collect ', 'The manifest must include all details relating to a MAWB (container number, seal, weight, total pieces, volume, carrier, origin, destination, departure and arrival dates). The sub-sections describing each shipment must include all details relating to each HAWB (shipper, consignee, prepaid or collect, goods - commodity, pieces, weight, volume, marks - and a file reference number). ', 'The manifest must include all details relating to a MOBL (container number, seal, weight, total pieces, volume, carrier, origin, destination, departure and arrival dates). The sub-sections describing each shipment must include all details relating to each HBL (shipper, consignee, prepaid or collect, goods - commodity, pieces, weight, volume, marks - and a file reference number).', 'Note any special commodities - hazardous, restricted or temperature sensitive. ', 'Note any special commodities - hazardous, restricted or temperature sensitive. ', 'Note any special commodities - hazardous, restricted, temperature sensitive, or specific financial handling information - like COD shipments, DDU or DDP Incoterms. ', 'Note any special commodities - hazardous, restricted, temperature sensitive, or specific financial handling information - like COD shipments, DDU or DDP Incoterms. ', 'All shipments must be pre-alerted to the appropriate ITN office by FAX or by e-mail.', 'All shipments must be pre-alerted to the appropriate ITN office by FAX or by e-mail.', 'Most Canadian importers purchase on an EXW, FOB or CIF basis and have existing arrangements with their Canadian customs broker. However for DDU or DDP shipments, ITN can arrange customs clearance for any shipment. We will require a one-time power-of-attorney and the importer\'s Canadian Business Number (or GST registration number) if one exists. If not, we can apply for one. Specific written instructions are needed from the exporter about who will pay for the 7% Canadian Goods and Services Tax. ', 'Unless prohibited on a commercial invoice or a letter-of-credit, transshipment via any non-embargoed country is acceptable. ', 'Shipments to Canada must include a commercial invoice, packing list and a Canada Customs Invoice (CCI) - this CCI document can be provided by the exporter or can be completed by the Canadian customs broker.\r\nOther types of shipments also have special requirements - agricultural (phytosanitary), hazardous (hazardous declaration), food (certificate based on the applicable commodity) etc.\r\n\r\nImport duty is calculated based on the FOB transaction value of the goods, inclusive of royalties & commissions, plus export packing costs. Import GST is assessed at 7% of the duty-paid value.\r\n\r\nCertain countries have free-trade agreements with Canada (USA, Mexico, Chile, Israel) and others have reduced tariff treatment (China, Hong Kong, Caribbean countries and many others), in all cases it is essential to remind the exporter about the appropriate Certificate of Origin, Form A and Exporters Statement of Origin documents. Exporters can check with the commercial officer at the nearest Canadian Embassy, Consulate, or High Commission about the tariff status of their respective country.\r\n\r\nOn-line PDF versions of these and other documents are available through the links page on the www.itn-logistics.com website.', 'A Dangerous Goods Certificate is mandatory - and the commodity description, commodity class, UN Number and Packing Group should be noted on the master bill of lading. ', '- Canada has adopted strict rules governing the import of wood packing materials. Please refer to this document for the guidelines;\r\nhttp://www.inspection.gc.ca/english/plaveg/protect/dir/d-98-08e.pdf\r\n\r\n- Any shipper planning to export textiles or garments to Canada must ensure that the importer has the necessary import quota in place and a system to have the import permit created. The same preplanning applies for other types of regulated commodities - examples of these include steel, agricultural and food products.\r\n\r\n- Please ensure that any collect charges are clearly noted on the house bill of lading. For freight collect shipments, we MUST KNOW the amount we have to collect - so please avoid rating collect house bills of lading with the expression \"As Agreed\". If possible include the shipment invoice and profit share along with the shipping paperwork.\r\n\r\n- For ITN routed shipments, please ensure that our Standard Shipping Instructions (SSI) are followed. Any questions - please check with us.'),
(34, '238', '0', 'Consignee : \r\nJames Forwarding Corporation\r\nJames Building, 727-15 Yeoksam-Dong \r\nKangnam-Ku\r\nSeoul 135-080\r\nKorea \r\n( If it\'s for Pusan destination, please also Master consign it to above address )\r\nMaster waybill : Prepaid ', 'Consignee : \r\nJames Forwarding Corporation\r\nJames Building, 727-15 Yeoksam-Dong \r\nKangnam-Ku\r\nSeoul 135-080\r\nKorea \r\n( If it\'s for Pusan destination, please also Master consign it to above address )\r\nMaster waybill : Prepaid ', '', 'In case of L/C shipment, do not forget to mark exact the Notified Party\'s name on HAWB. \r\nFreight charge is based on customer\'s price terms. \r\nThe rest : Follow shipper\'s SLI ', 'Manifest should contain: \r\n\r\nMAWB number \r\nHAWB number \r\nShipper name and address \r\nConsignee name and address \r\nPieces \r\nWeight of each HAWB & Total Master \r\nItem descriptions of each shipment ', 'Manifest should contain: \r\n\r\nMB/L number \r\nHB/L number \r\nShipper name and address \r\nConsignee name and address \r\nPieces \r\nWeight of each HB/L & Total Master \r\nItems of each shipment', '', '', '', '', 'Pre-alert has to be sent at least one day before cargo arrival along with copy of HAWB and commercial invoice ', 'Pre-alert has to be sent to us at least one day before cargo arrival along with copy of HB/L and commercial invoice ', 'We can do customs clearance and arrange delivery to the cnee\'s door for any air and ocean shipments. ', 'MAWB: \r\n1. Consignee / James forwarding corp.\r\n2. Destination : ICN \r\n3. Mark \" Transshipment cargo to final destination \" \r\nHAWB : \r\nShow \' Remark - Final destination : name \'\r\nFor air shipment, pre-notice must be advised before cargo arrival for us to assign cargo to T/S warehouse to minimize warehouse charge. \r\n\r\nMB/L :\r\n1. Consignee / James Forwarding Corp.\r\n2. Destination : Final destination of shipment \r\nHB/L : \r\n1. Consignee / Actual end user \r\n2. Destination : Final destination of shipment \r\n3. HB/L, Commercial invoice, Packing list : mark that final destination ', '', '', 'Pre-alert : \r\nIn both air & ocean, Pre-alert in advance is very important here in Korea as most of consignee have their own appointed warehouse, it is the forwarder\'s responsibility to assign correct warehouse via EDI prior to actual cargo arrival. \r\nFor the free-hand cargo :\r\nNeed exact consignee\'s contact point to avoid any delay of notice. \r\nOcean: \r\n1. Destination Incheon port shipment, in case of FCL, Do not make consololidation. Just move 1M/1H ( There is some problem in sending delivery order from line as they only issue one D/O )\r\n2. Do not make mult-consolidation : we always have difficulty in Multi-consolidated shipment'),
(35, '6', '0', 'Master Airwaybill to: Jets Express Services Sdn Bhd \r\nStated port of destination : KUL', 'Shipper should consign Master B/L to: Jets Express Services Sdn Bhd \r\nStated port of destination : Port Kelang, Malaysia ', 'Shipper should consign House Airwaybill to actual consignee.', 'Shipper should consign House B/L to actual consignee.', 'MAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION', 'MB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION', 'Must consign to consignee: Jets Express Services Sdn Bhd ', 'Must consign to consignee: Jets Express Services Sdn Bhd', 'Should consign to actual consignee ', 'Should consign to actual consignee ', 'Must fax Pre-alert before flight arrive destination. Need to include:\r\nManifest \r\nMaster airwaybill \r\nHouse airwaybill \r\nShipper invoice & packing list once available ', 'Must fax Pre-alert before flight arrive destination. Need to include:\r\nManifest \r\nMaster B/L \r\nHouse B/L \r\nShipper invoice & packing list once available ', '', 'Must type on House airwaybill / B/L, port of destination : KUL / Port Kelang, Final Destination : ____ ', 'Original shipper commercial invoice , certificates of origin (if any) required by customs for customs declaration. A photocopy is not acceptable, for either air or ocean shipments.', 'Follow \"dangerous goods\" rules & regulation requirement. ', 'KUL airport and Port Kelang North Port located in Free Commercial Zone, value added services available for transshipment cargo (duty & tax exempted). Custom declaration already computerised & link to government, duty & tax also paying through bank transfer and cheque/banker cheque not allowed. This will cost additional charges of EDI/SMK/FCZ/Manifest fee/EFT incurred. '),
(36, '34', '0', 'It must be consigned to the full name, address of the James P. Jones & Son Limited office closest to the consignee. The phone and fax number of the office must also appear.', 'It must be consigned to the full name, address of the James P. Jones & Son Limited sea freight office closest to the consignee. The phone and fax number of the office must also appear. ', 'It must be consigned to the full name, address of the consignee, showing a contact name, with phone and fax contact numbers. The terms of shipment and charges must be clearly shown. ', 'It must be consigned to the full name, address of the consignee, showing a contact name, with phone and fax contact numbers. The terms of shipment and charges must be clearly shown. ', 'Manifests should show both pieces, weight, volume and commercial value of each consignment, along with the terms of shipment. \r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nVOLUME \r\nCOMMERCIAL VALUE OF EACH CONSIGNMENT \r\nTERMS OF SHIPMENT \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION ', 'Manifests should show the following:\r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nVOLUME \r\nCOMMERCIAL VALUE OF EACH CONSIGNMENT \r\nTERMS OF SHIPMENT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION', 'In the handling information box please request the airline to notify James P. Jones & Son Limited immediately on the arrival of the goods. ', 'In the handling information box please request the line to notify James P. Jones & Son Limited immediately on the arrival of the goods. ', 'Always show the full description of goods, terms of shipment and the full charges pre-paid or collect. If possible please show the H.S. code used on exportation of the goods. ', 'Always show the full description of goods, terms of shipment and the full charges pre-paid or collect. If possible please show the H.S. code used on exportation of the goods. ', 'Always send both e-mail notification and a full faxed pre-alert in advance of the shipment. Please include the following:\r\n\r\nMAWB number \r\nHAWB number \r\nManifest \r\nCommercial Invoice \r\nFlight and Arrival Date \r\nplus any other supporting formal documents ( EUR\'s/Cert A/GSP forms,etc) ', 'Always send both e-mail notification and a full faxed pre-alert in advance of the shipment. We require a copies of the following: \r\nMB/L number \r\nHB/L number \r\nCommercial Invoice \r\nManifest \r\nAgent\'s Invoice \r\nplus any other supporting formal documents ( EUR\'s/Cert A/GSP forms,etc) ', 'No - clearance requires specific permissions from the consignee, therefore early notification allows us to obtain permission or instruct our HTFN partner on a course of action. \r\nPermission from the consignee is required to use their duty payment account(s) ( referred to as TAN accounts). Therefore the earlier we know about the shipment the more likely it is that we will obtain clearance permission, thus future shipments ', 'Goods which are for transshipment internally or externally must do so under bond, we therefore require the earliest possible notification, along with the ultimate consignees full address and customs related details. ', 'Commercial invoices, certificates, etc are legally required to show the proper name, address, description of goods, value of goods and shipping terms ( CIF etc and applicable charges) ', 'AIR:\r\nWe require to be pre-alerted with copies of the dangerous goods declaration (DGR), along with full contact details, in order to book vehicle and delivery as per DGR regulations. \r\n\r\nOCEAN:\r\nWe require to be pre-alerted with copies of the dangerous goods term card, along with full contact details, in order to book vehicle and delivery as per DGR regulations. Also MDSS ( Material Data Safety Sheets) ', 'When sending the first pre-alert e-mail to any James P. Jones & Son office always copy the HTFNTEAM @JPJONES.IE . Secondly check the appropriate office(s) to notify. '),
(38, '265', '0', 'Should be consigned to Mayan Overseas and the end Consignee as Notify Party\r\nIn case of Bank involvement: \r\nConsignee: Bank. \r\nThe Notify Party 1: Mayan Overseas. \r\nThe Notify Party 2: End Consignee\r\n\r\nNote: The above relates to direct jobs. In case of consolidations, always consign to Mayan Overseas', 'Always consign to:\r\nMayan Overseas\r\n2 Habonim St \r\nRamat Gan \r\nTel: 03 565 7800\r\nNote: We always prefer to get Express B/L to prevent the need for originals', 'The HAWB should be consigned to the end consignee. \r\nIf a Bank involved then: \r\nConsignee: Bank\r\nNotify: End Consignee', 'HB/L should be consigned to the final consignee. Please include telephone number.', 'Please include :\r\n\r\nMAWB \r\nHAWB \r\nFLIGHT DETAILS \r\nSHIPPER \r\nCONSIGNEE \r\nNO. OF PIECES \r\nWEIGHT \r\nCHARGES PP / CC', 'Please include :\r\n\r\nMB/L \r\nHB/L \r\nVESSEL DETAILS \r\nSHIPPER \r\nCONSIGNEE \r\nNO. OF PIECES \r\nWEIGHT AND VOLUME \r\nPP / CC \r\nANY SPECIAL INSTRUCTIONS', 'In cases of consolidation please show in the \"Nature of the Goods\' Square the wording \"Consol As Per Att. Manifest\". \r\nFreight Charges: Normally PP', 'No Special Instructions', 'No Special Instructions', 'No Special Instructions', 'Please send Pre-Alerts and include the following:\r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nCOPY OF COMMERCIAL INVOICES \r\nCOPY OF THE CERTIFICATE OF ORIGIN \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION', 'Please send Pre-Alerts before Sailing of Vessel and include the following:\r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION', 'We can Customs Clear for any shipment', 'For Ocean Freight must mention on B/L and Manifest that cargo is for Transshipment ', 'IMPORTANT: ORIGINAL paperwork is always required by Customs upon entry. Any Commercial Invoice, EUR1, C/O or any other movement certificate should arrive always on the original properly completed form.', 'For Dangerous Goods, do not send Class 1 or Class 5 in consolidated cargo.', ''),
(40, '271', '0', 'Consignee: Norman Global Logistics Ltd (DMK)\r\n           Unit 1 Griffin Centre\r\n           Staines Rd, Feltham, Middx \r\n           TW14 0HS       UK\r\n', 'Consignee: Norman Global Logistics Ltd\r\n           Unit 1 Griffin Centre\r\n           Staines Rd, Feltham, Middx \r\n           TW14 0HS       UK\r\n', '\r\n', 'Show Delivery Agent as: \r\nNorman Global Logistics Ltd \r\n           Unit 1 Griffin Centre\r\n           Staines Rd, Feltham, Middx \r\n           TW14 0HS       UK', '', '', '', '', '', '', 'Mark Cook  email: mco@norman.co.uk\r\n           fax:  44-208 893 1770', 'Paul Biddle    email: pbi@norman.co.uk\r\n               fax:   44-208 893 1770', '', '', '', 'Documents must be completed with:\r\nHaz Class\r\nUN No\r\nProper Shipping Name\r\nFlash Point (if applicable)\r\nNet weight of individual packaging containing the Haz substance.\r\nAny other relevant information\r\n', ''),
(41, '169', '0', 'Ocean Express Serviços em Comércio Exterior Ltda\r\nRua Tapes, 195 - Cep 93336-020\r\nNovo Hamburgo - RS - Brazil \r\nCNPJ # 89.981.104/0001-38\r\nPhone: 55 (0) 51 594 8688', 'Ocean Express Serviços em Comércio Exterior Ltda\r\nRua Tapes, 195 - Cep 93336-020\r\nNovo Hamburgo - RS - Brazil \r\nCNPJ # 89.981.104/0001-38\r\nPhone: 55 (0) 51 594 8688', '', '', '', '', 'Ocean Express CNPJ # must always be declared on consignee\'s field of MAWB. \r\nTotal amount of freight charges must be shown on MAWB\'s respective field. \r\n\"Freight As Agreed \" wording is not acceptable. It\'s considered illegal by Brazilian laws, subject to penalties. \r\nNet/Net rate must be declared on the respective field of MAWB unless it is not allowed you can mention the IATA rate. \r\nGross Weight has to be exactly the same as declared on both Commercial Invoice and Packing List.\r\nPlease declare goods description as \"Consolidation shipment as per cargo manifest\" ', 'Ocean Express CNPJ number must always be shown on consignee\'s field of MB/L. \r\nNet/net freight amount must always be shown in numbers and words. \r\nShip mode must always be shown. \r\n\"Freight as agreed\" wording is not acceptable. It\'s considered illegal by Brazilian laws.\r\nGross Weight has to be exactly the same as declared on both Commercial Invoice and Packing List.Quantity and kind of volumes / packages must be shown. ', 'Importer\'s CNPJ # must always be declared on consignee\'s field of HAWB \r\nAll eventual charges/costs at origin must be declared and named as \"CHC\" or \"CHA\" on HAWB. Such charges must be added on the top of airfreight and the total amount must be declared on HAWB\'s respective field. \r\n\"Freight As Agreed\" wording is not acceptable. It\'s considered illegal by Brazilian laws. \r\nSelling rate must be always declared on HAWB\'s respective field. \r\nThe original # 2 of the HAWB must always be included in the set of documents accompanying the cargo to the destination. Brazilian Customs will not allow the clearance of the goods without this original. \r\nAlso, commercial invoice and packing list of goods which must accompany the cargo must be an original draft, signed. Photocopies with an \"original\" stamp are not acceptable. \r\nBefore delivering cargo to airline, please always fax us copies of MAWB and HAWB for our approval. We should also receive the complete schedule / flight details. \r\nBesides, receiving the intended flight confirmation, we must also receive the confirmation that the shipment really took place according to previous schedule. \r\nEvery single package, carton or skid must bear a label identifying goods as per data shown on MAWB and HAWB. \r\nPlease make sure you to send following documents together with cargo: \r\n- MAWB original, original and non-negotiable copies have to be stamped and signed\r\n- HAWB original 2, original and non negotiable copies have to be stamped and signed\r\n- cargo manifest - original stamped and signed\r\n- commercial invoice - original stamped and signed\r\n- packing list - original stamped and signed\r\n- agent\'s invoice.\r\nGross weight has to be exactly the same weight as MAWB, commercial Invoice and Packing List.', 'Importer\'s CNPJ # must always be shown on consignee\'s field of HB/L \r\n\"Freight as agreed\" wording is not acceptable. It\'s considered illegal by Brazilian laws. \r\nHB/L and MB/L must always show same issue date. \r\nSelling rate must always be shown on HB/L respective field. All other charges must be added to the ocean freight amount, and everything declared as Total Freight Charges. Do not break down charges. \r\nShip mode ( FCL/FCL or LCL/LCL ) must always be shown. \r\nAny other charge the shipment may have MUST be printed on HBL. If not mentioned, consignee cannot remmit the money out of Brazil. \r\nBefore actual shipment, please always fax or scan us copies of MBL and HBL for our approval. \r\nWe must also receive the complete schedule details 9ETD, ETA, Vessel, Voyage). \r\nBesides shipment pre-advice, we will need a shipment confirmation after vessel\'s departure. \r\nWe need that you send us via courier at least 05 days after vessel\'s departure to do the desconsolidation and Customs Clearance: \r\n- MB/L - 02 originals + non negotiable copies, original and non-negotiable copies have to be stamped and signed\r\n- HBL - 02 originals + non negotiable copies, original and non-negotiable copies have to be stamped and signed\r\n- Cargo Manifest - 01 original - stamped and signed\r\n- Packing list - 01 original - stamped and signed\r\n- agent\'s invoice (credit / debit note)\r\nGross Weight has to be exactly the same weight as on MBL, Commercial Invoice and Packing List. Quantity and kind of volumes / packages must be shown.', 'Before actual shipment, please always e-mail (fretes@oceanexpress.com.br) or fax us copies of MAWB & HAWB for our approval. We should also receive the complete shipment schedule/flight details.', 'Before actual shipment, please always e-mail (fretes@oceanexpress.com.br) or fax us copies of MB/L and HB/L for our approval. ', '', '', '', '', ''),
