(43, '293', '0', 'Shipper should be indicated as the foreign forwarder, including their address, city, and country', 'Shipper should be indicated as the foreign forwarder, including their address, city, and country', 'House Bills should be consigned from actual shipper to actual consignee, with the US Broker/forwarder listed as a notify party. ', 'House Bills should be consigned from actual shipper to actual consignee, with the US Broker/forwarder listed as a notify party. ', 'Manifest should be specific and include the following: \r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION', 'Manifest should be specific and include the following: \r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION', '', '', '', '', 'Pre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips', 'Pre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips ', 'We can do customs clearance for any air and ocean shipments. However, a Power of Attorney is required in order to clear Customs for any importer/shipper. If a Power of Attorney has been issued to another broker, then the cargo will be turned over to that broker for clearance. \r\nIMPORTANT NOTE: New security regulations make distinctions between known and unknown shippers. Shipments from unknown shippers ( essentially new clients to your HTFN partner ) are subject to special scrutiny which may delay the air routing by 7 or more days.\r\n\r\nWhen issuing an urgent routing order to your USA HTFN partner, please ask them to advise you if your routing may be subject to such delays so that you may advise your importer accordingly of the options available. ', 'No special requirements ', 'No special requirements ', 'A copy of the HazMat or MSDS sheets must accompany shipments. ', ''),
(44, '2', '0', 'Address MAWB to individual office address.', 'Ocean Bill of Lading is to be addressed to individual Powerhouse offices at port of destination. ', 'HAWB is to be addressed between shipper and consignee.', 'House bill of Lading is to be addressed between shipper and consignee.', '\"Description of Goods\" must read \"Consolidation As Per Attached Manifest\". \r\nManifest must have full name and address of both shipper and consignee. \r\nWe require the manifest at least 24 hours prior to arrival of flight so incoming cargo can be electronically reported to Customs. New legislation will come into effect from 2002 that will allow the Customs Dept to fine forwarders approx AUD 500.00 per case where incoming cargo is not reported within the required time frame. This cost will be passed on to overseas agents if they have failed to send a prealert manifest. ', '', '', '', '', '', 'We require the manifest at least 24 hours prior to arrival of flight so incoming cargo can be electronically reported to Customs. New legislation will come into effect from 2002 that will allow the Customs Dept to fine forwarders approx AUD 500.00 per case where incoming cargo is not reported within the required time frame. This cost will be passed on to overseas agents if they have failed to send a prealert manifest.', 'Pre-Alerts must be received at least 3 days before arrival of vessel otherwise penalties will apply. We require the full name and address of both shipper and consignee along with container number and shipment details. ', 'We can do customs clearance for any air and ocean shipments. We can arrange customs clearance on faxed or emailed documents. Original commercial invoice, packing slip etc are not required. Original bills of Lading are required to obtain release of cargo as per usual.', 'There are no special requirements for Transshipment Cargo outside of normal practice. ', '', 'For Dangerous Goods, we require a copy of Emergency Procedure Guide for trucking purposes. ', 'Fumigation\r\nCurrently every FCL container entering Australia (with the exception of groupage boxes) must be fumigated if there are any wooden pallets / skids used, the cargo is packed in crates or if timber bracing is used to secure the load. It is imperative that containers are fumigated overseas before loading on vessels as this is a much cheaper option for importers and reduces unnecessary delays in delivering cargo locally. Fax / email copies of Fumigation Certificates are acceptable and must detail the vessel, container number, number of packages and fumigation treatment used as a minimum requirement.\r\n\r\nThe Australian Quarantine Inspection Service are about to extend this rule to include all LCL shipments and eventually all air freight consignments as well.\r\n\r\nPacking Declarations\r\nEvery FCL container entering Australia (with the exception of groupage boxes) must have a Packing Declaration. This is a standard document that declares whether timber has been used in the packing of the container and that the container was cleaned of dirt and dust prior to loading. The Packing Declaration is to be completed by whoever loads the container i.e. the shipper, the forwarder or a third party warehouse provider. The declaration format must be photocopied on to the packing company\'s letterhead, signed and dated.\r\n\r\nPlease contact us if you require a copy of the Declaration format. '),
(46, '266', '0', 'Master AWB should be consigned to: \r\nQuickflo Forwarders', 'Master Ocean BL should be consigned to:\r\nQuickflo Forwarders', 'The HAWB must be consigned to the consignee.', 'The HB/L must be consigned to the consignee.', 'No special requirements for creating a consolidation manifest. Normal manifest details will suffice. ', 'No special requirements for creating a consolidation manifest. Normal manifest details will suffice.', 'No special instructions for issuance of a MAWB - just make sure it is consigned to QUICKFLO. ', 'No special instructions for issuance of a MAWB - just make sure it is consigned to QUICKFLO. ', 'Consignee\'s contact and Telephone number must be included in HAWB. ', 'Consignee\'s contact and Telephone number must be included in HB/L. ', 'For air shipments, normal fax, or e-mail Pre-Alert will suffice.', 'To surrender the OBL at port of loading please ensure that documentation is received well in advance and before vessel arrives.', 'If shipper wants us to clear the shipment (mostly DDU shipments), we can do it for both air & sea shipments. ', 'We can handle transshipment cargo both air & sea shipments. Singapore is known as a transshipment hub for the Far East. ', 'No need for an original invoice. Fax or photostat is acceptable. We do not need Certificate of Origin in Singapore. A Certificate of Origin is at the request of consignee for their trading purposes. ', 'Dangerous Goods Procedures must be strictly adhered to. ', 'Most of our goods imported into SIN are duty free, except 4 commodities, i.e. Liquor/Wine. Tobacco, Cars & Petroleum. Importers need only to pay 3% of cif value of goods for non-duty goods. '),
(47, '78', '0', 'Shipper should be indicated as the foreign forwarder, including their address, city, and country', 'Shipper should be indicated as the foreign forwarder, including their address, city, and country', 'House Bills should be consigned from actual shipper to actual consignee, with the US Broker/forwarder listed as a notify party. ', 'House Bills should be consigned from actual shipper to actual consignee, with the US Broker/forwarder listed as a notify party. ', 'Manifest should be specific and include the following: \r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION', 'Manifest should be specific and include the following: \r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION', '', '', '', '', 'Pre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips', 'Pre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips ', 'We can do customs clearance for any air and ocean shipments. However, a Power of Attorney is required in order to clear Customs for any importer/shipper. If a Power of Attorney has been issued to another broker, then the cargo will be turned over to that broker for clearance. \r\nIMPORTANT NOTE: New security regulations make distinctions between known and unknown shippers. Shipments from unknown shippers ( essentially new clients to your HTFN partner ) are subject to special scrutiny which may delay the air routing by 7 or more days.\r\n\r\nWhen issuing an urgent routing order to your USA HTFN partner, please ask them to advise you if your routing may be subject to such delays so that you may advise your importer accordingly of the options available.', 'No special requirements ', 'No special requirements ', 'A copy of the HazMat or MSDS sheets must accompany shipments. ', ''),
