(49, '278', '0', 'QINGDAO RITZY INTfL CARGO TRANSPORT ANGENCY COBCLTD\r\nAIRCARGO COMPANY  iEWT QINGDAOj\r\nTELF0086-532-85759302/84715717\r\nFAXF0086-532-85759303/84718727\r\nATTNFMs TRACY SUN\r\n', 'For shipment to Qingdao:\r\nRitzy Int\'l Cargo Transport Agency Co., Ltd.\r\nTELF0086-532-85789137\r\nFAXF0086-532-85728715\r\nATTNFMr.Frank Wang\r\n\r\nFor shipment to Shanghai:\r\nRitzy Int\'l Cargo Transporta Agency Co., Ltd.\r\nTELF0086-532-5789137\r\nFAXF0086-532-5728715\r\nATTNFMr.Frank Wang\r\n\r\n', 'please show the actual shipper and consignee on the HAWB whatever for air shipments. ', 'please show the actual shipper and consignee on the HAWB whatever for sea shipments. \r\nNotify Party: Ritzy Int\'l Cargo Transport Agency Co., Ltd.\r\nTELF0086-532-85789137\r\nFAXF0086-532-85728715\r\nATTNFMr.Frank ', 'The consolidation manifest consist of representative commodity name, volume, packing, weight, and measurement, the commodity name can be listed totally, the final destination should be the same one. ', 'The consolidation manifest consist of representative commodity name, volume, packing, weight, and measurement, the commodity name can be listed totally, the final destination should be the same one. ', 'The MAWB (Air) is issued to the Freight Forwarder by the Airline or Shipping Company, Firstly, must make sure the the shipment for Air and Ocean are landed on board. If the Freight is on Prepaid basis, Freight for Air must be paid before getting the MAWB (Air) ', 'TheMaster B/L is issued to the Freight Forwarder by the Airline or Shipping Company, Firstly, must make sure the the shipment for Air and Ocean are landed on board. If the Freight is on Prepaid basis, Freight for Ocean must be paid before getting the Master B/L. ', 'Only after getting the issued MAWB (Air) can the Freight Forwarder issue its HAWB (Air) House B/L (Ocean). ', '', 'Only after geeting the issued Master B/L , can the Freight Forwarder issue its House B/L (Ocean). ', 'Pre-alert including all shipping details for ocean freight must be faxed, e-mailed or via airmail to the destination party within 24 house hours from the vessel departure, Pre-alert for Air Freight must be faxed, e-mailed or via airmail to the destination party within 1 hours within the plane\'s departure. ', 'No. The company or enterprise must register in China Customs and must present the actual shipper or consignee\'s customs clearence consignment.', 'To make a transshipment, the shipper or consignee must make a application to the origianl or destination Customs Bureau. and must getting its approval. ', 'The commercial invoice should ge marked the shipper and consignee\'s name and address, the name of the commodity, and the value ofthe commodity. Freight item and the currency. the commercial should possess the shipper\'s signature or common seal. For the certificates of origin, the exporter should provide the ceneralized system of preferences certificate of origin (G.S.P). ', 'China Cival Aviation regulate that the Air Forwarder should not accept dangerous cargo. For ocean freight, the consignment of dangerous cargo, it must do application to the shipping company in advance, and the consignment order must mark the name of the dangerous cargo, tand all other details, and must get the shipping conmpany approval. ', ''),
(50, '291', '0', 'Mawb to be consigned as follows:\r\nRoton Vander (Freighting) Ltd.,\r\n40, Church Street,\r\nColombo 01,\r\nSri Lanka.\r\nTel : 0094 1434500\r\nFax: 0094 1437898', 'M/Bl to be consigned as follows:\r\nRoton Vander (Freighting) Ltd.,\r\n40, Church Street,\r\nColombo 01,\r\nSri Lanka.\r\nTel : 0094 1434500\r\nFax: 0094 1437898', 'HAWB must be consigned to the Consignee', 'HB/L must be consigned to the Consignee', 'No special requirements', 'No special requirements', 'No special requirements', 'No special requirements', 'No special requirements', 'No special requirements', 'Pre-Alert with the basic information to be emailed to the attention of Mr.Rizni at rizni@rotonvander.com with a copy to Mr.Mani at mani@rotonvander.com \r\nAll pre-alerts should reach us prior to the shipment arrival. \r\n', 'Pre-Alert with the basic information to be emailed to the attention of Mr.Rizni at rizni@rotonvander.com with a copy to Mr.Mani at mani@rotonvander.com\r\nAll pre-alerts should reach us prior to the shipment arrival. Especially on ocean freight since the government imposes a penalty on late customs entries. ', 'We can clear air/ocean shipments.', 'Mawb/Mbl, Hawb/Hbl along with commercial invoices and packing lists must be faxed or emailed to us prior to the arrival of shipment. All these docs should have a clause \"Transshipment via Colombo\" marked on them. ', 'No Legal requirements. ', 'No special requirements. ', ''),
(51, '47', '0', 'Please consign to:\r\n\r\nROYAL CARGO DE COLOMBIA LTDA.\r\nCalle 39 No. 19-15 \r\nBogota, Colombia \r\nTel: (57) 1 2878742 - (57) 1 2879520 \r\nemail: royalcargo@cable.net.co', 'Please consign to: \r\n\r\nFOR FLC:\r\nIF ARRIVING TO ATLANTIC SEA PORTS (CARTAGENA, BARRANQUILLA, SANTA MARTA):\r\n\r\nROYAL CARGO DE COLOMBIA LDTA Y/O COCKERILL LTDA. \r\nCalle 39 No. 19-15 \r\nBogota, Colombia \r\nTel: (57) 1 2878742 - (57) 1 2879520 \r\nemail: royalcargo@cable.net.co \r\n\r\nIF ARRIVING TO PACIFIC SEA PORT (BUENAVENTURA):\r\nROYAL CARGO DE COLOMBIA Y/O SOFILINK LTDA. \r\nCalle 39 No. 19-15 \r\nBogota, Colombia \r\nTel: (57) 1 2878742 - (57) 1 2879520 \r\nemail: royalcargo@cable.net.co\r\n\r\nFOR LCL:\r\nARRIVING TO ANY SEA PORT:\r\nROYAL CARGO DE COLOMBIA LTDA.\r\nCalle 39 No. 19-15 \r\nBogota, Colombia \r\nTel: (57) 1 2878742 - (57) 1 2879520 \r\nemail: royalcargo@cable.net.co', 'To Consignee / REPREMUNDO 2 \r\nPlease include consignee\'s telephone number, contact person and address. \r\n\r\n\r\n', 'To Consignee.  \r\nPlease include consignee\'s telephone number, contact and address. ', 'Consolidation manifest must include: \r\n- MAWB \r\n- Each HAWB including pieces, weight and commodity. ', 'Consolidation manifest must include: \r\n- MBL. Including pieces, weight, measurement and commodity. \r\n- Each HBL including pieces, weight, measurement and commodity. ', 'Master AWB must show: Consolidation ', 'Master BL must show: Consolidation ', 'Consolidation ', 'Consolidation ', 'Send Pre-Alert to our main office in Bogotá by email: royalcargo@cable.net.co with copy to royalsia@cable.net.co  or  \r\nFax: (57) 1 2856864. \r\n\r\nMust Inlude: \r\n- MAWB \r\n- HAWB \r\n- Carrier \r\n- Flight Number, icluding arriving date \r\n', 'Send Pre-Alert to our main office in Bogotá by email: royalcargo@cable.net.co or \r\nFax: (57) 1 2856864. \r\n\r\nMust Include: \r\n- Copy of MBL \r\n- Copy of HBL  \r\n- Carrier and Vessel  \r\n- Vessel\'s Schedule\r\n\r\nIN ORDER TO AVOID HIGH FINES, IT IS ABSOLUTELY NECESARY TO HAVE COPIES OF MBLs 48 HOURS BEFORE VESSEL ARRIVES.\r\n\r\nWe always confirm receiving of each Pre-Alert, if you do not receive confirmation, please send it again.    ', 'We are Customs Broker licensed therefore we can do clearance import/export, air/ocean.   ', '', 'Commercial invoices must show currency, Inconterms, type of goods, quantity and unit value.\r\n\r\nFor CIF, CIP, CFR, and other Incoterms that include freight and insurance:\r\n\r\n- Goods Value \r\n- Freight Value\r\n- Insurance Value\r\n\r\nFor Certificates of Origin:\r\n- HST\r\n- Agreement number \r\n- Commercial Inovice\'s number ', 'Please follow U.N./IATA requirements. ', ''),
(52, '46', '0', 'The MAWB must be consigned to Rush Cargo SRL. In the MAWB you must show \"Consolidated Cargo\". If the cargo is a direct shipment you must list the type of goods.', 'The Master B/L must be consigned to Rush Cargo SRL. We need 2 (two) original MB/L in BUE before the vessel arrives in Buenos Aires. ', 'The HAWB must be Consigned to the Consignee. In the HAWB you must show the Freight amount and not: \"As agreed\" (For Prepaid or Collect basis). We always need to receive two originals for the consignee.', 'The HB/L must be consigned to the consignee, or \"to the order of\". In the HAB/L you must show the freight amount and not \"As Agreed\" (for prepaid or collect Basis). We always need to receive two originals for the consignee.', 'MAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION', 'MB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION', '1. The MAWB must be consigned to Rush Cargo SRL. \r\n2. In the MAWB you must show \"Consolidated Cargo\".\r\n3. If the cargo is a direct shipment you must show the kind of goods.', '1. The MB/L must be consigned to Rush Cargo SRL. \r\n2. Express release does not exist in Argentina and is not allowed. ', '1. The HAWB must be consigned to the consignee \r\n2. In the HAWB you must show the freight amount and not \"As Agreed\" (for prepaid or collect basis)\r\n3. We always need to receive copy 2 \"original for the consignee\" ', '1. The HB/L must be consigned to the consignee.\r\n2. Express release does not exist in Argentina and is not allowed. ', 'MAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION', 'MB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION', 'We can do customs clearance for any air and ocean shipments. However, there are many requirements for each specific commodity. One of the most important things is that the consignee must have an import/export license, otherwise we cannot do the clearance for such consignee. For these and others points, we recommend you to advise us always BEFORE sending us any clearance.', 'AIR:\r\nMAWB:\r\nConsigned to Rush Cargo\r\nFinal destination Buenos Aires \r\nYou must show \"Consolidated Cargo\" .\r\nHAWB:\r\nConsigned to the importer\r\nFinal destination (Ex. Cordoba, Tucuman, etc)\r\nDeclared value for customs\r\nIn the HAWB must show \"Cargo with final destination ...... in transit to Buenos Aires\" \r\nThe total weight of each piece must not exceed 100 kg \r\nThe dimensions of each piece must not exceed 1.15 x 0.82 CM \r\n\r\nMANIFEST :\r\nMAWB number\r\nHAWB number\r\nPieces and weight\r\nShipper and consignee\r\nFlight and arrival date\r\nGoods description\r\nThe manifest must show \"Cargo with final destination ...... in transit to Buenos Aires\"\r\n\r\nOCEAN:\r\nMB/L:\r\nConsigned to Rush Cargo\r\nFinal destination Buenos Aires\r\n\r\nHB/L:\r\nConsigned to the importer\r\nFinal destination (Ex. Cordoba, Tucuman, etc)\r\nThe HB/L must show \"Cargo with final destination ...... in transit to Buenos Aires\"', 'There are a lot of legal requirements regarding commercial invoices, certificates of origin, etc. But they depend on each specific case. There is also a regulation in our country which requires to perform a pre shipment inspection to some of the commodities, not all of them. So as you can see in this aspect, the needs and requirements are very broad and we should work together on each shipment before shipping it. That is way, that in this issue we would also ask you not to ship any cargo to BUE before asking us first which are the requests.', 'AIR:\r\nDangerous goods declaration required. \r\nYou must show in the MAWB and HAWB \"Dangerous Goods as per shipper declaration\". \r\nIn the MAWB, Manifest and HAWB you must show that the cargo is dangerous goods. You must show U.N. number, Class or Division, packing group, packing instruction and quantity and type of packaging. \r\n\r\nOCEAN:\r\nIn the MB/L and HB/L must show that the cargo is dangerous goods (IMO Class, Page and U.N. number).', '');
INSERT INTO `pubship` (`recno`, `memid`, `branch`, `cma`, `cmb`, `cha`, `chb`, `ccma`, `ccmo`, `iimawb`, `iimbl`, `iihawb`, `iihbl`, `pria`, `prio`, `cust`, `trans`, `legal`, `dang`, `special`) VALUES
(53, '284', '0', 'Air: MAWB should be consigned to:\r\nSailors Shipping Ltd\r\nA R Tower 4th Floor, 24 Kemal Ataturk Ave,\r\nBanani, Dhaka-1213, Bangladesh\r\nTel: 880-2-9884435, 9884438\r\nFax: 880-2-9883784\r\nEmail: sailors@global-bd.net\r\nContact: Import Department\r\nFreight term on MAWB should be always: PREPAID unless acceptance by the authority in advance.', 'Ocean: MB/L should be consigned to:\r\nSailors Shipping Ltd\r\nNascent Tower 6th Floor, 806-A, Agrabad C/A,\r\nChittagong, Bangladesh\r\nTel: 880-31-718702\r\nFax: 880-31-718702\r\nEmail: cgpcargo@abnetbd.com\r\nContact: Import Department\r\nFreight term on MAWB should always be PREPAID unless acceptance by the authority in advance.\r\n', 'Both HAWB & HB/L must be prepared as per L/C terms & consigned to ultimate consignee. ', 'Both HAWB & HB/L must be prepared as per L/C terms & consigned to ultimate consignee.', 'Consolidation manifest should be created as precise as possible so that we can use the same as pre-alert if the consignee’s as well as notify details are given on the manifest. The cargo manifest should have the usual information ie.:\r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION', 'Consolidation manifest should be created as precise as possible so that we can use the same as pre-alert if the consignee’s as well as notify details are given on the manifest. The cargo manifest should have the usual information ie:\r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION', 'No special instruction is required.', 'No special instruction is required.', 'No special instruction is required.', 'No special instruction is required.', 'The pre-alert instruction is very important & necessary for contacting consignee in advance in order to keep them happy or to prepare import documentation in advance to avoid storage, etc. We can even follow up with the carrier with a pre-alert.', 'The pre-alert instruction is very important & necessary for contacting consignee in advance in order to keep them happy or to prepare import documentation in advance to avoid storage, etc. We can even follow up with the carrier with a pre-alert. ', 'We do customs clearance for both Air & Ocean shipments.', 'For transshipment, we require pre-alert along with the details of transshipment agent so that we can contact them for any information may require. ', 'We do need commercial invoice & packing list only. But in any case if some other documents are required, we may obtain from the consignee like copy of L/C, Import permit, VAT certificate of importer, IRC, etc. ', 'For dangerous goods, we can only confirm the requirement upon request for a specific item & at sight. We seldom handle dangerous goods. ', 'For any Ocean import, if we can’t identify the ultimate consignee name before arrival of VSL, the steamship line will issue IGM against our name & by end of the job, we have to pay unnecessary penalty to the port authority which is not a fix amount & it could be +/- 100U$ per consignment. As such, we need the pre-alert or manifest to identify the correct consignee.\r\nOur CENTRAL Bank is now-a-days monitoring very strictly all in & out REMITTANCE of foreign currencies. As such we need bilateral agreement with all our agents with whom we have business transaction. Once we submit the agreement copy to central Bank, they give us a permission to receive foreign currency from that company. As such, may I request you all to make a very simple agreement for us & sign as quickly as possible. '),
(54, '275', '0', 'The MAWB must be consigned to ScanAm Transport freight prepaid.', 'The Master B/L must be consigned to ScanAm Transport freight prepaid. ', 'The HAWB must be Consigned to the final Consignee as per terms and conditions of sale.', 'The HB/L must be consigned to the final Consignee as per terms and conditions of sale.', 'Consolidated manifest with individual HAWB\'s and/or HB/L\'s with proforma or commercial invoices and the freight invoice when applicable. ', 'Consolidated manifest with individual HAWB\'s and/or HB/L\'s with proforma or commercial invoices and the freight invoice when applicable. ', 'No Special Instructions', 'No Special Instructions', 'The HAWB must show \"Freight collect as agreed\"', 'The HAWB must show \"Freight collect as agreed\"', 'Please send shipping docments by fax and include the following:\r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION', 'Please send shipping documents by fax and include the following:\r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION', 'If terms are DDP/DDU we can arrange customs clearance on behalf of Shipper subject to the Consignee\'s agreement. ', 'Contact person including telephone/fax numbers and if possible email address must be supplied. ', 'No Special Requirements', 'IMO or Dangerous good regulation certificates must accompany shipping documents.', 'Goods shipped from Canada, P.R. of China, Japan, Rep. of Korea, Mexico Taiwan and USA which have wooden packing material of Coniferous origin, except Thuja L., should be accompanied by a phytosanitary certificate, which certifies that one of the following requirements has been met. \r\nThe packing material shall be:-\r\n\r\nStripped of it\'s bark and shall be free from grub holes cause by genus Monochamus (non-European spp.), defined for this purpose as those which are larger than 3 mm across and shall have a moisture content expressed as a percentage of dry matter of less than 20% achieved at the time of manufacture. \r\n\r\nOr - The wood has undergone a heat treatment to achieve a minimum wood core temperature of 56 degrees centigrade for 30 minutes. \r\n\r\nOr - has undergone kiln-drying to below 20% moisture content, expressed as a percentage of dry matter at the time of manufacture, achieved through an appropriate time/temperature schedule. \r\n\r\nOr - has undergone fumigation with an appropriate chemical. In the phytosanitary certificate the active agent, lowest temperature of the wood, amount (grams/square meter) of chemical used and time of exposure (in hours) shall be stated. '),
(55, '212', '0', 'MAWB should be consigned to Swiftair Intenational \r\nwith the respective address in Durban, Johannesburg or Cape Town. ', 'MB/L should be consigned to Swiftair Intenational \r\nwith the respective address in Durban, Johannesburg or Cape Town. ', 'HAWB should show the actual shipper and consignee, and if under L/C must reflect the bank details.', 'HB/L should show the actual shipper and consignee, and if under L/C must reflect the bank details.', 'The cargo manifest should have the usual information ie.:\r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION', 'The cargo manifest should have the usual information ie:\r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION', 'Special instructions on MAWB only required if for handling of cargo.', 'Special instructions on MBL only required if for handling of cargo. ', 'Special instruction on HAWB is COD shipment or any other instruction the shipper may require. ', 'Special instruction on HB/L is COD shipment or any other instruction the shipper may require. ', 'Pre-alert is a must on all shipments.', 'Pre-alert is a must on all shipments.', 'We can clear air/ocean shipment on instruction of consignee. Except DDU/DDP where the forwarding agents instructions are sufficient.', 'Transshipment of air/ocean shipments can be done without payment of duty or VAT and fairly simplified procedure ie In-Bond transfer. ', 'Legal requirements all shipments will require commercial invoice and packing list, Commodities subject to Preferential rate of duty will be subject to an authenticated Certificate of Origin ', 'Dangerous goods must specify trade name IMCO class and handling / storage information. ', ''),
(56, '305', '0', 'TCC-Spedycargo Transitários Lda\r\nTravessa da Telheira, 305-1ºAndar-Sala 9\r\n4455-563 Perafita - Matosinhos\r\nPortugal\r\nTel. + 351 229 965 912 Fax: + 351 229 964 962\r\nor\r\nTCC-Spedycargo Transitários Lda\r\nEdifício 124, Piso 1 - Gab, 17-A\r\n1700-008 Aeroporto Lisboa\r\nPortugal\r\nTel. + 351 218 480 369  Fax: + 351 218 480 370\r\n', 'Same as above', 'HAWB consigned according to Shipping terms PPD/EXW. \r\nAny specific instructions must be clearly shown on the HAWB', 'Same as above', 'Company name, complete address and telephone number of the Shipper and Consignee\r\nMAWB number\r\nHAWB number\r\nExact number of pieces with gross weight shown on each HAWB\r\nDate and flight of arrival \r\nValue of freight and/or charges to collect if any\r\n', 'Company name, complete address and telephone number of the Shipper and Consignee\r\nMBL number\r\nHBL number\r\nEstimated date of arrival\r\nShipment details : Exact number of packages with gross weight shown for each AWB\r\nFlight arrival and date\r\nValue of freight and/or charges on collect shipments', 'No specific requirements', 'No specific requirements', 'No specific requirements', 'No specific requirements', 'Pre-alert by fax or email showing:\r\nMAWB number\r\nHAWB number\r\nNumber of pieces, weight and volume\r\nSHIPPER AND CONSIGNEE\r\nFLIGHT AND ARRIVAL DATE\r\nDESCRIPTION OF GOODS \r\nAMOUNT TO COLLECT, IF ANY\r\nANY OTHER INSTRUCTIONS', 'Pre-alert by fax or email showing:\r\nMBL number\r\nHBL number\r\nNumber of pieces, weight and volume\r\nSHIPPER AND CONSIGNEE\r\nFLIGHT AND ARRIVAL DATE\r\nGOODS DESCRIPTION\r\nAMOUNT TO COLLECT, IF ANY\r\nANY SPECIFIC INSTRUCTIONS', 'Commercial invoice indicating HS Code required. \r\n', 'Country of origin must be shown on AWB/BL for all shipments to be transhipped, except  those of personal effects and household goods. AWB/BL’s covering shipments not intended for imports must state \"IN TRANSIT TO...(country of destination)\" and correctly identify the nature of the goods.', 'Commercial invoice, Packing list & Certificate of Origin required', 'Standard International Rules apply', 'Gross weight shown on MAWB/MBL must be the same shown on the HAWB/HBL'),
(57, '54', '0', 'The MAWB must be consigned to: \r\nTradewings Chile Ltd \r\nLa Gioconda 4365, Las Condes\r\nSantiago\r\nATTN: Ian M.Taylor', 'The MB/L must be consigned to: \r\nTradewings Chile Ltd \r\nLa Gioconda 4365, Las Condes\r\nSantiago\r\nATTN: Ian M.Taylor', 'Unless there is an L/C involved, the HAWB should be consigned to the name and address of the shipper\'s customer.', 'Unless there is an L/C involved, the HB/L should be consigned to the name and address of the shipper\'s customer.', 'SHIPPER AND CONSIGNEE \r\nPIECES AND WEIGHT \r\nVolume in M3 \r\nGOODS DESCRIPTION', 'SHIPPER AND CONSIGNEE \r\nPIECES AND WEIGHT \r\nVolume in M3 \r\nGOODS DESCRIPTION', 'The MAWB must be consigned always to : \r\nTradewings Chile Ltd. \r\nLa Gioconda 4365, Las Condes\r\nSantiago\r\natt: Ian M. Taylor\r\nand sent by Fax or e-mail as a pre alert. Collect Master is only allowed when the house is collect. ', '', '', 'The HB/L must be consigned always to : \r\nTradewings Chile Ltd. \r\nLa Gioconda 4365, Las Condes\r\nSantiago\r\natt: Ian M. Taylor\r\nand sent by Fax or e-mail as a pre alert. Collect Master is only allowed when the house is collect. ', 'MAWB must always be sent together with the HAWB and a copy of the consolidation manifest prior to arrival of the flight.', 'MB/L must always be sent together with the HB/L and a copy of the consolidation manifest prior to arrival of the Vessel. ', 'We can do customs clearance for any air and ocean shipments.', 'The manifest must have the following wording for the transshipment shipment \'\' Carga en Transbordo \'\'. ', 'These are according to the agreements with each country, and should be requested if needed. ', 'Standard international regulations are applied, all shipments must have their proper certificates. ', 'Special Instructions - Ocean:\r\nOriginal master B/L and Copies of HB/L must be received in our office at least 6 working days prior to vessels arrival to destination port.'),
(58, '272', '0', 'The Master AWB should be consigned to: \r\nTRANSBER SAC \r\nCalle Cadmio 129-135 \r\nUrb. Industrial Grimanesa\r\nCallao, Peru\r\nTel: (511) 572 1954 \r\nFax: (511) 572 0269 \r\nATTN: Mrs. Rosario Diaz ', 'The Master B/L should be consigned to: \r\nTRANSBER SAC\r\nCalle Cadmio 129-135 \r\nUrb. Industrial Grimanesa \r\nCallao, Peru \r\nTel: (511) 572 1954 \r\nFax: (511) 572 0269 \r\nATTN: Mrs. Rosario Diaz ', 'Should be consigned to the Customer: Exact Company Name, Bank and Address (if it is through them), please include telephone and contact person to give them arrival notice on time or check any other detail.', 'Should be consigned to the Customer: Exact Company Name, Bank and Address (if it is through them), please include telephone and contact person to give them arrival notice on time or check any other detail.', 'Should be consigned to Transber SAC, including the following information: \r\n\r\nMaster AWB \r\nHouse AWB \r\nCarrier, flight number and date \r\nConsignee including complete company name \r\nNumber of packages and gross weight \r\nDescription of goods \r\nTotal weight and number of packages consolidated', 'Must be consigned to Transber SAC including the following information: \r\n\r\nMaster B/L number \r\nHouse B/L number \r\nShipping line information, vessel number and date \r\nConsignee including complete company name \r\nNumber of packages and gross weight \r\nDescription of goods \r\nTotal weight and number of packages consolidated', 'Creation of Master AWB:\r\n\r\nCorrectly indicate the consignee (including contact information) \r\nExact weight, not to exceed +/- 5% of actual weight of shipment \r\nExact number of packages \r\nFor AIR shipments, description should read simply \"Consolidated as per attached manifest\". ', 'Creation of Master B/L:\r\n\r\nCorrectly indicate the consignee (including contact information) \r\nExact weight, not to exceed +/- 5% of actual weight of shipment \r\nExact number of packages \r\nFor OCEAN shipments, the description should specify the contents of each House B/L. \r\nFor ocean shipments please also indicate the container number, vessel section number and supervisor number. In case an inspection is required, please indicate shipment conditions for the container (FCL/FCL, LCL/LCL, etc.) ', 'Creation of House AWB, House B/L:\r\n\r\nCorrectly indicate the consignee (including contact information) \r\nExact weight of shipment \r\nExact number of packages \r\nDescription of goods ', 'Creation of House AWB, House B/L:\r\n\r\nCorrectly indicate the consignee (including contact information) \r\nExact weight, not to exceed +/- 5% of actual weight of shipment \r\nExact number of packages \r\nDescription of goods \r\nFor ocean shipments please indicate the container number, vessel section number and supervisor number. In case an inspection is required, include a notice that the container is exclusively for the listed client. ', 'It is very important to receive pre-alert after arrival of the shipment. Please send a copy of the MAWB/MBL, HAWB/HBL manifest to the following:\r\nFax Number: (511) 572 0269\r\nEmail Addresses: rdiaz@transberperu.com, mmanrrique@transberperu.com, hcordova@transberperu.com', 'In order to verify the information included in the shipping documents and to verify the arrival of cargo we must receive a pre-alert with copies of the M B/L and shipping manifest attached. ', 'We are able to do clearance and delivery for both air and ocean shipments. Peruvian Custom will require the following original documents:\r\n\r\nHB/I or HAWB\r\nCommercial invoice \r\nPacking list \r\nOriginal Certificate of origin, if a trade agreement exists.\r\nPlease provide us information prior to shipping cargo in order to check the necessary paperwork, duties and taxes.', 'Shipping documents must indicate \"Cargo en Transito\" (Master AWB, House AWB, B/L, F B/L and manifest). ', 'The commercial invoice should show the name and address of the shipper, name and address of consignee, invoice number, shipping date and complete description of goods. If the origin country has signed a trade agreement with Peru, a certificate of origin must be issued.', 'Dangerous goods must be sent with a certificate of dangerous cargo. There is a category of goods for which permission must be obtained from the Ministry of Industry before entering Peru. Please contact TRANSBER for additional information.', ''),
(59, '287', '0', 'How to consign a MAWB to destination: MILAN/MXP or LIN:\r\nTUVIA SPA\r\nVIA LONDRA 16\r\n20090 SEGRATE (MI) – I\r\ntel + 39 02 2694001\r\nfax + 39 02 26929310 \r\nHow to consign a MAWB to destination: VENICE/VCE\r\nTUVIA SPA \r\nc/o TUVIA LOGISTIC SRL\r\nVIA ORLANDA 271\r\n30030 TESSERA (VE) – I\r\ntel + 39 041 541 6612\r\nfax + 39 041 541 6608 \r\n\r\nHow to consign a MAWB to destination: FLORENCE/FLR\r\nTUVIA SPA\r\nVIA PERTINI 42\r\n50019 SESTO FIORENTINO (FI) – I\r\ntel + 39 055 7221445\r\nfax + 39 055 7318253\r\n\r\nHow to consign a MAWB to destination: ROME/FCO TUVIA SPA C/O A.S.D\'ERAMO \r\n00050 AEROPORTO FIUMICINO – ROME - ITALY\r\ntel + 39 06 65010815\r\npre alerts to + 39 02 26929310\r\n\r\nHow to consign a MAWB to all other Italian airports: TUVIA SPA\r\nVIA LONDRA 16\r\n20090 SEGRATE (MI) – I\r\ntel + 39 02 2694001', 'The Master B/L must be consigned to :\r\nTUVIA SPA \r\nVIA LONDRA 16\r\n20090 SEGRATE (MI) -- I \r\ntel + 39 02 2694001', 'HAWB must be consigned to consignee, or to the bank ,or to order as per Shipping instructions', 'House B/L must be consigned to consignee, or to the bank ,or to order as per Shipping instructions ', 'No Special Instructions', 'No Special Instructions', 'Do not show any declared value', 'No special instructions in terms of compilation of the document, however Express M/BL (no original required) is encouraged for smooth operational purposes', 'The HAWB must show \"Freight collect as agreed\" if Freight Collect.', 'The HAWB must show \"Freight collect as agreed\" if Freight Collect.', 'To be sent to the involved office via fax or email, indications required:\r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nSHIPPER \r\nCONSIGNEE \r\nFLIGHT DETAILS \r\nSHIPPER’S INVOICE \r\nPIECES/WEIGHT \r\nCOLLECT CHARGES IF ANY', 'To be sent to TUVIA SPA MILAN HEAD OFFICE at least one week prior vessel arrival. Indicate:\r\n\r\nVESSEL NAME \r\nETD/ETA \r\nCARRIER INFORMATION OR DELIVERY AGENT FOR SHIPMENTS COLOADED WITH NVOCC \r\nCONTAINER NO. FOR FCL SHIPPER \r\nCONSIGNEE \r\nPIECES/WEIGHT \r\nCBM \r\nCOLLECT CHARGES IF ANY', 'We can clear customs of any airfreight or seafreight shipment for any commodity provided that documentation is complete. Duties and taxes are normally collected in advance. Temporary importations in Italy are subject to a very complicated procedure and are not allowed in the border customs offices but only in the internal customs departments related with consignee location. For this reason, savings on duties may not be a significant consideration of temporary entry procedures. \r\n\r\nCustoms clearance for items subjects to import license or VISA: To avoid high storage charges ,the documents must be made available with at least 5 working days prior vessel or aircraft arrival. \r\n\r\nTextile-related items customs clearance. Garments, clothes, fabrics and all textile-related items can be imported only by submitting a valid certificate of origin, no matter which country the cargo is coming from.', 'Please mark \"Transshipment Cargo\" ', 'Commercial invoices should contain:\r\nsupplier\r\nbuyer\r\ncountry of origin\r\nshipping terms\r\nunit/total price and currency\r\ndescription of the goods\r\nProforma invoices should contain same details as the commercial invoice, plus indication of value for customs purposes only ', 'Normally accepted for both air and seafreight. However for smooth handling a copy of DGR declaration is required along with pre alert.', 'Fumigation as per EEC rules being required for wooden packaging originating from countries outside the European Common Market.'),
(60, '25', '0', 'SHIPPER: Agents name and address \r\nCONSIGNEE: Unimasters Air&Ocean Ltd. \r\n12 Prodan Tarakchiev Str. \r\nSofia Airport\r\nBulgaria', 'Master B/L ocean should be consigned to Unimasters Air&Ocean Ltd. ', 'SHIPPER: actual shipper\r\nCONSIGNEE: actual consignee ', 'The House B/L to be consigned to real consignee and list the Notified Party as:/ Unimasters Air&Ocean Ltd.  ', 'Please include :\r\n\r\nMAWB \r\nHAWB \r\nFLIGHT DETAILS \r\nSHIPPER \r\nCONSIGNEE \r\nCOMMODITY AND NO. OF PIECES \r\nGROSS WEIGHT \r\nCHARGEABLE WEIGHT', 'Please include :\r\n\r\nMB/L \r\nHB/L \r\nVESSEL DETAILS \r\nSHIPPER \r\nCONSIGNEE \r\nCOMMODITY AND NO. OF PIECES \r\nGROSS WEIGHT \r\nCHARGEABLE WEIGHT', 'The rates on MAWB should be issued as per IATA requirements', 'Following the usual scheme\r\nShipper: HTFN agent at POL\r\nConsignee: HTFN agent at POD', 'Fields \"Rate Charge\", \"Total charges\", \"Other Charges\", etc. should be issued \"AS AGREED\"', 'Shipper: real shipper \r\nConsignee: real consignee\r\nNotified Party: Unimasters Air&Ocean Ltd.  ', 'Please send Pre-Alerts before the departure of the shipment and include the following:\r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nCOPY OF COMMERCIAL INVOICE AND PACKING LIST \r\nCOPY OF THE CERTIFICATES \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION', 'Please send Pre-Alerts before the departure of the shipment and include the following:\r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nCOPY OF COMMERCIAL INVOICE AND PACKING LIST \r\nCOPY OF THE CERTIFICATES \r\nFREIGHT TERMS TO BE ADVISED \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION', 'We can Customs Clear Air and Ocean shipments. However a letter of attorney from shipper/ consignee is required. ', 'Air:\r\nLHR to be avoided - for loose cargo only\r\nATH to be avoid\r\nLH - ONLY RFS to be avoided from FRA to SOF\r\n\r\nOcean:\r\nGioia Tauro, Italy to be avoided \r\n', 'Air:\r\nORIGINAL commercial invoices should be attached to HAWB, copies are NOT accepted by Bulgarian Customs Authorities \r\n\r\nOcean:\r\n- For general cargo: no\r\n- For imports to Bulgaria from EU member countries, need to have EUR1 certificate and EX1 apart from other commercial documents imports of veterinary products: health certificate, certificate of origin, export certificate, import license, fitosanitary certificate ', 'AIR:\r\nAs per IATA Rules\r\n\r\nOCEAN:\r\nDeclaration forms required. Make sure if shipping line will accept to carry goods of specific IMO class. \r\nConsignee must obtain an Import Permission from the Ministry of Environment and Water PRIOR arrival of the shipment at Bulgarian border. ', 'For cargo weight up to 21 tons, each specific traffic to be discussed in advance.\r\nWritten pre-advice for any restrictions or special requirements of carrier/customs/etc. at the Airport of Departure required. \r\n\r\nWhen it is only airfreight (no RFS is lised to SOF) pallets should not exceed 80 cm height. '),
(61, '260', '0', 'The MAWB must be consigned to :\r\nUNIVERSAL EXPRESS AG \r\nDAMMSTRASSE 28-32\r\nCH-4142 MUENCHENSTEIN/SWITZERLAND \r\ntel 061 416 22 92 \r\nfax 061 416 22 00 ', 'The Master B/L must be consigned to :\r\nUNIVERSAL EXPRESS AG \r\nDAMMSTRASSE 28-32\r\nCH-4142 MUENCHENSTEIN/SWITZERLAND \r\ntel 061 416 22 92 \r\nfax 061 416 22 00 ', 'The HAWB must be Consigned as per the Shipper\'s choice.', 'The HB/L must note \"For Delivery Please Apply To: \r\nUNIVERSAL EXPRESS AG\r\nDAMMSTRASSE 28-32\r\nCH-4142 MUENCHENSTEIN \r\nTEL 061 416 22 92 \r\nATTN: MR STEINACHER ', 'No Special Instructions', 'No Special Instructions', 'No Special Instructions', 'No Special Instructions', 'The HAWB must show \"Freight collect as agreed\" if Freight Collect.', 'The HAWB must show \"Freight collect as agreed\" if Freight Collect.', 'Please send Pre-Alert including the following:\r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nCOPY OF INVOICE AND PACKING LIST \r\nCOPY OF THE CERTIFICATE OF ORIGIN FORM A IF ANY \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION', 'Please send Pre-Alert including the following:\r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nCOPY OF INVOICE AND PACKING LIST \r\nCOPY OF THE CERTIFICATE OF ORIGIN FORM A IF ANY \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION', 'We can Customs Clear Air and Ocean shipments or store cargo in our bonded warehouse. ', 'Please mark \"Transshipment Cargo\" ', 'In Switzerland we do have duty on Gross Weight. Therefore, we always need weight indication on invoice or packing list. Customs Duty reductions are possible with Certificate of Origin Form A only. (Applicable only to countries of origin appertaining to the GSP Generalized System of Preferences). ', 'As per International Standards', 'Always clearly mention delivery terms on Pre-Alert. '),
(62, '165', '0', 'Shipper should be indicated as the foreign forwarder, including their address, city, and country.  Shipments should be consigned to the forwarder receiving the shipment', 'Shipper should be indicated as the foreign forwarder, including their address, city, and country. ', 'House Bills should be consigned from actual shipper to actual consignee, with the US Broker/forwarder listed as a notify party. Shipper could also consign to a banking institution depending on terms of sale.', 'House Bills should be consigned from actual shipper to actual consignee, with the US Broker/forwarder listed as a notify party. \r\nShipper could also consign to a banking institution depending on terms of sale.', 'Manifest should be specific and include the following: \r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION\r\nSHIPPER AND CONSIGNEE INFO', 'Manifest should be specific and include the following: \r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION\r\nSHIPPER AND CONSIGNEE INFO', '', '', '', '', 'Pre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips. Documents should be scanned and emailed.', 'Pre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips.  Documents should be scanned and emailed. ', 'We can do customs clearance for any air and ocean shipments. However, a Power of Attorney is required in order to clear Customs for any importer/shipper. If a Power of Attorney has been issued to another broker, then the cargo will be turned over to that broker for clearance. \r\nIMPORTANT NOTE: New security regulations make distinctions between known and unknown shippers. Shipments from unknown shippers ( essentially new clients to your HTFN partner ) are subject to special scrutiny which may delay the air routing by 7 or more days.\r\n\r\nWhen issuing an urgent routing order to your USA HTFN partner, please ask them to advise you if your routing may be subject to such delays so that you may advise your importer accordingly of the options available. ', 'No special requirements ', 'US Customs requires the country of origin be specified on the commercial invoice.\r\nCargo should be properly marked with the country of origin.  Contact us for specific requirements.', 'A copy of the HazMat or MSDS sheets must accompany shipments. ', ''),
(63, '292', '0', 'MAWB should be consigned to: \r\nWillfreight Express Cargo Services.\r\n1st Floor, Aviation House, Langata Road,Wilson Airport,\r\nP.O.BOX 47578 \r\nNAIROBI KENYA.\r\nTel: 254 2 602 841/2,\r\nFax: 254 2 609 147,\r\nCell:254 722 511055\r\nCell:254 735 511055\r\nEmail: info@willfreight.com\r\nEmail: info@willfreight.co.ke\r\n', 'MB/L should be consigned to:\r\nWillfreight Express Cargo Services\r\nFreed House, First Floor\r\nMoi Avenue-Kwashibu Road Junction\r\nPO BOX 83972 \r\nTel: 254 41 224 419\r\nFax: 254 41 226 621\r\nCell: 254 722 511055\r\nCell: 254 735 511055\r\nEmail:msa@willfreight.com\r\nEmail:msa@willfreight.co.ke\r\n', 'The HAWB must be consigned to the Consignee. ', 'The H B/L must be consigned to the Consignee.', 'No special requirements. Please include:\r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION', 'No special requirements. Please include:\r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION', 'Declared value for carriage to read NVD\r\nDeclared value for Customs to read NCV ', 'No special instructions ', 'Depending on agreement\r\nDeclared value for carriage to read NVD\r\nDeclared value for Customs to read NCV', 'Depending on agreement ', 'Pre-Alerts should contain basic information such as:\r\nMAWB Number\r\nHAWB Number\r\nPieces and Weight\r\nShipper and Consignee\r\nFlight and arrival date\r\nCopy of the invoice\r\nCopy of the manifest', 'Pre-alert to reach us 2-3 days after vessel departure. Pre-alert to contain the following information:\r\nShipper/ Consignee (Including Tel/ Fax No and PIC)\r\nCommodity\r\nNumber of cartons\r\nWeight\r\nCBM\r\nVessel name\r\nContainer number or info LCL\r\nRelease agent (Shipping line)\r\nETD\r\nETA', 'We can do Customs clearance for any air and ocean shipments if we have proper invoice and packing list, certificate of insurance is not essential. Duty and VAT has to be paid in advance if we do not know the customer. Customs clearance can be made only if shipment is consigned to a registered company/person in the relevant country. ', 'Depending on clients request. For all LCL shipment we need the commercial invoice 5 days before vessel arrival at the latest.', 'Commercial Invoice needs to contain: \r\n- supplier/buyer\r\n- country of origin\r\n- shipping terms (should match on the AWB)\r\n- payment terms\r\n- unit/total price\r\n- description of goods\r\n- currency\r\n- invoice date & No.\r\n- the invoice should state \"commercial invoice\" \r\n\r\nProforma Invoice should contain same  criteria for commercial invoice, except payment terms. In this case it should state:\r\n- value for customs purposes only\r\n- if samples: \"sample\"', 'Air D.G. generally accepted provided it has authenticated (signed and stamped) documents showing relevant worldwide approved test standards clearly displayed.HANDLING INSTRUCTIONS SHOULD BE CLEARLY INDICATED on\r\npackages and accompanying documents – HOWEVER CONFIRM WITH US CASE BY CASE BEFORE SHIPPING ! ', ''),
