(111, '18', '', 'East-West Air Services Co.,Ltd.\r\n10/1 Soi Farm Watana, Rama 4 Road\r\nPrakhanong Klongtoey\r\nBangkok 10110', 'East-West Air Services Co.,Ltd.\r\n10/1 Soi Farm Watana, Rama 4 Road\r\nPrakhanong Klongtoey\r\nBangkok 10110', 'Follow shipper\'s instruction. Ensure that there are no typing mistakes, as only the company shown as \"consignee\" can customs-clear the shipment. Exception for L/C shipments consigned to a bank.\r\n', 'Follow shipper\'s instructions.', 'Standard', 'Standard', 'Prepaid', 'Standard', 'Always show a rate. Heavy customs penalties occur for \"as agreed\" or \"as arranged\" HAWBs, both collect and prepaid.', 'Standard', 'Send all docs to air.imp@ewas.co.th or fax +66-2-712-0156, Attn Mr Kim.', 'Send all docs to seafreight@ewas.co.th or fax +66-2-712-0158, Attn Ms Namfon.', 'Contact us in advance for DDU/DDP shipments, as we have to obtain the customs card (licence to be an importer) from the consginee first.', 'MAWB to East-West, airport of destiantion BKK. HAWB must show consginee address and airport of destination outside of Thailand. Please book with us first, because warehouse charges will occur if the shipment stays in BKK more than 2 calendar days.', '', '', ''),
