(115, '309', '0', 'MAWB should show Options Logistics, Inc. as consignee', 'MBL should show Options Logistics, Inc. as Consignee', 'HAWB should show Actual Consignee as Consignee', 'HBL should show Actual Consignee as Consignee', 'Manifest should include:\r\nMAWB Number / HAWB Number\r\nNo. of Pieces & weight\r\nShipper & Consignee Name\r\nFlight & Arrival\r\nDescription of Goods', 'Manifest should include:\r\nOcean MB/L Number\r\nHouse B/L Number\r\nPieces / Weight / Volume\r\nMarks & Numbers\r\nVessel\r\nShipper / Consignee/ Notify Party\r\nContainer Number / Seal Number\r\nGoods Description', 'MAWB should show Options Logistics, Inc. as consignee', 'MBL should show Options Logistics, Inc. as Consignee', 'HAWB should show Actual Consignee as Consignee', 'HBL should show Actual Consignee as Consignee', 'Pre-alert should include:\r\nCargo Manifest\r\nMAWB & HAWB\r\nCommercial Invoice & Packing List', 'Copy of Master Bill of Lading\r\nCopy of House Bill of Lading\r\nCopy of Cargo Manifest\r\nCommercial Invoice & Packing List\r\nDebit Note / Credit Note ', 'Address your request quotation  for Door to Door air Import shipment destination Manila to:\r\n\r\nDing L. Gamboa, Brokerage Manager email address: ding@optionslogistics.com.ph\r\nAlvaro Bentulan, Air Import Coordinator email address: Alvaro@optionslogistics.com.ph\r\n\r\n1. When door to door airshipment is duty paid by shipper \r\n\r\nConsign master airwaybill to:\r\nOptions Logistics, Inc.\r\nUnit 7Columbia Airfreight Complex\r\nNinoy Aquino Avenue, Sucat\r\nParanaque City, Metro Manila\r\nPhilippines\r\nTel Nos. (632)854 5074 to 77\r\nFax No. (632) 854 5628/854 5351\r\n\r\nPort of Destination: Ninoy Aquino International Airport, Manila\r\n\r\nContact Person: Mr. Alvaro Bentulan, Air Import Coordinator\r\nEmail address: Alvaro@optionslogistics.com.ph\r\n\r\nPre alert send thru Facsimile Message or Email attention Mr. Alvaro Bentulan\r\nDocuments Requirement:\r\nAdvance copy of invoice for computation of duty and tax and invoice value is subject to Philippine customs appraised value of the shipment.\r\nMaster airwaybill\r\nHouse airwaybill\r\nInvoice for house airwaybill\r\nPacking List for houseairwaybill\r\nCargo Manifest\r\n\r\n2. When door to door airshipment is duty paid by consignee\r\n\r\nConsignee\'s contact person\r\nTelephone number\r\nFacsimile number\r\nConsign master airwaybill to:\r\n\r\nOptions Logistics, Inc.\r\nUnit 7 Columbia Airfreight Complex\r\nNinoy Aquino Avenue, Sucat\r\nParanaque City, Metro Manila\r\nTel. Nos. (632) 854 5074 to 5077\r\nFax No. (632) 854 5351/854 5628\r\n\r\nAirport of Destination: Ninoy Aquino International Airport\r\n\r\nDocuments Requirement:\r\nMaster airwaybill\r\nHouse airwaybill\r\nInvoice for house airwaybill\r\nPacking List\r\nCargo Manifest\r\n\r\n3. When door to door seashipment is duty paid by shipper\r\nAdvance copy of invoice for duty and tax computation but subject to Philippine customs apprased value of the shipment.\r\n\r\nAddress your request quotation for door to door charges to:\r\n\r\nDing L. Gamboa, Brokerage Manager Email address: ding@optionslogistics.com.ph\r\nMichael Sibucao, Seafreight Import Coordinator email address: michael@optionslogistics.com.ph\r\n\r\n\r\nConsign master bill of lading to:\r\n\r\nOptions Logistics, Inc.\r\nUnit 7 Columbia Airfreight Complex\r\nNinoy Aquino Avenue,Sucat\r\nParanaque City, Metro Manila\r\nPhilippines\r\nTel. No. (632) 854 5074 to 5077\r\nContact Person: Michael Sibucao, Sea Import Coordinator\r\n\r\nPort of Destination: South Harbor or Manila International Port(Check Shipping line at origin which port they are using. No problem for us using either of the two ports) \r\nDocuments Requirement:\r\nMaster bill of lading\r\nHoue bill of lading\r\nInvoice\r\nPacking List\r\n\r\n4. When door to door shipment is duty paid by consignee\r\n\r\nConsignee\'s contact person\r\nTelephone number\r\nFacsimile number\r\nEmail address if any\r\n\r\nConsign master bill of lading to:\r\n\r\nOptions Logistics, Inc.\r\nUnit 7Columbia Airfreight Complex\r\nNinoy Aquino Avenue, Sucat\r\nParanaque City,Metro Manila\r\nTel. No. (632) 854 5074 to 5077\r\nFax No. (632) 854 5628\r\nContact Person: Mr. Michael Sibucao, Sea Import Coordinator Email address: Michael@optionslogistics.com.ph\r\n\r\nPort of Destination: South Harbor or Manila International Port (Check Shipping line at origin which port they are using. No problem for us using either of the two ports.\r\n\r\nDocuments Requirement:\r\nMaster bill of lading\r\nhousebill of lading\r\nInvoice\r\nPacking List\r\nCargo Manifest', '', 'Original Commercial Invoices & Packing List must be provided for customs entry declaration.\r\nOriginal Certificate of Origin particularly for shipments of ASEAN CEPT must be provided for, photocopies of such documents will not be accepted by customs.', 'DG goods will require DG Certificate, certifying that goods are hazardous in nature.\r\nProduct Specification from shipper as well as MSDS (Material Safety Data Sheet) may be required if available for customs releasing.\r\n', 'Shipments under L/C Instructions must be followed as required by Letter of Credit requirements w/c was provided by cnee otherwise, discrepancy will be encountered on bank transactions'),
