(69, '54', '1', 'Master airwaybill must be consigned and notified as follows:\r\n	\r\nTRADEWINGS Ltd.\r\nLa Gioconda 4365 \r\nLas Condes - Santiago\r\nPh.: (56 2) 412 2000\r\nFax: (56 2) 3817414\r\nIan M. Taylor\r\n', '', '', '', '', '', '', '', 'Transshipments must be issued in a separate consolidation manifest	under the same MAWB indicating across the HAWB and the manifest  for the Transshipment HAWB, the following clause.\r\n\r\n “CARGA EN TRANSBORDO”   \r\n', '', 'Pre-alerts for all consolidations are required, and must be sent to the following Fax number:\r\n\r\n-Pre-alert fax number: 56 2 381 7414\r\n', '', '', '', '', '', 'Consolidation pouch must include the following:\r\n- 1 Set of each HAWB with at least 4 copies each.\r\n- 3 Copies of consolidation manifest.\r\n- 1 Original + 1 copy of your invoice for each CC HAWB\r\n- 1 commercial invoice per HAWB.\r\n- 1 Copy of packing list per HAWB.\r\n- 1 Copy of insurance certificate if applicable.\r\n- Credit note for profit shares.\r\n'),
(70, '262', '1', 'See head office instructions.', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '- Canada has adopted strict rules governing the import of wood packing materials. Please refer to this document for the guidelines;\r\nhttp://www.inspection.gc.ca/english/plaveg/protect/dir/d-98-08e.pdf\r\n\r\n- Any shipper planning to export textiles or garments to Canada must ensure that the importer has the necessary import quota in place and a system to have the import permit created. The same preplanning applies for other types of regulated commodities - examples of these include steel, agricultural and food products.\r\n\r\n- Please ensure that any collect charges are clearly noted on the house bill of lading. For freight collect shipments, we MUST KNOW the amount we have to collect - so please avoid rating collect house bills of lading with the expression \"As Agreed\". If possible include the shipment invoice and profit share along with the shipping paperwork.\r\n\r\n- For ITN routed shipments, please ensure that our Standard Shipping Instructions (SSI) are followed. Any questions - please check with us.'),
(71, '262', '2', 'See head office instructions', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '- Canada has adopted strict rules governing the import of wood packing materials. Please refer to this document for the guidelines;\r\nhttp://www.inspection.gc.ca/english/plaveg/protect/dir/d-98-08e.pdf\r\n\r\n- Any shipper planning to export textiles or garments to Canada must ensure that the importer has the necessary import quota in place and a system to have the import permit created. The same preplanning applies for other types of regulated commodities - examples of these include steel, agricultural and food products.\r\n\r\n- Please ensure that any collect charges are clearly noted on the house bill of lading. For freight collect shipments, we MUST KNOW the amount we have to collect - so please avoid rating collect house bills of lading with the expression \"As Agreed\". If possible include the shipment invoice and profit share along with the shipping paperwork.\r\n\r\n- For ITN routed shipments, please ensure that our Standard Shipping Instructions (SSI) are followed. Any questions - please check with us.'),
(72, '262', '3', 'See head office instructions.', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '- Canada has adopted strict rules governing the import of wood packing materials. Please refer to this document for the guidelines;\r\nhttp://www.inspection.gc.ca/english/plaveg/protect/dir/d-98-08e.pdf\r\n\r\n- Any shipper planning to export textiles or garments to Canada must ensure that the importer has the necessary import quota in place and a system to have the import permit created. The same preplanning applies for other types of regulated commodities - examples of these include steel, agricultural and food products.\r\n\r\n- Please ensure that any collect charges are clearly noted on the house bill of lading. For freight collect shipments, we MUST KNOW the amount we have to collect - so please avoid rating collect house bills of lading with the expression \"As Agreed\". If possible include the shipment invoice and profit share along with the shipping paperwork.\r\n\r\n- For ITN routed shipments, please ensure that our Standard Shipping Instructions (SSI) are followed. Any questions - please check with us.'),
