(79, '2', '4', 'Powerhouse Clearances (WA)\r\n1/51-53 Kewdale Road\r\nKewdale, Perth, 6105\r\nWestern Australia', 'Powerhouse Clearances (WA)\r\n1/51-53 Kewdale Road\r\nKewdale, Perth, 6105\r\nWestern Australia', 'Directly to consignee', 'Directly to consignee', '', '', 'Powerhouse Clearances (WA)\r\n1/51-53 Kewdale Road\r\nKewdale, Perth, 6105\r\nWestern Australia', 'Powerhouse Clearances (WA)\r\n1/51-53 Kewdale Road\r\nKewdale, Perth, 6105\r\nWestern Australia', '', '', 'email: sales@powerhousewa.com.au\r\nor\r\nFax: +61 8 9353 3272', 'email: sales@powerhousewa.com.au\r\nor\r\nFax: +61 8 9353 3272', '', '', 'Origin of goods MUST be shown on Commercial Invoice.\r\nAll Wooden items/ packing must be accompanied by a fumogation certificate. ', '', 'All Wooden items/ packing must be accompanied by a fumogation certificate. ');
