(80, '305', '1', 'TCC-Spedycargo Transitários Lda\r\nEdificio 124 - Piso 1 - Gab 17A\r\nAeroporto de Lisboa\r\n1700-008 Lisboa\r\nPortugal', 'Same as above', 'HAWB consigned according to shipping terms PPD/EXW. \r\nAny specific instructions must be clearly shown on the HAWB.', 'Same as above', 'Company name, complete address and telephone number of Shipper and Consignee\r\nMAWB number\r\nHAWB number\r\nExact number of pieces with gross weight shown on each HAWB\r\nDate and Flight of arrival \r\nValue of freight and/or charges to collect if any\r\n', 'Company name, complete address and telephone number of the Shipper and Consignee.\r\nMBL number\r\nHBL number\r\nEstimated date of arrival', 'No specific requirements', 'No specific requirements', 'No specific requirements', 'No specific requirements', 'Pre-alert by fax or email showing:\r\nMAWB number\r\nHAWB number\r\nNumber of pieces, weight and volume\r\nSHIPPER AND CONSIGNEE\r\nFLIGHT AND ARRIVAL DATE\r\nDESCRIPTION OF GOODS \r\nAMOUNT TO COLLECT, IF ANY\r\nANY OTHER INSTRUCTIONS', 'Pre-Alert by fax or email showing:\r\nMBL number\r\nHBL number\r\nNumber of pieces, weight and volume\r\nEstimated date of arrival', 'Commercial invoice showing HS Code required', 'Country of origin must be shown on AWB/BL for all shipments to be transhipped, except those of personal effects and household goods.\r\nAWB/BL for shipments not intended for imports must declare \"IN TRANSIT TO ...(country of destination)\" and correctly identify the nature of the goods.', 'Commercial invoice, Packing list & Certificate of Origin requiered', 'Standard International Rules apply', 'Gross weight shown on MAWB/MBL must be the same  shown on the HAWB/HBL'),
(82, '280', '', 'It must be consigned to : \r\nGollcher Co Ltd. \r\n19, Zachary Street. \r\nValletta VLT10 \r\nMalta \r\nTel: ++356 25691300 \r\nFax: ++356 21234195', 'It must be consigned to : \r\nGollcher Co Ltd. \r\n19, Zachary Street. \r\nValletta VLT10 \r\nMalta \r\nTel: ++356 25691200\r\nFax: ++356 21234195\r\n', 'House Airwaybills should be cosigned to the consignee with full address( no P.O. Box numbers.) a contact person and a telephone/fax number. \r\n', 'House B/L\'s should be cosigned to the consignee with full address( no P.O. Box numbers.) a contact person and a telephone/fax number. \r\n', 'Manifests should show both pieces, weight, volume and commercial value of each consignment, along with the terms of shipment. \r\n\r\nMAWB number \r\nHAWB numbers with individual number of pieces and weight \r\nNumber and total pieces and weight \r\nShould indicate if the hawb is collect or prepaid and amount to be collected \r\nCommodity of each shipment \r\nFlight details \r\nOrigin Station \r\n', 'Manifests should show the following: \r\n\r\nMaster B/L No. \r\nHouse B/L No. \r\nCnee\'s details \r\nNo. of Packages / Gross Weight / Container No. \r\nIf Freight charges are Prepaid or Collect \r\nIf Freight charges are collect. Amount to be collected \r\nVessel details \r\nPort of Loading \r\n', 'When issuing a MAWB with only one HAWB (Back to Back). do not write the words \"Consolidation\" anywhere on the MAWB. ( This reduces local airport handling charges.) \r\n', 'If possable HTFN agents should always instruct Shipping Line to issue Express Master B/L\'s. This helps us with quicker delivery of cargo. \r\n', 'No Special Instructions ', 'House B/L\'s should should clearly state that \" Port Destination charges are not included\" unless shipments are on a Door to Door basis. \r\n', 'Pre-Alerts should be accompanied by: \r\nMAWB number \r\nHAWB number \r\nManifest \r\nInvoices \r\nFlight and Arrival Date \r\n', 'Pre-Alerts should be accompanied by: \r\nMB/L number \r\nHB/L number \r\nManifest \r\n', 'Customs Clearance available for any client on both Air and Sea.\r\n', 'For transhipments all invoices must show consignee at final destination. HAWB / House B/L should have the words \" Shipment in Transit to ( indicate final destination).\" written in the handling information box. \r\n', 'Airfreight \r\nFor Air Transhipments to LIBYA we require the following: \r\na. Original Invoice \r\nb. Packing List \r\nc. Certificate of Origin validated by Chamber of Commerce / Libyan Peoples Bureau at origin country. \r\nd. Import License . \r\ne. Arabic translation of all documents. \r\nf. All shipments should be on prepaid basis only. \r\n\r\nSeafreight \r\na. All Import shipments have to be accopanied by an Original Invoice declaring the total Gross Weight / CBM of the shipment if possable. The supplier has to state that the amont shown on the invoice is the correct amount and that no other invoices will be issued. \r\nb. All cargo originating from EEC countries or any other countries who have special agreements with the EEC have to be accompanied by a EUR 1 certificate or T2L document.\r\n', 'AIR: \r\nNo special requirement for D.G.R. except for a pre alert preferably with a copy of the D.G. R. certificate. Special handling charges apply. \r\n\r\nOCEAN: \r\nAll Hazardous Cargo has to be accopanied by a Hazardous Decleration showing the IMCO Class & UN No. Also all Chemicals have to be accompanied by a Certificate of Analysis as these would be required for customs clearance procedures. \r\n', 'No special instructions for General cargo but other types of cargoes may require special handling. In these cases we suggest one should contact our office for instructions and assistance. \r\nContact persons:- \r\nManager Airfreight - Mr. Walter Micallef e-mail: \"Mailto:wmicallef@gollcher.com\" wmicallef@gollcher.com \r\nSenior Manager Seafreight - Mr. Peter Fleri Soler email: \"Mailto:pflerisoler@gollcher.com\" pflerisoler@gollcher.com \r\n'),
(83, '306', '', 'The MAWB must be consigned to Transports Internationaux Philippe Peschaud, Casablanca ', '-The MAWB must be consigned to  Transports Internationaux Philippe Peschaud, Casablanca\r\n-Discharge Port of Preference: CASABLANCA (unless it is constrained to be shipped to Port  AGADIR) ', 'The HAWB must be consigned to the Final Receiver and in case of credit letter, HAWB might be consigned to receiver\'s bank', 'The HB/L must be consigned to the Final Receiver and in case of credit letter, HB/L might be consigned to receiver\'s bank', '-Master AWB will be consigned to Transports Internationaux Philippe Peschaud \r\n-Several HAWB to correspond to the MAWB \r\nNumber of packages / weight volume of all Houses should total and be equal to the details on MAWB \r\n-Each consolidation manifest to show shipper / actual consignee / number of packages / net and gross weight / DGR etc / freight terms, collect or pre-paid ', '-Master B/L will be consigned to Transports Internationaux Philippe Peschaud\r\n-Several HB/L to correspond to the MB/L \r\nNumber of packages / weight volume of all Houses should total and be equal to the details on MB/L \r\n-Each consolidation manifest to show shipper / actual consignee / number of packages / net and gross weight / DGR etc / freight terms, collect or pre-paid ', '-Master MAWB should be consigned to Transports Internationaux Philippe Peschaud, showing freight terms: pre-paid \r\n-Original documents, namely Invoice, packing list and Certificate Of Origin (COO)ex:Eur1 a must, for clearance for countries having agreements with Morocco.', '-Master B/L should be consigned to Transports Internationaux Philippe Peschaud, showing freight terms: pre-paid \r\n-Original documents, namely Invoice, packing list and Certificate Of Origin (COO)ex:Eur1 a must, for clearance for countries having agreements with Morocco.\r\n-CIF does not hold in Morocco because Insurance has to be paid inside the country directly by receiver', '-HAWB to be consigned to final receiver, showing freight terms, collect, details of amount,Copy of Invoice, packing list and COO to accompany the shipment ', '-HB/L to be consigned to final receiver, showing freight terms, collect, details of amount,Copy of Invoice, packing list and COO to accompany the shipment ', 'Always pre-alert to be received 24H prior to shipment arrival, indicating AWB / flight details,number of packages, shipper/consignee, DGR, special handling, if any', 'Always pre-alert to be received right after vessel departure, indicating B/L / loading date, vessel name, number of packages, shipper consignee, DGR, special handling, if any', 'We can do customs clearance for both air and ocean shipments.\r\nWe need the original invoice (either in Euros or Dollars), packing list, and certificate of origin (ex:Eur1)', 'Ask for specific instructions before loading.\r\nCopy of Invoice and packing list to accompany shipment, along AWB / BL instructions from Casablanca to final destination to be advised ', 'For both Air and Ocean : Original Invoice / Packing list and certificate of origin is a must ', 'DGR / IMCO class number and nature of goods have to be advised on all documents ', 'To be advised if there are any'),
(84, '', '', 'shipping instructions pending', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(85, '26', '', 'The MAWB must be consigned to Allfreight Logistics and always on a prepaid base. \r\n\r\n \r\n', 'The Master B/L must be consigned to Allfreight Logistics and always on a prepaid base.', 'The HAWB can be consigned as shipper wants PPD/EXW and if there are special instructions must be mentioned clearly on HAWB. Shipments via letter of credit,COD or CAD has to be announced in advance !', 'The HB/L can be consigned as shipper wants PPD/EXW and if there are special instructions must be mentioned clearly on the HB/L.Shipments via letter of credit,COD or CAD has to be announced in advance !', 'No Special Instructions but please include the following:\r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION', 'No Special Instructions but please include the following:\r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION\r\n', 'No Special Instructions', 'No Special Instructions', 'No Special Instructions', 'No Special Instructions', 'Always pre-alert by fax or by e-mail and please include the following:\r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION \r\n', 'Always pre-alert by fax or by e-mail and please include the following:\r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION\r\n', 'We can do customs clearance for any air and ocean shipments. ', 'Full details of cargo and clear instructions to move cargo must be included. \r\n', 'For India if a \'Form A\' is attached to shipment there are no import duties. For the rest of the world there are no special requirements', 'Standard International Requirements', 'Standard International Requirements'),
