(94, '46', '', 'Rush Cargo S.R.L.\r\nAlfredo Palacios 1280\r\nC1167ABJ\r\nCiudad Autónoma de Buenos Aires\r\n', 'According to Consignee Request\r\n', 'Rush Cargo S.R.L.\r\nAlfredo Palacios 1280\r\nC1167ABJ\r\nCiudad Autónoma de Buenos Aires\r\n', 'According to Consignee Request\r\n', 'Master House Number, Flight, Airline, Origin, Destination, Pieces, Weight, Sizes, Shipper, Consignee, Freight: Pre-Paid or Collect\r\n', 'Does not apply.', 'Show Always: \"Consolidation Cargo as per Attached Manifest\", as Description of Goods.\r\nShow Freight, Pieces, Net Fares, Surcharges.\r\n\r\n', 'Show always: \"LCL or FCL\", Freight: Pre-paid or Collect, Container and Seal Number, Gross Weight, Measurements and Description of Goods.\r\n\r\n', '\"Said to Contain\", Description of Goods.\r\nShow Selling Rate, Surcharges.\r\n', 'Show always: \"LCL or FCL\", Freight: Pre-paid or Collect, Container and Seal Number, Gross Weight, Measurements and Description of Goods, Freight Amount.\r\n\r\n', 'MAWB and HAWB Number, Shipper, Consignee, Pieces, Weight, Flights, Freight Charges.\r\n\r\n', 'Vessel, ETD, ETA, HB/L and MB/L Number, Pre-paid or Collect, Charges to Collect, Special Instructions to Consider.', 'PLEASE, DO NOT SEND ANY CARGO WITHOUT CONTACTING US BEFOREHAND. Show Freight Charges, Detailing Charges, Due Carrier and Due Agent.', '', 'DO NOT SEND ANY DOCUMENTS WITHOUT CONTACTING OUR COUNTRY BEFOREHAND. Original Documents detailing F.O.B: Charges, Commercial Invoices, Packing List and Certificate of Origin (if needed).', 'Safety Danger Sheet Required as per Airline and IATA Regulations.', 'BEFORE SENDING ANY CARGO, PLEASE CONTACT US IN ADVANCE. IN ORDER TO ISSUE A DOCUMENT, ALSO CONTACT US FIRST FOR SPECIAL INSTRUCTIONS, SO AS TO AVOID POINTLESS EXPENSES THAT WE WOULD, UNFORTUNATELY, BE FORCED TO CHARGE YOU.'),
