(99, '275', '2', 'The MAWB must be consigned to ScanAm Transport freight prepaid.', 'The Master B/L must be consigned to ScanAm Transport freight prepaid. ', 'The HAWB must be Consigned to the final Consignee as per terms and conditions of sale.', 'The HB/L must be consigned to the final Consignee as per terms and conditions of sale.', 'Consolidated manifest with individual HAWB\'s and/or HB/L\'s with proforma or commercial invoices and the freight invoice when applicable. ', 'Consolidated manifest with individual HAWB\'s and/or HB/L\'s with proforma or commercial invoices and the freight invoice when applicable. ', 'No Special Instructions', 'No Special Instructions', 'The HAWB must show \"Freight collect as agreed\"', 'The HAWB must show \"Freight collect as agreed\"', 'Please send shipping docments by fax and include the following:\r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION', 'Please send shipping documents by fax and include the following:\r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION', 'If terms are DDP/DDU we can arrange customs clearance on behalf of Shipper subject to the Consignee\'s agreement. ', 'Contact person including telephone/fax numbers and if possible email address must be supplied. ', 'No Special Requirements', 'IMO or Dangerous good regulation certificates must accompany shipping documents.', 'Goods shipped from Canada, P.R. of China, Japan, Rep. of Korea, Mexico Taiwan and USA which have wooden packing material of Coniferous origin, except Thuja L., should be accompanied by a phytosanitary certificate, which certifies that one of the following requirements has been met. \r\nThe packing material shall be:-\r\n\r\nStripped of it\'s bark and shall be free from grub holes cause by genus Monochamus (non-European spp.), defined for this purpose as those which are larger than 3 mm across and shall have a moisture content expressed as a percentage of dry matter of less than 20% achieved at the time of manufacture. \r\n\r\nOr - The wood has undergone a heat treatment to achieve a minimum wood core temperature of 56 degrees centigrade for 30 minutes. \r\n\r\nOr - has undergone kiln-drying to below 20% moisture content, expressed as a percentage of dry matter at the time of manufacture, achieved through an appropriate time/temperature schedule. \r\n\r\nOr - has undergone fumigation with an appropriate chemical. In the phytosanitary certificate the active agent, lowest temperature of the wood, amount (grams/square meter) of chemical used and time of exposure (in hours) shall be stated. '),
