(101, '243', '0', 'KDS Cargo B.V.\r\nShannonweg 1\r\n1118 LA  Schiphol Amsterdam Airport\r\nThe Netherlands\r\nTel.: +31 (0)204467120\r\nFax.: +31 (0)204467105', 'KDS Cargo B.V.\r\nShannonweg 1\r\n1118 LA  Schiphol Amsterdam Airport\r\nThe Netherlands\r\nTel.: +31 (0) 204467130\r\nFax.: +31 (0) 204467105', 'To final consignee or as per shipper\'s instructions', 'To final consignee or as per shipper\'s instructions', 'No Special Instructions. As commonly practiced.', 'No Special Instructions. As commonly practiced.', 'No Special Instructions. As commonly practiced.', 'No Special Instructions. As commonly practiced.', 'No Special Instructions. As commonly practiced.', 'No Special Instructions. As commonly practiced.', 'e-mail: Csimport@kds-cargo.com\r\nFax:    +31 20 4467105\r\nPlease e-mail or fax copies of all documents related to your consignment including following information:\r\n\r\nMAWB NUMBER;\r\nHAWB NUMBER;\r\nNUMBER OF PIECES, WEIGHT AND VOLUME;\r\nSHIPPER AND CONSIGNEE;\r\nFLIGHT NUMBERS AND DATE OF ARRIVAL;\r\nDESCRIPTION OF THE GOODS.', 'e-mail: Ocean@kds-cargo.com\r\nFax:    +31 20 4467105\r\nPlease e-mail or fax copies of all documents related to your consignment including following information:\r\n\r\nMB/L NUMBER;\r\nHB/L NUMBER;\r\nCONTAINER NUMBER;\r\nNUMBER OF PIECES, WEIGHT AND VOLUME;\r\nSHIPPER AND CONSIGNEE;\r\nVESSAL NAME AND DATE OF ARRIVAL;\r\nDESCRIPTION OF THE GOODS.', 'Fully licenced by Dutch Customs Authorities.\r\nImport, Export and Transit declarations are done  through a direct EDI link with Customs and is operated out of our own bonded warehouse.', '', 'No Special Instructions. As commonly practiced.', 'As per current IATA Dangerous Goods Regulations.', ''),
(102, '25', '', 'shipping instructions pending', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(103, '59', '2', 'For Back to Back Shipments :\r\nA. In presence of Agency Agreement (It is a contract signed and agreed between NK & Agents from different countries) \r\nAll MAWBs will be PREPAID and freight Charges will be collected according to HAWB at our end from the consignee, if applicable.\r\nAll MAWBs should be consigned to Naqeeb & Khattar Co. P.O.Box.26907 Safat, 13130 Kuwait, Tel : 965 484 6009, Fax : 965 484 4620. \r\nThe Description of cargo should be mentioned under column (Nature & Quantity of Goods) on all MAWBs, but no word \"CONSOLIDATION\" should appear on the MAWB. \r\nAll documents should match each other in all respect viz no.of packages/G.wt/N.wt with the MAWB. \r\nAs per Kuwaiti Customs regulations any correction or overwriting in the MAWB will not be accepted unless and until we receive a correction telex from the origin.\r\nB. In Absence of Agency Agreement:\r\nAll the points are the same as per above except the following:\r\nMAWB should be consigned to Consignee\'s name directly C/o Naqeeb & Khattar Co., P.O.Box. 26907 Safat, 13130 Kuwait, Tel: 965 484 6009, Fax: 965 484 4620 to enable us collect the delivery order and release it to the c/nee after collecting any charges on Freight or COD cheque for the supplier etc..\r\nFor Consolidated Shipments (Consolidation) :\r\nA. In presence of Agency Agreement:\r\nFinally Civil Aviation in Kuwait have approved accepting air consolidation shipments into Kuwait effective from 1st of February 2001. Please note that as per the Civil Aviation & Customs, the following instructions have to be followed by all the agents abroad for accepting consolidated shipments into Kuwait. \r\nOriginal HAWBs i.e 1 inside the pouch & 1 along with MAWB outside the pouch showing \"As Agreed\"\r\nOriginal Console manifest to be attached to MAWB outside the pouch & copy inside the pouch. \r\nMAWB to mention \"Consolidation\" as per attached manifest on the Nature of goods column. \r\nShipments under L/C the HAWB to be consigned as follows \"Goods Dispatched to Consignee name………address……..mentioning the L/C Number\r\nB. In absence of Agency Agreement :\r\nAs per the Kuwaiti Customs Rules & Regulations you cannot effect consolidated shipment until you have an Agency Agreement. ', 'The Master Bill Of Lading should mention all the following details: \r\n· SHIPPER\'S NAME & ADDRESS\r\n· CONSIGNEE\'S NAME & ADDRESS TO READ AS:\r\n     NAQEEB & KHATTAR Co.\r\n     P.O. BOX 26907, SAFAT 13130\r\n     KUWAIT \r\n     TEL: 00 965 48 46 009 \r\n     FAX: 00 965 48 44 620\r\n· NOTIFY PARTY\'S : SAME AS CONSIGNEE \r\n· BILL OF LADING #\r\n· M/VESSEL NAME & VOYAGE No.\r\n· PORT OF LOADING\r\n· MARKS & NUMBERS \r\n· CONTAINER & SEAL NUMBER \r\n· NUMBER & KIND OF PACKAGES\r\n· DESCRIPTION OF GOODS\r\n· GROSS WEIGHT \r\n· TARE WEIGHT\r\n· MEASUREMENT (CBM)\r\n· FREIGHT PRE PAID\r\n· PLACE & DATE OF ISSUE\r\nAll the documents related to the shipment should match each other in all respect viz. No: of packages, Gross Weight & measurement. \r\nAs per Kuwaiti Customs rules & regulations, any correction or over writing in the Master Bill of Lading will not be accepted until we receive a correction letter from the respective shipping line at origin. ', 'For Back to Back shipments :\r\n1.HAWB should be consigned to the consignee mentioning CC or PP charges \r\n2.HAWB should mention if any COD cheques to be collected before releasing the Delivery Order to the consignee to enable us collect the same. \r\nFor Consolidated shipments (Consolidation) : \r\n1. Original HAWBs i.e 1 set inside the pouch & 1 along with MAWB outside the pouch showing \"As Agreed\"\r\n2. Shipments under L/C the HAWB to be consigned as follows \"Goods Dispatched to Consignee name ……..address………..mentioning the L/C number.. ', 'All Original Documents should be received 72 hours prior to vessel arrival at designated port in Kuwait. \r\nFor L/C\'s we should have full set of copies by fax, 72 hrs prior to vessel arrival. \r\n1. In case of L/C , pls. specify Bank\'s full name. \r\n2. In case of COD ( cash on delivery) , pls. mention your instructions for COD shipment clearly in the house mentioning the amount & currency to be collected. \r\n3. In case of CAD ( cash against delivery) through Bank, pls. mention clear instructions for freight & other charges to be collected from final consignee. \r\n* The House Bill of Lading, should mention the following details:\r\n· EXPORTERS / SUPPLIERS COMPLETE NAME & ADDRESS\r\n· FINAL CONSIGNEE\'S NAME & ADDRESS \r\n· NOTIFY PARTY\'S COMPLETE NAME & ADDRESS\r\n· OTHER DETAILS SAME AS IN M B/L ', 'The Cargo Manifest in general should mention the following information: \r\nFrom : \r\nTo : \r\nMAWB #\r\nAirline\r\nFlight # and Dtd\r\nDeparture Airport\r\nArrival Airport\r\nDate \r\nFile Ref # \r\n_____________________________________________________________________ HAWB #, Shipper, C/nee, Destination, Pgks, G.Wt, Goods, CC \r\nIn case of Consolidation manifest the HAWB # will continue so far as how much so every shipments you have. ', 'The Cargo Manifest in general should mention the following information: \r\nFROM \r\nTO \r\nB/L No. \r\nVESSEL NAME \r\nCONTAINER No.\r\nETD \r\nETA \r\nH B/L No. , SHIPPER , CONSIGNEE, GROSS WEIGHT, VOLUME, PKG., TYPE, COMMODITY, MARKS, FREIGHT PREPAID/ COLLECT.', 'Master MAWB should be consigned to Enkay Express, showing freight terms: pre-paid \r\nOriginal documents, namely Invoice, packing list and COO a must, for clearance.', 'Master B/L should be consigned to Enkay Express, showing freight terms: pre-paid \r\nOriginal documents, namely Invoice, packing list and COO a must, for clearance.', 'HAWB to be consigned to final receiver, showing freight terms, collect, details of amount \r\nCopy of Invoice, packing list and COO to accompany the shipment.', 'HB/L to be consigned to final receiver, showing freight terms, collect, details of amount \r\nCopy of Invoice, packing list and COO to accompany the shipment.', 'Always pre-alert to be received prior to shipment arrival, indicating B/L or AWB / flight details, ETA, number of packages, shipper consignee, DGR, special handling, if any.\r\nPre-Alert should be advised prior to the shipment along with a copy of MAWB & HAWB for the following reasons : \r\n1. To check whether the shipment has been consigned as per the above instructions and if not to revert back to the agent 2. Pre-Alert is required for insurance purpose prior to shipment arrival. ', 'Always pre-alert to be received prior to shipment arrival, indicating B/L or AWB / flight details, ETA, number of packages, shipper consignee, DGR, special handling, if any.\r\nPre-Alert should be advised prior to the shipment along with a copy of MB/L & H B/L for the following reasons: \r\n1. To check whether the shipment has been consigned as per the above instructions or not to revert back to the agent.\r\n2. Pre-Alert is required for insurance purpose prior to shipment arrival.', 'Here again if you define shipper as an Agent, Yes we can custom clear the shipment in either case : \r\ni) In presence of Agency Agreement \r\nii) In absence of Agency Agreement \r\nProvided all the documents required as below accompanies the shipment.\r\n· Original Commercial Invoice duly attested from Chamber of Commerce\r\n· Certificate of Origin duly attested from Chamber of Commerce \r\n· Packing List\r\nImportant: It is not allowed to custom clear or import from any Israeli shipper\'s product. ', 'Transshipments are not allowed into Kuwait. ', 'AIR:\r\nCertificate of Origin (need to be attested from the chamber of commerce or legalised from the Kuwaiti Consulate) as per the agreement between the c/nee and the supplier. \r\nCommercial Invoice (need to be attested from the chamber of commerce or legalised from the Kuwaiti Consulate) as per the agreement between the c/nee and the supplier. The Invoice should mention the Currency of value mentioned. \r\nPacking list \r\nOCEAN:\r\nC/O should show manufacturer\'s name & address & country of origin. ( needs to be attested from the Chamber Of Commerce or legalized from the Kuwait Consulate) \r\nIncase of L/C , it shall be authenticated from Kuwaiti Consulate. \r\nCommercial invoice ( needs to be attested from the Chamber Of Commerce )\r\nThe invoice should mention the following:\r\n- Currency of Value \r\n- Gross Weight\r\n- Net weight\r\n- No. of packages (it should tally with M B/L)\r\n- Unit Price and total Value\r\nPacking List ', 'AIR - It is as per the TACT rules….. No special requirements. \r\nOCEAN - As per IMCO Rules & Regulations, it should be shown on the M B/L & H B/L. ', ''),
(104, '59', '1', 'The MAWB must be consigned to ENKAY EXPRESS BAHRAIN, \r\nP O BOX 10642, BAHRAIN.\r\nFreight should be on PP Basis ', 'The MBL must be consigned to ENKAY EXPRESS BAHRAIN, \r\nP O BOX 10642, BAHRAIN.\r\nFreight should be on PP Basis \r\n', 'HAWB should be consigned to the actual consignee showing mode of freight: PP or CC.\r\n', 'HBL should be consigned to the actual consignee showing mode of freight: PP or CC.\r\n', 'Consolidation Manifest should be made as per the shipper/consignee weight, volume and pieces of the shipment\'s detail. \r\n', 'Consolidation Manifest should be made as per the shipper/consignee weight, volume and pieces of the shipment\'s detail.\r\n', 'Master MAWB should be consigned to Enkay Express, showing freight terms: Pre-paid \r\nOriginal documents, namely Shipper Invoice and Packing List a must, for clearance.\r\nOther services required at Destination should be mentioned i.e. Customs Clearance/Delivery \r\n', 'Master B/L should be consigned to Enkay Express, showing freight terms: Pre-paid \r\nOriginal documents, namely Shipper Invoice and Packing List a must, for clearance.\r\nOther services required at Destination should be mentioned i.e. Customs Clearance/Delivery ', 'HAWB to be consigned to final receiver, showing freight terms, collect, details of amount \r\nOriginal Shipper\'s Invoice and packing list to accompany the shipment.\r\nPre-Alert should be sent to us as soon as the shipment is booked or MAWB has been prepared with all details. Copy of MAWB/HAWB/ should be faxed/emailed prior to shipment arrival. Airfreight shipment on Freight collect - Two sets of HAWB should be prepared. One set of \"\"AS AGREED\"\" for customs clearance purpose and Second set \"\"As per selling rate\"\" for consignee and both sets of HAWB must be sent with the MAWB. ', 'HB/L to be consigned to final receiver, showing freight terms, collect, details of amount \r\nOriginal Shipper Invoice and Packing list to accompany the shipment.\r\nPre-Alert should be sent to us once the shipment is booked or MBL has been made with all details. Copy of MBL/HBL should be faxed prior to shipment arrival. ', 'Always pre-alert to be received prior to shipment arrival, indicating AWB / flight details, ETA, number of packages, shipper consignee, DGR, special handling, if any.\r\nPre-Alert should be sent to us as soon as shipment is booked or MAWB has been prepared with all details. Copy of MAWB/HAWB/should be faxed immediately. For Airfreight shipments on Freight collect two sets of HAWB should be made. One set \"\"AS AGREED\"\" for customs clearance purpose and Second set \"\"As per selling rate\"\" for consignee and both sets of HAWB must be sent with the MAWB. \r\nOriginal shipper\'s invoice/packing list must be sent with the MAWB & HAWB.Shipment cannot be cleared in the absence of these documents.\r\n', 'Always pre-alert to be received prior to shipment arrival, indicating B/L ,Vessel Details, ETA, number of packages, shipper consignee, DGR, special handling, if any.\r\nPre-Alert should be sent to us as soon as shipment booked or MBL has been made with all details. Copy of MBL/HBL should be faxed immediately. \r\nOriginal shipper\'s invoice/packing list must be sent with the MBL & HBL .Shipment cannot be cleared in the absence of these documents.', 'We can provide Customs Clearance services for both air and sea freight shipments on behalf of the consignee. The consignee should have a valid commercial registration certificate with the activitiy allowing him to import the required cargo.', 'If the shipment in under an L/C (Letter of Credit) Certificate of origin is required and it should be legalized by Chamber of Commerce and any Arab consulate. ', 'On the Shipper\'s Invoice and packing list the manufacturer details and origin of goods must be mentioned. ', 'Dangerous goods as per IATA or shipping lines regulation.', ''),
