(134, '299', '2', 'ANC CO., LTD - Ha Noi Branch \r\nR#1 , B6-19 - Lotus 03  , Vinhome Gardenia , Ham Nghi Street , Cau Dien Ward  , Nam Tu Liem , Ha Noi Viet Nam ', 'NIL | No seaport in Ha Noi ', ' import3@ancshipping.com.vn ; import2@ancshipping.com.vn ; yang@ancshipping.com.vn', 'NIL | No seaport in Ha Noi ', 'As normal ', 'NIL | No seaport in Ha Noi ', ' ANC CO., LTD - Ha Noi Branch \r\nR#1 , B6-19 - Lotus 03  , Vinhome Gardenia , Ham Nghi Street , Cau Dien Ward  , Nam Tu Liem , Ha Noi Viet Nam ', 'NIL | No seaport in Ha Noi ', ' Delivery agent :\r\nANC CO., LTD - Ha Noi Branch \r\nR#1 , B6-19 - Lotus 03  , Vinhome Gardenia , Ham Nghi Street , Cau Dien Ward  , Nam Tu Liem , Ha Noi Viet Nam  Tel / Fax : + 84 4 37932327   / +84 4 37932326', 'NIL | No seaport in Ha Noi ', 'Pre-alert should  be sent to us at least 3 office hours  before the flight   arrive for air freight and 24 hours before ETA for sea freight   for manifest submiting .', 'NIL | No seaport in Ha Noi  ', ' Consignee name must be full information : name , address, phone ; commodity name must be same as commercial invoice ; ', ' ', ' ', 'Surcharge for DG will be applied depends on UN Code .', '  With Air shipment  please make sure all cartons have House Label . The fine for lack of House Label is 5 USD / Carton, min 45 USD / shipment  .'),
