INSERT INTO `rss_control` (`URL`, `Time`, `Data`) VALUES
('http://feeds.feedburner.com/lm/rss/recentlyfiled?format=XML', 1500573321, '<p><a href=http://www.logisticsmgmt.com/article/federal_maritime_commission_now_evaluating_transpacific_carrier_agreements target=_whole><b><i>Federal Maritime Commission now evaluating Transpacific carrier agreements</a></i></b><br>Two agreements related to the west coast and trade flows between the United States and Asia were addressed today by the Federal Maritime Commission during a regularly scheduled meeting, as were recent developments regarding government linked ocean carriers.<br>Thursday, July 20th, 2017<p><p><a href=http://www.logisticsmgmt.com/article/kuebix_partnership_with_simpliship_may_create_new_opportunities_shippers_go target=_whole><b><i>Kuebix partnership with SimpliShip may create new opportunities for shippers ?going global?</a></i></b><br>Kuebix, creator of a transportation management systems (TMS) providing shipping intelligence, recently partnered with SimpliShip International Freight Rate API to manage all freight modes and providers on one cloud-based platform.<br>Thursday, July 20th, 2017<p><p><a href=http://www.logisticsmgmt.com/article/ata_forecast_report_points_to_continued_future_freight_growth target=_whole><b><i>ATA forecast report points to continued future freight growth</a></i></b><br>Continued growth appears to be the main thesis looking out over the next decade for the freight transportation market, according to the American Trucking Associations (ATA) ATA Freight Transportation Forecast 2017, which was released today.<br>Thursday, July 20th, 2017<p><p><a href=http://www.logisticsmgmt.com/article/prospects_for_peak_season_appear_to_be_cautiously_optimistic target=_whole><b><i>Prospects for Peak Season appear to be cautiously optimistic</a></i></b><br>When examining prospects for the 2017 Peak Season, it is apparent many factors come into play in order to assess what may or may not happen. As is always the case, there are multiple economic factors that come into play. And, like in past years, these indicators are somewhat of a mixed bag, including sluggish GDP, decent job growth, flattish retail sales, and lower inventory levels compared to a year ago, among others.<br>Thursday, July 20th, 2017<p><p><a href=http://www.logisticsmgmt.com/article/asiainspection_report_supplier_audits_remain_essential target=_whole><b><i>AsiaInspection Report: Supplier audits remain essential</a></i></b><br>AsiaInspection (AI), a global provider of quality control services for businesses importing from the Pacific Rim, maintains that logistics managers should pay more attention to risk?irrespective of region.<br>Thursday, July 20th, 2017<p>'),
('http://www.aircargonews.net/rss.xml', 1500573323, '<p><a href=http://www.aircargonews.net/news/airline/single-view/news/cobalt-air-appoints-aia-cargo-as-worldwide-gsa.html target=_whole><b><i>Cobalt Air appoints AIA Cargo as worldwide GSA</a></i></b><br>Cyrpus-based airline Cobalt Air has appointed Airbridge International Agencies (AIA Cargo) as its worldwide cargo general sales agent (GSA). \nA spokesperson for the low cost carrier said: \"The appointment marks another positive milestone in the development of Cobalt Air,...<br>Thursday, July 20th, 2017<p><p><a href=http://www.aircargonews.net/news/airline/express/single-view/news/timematters-expands-flight-network-to-birmingham-and-dublin.html target=_whole><b><i>time:matters expands flight network to Birmingham and Dublin</a></i></b><br>Time-critical logistics provider time:matters has expanded its flight network for spare parts logistics from Karlsruhe/Baden-Baden in southern Germany to Birmingham and Dublin on weekdays. \nThe new routes extend the current network to the UK and Ireland, which have been served by flights from...<br>Thursday, July 20th, 2017<p><p><a href=http://www.aircargonews.net/news/airports/ground-handlers/single-view/news/swissport-netherlands-awarded-ceiv-pharma.html target=_whole><b><i>Swissport Netherlands awarded CEIV Pharma</a></i></b><br>Swissport International\'s Netherlands subsidiary has gained IATA\'s CEIV certificate for pharmaceutical logistics at (CEIV Pharma) Amsterdam\'s Schiphol airport.\nCEIV Pharma certification for the ground and air cargo services provider in the Netherlands will increase its contribution...<br>Thursday, July 20th, 2017<p><p><a href=http://www.aircargonews.net/news/airline/single-view/news/new-tax-could-hit-indian-airfreight-exports.html target=_whole><b><i>New tax could hit Indian airfreight exports</a></i></b><br>An Indian trade organisation has warned that a proposed tax on airfreight exports will stifle growth in the country?s air cargo sector, while it has also called for investment in the sector.\nAt its annual Air Cargo Summit, PHD Chamber of Commerce and Industry warned that moves to include...<br>Thursday, July 20th, 2017<p><p><a href=http://www.aircargonews.net/news/people/single-view/news/bifa-elects-new-national-chairman.html target=_whole><b><i>BIFA elects new national chairman</a></i></b><br>Mark Bromley has succeeded Fred Osborn as the elected national chairman of UK freight forwarder group BIFA for a two-year period. \nOsborn becomes immediate vice-chairman for a two-year term. Alongside him is John Stubbings, group director and company Secretary of the Woodland group who was elected...<br>Thursday, July 20th, 2017<p><p><a href=http://www.aircargonews.net/news/freight-forwarder/single-view/news/freight-forwarder-panalpina-expects-continuing-airfreight-margin-pressure.html target=_whole><b><i>Freight forwarder Panalpina expects continuing airfreight margin pressure</a></i></b><br>Freight forwarder Panalpina will concentrate on controlling costs after its airfreight business faced continued margin pressure on higher airfreight demand.\nThe Switzerland-headquartered logistics giant saw second-quarter airfreight revenues increase by 10% year on year to Sfr700m on the back of a...<br>Thursday, July 20th, 2017<p><p><a href=http://www.aircargonews.net/news/airline/single-view/news/delta-cargo-appoints-eric-anderson-as-asia-pacific-sales-director.html target=_whole><b><i>Delta Cargo appoints Eric Anderson as Asia Pacific sales director </a></i></b><br>Delta Air Lines Cargo has appointed Eric Anderson as director, cargo sales for the Asia-Pacific region, effective August 1.\nAnderson, who will be based in Tokyo, assumes the role previously held by Eric Wilson, recently promoted to managing director, global cargo sales.\nAnderson will lead...<br>Thursday, July 20th, 2017<p>');
