(143, '331', '1', 'Please consign air shpt to DLC as below: \r\n\r\nHarmony International Forwarding (Dalian) Ltd.\r\nRoom 1105,  Dalian Asia Pacific Finance Centre 55 Ren Min Road,Dalian China.116001\r\nTel£º(0086)411-82535886-809\r\nFax£º(0086)411-82535887\r\n', 'Please consign ocean shpt to Dalian port as below: \r\n\r\nHarmony International Forwarding (Dalian) Ltd.\r\nRoom 1105,  Dalian Asia Pacific Finance Centre 55 Ren Min Road,Dalian China.116001\r\nTel£º(0086)411-82535886-809\r\nFax£º(0086)411-82535887\r\n', 'Please indicate the full contact details of the consignee on HAWB. ', 'Please indicate the full contact details of the consignee on HB/L. ', '', '', '', '', '', '', 'Please send your pre-alert of air shpt to: \r\nCandy_liu@harmony.com.cn\r\nCopy to : bonnie_yang@harmony.com.cn\r\n          ricky_wang@harmony.com.cn', 'Please send your pre-alert of ocean shpt to: \r\nzhouxue@harmony.com.cn\r\nCopy to : bonnie_yang@harmony.com.cn\r\n          ricky_wang@harmony.com.cn', '', '', 'Please always attached the commercial invoice and packing list with the pre-alert', 'Case by case, Please provide the shpt details. ', 'If the goods packed in wood, it must have IPPC mards at the opposite sides of the package.'),
(212, '299', '4', 'ANC CO.,LTD - Da Nang Branch\r\n39 Le Dinh Tham Street, Hai Chau Dist., Da Nang city , Viet Nam \r\nEmail : import1@ancshipping.com', 'ANC CO.,LTD - Da Nang Branch\r\n39 Le Dinh Tham Street, Hai Chau Dist., Da Nang city , Viet Nam \r\nEmail : import1@ancshipping.com', 'ANC CO.,LTD - Da Nang Branch\r\n39 Le Dinh Tham Street, Hai Chau Dist., Da Nang city , Viet Nam \r\nEmail : import1@ancshipping.com', 'ANC CO.,LTD - Da Nang Branch\r\n39 Le Dinh Tham Street, Hai Chau Dist., Da Nang city , Viet Nam \r\nEmail : import1@ancshipping.com', 'As standard ', ' As standard ', 'QTY, G.W, CBM ON MAWB MUST EQUAL TO  TOTAL QTY, G.W, CBM OF ALL HAWBS ', ' QTY, G.W, CBM ON MBL MUST EQUAL TO  TOTAL QTY, G.W, CBM OF ALL HBLs', ' ', ' ', 'SCAN OR  FAX US ALL DOCS RELATED TO THAT SHPT ( HAWB, MAWB, CARGO MANIFEST, COMMERCIAL INVOICE, PACKING LIST , CREDIT NOTE, DEBIT NOTE, ETC...) NOT LATER THAN 1 DAY BEFORE THE ARIVAL DATE.\r\nALL PRE-ALERTS OF SHIPMENTS TO VIET NAM ( HO CHI MINH ,DA NANG, HA NOI ... ) MUST BE SENT TO OUR HEAD OFFICE IN HO CHI MINH CITY import1@ancshipping.com , import2@ancshipping.com or yang@ancshipping.com OR  FAX # 84-8-8115048 .', 'SCAN OR  FAX US ALL DOCS RELATED TO THAT SHPT ( HBl, MBl, CARGO MANIFEST (IF ANY),CREDIT NOTE, DEBIT NOTE, ETC...) NOT LATER THAN 1 DAY BEFORE THE ARIVAL DATE.\r\nALL PRE-ALERTS OF SHIPMENTS TO VIET NAM ( HO CHI MINH ,DA NANG, HA NOI, HAI PHONG  ... ) MUST BE SENT TO OUR HEAD OFFICE IN HO CHI MINH CITY import1@ancshipping.com , import2@ancshipping.com or yang@ancshipping.com OR  FAX # 84-8-8115048 .', ' ALL DOCS RELATED TO THAT SHPT (HOUSE BILL, MASTER BILL, SALES CONTRACT, COMMERCIAL INVOICE, PACKING LIST, HEALTH CERTIFICATE, CERTIFICATE OF ANALYSIS, C/O, ETC...) SHOULD BE SCANNED TO US FIRST AND LATER SENT ORIGINAL DOCS TO US .', ' ', 'ALL DETAILS : SHIPPER\'S NAME , CONSIGNEE\'S NAME , DESCRIPTION OF GOODS , QUANTITY , GROSS WEIGHT, MEASUREMENT,... SHOWN ON HAWB , HB/L COMMERCIAL INVOICE , PACKING LIST , CERTIFICATE OF ORIGIN MUST BE THE SAME. ORIGINAL INVOICE , PACKING LIST ,... MUST BE SIGNED AND STAMPED.', '  MUST ASK FOR OUR CONFIRMATION BEFORE LOADING THE DG CARGO. PLS BE ADVISED THAT THERE WILL BE SOME ADDITIONAL CHARGES OCCURRED. ALSO PLS SHOW IT ON CARGO MANIFEST & HB/L OR HAWB', ' 1.FOR BOTH AIR FREIGHT & SEA FREIGHT :\r\nAFTER ARRIVAL DATE, ANY ADJUSTMENT OF CARGO MANIFEST/HAWB WILL BE AGAINST THE CUSTOMS FINE OF USD 80.00 PER CASE.\r\nTHE AMENDMENT WILL BE CARRIED OUT AFTER WE RECEIVE YOUR CONFIRMATION OF THE FINE BEARER AND THE REVISED DOCUMENTS.\r\n2. FOR AIR FREIGHT :\r\n*EACH CASE OF LACK OF LABEL WILL BE AGAINST THE FINE OF USD 45.00 PER LACKED LABEL.\r\n*YOU MUST ISSUE MANIFEST EVEN FOR BACK TO BACK SHIPMENT.EACH CASE OF LACK OF CARGO MANIFEST WILL BE AGAINST THE FINE OF USD 80.00 PER SHIPMENT. \r\n3. SEA FREIGHT :\r\nEACH CASE OF LACK OF CONSOLIDATION CARGO MANIFEST WILL BE AGAINST THE FINE OF USD 80.00 PER SHIPMENT. \r\n\r\nALL FINE OCCURRED WILL BE INVOICED TO YOU.'),
