(218, '254', '1', 'AEROSERVICIOS LOGISTICS CORP\r\nCOLON FREE ZONE  COLON REP OF PANAMA \r\nPHONE (507) 4414884 / 4414196\r\nATTN MELISSA SOTTO\r\n ', 'AEROSERVICIOS LOGISTICS CORP\r\nCOLON FREE ZONE\r\nCOLON REP OF PANAMA\r\nPHONE (507) 441 4884 / 4445 3755\r\nATTN MELISSA SOTO \r\nEmail  trafico@aeroserviciossa.com  ', 'HAWB must indicate consignee\'s name, full address, phone number and contact. Consignee\'s address must correctly indicate site of ultimate destination of shipment. Amending errors result in high extra charges and serious delays.\r\nMust show Colon Free Zone on consignee address', 'HBL must indicate consignee\'s name, full address, phone number and contact. Consignee\'s address must correctly indicate site of ultimate destination of shipment. Amending errors result in high extra charges and serious delays.\r\n\r\nMUST SHOW COLON FREE ZONE ON CONSIGNEE ADDRESS', 'BASIC INFORMATION\r\nAGENTS NAME AND ADDRESS\r\nMAWB NO,\r\nHAWB NO,\r\nCONSIGNEE S NAME AND ADDRESS\r\nAIRLINE\r\nNUMBER OF PIECES, WEIGHT, VOLUMEN IF APPLY, DESCRIPTION\r\n', ' BASIC INFORMATION\r\nAGENT\'S NAME / ADDRESS\r\nMBL NO\r\nHBL NO\r\nCONSIGNEE s NAME AND ADDRESS\r\nSHIPPING LINE\r\nNUMBER OF CONTAINERS, SEALS, \r\nDESCRIPTION  ', ' ', ' ', ' ', ' ', 'SHIPPING DOCS \r\nETD AND ETA\r\nFREIGHT TERMS', 'SHIPPING DOCUMENTS\r\nETD AND ETA\r\nFREIGHT TERMS', ' Necessary copy of Shipping Documents \r\nCommercial Invoice \r\nand Terms', 'Must show In Transit on Consignee address and\r\nHandling Information', ' ', 'PREALERT AND COPY OF DG DECLARATION', ' TO AVOID DUTY AND TAXES WHEN CONSIGNEE IS LOCATED AT COLON FREE ZONE IS IMPORTANT TO SHOW\r\nCOLON FREE ZONE AS ADDRESS.'),
(29, '59', '0', 'The MAWB must be consigned Al Rai Logistica ksc, Kuwait', 'The Master B/L must be consigned Enkay Express, Kuwait \r\nDischarge Port of Preference: Shuwaikh ', 'The HAWB must be consigned to the Final Receiver', 'The HB/L must be consigned be consigned to the Final Receiver', 'Master AWB will be consigned to Enkay Express \r\nSeveral HAWB to correspond to the MAWB \r\nNumber of packages / weight volume of all Houses should total and be equal to the details on MAWB \r\nEach consolidation manifest to show shipper / actual consignee / number of packages / net and gross weight / DGR etc / freight terms, collect or pre-paid.', 'Master B/L will be consigned to Enkay Express \r\nSeveral HB/L to correspond to the MB/L \r\nNumber of packages / weight volume of all Houses should total and be equal to the details on MB/L \r\nEach consolidation manifest to show shipper / actual consignee / number of packages / net and gross weight / DGR etc / freight terms, collect or pre-paid.', 'Master MAWB should be consigned to Enkay Express, showing freight terms: pre-paid \r\nOriginal documents, namely Invoice, Packing list is a must, for Customs Clearance.', 'Master B/L should be consigned to Enkay Express, showing freight terms: Pre-paid \r\nOriginal documents, namely Invoice, packing list and COO a must, for clearance.', 'HAWB to be consigned to final receiver, showing freight terms, collect, details of amount \r\nOriginal HAWB ,Shipper Invoice and packing list  to accompany the shipment.', 'HB/L to be consigned to final receiver, showing freight terms, collect, details of amount \r\nOriginal HBL ,Original Shipper Invoice, Packing list and COO to accompany the shipment.', 'Always pre-alert to be received prior to shipment arrival, indicating B/L or AWB / flight details, ETA, number of packages, shipper consignee, DGR, special handling, if any.', 'Always pre-alert to be received prior to shipment arrival, indicating B/L or AWB / flight details, ETA, number of packages, shipper consignee, DGR, special handling, if any.', 'We provide Customs Clearance for both air and sea freight shipments.', 'Copy of Invoice and packing list to accompany shipment, along AWB / BL instructions from Kuwait to final destination to be advised.', 'For Ocean : Original Invoice / Packing list and Certificate of origin issued by chamber of commerce is a must.\r\nShipper Invoice must reflect HS CODE number of the products.', 'DGR / IMCO class number should be advised on all documents.', ''),
(205, '352', '3', 'Mexico Air Cargo Systems, S.A. de C.V.\r\nLázaro Cárdenas # 3422-101\r\nCol. Chapalita.\r\nGuadalajara, Jal., Mexico, CP 45052\r\nTEL: (5233) 3121-3745, 3121-6346, 3647-3001, \r\nFAX: (5233) 3647-0450, 3121-3468', 'Mexico Air Cargo Systems, S.A. de C.V.\r\nLázaro Cárdenas # 3422-101\r\nCol. Chapalita.\r\nGuadalajara, Jal., Mexico, CP 45052\r\nTEL: (5233) 3121-3745, 3121-6346, 3647-3001, \r\nFAX: (5233) 3647-0450, 3121-3468', '- The actual shipper and actual consignee should be shown on HAWB. \r\n- Cnee\'s full name, full address, telephone, contact & TAX ID (named RFC).\r\n- Shipper\'s full name, full address, telephone, contact & TAX ID (named RFC).', '- The actual shipper and actual consignee should be shown on HAWB. \r\n- Cnee\'s full name, full address, telephone, contact & TAX ID (named RFC).\r\n- Shipper\'s full name, full address, telephone, contact & TAX ID (named RFC).\r\n- \"TO THE ORDER OF\" consignment is not allowed.', '- MAWB number \r\n- HAWB number \r\n- Qty of pieces \r\n- Gross weight (in KG)\r\n- Volume (cbm)\r\n- Shipper\r\n- Consignee \r\n- Nature of goods \r\n- Flight information (ETD & ETA)', '- MB/L number\r\n- HB/L number\r\n- Shipper\r\n- Consignee\r\n- Qty of pieces \r\n- Total Volume (in cbm)\r\n- Gross weight (in KG)', '- Pls apply freight prepaid in ALL cases. \r\n- Pls always show \"CONSOLIDATED AS PER ATTACHED CARGO MANIFEST SHIPMENT\" in \"nature & qty of goods\". \r\n- Pls show in \"handling information\" if goods need any special care (such as temperature, handling, etc). ', '- Pls ask ocean carrier to issue it as Seaway bill or Telex Release, originals are not required. Printed at destination also is not necessary, always to release it under copy terms.\r\n- Originals always delays releasing and might cause demurrages or storages.', '- HAWB can be rated or \"As Agreed\" \r\n- Pls show if freight is prepaid or collect. \r\n- Pls show if charges are prepaid or collect. \r\n- Original #2 (for cnee) must come inside a pouch.\r\n- Credits and debits must be sent inside the consolidation document pouch.', '- HB/L can be rated or \"As Agreed\" \r\n- Express release is allowed by Mexican customs.\r\n- Credits and debits must be sent inside the consolidation document pouch.\r\n- If HB/L is requested by shipper to be issue as original, they most be delivered to shipper as well as all other documents related to shipment.\r\n- If HB/L is requested by shipper to be issue as Telex Release or Surrender, a copy must be provided to shipper and he must sent a copy to copnsignee, since we will require a copy to be duly endorsed in order to release it.\r\n- If HB/L changes from original to Surrender or Telex Release, then a copy with statement of \"Telex Release\" or \"Surrender\" must be provided to MAC as well as shipper, since we will require a copy to be duly endorsed in order to release it.', '- Pre-Alerts should be complete and include a copy of the MAWB, HAWB, commercial invoice and packing list, if available.\r\n- Pre-alert must be sent to aibarra@macargo.com.mx & abarba@macargo.com.mx', '- Pre-Alerts should be complete and include a copy of the MAWB, HAWB, commercial invoice and packing list, if available.\r\n- Pre-alert must be sent to aibarra@macargo.com.mx & abarba@macargo.com.mx', '- Pls be advised that Mexico Air Cargo Systems,  S.A. de C.V. cannot act as importer/exporter of record.\r\n- No foreign company is allowed to be importer/exporter of record.\r\n- A mexican company must be duly registered as importer/exporter and have a valid import license in order clear shipment on their behalf.\r\n- In order to clear shipment, importer/exporter must provide a Customs Power of Attorney in order to submit the entry on their behalf. If a Power of Attorney has been issued to another broker, then the cargo will be turned over to that broker for clearance. \r\n- Importer/Exporter must provide ALL legal documents that proves they are legally established in Mexico, otherwise our customs broker will reject to clear shipment without any law enforcement.', 'Transhipment are not handled by MAC. Mexican Law has too many locks in order to make clearance almost impossible. Expenses will be extrenmely high and also will be extremely delayed at Customs.', '- Original commercial invoices are not required by customs in order to consignee can clear cargo. \r\n- Shipper must always send them to consignee, we are not responsible for any document sent by courier or pouch.\r\n- Certificates are required only when requested by consignee, so they are responsible for approving or issuing documents based on nature of goods.', '- Some DGR goods might not accepted by Mexican Customs or have special requirements, which should be checked in advance by shipper/consignee (before shipping out).\r\n- A copy of the DG Certificate or IMO and/or MSDS sheets must accompany shipments.', '-  ALL pieces for air or ocean shipments must be properly labeled in order to avoid problems/delays and extra expenses.\r\n- DDU/DDP shipments please do not ship out without our approval, pls contact us in advance. If shipment is shipped out without notifying about it and arrabnge all prior to ship, MAC will not be resposible for any extracost or mishandling on it.\r\n- Any quotation approved for DDU/DDP shipment by Agent must be fully paid, more even if quotation is estimated based on information provided or in case of any problem or delay on clearance, pick up, freight or any part of logistics.\r\n- Pls be advsied that Mexican regulation just allows to do payments or receive payment in USD as foreign currency, any other are not recognize and we cannot set up payment on them. Agent is responsible to provide invoice, debite or credit note in USD considering to protect exchange rate good enough in order to prevent any shortage or loss in shipment. Also, bank intermediary fees needs to be considered by Agent and on its account.\r\n- Any Fines or Penalties for mishandling, lack of documents, lack of pre-alert or following, will be on account of Agent. Certanly we will support in order to minimize extra expenses or fines, but definitely on account of Agent.'),
