(30, '71', '0', 'Shipper should be indicated as the foreign forwarder, including their address, city, and country', 'Shipper should be indicated as the foreign forwarder, including their address, city, and country', 'House Bills should be consigned from actual shipper to actual consignee, with the US Broker/forwarder listed as a notify party. ', 'House Bills should be consigned from actual shipper to actual consignee, with the US Broker/forwarder listed as a notify party. ', 'Manifest should be specific and include the following: \r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION', 'Manifest should be specific and include the following: \r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION', '', '', '', '', 'Pre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips', 'Pre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips ', 'We can do customs clearance for any air and ocean shipments. However, a Power of Attorney is required in order to clear Customs for any importer/shipper. If a Power of Attorney has been issued to another broker, then the cargo will be turned over to that broker for clearance. \r\nIMPORTANT NOTE: New security regulations make distinctions between known and unknown shippers. Shipments from unknown shippers ( essentially new clients to your HTFN partner ) are subject to special scrutiny which may delay the air routing by 7 or more days.\r\n\r\nWhen issuing an urgent routing order to your USA HTFN partner, please ask them to advise you if your routing may be subject to such delays so that you may advise your importer accordingly of the options available. ', 'No special requirements ', 'No special requirements ', 'A copy of the HazMat or MSDS sheets must accompany shipments. ', ''),
(126, '318', '0', 'Cairo Freight Systems, freight prepaid, description \"Consolidation as per attached cargo manifest\r\nNo value declared either on Master or on House, (NVD) & The House Label to be stickerd on the cartons having the H & MAWB#s', 'MBL to read our name as conginee, telex release or seaway bill both acceptable', 'Consingee to read as per shippers instructions:\r\nNo Value to be declared either on Master or on House (NVD), (Also to mention NVD in declared value for carriage and NCV in delcared value for customs) & AS AGREED\r\nOnly original 2 for consignee is accepted by customs and it should accompany the pouch sent as well as 2 extra carbonised copies', 'HBL as per shippers instructions', '', 'In case of ocean consolidation must show on MBL \"CONSOLIDATED CARGO TO BE DISTRIBUTED TO FINAL RECEIVERS BY CAIRO FREIGHT SYSTEMS.\"', '', '', '', '', '', '', '', '', '', '', ''),
(127, '320', '0', 'Translink Freight Services \r\nP.O.BOX 2468 Amman 11181 Jordan\r\nGardens St,Subhi Ghanmeh Bldg, 4th Floor \r\nTel : 009626-5659602/03\r\nFax : 009626-5659604\r\n', 'Translink Freight Services \r\nP.O.BOX 2468 Amman 11181 Jordan\r\nGardens St,Subhi Ghanmeh Bldg, 4th Floor \r\nTel : 009626-5659602/03\r\nFax : 009626-5659604\r\n', 'Per the Supplier Invoices , \r\nIn Case there a L/C , we follow the L/C Instructions ', 'Per the Supplier Invoices , \r\nIn Case there a L/C , we follow the L/C Instructions ', 'Yes ', 'Yes', 'If Required we inform Case by Case ', 'If Required we inform Case by Case ', 'If Requir we inform Case by Case ', 'If Requir we inform Case by Case ', 'We Inform Case by Case ', 'We Inform Case by Case ', 'We Inform Case by Case ', 'Mention in Transit on MAWB & HAWB as Final Dest ( On Handling Information Section )', 'We Inform Case by Case', 'We must be informed 48 Hours before', 'NO'),
(136, '299', '1', 'NO INTERNATIONAL AIPORT IN HAI PHONG, SEA PORT ONLY.THE NEAREST INT\'L AIRPORT IS HA NOI (HAN)', 'SHIPPER: YOUR COMPANY\'S NAME\r\nADDRESS: YOUR COMPANY\'S ADDRESS\r\nTEL/FAX:YOUR TEL/FAX NOS.\r\nEMAIL: YOUR EMAIL ADDRESS (IF ANY)\r\n\r\nCONSIGNEE: ANC CO.,LTD - Hai Phong  Branch \r\nR#516B,  TD Business Center Building , Le Hong Phong  Street, Ngo Quyen  District , Hai Phong City, Viet Nam \r\nTel:  84 2253979221 | import3@ancshipping.com.vn ; import2@ancshipping.com.vn ; yang@ancshipping.com.vn', 'NO INTERNATIONAL AIPORT IN HAI PHONG, SEA PORT ONLY.THE NEAREST INT\'L AIRPORT IS HA NOI (HAN)', 'SHIPPER: SHIPPER\'S NAME\r\nADDRESS: SHIPPER\'S ADDRESS\r\nTEL/FAX: SHIPPER\'S TEL/FAX NOS.\r\n\r\nCONSIGNEE: CONSIGNEE\'S NAME\r\nADDRESS: CONSIGNEE\'S ADDRESS\r\nTEL/FAX: CONSIGNEE\'S TEL/FAX NOS.\r\n\r\nDELIVERY AGENT: ANC CO.,LTD - Hai Phong  Branch \r\nR#516B,  TD Business Center Building , Le Hong Phong  Street, Ngo Quyen  District , Hai Phong City, Viet Nam \r\nTel:  84 2253979221 | import3@ancshipping.com.vn ; import2@ancshipping.com.vn ; yang@ancshipping.com.vn', 'NO INTERNATIONAL AIPORT IN HAI PHONG, SEA PORT ONLY.THE NEAREST INT\'L AIRPORT IS HA NOI (HAN)', 'MASTER BILL OF LADING NO.\r\nVESSEL NAME/VOYAGE NO.\r\nCONTAINER/SEAL NOS.\r\nPORT OF LOADING\r\nPORT OF DISCHARGE\r\nCARRIER NAME\r\n----------------------\r\nEACH SHIPMENT:\r\nHOUSE BILL OF LADING NO.\r\nSHIPPER\'S NAME\r\nCONSIGNEE\'S DETAILS\r\nNOTIFY PARTY\r\nQUANTITY OF PACKAGE\r\nSHIPPING MARKS\r\nDESCRIPTION OF GOODS\r\nGROSS WEIGHT\r\nMEASUREMENT \r\nDESTINATION\r\nOCEAN FREIGHT: COLLECT OR PREPAID\r\nORIRGINAL BILL OF LADING OR SURRENDERED/TELEX RELEASE', 'NO INTERNATIONAL AIPORT IN HAI PHONG, SEA PORT ONLY.THE NEAREST INT\'L AIRPORT IS HA NOI (HAN)', 'QUANTITY, GROSS WEIGHT, MEASUREMENT MUST BE EQUAL TO THE TOTAL QUANTITY, GROSS WEIGHT, MEASUREMENT OF ALL HBs/L .\r\nTERM OF DELIVERY: MUST CLEARLY SHOW CY/CY OR CY/CFS OR CFS/CFS OR CFS/CY', 'NO INTERNATIONAL AIPORT IN HAI PHONG, SEA PORT ONLY.THE NEAREST INT\'L AIRPORT IS HA NOI (HAN)', 'MUST CLEARLY SHOW CONSIGNEE\'S FULL DETAILS:\r\n- FULL NAME\r\n- ADRESS\r\n- TEL/FAX NOS.\r\n- PIC (IF ANY)\r\nTERM OF DELIVERY: MUST CLEARLY SHOW CY/CY OR CY/CFS OR CFS/CFS OR CFS/CY', 'NO INTERNATIONAL AIPORT IN HAI PHONG, SEA PORT ONLY.THE NEAREST INT\'L AIRPORT IS HA NOI (HAN)', 'SCAN THEN SEND AS ATTACHED BY EMAIL OR FAX TO US ALL RELATED SHIPPING DOCUMENTS OF THE SHIPMENT (MB/L, HBs/L, CARGO MANIFEST, CREDIT/DEBIT NOTEs, ETC.,..)\r\nALL SAID DOCUMENTS MUST BE SENT TO US NOT LATER THAN 2 DAYS BEFORE THE ARRIVAL DATE.\r\nALL PRE-ALERTS OF SHIPMENTS TO BOTH HO CHI MINH CITY AND HAI PHONG (HPH) PORTS MUST BE SENT TO OUR HEAD OFFICE IN HO CHI MINH CITY (IF YOU DO NOT KNOW WHO IS IN CHARGE PLEASE SEND SHIPPING DOCUMENTS TO: yang@ancshipping.com.vn  or   lisa@ancshipping.com.vn', 'FOR SHIPMENTS WHICH REQUEST CUSTOMS CLEARANCE AT DESTINATION, PLEASE SCAN ALL RELATED DOCUMENTS (MASTER/HOUSE BILLS OF LADING, SALES CONTRACT, COMMERCIAL INVOICE, PACKINGLIST, HEALTH CERTIFICATE OF ANALYSIS (IF ANY), CERTIFICATE OF ORIGIN, ETC.,..) THEN SEND THEM TO US FIRST, THE ORIGINAL COPIES SHOULD BE SENT LATER BY COURIER.\r\n', 'PLEASE INFORM US IN PRE-ALERT IF THERE IS ANY REQUIREMENT.', 'ALL DETAILS:SHIPPER\'S NAME, CONSIGNEE\'S NAME, DESCRIPTION OF GOODS, QUANTITY, GROSS WEIGHT, MEASUREMENT, VESSEL,...SHOWN ON HOUSE BILL OF LADING, COMMERCIAL INVOICE, PACKING LIST, CERTIFICATE OF ORIGIN MUST BE THE SAME. BESIDES, ORIGINAL INVOICE, PACKING LIST,...MUST BE SIGNED AND STAMPED BY ISSUER / SHIPPER.', 'MUST ASK FOR OUR CONFIRMATION BEFORE LOADING DANGEROUS GOODS. THERE WILL BE SOME ADDITIONAL CHARGES OCCURRED. ALSO PLEASE SHOW IT ON CARGO MANIFEST, HOUSE BILL OF LADING.', ' Pre-alert should  be sent to us at least 3 office hours  before the flight   arrive for air freight and 24 hours before ETA for sea freight   for manifest submiting .  Any adjustment or supplementary ( any document) after the flight / vessel  arrive will be against the amendment manifest of USD 95.00 per case  in Ho Chi Minh City & Ha Noi ;  220 USD per case in Cai Mep Terminal  ; 150 usd per case for Hai Phong , Da Nang shipment ; 250 usd  per case for Cai Lan shipment .\r\nWith Air shipment  please make sure all cartons have House Label . The fine for lack of House Label is 5 USD / Carton, min 45 USD / shipment  .\r\n\r\nALL FINE OCCURRED WILL BE INVOICED TO YOU.'),
