ST, CREDIT/DEBIT NOTEs, ETC.,...)\r\nALL SAID DOCUMENTS MUST BE SENT TO US NOT LATER THAN 1 DAY BEFORE THE ARRIVAL DATE.\r\nALL PRE-ALERTS OF SHIPMENTS TO BOTH HO CHI MINH CITY(SGN) AND HA NOI(HAN) AIRPORTS MUST BE SENT TO OUR HEAD OFFICE IN HO CHI MINH CITY (IF YOU DO NOT KNOW WHO IS INCHARGE PLEASE SEND SHIPPING DOCUMENTS TO: yang@ancshipping.com.vn or lisa@ancshipping.com.vn', 'SCAN THEN SEND AS ATTACHED BY EMAIL OR FAX TO US ALL RELATED SHIPPING DOCUMENTS OF THE SHIPMENT (MAWB, HAWBs, CARGO MANIFEST, COMMERCIAL INVOICE, PACKING LIST, CREDIT/DEBIT NOTEs, ETC.,...)\r\nALL SAID DOCUMENTS MUST BE SENT TO US NOT LATER THAN 1 DAY BEFORE THE ARRIVAL DATE.\r\nALL PRE-ALERTS OF SHIPMENTS TO BOTH HO CHI MINH CITY(SGN) AND HAI PHONG (HPH) SEAPORTS OR HA NOI (AS DESTINATION) MUST BE SENT TO OUR HEAD OFFICE IN HO CHI MINH CITY (IF YOU DO NOT KNOW WHO IS INCHARGE PLEASE SEND SHIPPING DOCUMENTS TO: yang@ancshipping.com.vn or lisa@ancshipping.com.vn', 'FOR SHIPMENTS WHICH REQUEST CUSTOMS CLEARANCE AT DESTINATION PLEASE SCAN ALL RELATED DOCUMENTS (MAWB/HAWB, SALES CONTRACT, COMMERCIAL INVOICE, PACKING LIST, HEALTH CERTIFICATE, CERTIFICATE OF ANALYSIS, CERTIFICATE OF ORIGIN, ETC.,...) THEN SEND THEM TO US FIRST, THE ORIGINAL COPIES SHOULD BE SENT LATER BY COURIER', 'PLEASE INFORM US IN PRE-ALERT IF THERE IS ANY REQUIREMENT.', 'ALL DETAILS: SHIPPER\'S NAME, CONSIGNEE\'S NAME, DESCRIPTION OF GOODS, QUANTITY, GROSS WEIGHT, MEASUREMENT,...SHOWN ON HAWB ( HB/L), COMMERCIAL INVOICE, PACKING LIST, CERTIFICATE OF ORIGIN MUST BE THE SAME. BESIDES, ORIGINAL INVOICE, PACKING LIST,...MUST BE SIGNED AND STAMPED BY ISSUER / SHIPPER', 'ASK FOR OUR CONFIRMATION BEFORE LOADING THE DG CARGO. PLS BE ADVISED THAT THERE WILL BE SOME ADDITIONAL CHARGES OCCURRED. ALSO PLS SHOW IT ON CARGO MANIFEST & HB/L OR HAWB', 'Pre-alert should  be sent to us at least 3 office hours  before the flight   arrive for air freight and 24 hours before ETA for sea freight   for manifest submiting .  Any adjustment or supplementary ( any document) after the flight / vessel  arrive will be against the amendment manifest of USD 95.00 per case  in Ho Chi Minh City & Ha Noi ;  220 USD per case in Cai Mep Terminal  ; 150 usd per case for Hai Phong , Da Nang shipment ; 250 usd  per case for Cai Lan shipment .\r\n With Air shipment  please make sure all cartons have House Label . The fine for lack of House Label is 5 USD / Carton, min 45 USD / shipment  .\r\nALL FINE OCCURRED WILL BE INVOICED TO YOU.'),
