(34, '238', '0', 'JAMES FORWARDING CORPORATION\r\nJAMES BLDG, 727-15 YEOKSAM-DONG, KANGNAM-KU, \r\nSEOUL, KOREA 135-080\r\nTEL. 822-567-3030, FAX.822-567-9420', 'Consignee : \r\nJames Forwarding Corporation\r\nJames Building, 727-15 Yeoksam-Dong \r\nKangnam-Ku\r\nSeoul 135-080\r\nKorea \r\n( If it\'s for Pusan destination, please also Master consign it to above address )\r\nMaster waybill : Prepaid ', '', 'In case of L/C shipment, do not forget to mark exact the Notified Party\'s name on HAWB. \r\nFreight charge is based on customer\'s price terms. \r\nThe rest : Follow shipper\'s SLI ', 'Manifest should contain: \r\n\r\nMAWB number \r\nHAWB number \r\nShipper name and address \r\nConsignee name and address \r\nPieces \r\nWeight of each HAWB & Total Master \r\nItem descriptions of each shipment ', 'Manifest should contain: \r\n\r\nMB/L number \r\nHB/L number \r\nShipper name and address \r\nConsignee name and address \r\nPieces \r\nWeight of each HB/L & Total Master \r\nItems of each shipment', '', '', '', '', 'Pre-alert has to be sent at least one day before cargo arrival along with copy of HAWB and commercial invoice ', 'Pre-alert has to be sent to us at least one day before cargo arrival along with copy of HB/L and commercial invoice ', 'We can do customs clearance and arrange delivery to the cnee\'s door for any air and ocean shipments. ', 'MAWB: \r\n1. Consignee / James forwarding corp.\r\n2. Destination : ICN \r\n3. Mark \" Transshipment cargo to final destination \" \r\nHAWB : \r\nShow \' Remark - Final destination : name \'\r\nFor air shipment, pre-notice must be advised before cargo arrival for us to assign cargo to T/S warehouse to minimize warehouse charge. \r\n\r\nMB/L :\r\n1. Consignee / James Forwarding Corp.\r\n2. Destination : Final destination of shipment \r\nHB/L : \r\n1. Consignee / Actual end user \r\n2. Destination : Final destination of shipment \r\n3. HB/L, Commercial invoice, Packing list : mark that final destination ', '', '', 'Pre-alert : \r\nIn both air & ocean, Pre-alert in advance is very important here in Korea as most of consignee have their own appointed warehouse, it is the forwarder\'s responsibility to assign correct warehouse via EDI prior to actual cargo arrival. \r\nFor the free-hand cargo :\r\nNeed exact consignee\'s contact point to avoid any delay of notice. \r\nOcean: \r\n1. Destination Incheon port shipment, in case of FCL, Do not make consololidation. Just move 1M/1H ( There is some problem in sending delivery order from line as they only issue one D/O )\r\n2. Do not make mult-consolidation : we always have difficulty in Multi-consolidated shipment'),
(35, '6', '0', 'Master Airwaybill to: Jets Express Services Sdn Bhd \r\nStated port of destination : KUL', 'Shipper should consign Master B/L to: Jets Express Services Sdn Bhd \r\nStated port of destination : Port Kelang, Malaysia ', 'Shipper should consign House Airwaybill to actual consignee.', 'Shipper should consign House B/L to actual consignee.', 'MAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION', 'MB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION', 'Must consign to consignee: Jets Express Services Sdn Bhd ', 'Must consign to consignee: Jets Express Services Sdn Bhd', 'Should consign to actual consignee ', 'Should consign to actual consignee ', 'Must fax Pre-alert before flight arrive destination. Need to include:\r\nManifest \r\nMaster airwaybill \r\nHouse airwaybill \r\nShipper invoice & packing list once available ', 'Must fax Pre-alert before flight arrive destination. Need to include:\r\nManifest \r\nMaster B/L \r\nHouse B/L \r\nShipper invoice & packing list once available ', '', 'Must type on House airwaybill / B/L, port of destination : KUL / Port Kelang, Final Destination : ____ ', 'Original shipper commercial invoice , certificates of origin (if any) required by customs for customs declaration. A photocopy is not acceptable, for either air or ocean shipments.', 'Follow \"dangerous goods\" rules & regulation requirement. ', 'KUL airport and Port Kelang North Port located in Free Commercial Zone, value added services available for transshipment cargo (duty & tax exempted). Custom declaration already computerised & link to government, duty & tax also paying through bank transfer and cheque/banker cheque not allowed. This will cost additional charges of EDI/SMK/FCZ/Manifest fee/EFT incurred. '),
(36, '34', '0', 'It must be consigned to the full name, address of the Jenkinson Logistics office closest to the consignee. The phone and fax number of the office must also appear.', 'It must be consigned to the full name, address of the Jenkinson Logistics sea freight office closest to the consignee. The phone and fax number of the office must also appear. ', 'It must be consigned to the full name, address of the consignee, showing a contact name, with phone and fax contact numbers. The terms of shipment and charges must be clearly shown. ', 'It must be consigned to the full name, address of the consignee, showing a contact name, with phone and fax contact numbers. The terms of shipment and charges must be clearly shown. ', 'Manifests should show both pieces, weight, volume and commercial value of each consignment, along with the terms of shipment. \r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nVOLUME \r\nCOMMERCIAL VALUE OF EACH CONSIGNMENT \r\nTERMS OF SHIPMENT \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION ', 'Manifests should show the following:\r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nVOLUME \r\nCOMMERCIAL VALUE OF EACH CONSIGNMENT \r\nTERMS OF SHIPMENT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION', 'In the handling information box please request the airline to notify Jenkinson Logistics immediately on the arrival of the goods. ', 'In the handling information box please request the line to notify Jenkinson Logistics immediately on the arrival of the goods. ', 'Always show the full description of goods, terms of shipment and the full charges pre-paid or collect. If possible please show the H.S. code used on exportation of the goods. ', 'Always show the full description of goods, terms of shipment and the full charges pre-paid or collect. If possible please show the H.S. code used on exportation of the goods. ', 'Always send both e-mail notification to airimp@jenkinson.ie and a full faxed pre-alert in advance of the shipment. Please include the following:\r\n\r\nMAWB number \r\nHAWB number \r\nManifest \r\nCommercial Invoice \r\nFlight and Arrival Date \r\nplus any other supporting formal documents ( EUR\'s/Cert A/GSP forms,etc) ', 'Always send both e-mail notification to seaimports@jenkinson.ie and a full faxed pre-alert in advance of the shipment. We require a copies of the following: \r\nMB/L number - send the e-mail to \r\nHB/L number \r\nCommercial Invoice \r\nManifest \r\nAgent\'s Invoice \r\nplus any other supporting formal documents ( EUR\'s/Cert A/GSP forms,etc) ', 'No - clearance requires specific permissions from the consignee, therefore early notification allows us to obtain permission or instruct our HTFN partner on a course of action. \r\nPermission from the consignee is required to use their duty payment account(s) ( referred to as TAN accounts). Therefore the earlier we know about the shipment the more likely it is that we will obtain clearance permission, thus future shipments ', 'Goods which are for transshipment internally or externally must do so under bond, we therefore require the earliest possible notification, along with the ultimate consignees full address and customs related details. ', 'Commercial invoices, certificates, etc are legally required to show the proper name, address, description of goods, value of goods and shipping terms ( CIF etc and applicable charges) ', 'AIR:\r\nWe require to be pre-alerted with copies of the dangerous goods declaration (DGR), along with full contact details, in order to book vehicle and delivery as per DGR regulations. \r\n\r\nOCEAN:\r\nWe require to be pre-alerted with copies of the dangerous goods term card, along with full contact details, in order to book vehicle and delivery as per DGR regulations. Also MDSS ( Material Data Safety Sheets) ', 'When sending the first pre-alert e-mail to any Jenkinson Logistics office always copy the HTFNTEAM @jenkinson.IE . Secondly check the appropriate office(s) to notify. If it is an ocean consignment also notify : seaimports@jenkinson.ie '),
(144, '331', '2', 'Please consign your air shpt to TAO as below: \r\nQingdao International Aviation Logistics Center Co., Ltd. 		\r\nO/B  Shandong HARMONY  SHIPPING & FORWARDING AGENT  CO.,LTD.		\r\nATTN:JIANG LING FANG 		\r\nTEL£º0532-6661161/53 FAX£º0532-4715662\r\n', 'Please consign your ocean shpt to Qingdao port as below: \r\nQingdao International Aviation Logistics Center Co., Ltd. 		\r\nO/B  Shandong HARMONY  SHIPPING & FORWARDING AGENT  CO.,LTD.		\r\nATTN:JIANG LING FANG 		\r\nTEL£º0532-6661161/53 FAX£º0532-4715662\r\n', '', '', '', '', '', '', '', '', 'Please send your air shpt pre-alert to : \r\n         rockyzhao@harmony.com.cn\r\nCopy to: sonasong@harmony.com.cn\r\n         ljh@harmony.com.cn', 'Please send your ocean shpt pre-alert to: \r\n         hushuhui@harmony.com.cn\r\nCopy to : sonasong@harmony.com.cn\r\n          ljh@harmony.com.cn\r\n          jihongwei@harmony.com.cn', '', '', 'Please always attach your commercial invoice, packing list and certificate of origin with your pre-alert', 'Case by case, please provide your shpt details in inquiry. ', ''),
(160, '331', '3', 'Please consign MAWB to Harmony Beijing. \r\nThe shpt exported to Hohhot will \r\nbe transfered via Beijing gateway ', '', '', 'Please consign MB/L to Harmony Tianjin. \r\nThe shpt exported to Hohhot via ocean service \r\nwill be delivered via Xingang port. ', '', '', '', '', '', '', '', '', '', '', '', '', 'If the goods packed in wood, it must have the IPPC marks on the opposite two sides of the wood package.'),
(40, '271', '0', 'Consignee: Norman Global Logistics Ltd (DMK)\r\n           Unit 1 Griffin Centre\r\n           Staines Rd, Feltham, Middx \r\n           TW14 0HS       UK\r\n', 'Consignee: Norman Global Logistics Ltd\r\n           Unit 1 Griffin Centre\r\n           Staines Rd, Feltham, Middx \r\n           TW14 0HS       UK\r\n', '', 'Show Delivery Agent as: \r\nNorman Global Logistics Ltd \r\n           Unit 1 Griffin Centre\r\n           Staines Rd, Feltham, Middx \r\n           TW14 0HS       UK', '', '', '', '', '', '', 'Mark Evans  email: mev@norman.co.uk\r\n           fax:  44-208 893 1770', 'Paul Biddle    email: pbi@norman.co.uk\r\n               fax:   44-208 893 1770', '', '', '', 'Documents must be completed with:\r\nHaz Class\r\nUN No\r\nProper Shipping Name\r\nFlash Point (if applicable)\r\nNet weight of individual packaging containing the Haz substance.\r\nAny other relevant information\r\n', '');
INSERT INTO `ship` (`recno`, `memid`, `branch`, `cma`, `cmb`, `cha`, `chb`, `ccma`, `ccmo`, `iimawb`, `iimbl`, `iihawb`, `iihbl`, `pria`, `prio`, `cust`, `trans`, `legal`, `dang`, `special`) VALUES
(41, '169', '0', 'Ocean Express Serviços em Comércio Exterior Ltda\r\nRua Tapes, 195 - Cep 93336-020\r\nNovo Hamburgo - RS - Brazil \r\nCNPJ # 89.981.104/0001-38\r\nPhone: 55 51 30367200', 'Ocean Express Serviços em Comércio Exterior Ltda\r\nRua Tapes, 195 - Cep 93336-020\r\nNovo Hamburgo - RS - Brazil \r\nCNPJ # 89.981.104/0001-38\r\nPhone: 55 51 30367200', '', '', '', '', 'Ocean Express CNPJ # must always be declared on consignee\'s field of MAWB. \r\nTotal amount of freight charges must be shown on MAWB\'s respective field. \r\n\"Freight As Agreed \" wording is not acceptable. It\'s considered illegal by Brazilian laws, subject to penalties. \r\nNet/Net rate must be declared on the respective field of MAWB unless it is not allowed you can mention the IATA rate. \r\nGross Weight has to be exactly the same as declared on both Commercial Invoice and Packing List.\r\nPlease declare goods description as \"Consolidation shipment as per cargo manifest\" ', 'Ocean Express CNPJ number must always be shown on consignee\'s field of MB/L. \r\nNet/net freight amount must always be shown in numbers and words. \r\nShip mode must always be shown. \r\n\"Freight as agreed\" wording is not acceptable. It\'s considered illegal by Brazilian laws.\r\nGross Weight has to be exactly the same as declared on both Commercial Invoice and Packing List.Quantity and kind of volumes / packages must be shown. ', 'Importer\'s CNPJ # must always be declared on consignee\'s field of HAWB \r\nAll eventual charges/costs at origin must be declared and named as \"CHC\" or \"CHA\" on HAWB. Such charges must be added on the top of airfreight and the total amount must be declared on HAWB\'s respective field. \r\n\"Freight As Agreed\" wording is not acceptable. It\'s considered illegal by Brazilian laws. \r\nSelling rate must be always declared on HAWB\'s respective field. \r\nThe original # 2 of the HAWB must always be included in the set of documents accompanying the cargo to the destination. Brazilian Customs will not allow the clearance of the goods without this original. \r\nAlso, commercial invoice and packing list of goods which must accompany the cargo must be an original draft, signed. Photocopies with an \"original\" stamp are not acceptable. \r\nBefore delivering cargo to airline, please always fax us copies of MAWB and HAWB for our approval. We should also receive the complete schedule / flight details. \r\nBesides, receiving the intended flight confirmation, we must also receive the confirmation that the shipment really took place according to previous schedule. \r\nEvery single package, carton or skid must bear a label identifying goods as per data shown on MAWB and HAWB. \r\nPlease make sure you to send following documents together with cargo: \r\n- MAWB original, original and non-negotiable copies have to be stamped and signed\r\n- HAWB original 2, original and non negotiable copies have to be stamped and signed\r\n- cargo manifest - original stamped and signed\r\n- commercial invoice - original stamped and signed\r\n- packing list - original stamped and signed\r\n- agent\'s invoice.\r\nGross weight has to be exactly the same weight as MAWB, commercial Invoice and Packing List.', 'Importer\'s CNPJ # must always be shown on consignee\'s field of HB/L \r\n\"Freight as agreed\" wording is not acceptable. It\'s considered illegal by Brazilian laws. \r\nHB/L and MB/L must always show same issue date. \r\nSelling rate must always be shown on HB/L respective field. All other charges must be added to the ocean freight amount, and everything declared as Total Freight Charges. Do not break down charges. \r\nShip mode ( FCL/FCL or LCL/LCL ) must always be shown. \r\nAny other charge the shipment may have MUST be printed on HBL. If not mentioned, consignee cannot remmit the money out of Brazil. \r\nBefore actual shipment, please always fax or scan us copies of MBL and HBL for our approval. \r\nWe must also receive the complete schedule details 9ETD, ETA, Vessel, Voyage). \r\nBesides shipment pre-advice, we will need a shipment confirmation after vessel\'s departure. \r\nWe need that you send us via courier at least 05 days after vessel\'s departure to do the desconsolidation and Customs Clearance: \r\n- MB/L - 02 originals + non negotiable copies, original and non-negotiable copies have to be stamped and signed\r\n- HBL - 02 originals + non negotiable copies, original and non-negotiable copies have to be stamped and signed\r\n- Cargo Manifest - 01 original - stamped and signed\r\n- Packing list - 01 original - stamped and signed\r\n- agent\'s invoice (credit / debit note)\r\nGross Weight has to be exactly the same weight as on MBL, Commercial Invoice and Packing List. Quantity and kind of volumes / packages must be shown.', 'Before actual shipment, please always e-mail (fretes@oceanexpress.com.br) or fax us copies of MAWB & HAWB for our approval. We should also receive the complete shipment schedule/flight details.', 'Before actual shipment, please always e-mail (fretes@oceanexpress.com.br) or fax us copies of MB/L and HB/L for our approval. ', '', '', '', '', ''),
(43, '293', '0', 'Plane Cargo Inc should be indicated as the consignee or notify party.', 'Plane Cargo Inc should be indicated as the consignee or notify party.', 'The actual shipper and actual consignee should be shown on the Hawb. ', 'The actual shipper and actual consignee should be shown on the HB/L.', 'Manifest should be specific and include the following: \r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION', 'Manifest should be specific and include the following: \r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION', '', '', '', '', 'Pre-Alerts should be complete and should include a copy of the Master AWB, House AWB, commercial invoice and packing list, if available.', 'Pre-Alerts should be complete and should include a copy of the Master B/L, House B/L, commercial invoice and packing list, if available.', 'We can submit the customs entry for air and ocean shipments at most US airports or ocean ports. However, a Customs Power of Attorney is required from the importer of record in order to submit the entry on their behalf. If a Power of Attorney has been issued to another broker, then the cargo will be turned over to that broker for clearance.\r\n \r\nIMPORTANT NOTE: \r\nFor ocean shipments an ISF entry is required to be lodged with US Customs prior to sailing.  Plane Cargo Inc will make the ISF entry on behalf of HTFN partners and importers. We maust have the data 48 hours prior to loading.', 'No special requirements ', 'No special requirements ', 'A copy of the DG Certificate or IMO and/or MSDS sheets must accompany all shipments. ', ''),
(202, '352', '0', 'MEXICO AIR CARGO SYSTEMS, S.A. de C.V.\r\nHidalgo # 84\r\nCol. Peñon de los Baños\r\nMexico, D.F. CP 15520\r\nTel. ++ 52(55) 5784-4100\r\nAtn. Raul Cisneros', 'MEXICO AIR CARGO SYSTEMS, S.A. de C.V.\r\nHidalgo # 84\r\nCol. Peñon de los Baños\r\nMexico, D.F., CP 15520\r\nAt\'n. Sara Andrade / Axel Martinez\r\nTel. ++52 (55)5784-4100', '- The actual shipper and actual consignee should be shown on HAWB. \r\n- Cnee\'s full name, full address, telephone, contact & TAX ID (named RFC).\r\n- Shipper\'s full name, full address, telephone, contact & TAX ID (named RFC).', '- The actual shipper and actual consignee should be shown on HAWB. \r\n- Cnee\'s full name, full address, telephone, contact & TAX ID (named RFC).\r\n- Shipper\'s full name, full address, telephone, contact & TAX ID (named RFC).\r\n- \"TO THE ORDER OF\" consignment is not allowed.', '- MAWB number \r\n- HAWB number \r\n- Qty of pieces \r\n- Gross weight (in KG).\r\n- Volume (cbm)\r\n- Shipper\r\n- Consignee \r\n- Nature of goods \r\n- Flight information (ETD & ETA)', '- MB/L number\r\n- HB/L number\r\n- Shipper\r\n- Consinee\r\n- Qty of pieces \r\n- Total Volume (in cbm)\r\n- Gross weight (in KG)\r\n- ETD\r\n- ETA', '- Pls apply freight prepaid in ALL cases. \r\n- Pls always show \"CONSOLIDATED AS PER ATTACHED CARGO MANIFEST SHIPMENT\" in \"nature & qty of goods\". \r\n- Pls show in \"handling information\" if goods need any special care (such as temperature, handling, etc). ', '- Pls ask ocean carrier to issue it as Seaway bill or Telex Release, originals are not required. Printed at destination also is not necessary, always to release it under copy terms.\r\n- Originals always delays releasing and might cause demurrages or storages.', '- HAWB can be rated or \"As Agreed\" \r\n- Pls show if freight is prepaid or collect. \r\n- Pls show if charges are prepaid or collect. \r\n- Original #2 (for cnee) must come inside a pouch.\r\n- Credits and debits must be sent inside the consolidation document pouch.', '- HB/L can be rated or \"As Agreed\" \r\n- Express release is allowed by Mexican customs.\r\n- Credits and debits must be sent inside the consolidation document pouch.\r\n- If HB/L is requested by shipper to be issue as original, they most be delivered to shipper as well as all other documents related to shipment.\r\n- If HB/L is requested by shipper to be issue as Telex Release or Surrender, a copy must be provided to shipper and he must sent a copy to copnsignee, since we will require a copy to be duly endorsed in order to release it.\r\n- If HB/L changes from original to Surrender or Telex Release, then a copy with statement of \"Telex Release\" or \"Surrender\" must be provided to MAC as well as shipper, since we will require a copy to be duly endorsed in order to release it.', '- Pre-Alerts should be complete and include a copy of the MAWB, HAWB, commercial invoice and packing list, if available.\r\n- Pre-alert must be sent to mexia@macargo.com.mx', '- Pre-Alerts should be complete and include a copy of the MAWB, HAWB, commercial invoice and packing list, if available.\r\n- Pre-alert must be sent to mexocean@macargo.com.mx ', '- Pls be advised that Mexico Air Cargo Systems,  S.A. de C.V. cannot act as importer/exporter of record.\r\n- No foreign company is allowed to be importer/exporter of record.\r\n- A mexican company must be duly registered as importer/exporter and have a valid import license in order clear shipment on their behalf.\r\n- In order to clear shipment, importer/exporter must provide a Customs Power of Attorney in order to submit the entry on their behalf. If a Power of Attorney has been issued to another broker, then the cargo will be turned over to that broker for clearance. \r\n- Importer/Exporter must provide ALL legal documents that proves they are legally established in Mexico, otherwise our customs broker will reject to clear shipment without any law enforcement.', '- Transhipment are not handled by MAC. Mexican Law has too many locks in order to make clearance almost impossible. Expenses will be extrenmely high and also will be extrenmely delayed at Customs.', '- Original commercial invoices are not required by customs in order to consignee can clear cargo. \r\n- Shipper must always send them to consignee, we are not responsible for any document sent by courier or pouch.\r\n- Certificates are required only when requested by consignee, so they are responsible for approving or issuing documents based on nature of goods.', '- Some DGR goods might not accepted by Mexican Customs or have special requirements, which should be checked in advance by shipper/consignee (before shipping out).\r\n- A copy of the DG Certificate or IMO and/or MSDS sheets must accompany shipments.', '-  ALL pieces for air or ocean shipments must be properly labeled in order to avoid problems/delays and extra expenses.\r\n- DDU/DDP shipments please do not ship out without our approval, pls contact us in advance. If shipment is shipped out without notifying about it and arrabnge all prior to ship, MAC will not be resposible for any extracost or mishandling on it.\r\n- Any quotation approved for DDU/DDP shipment by Agent must be fully paid, more even if quotation is estimated based on information provided or in case of any problem or delay on clearance, pick up, freight or any part of logistics.\r\n- Pls be advsied that Mexican regulation just allows to do payments or receive payment in USD as foreign currency, any other are not recognize and we cannot set up payment on them. Agent is responsible to provide invoice, debite or credit note in USD considering to protect exchange rate good enough in order to prevent any shortage or loss in shipment. Also, bank intermediary fees needs to be considered by Agent and on its account.\r\n- Any Fines or Penalties for mishandling, lack of documents, lack of pre-alert or following, will be on account of Agent. Certanly we will support in order to minimize extra expenses or fines, but definitely on account of Agent.'),
(203, '352', '1', 'MEXICO AIR CARGO SYSTEMS, S.A. de C.V.\r\nHidalgo # 84\r\nCol. Peñon de los Baños\r\nMexico, D.F., CP 15520\r\nAt\'n. Raul Cisneros / Cesar Gutierrez\r\nTel. ++52 (55)5784-4100\r\n\r\nNOTE: BJX shipments are handle through MEX station.', 'MEXICO AIR CARGO SYSTEMS, S.A. de C.V.\r\nPaseo de las Alondras # 126\r\nCol San Isidro\r\nLeon, Gto,  Mexico, CP 037530\r\nTEL/Fax: (52477)  51 47 457 al 61', '- The actual shipper and actual consignee should be shown on HAWB. \r\n- Cnee\'s full name, full address, telephone, contact & TAX ID (named RFC).\r\n- Shipper\'s full name, full address, telephone, contact & TAX ID (named RFC).', '- The actual shipper and actual consignee should be shown on HAWB. \r\n- Cnee\'s full name, full address, telephone, contact & TAX ID (named RFC).\r\n- Shipper\'s full name, full address, telephone, contact & TAX ID (named RFC).\r\n- \"TO THE ORDER OF\" consignment is not allowed.', '- MAWB number\r\n- HAWB number\r\n- Qty of pieces \r\n- Gross weight (in KG).\r\n- Volume (cbm)\r\n- Shipper\r\n- Consignee\r\n- Nature of goods\r\n- Flight information (ETD & ETA)', '- MB/L number\r\n- HB/L number\r\n- Shipper\r\n- Consignee\r\n- Qty of pieces \r\n- Total Volume (in cbm)\r\n- Gross weight (in KG)', '- Pls apply freight prepaid in ALL cases. \r\n- Pls always show \"CONSOLIDATED AS PER ATTACHED CARGO MANIFEST SHIPMENT\" in \"nature & qty of goods\". \r\n- Pls show in \"handling information\" if goods need any special care (such as temperature, handling, etc). ', '- Pls ask ocean carrier to issue it as Seaway bill or Telex Release, originals are not required. Printed at destination also is not necessary, always to release it under copy terms.\r\n- Originals always delays releasing and might cause demurrages or storages.', '- HAWB can be rated or \"As Agreed\" \r\n- Pls show if freight is prepaid or collect. \r\n- Pls show if charges are prepaid or collect. \r\n- Original #2 (for cnee) must come inside a pouch.\r\n- Credits and debits must be sent inside the consolidation document pouch.', '- HB/L can be rated or \"As Agreed\" \r\n- Express release is allowed by Mexican customs.\r\n- Credits and debits must be sent inside the consolidation document pouch.\r\n- If HB/L is requested by shipper to be issue as original, they most be delivered to shipper as well as all other documents related to shipment.\r\n- If HB/L is requested by shipper to be issue as Telex Release or Surrender, a copy must be provided to shipper and he must sent a copy to consignee, since we will require a copy to be duly endorsed in order to release it.\r\n- If HB/L changes from original to Surrender or Telex Release, then a copy with statement of \"Telex Release\" or \"Surrender\" must be provided to MAC as well as shipper, since we will require a copy to be duly endorsed in order to release it.', '- Pre-Alerts should be complete and include a copy of the MAWB, HAWB, commercial invoice and packing list, if available.\r\n- Pre-alert must be sent to mexia@macargo.com.mx\r\n- Also please copy to BJX staff that requested air shipment for following.', '- Pre-Alerts should be complete and include a copy of the MAWB, HAWB, commercial invoice and packing list, if available.\r\n- Pre-alert must be sent to proper ocean import staff that requested shipment.', '- Pls be advised that Mexico Air Cargo Systems,  S.A. de C.V. cannot act as importer/exporter of record.\r\n- No foreign company is allowed to be importer/exporter of record.\r\n- A mexican company must be duly registered as importer/exporter and have a valid import license in order clear shipment on their behalf.\r\n- In order to clear shipment, importer/exporter must provide a Customs Power of Attorney in order to submit the entry on their behalf. If a Power of Attorney has been issued to another broker, then the cargo will be turned over to that broker for clearance. \r\n- Importer/Exporter must provide ALL legal documents that proves they are legally established in Mexico, otherwise our customs broker will reject to clear shipment without any law enforcement.', '- Transhipment are not handled by MAC. Mexican Law has too many locks in order to make clearance almost impossible. Expenses will be extrenmely high and also will be extrenmely delayed at Customs.', '- Original commercial invoices are not required by customs in order to consignee can clear cargo. \r\n- Shipper must always send them to consignee, we are not responsible for any document sent by courier or pouch.\r\n- Certificates are required only when requested by consignee, so they are responsible for approving or issuing documents based on nature of goods.', '- Some DGR goods might not accepted by Mexican Customs or have special requirements, which should be checked in advance by shipper/consignee (before shipping out).\r\n- A copy of the DG Certificate or IMO and/or MSDS sheets must accompany shipments.', '- ALL pieces for air or ocean shipments must be properly labeled in order to avoid problems/delays and extra expenses.\r\n- DDU/DDP shipments please do not ship out without our approval, pls contact us in advance. If shipment is shipped out without notifying about it and arrabnge all prior to ship, MAC will not be resposible for any extracost or mishandling on it.\r\n- Any quotation approved for DDU/DDP shipment by Agent must be fully paid, more even if quotation is estimated based on information provided or in case of any problem or delay on clearance, pick up, freight or any part of logistics.\r\n- Pls be advsied that Mexican regulation just allows to do payments or receive payment in USD as foreign currency, any other are not recognize and we cannot set up payment on them. Agent is responsible to provide invoice, debite or credit note in USD considering to protect exchange rate good enough in order to prevent any shortage or loss in shipment. Also, bank intermediary fees needs to be considered by Agent and on its account.\r\n- Any Fines or Penalties for mishandling, lack of documents, lack of pre-alert or following, will be on account of Agent. Certanly we will support in order to minimize extra expenses or fines, but definitely on account of Agent.'),
