(123, '312', '1', 'To Caracas Airport (Others please consult before send the cargo)\r\n\r\nThe MAWB must be consigned to:\r\nALMACENADORA ANDROMEDA\r\nAv. Soublette Sector Cabo Blanco\r\nN.3 Maiquetia - Edo Vargas\r\nCaracas, Venezuela\r\n		\r\nNotify to:\r\nJ & G FREIGHT FORWARDERS, C.A\r\nCaracas, Venezuela\r\nAttention: Jenny Lago \r\nPhone: (58212) 993-6787 / 993-0334\r\n\r\nNotes:\r\nFreight can be shown “AS ARRANGED”\r\nFreight must always be prepaid (MAWB)', 'How to consign a Master B/L (FCL):	\r\nTO LA GUAIRA PORT:\r\nThe MBL must be consigned to:\r\nALMACENADORA ANDROMEDA\r\nZona Portuaria, Almacen No. 9, Sector\r\nVargas 6-A . La Guaira - Edo Vargas\r\nCaracas, Venezuela\r\n	\r\nThe Master B/L Should  to Say:                    \r\n “Container to be remove alongside the vessel by Almacenadora Andromeda”\r\n\r\n           \r\nTO PUERTO CABELLO PORT:\r\nThe MBL must be consigned to:\r\nALMACENADORA ANDROMEDA\r\nCaracas, Venezuela\r\n						\r\nThe Master B/L Should Say:                   \r\n“Container to be remove alongside the vessel by Almacenadora Saexport”\r\n\r\nNotify to: (for both ports)\r\nJ&G FREIGHT FORWARDERS, C.A\r\nCaracas, Venezuela\r\nAttention: Jenny Lago \r\nPhone: (58212) 993-6787 / 993-0334\r\n\r\nNotes\r\nFreight can be shown “AS ARRANGED”\r\nFreight must always be prepaid (MBL)\r\n\r\nHow to consign a Master B/L:           	\r\nLA GUAIRA  &  PUERTO CABELLO\r\nIf the shipment is sent through a Coloader (LCL-LCL)\r\nThe MAWB must be consigned to:\r\nJ & G FREIGHT FORWARDERS, C.A\r\nEntre Avenida Orinoco y Veracruz  Torre Orinoco\r\nPiso 2 - Oficina 2A   las Mercedes\r\nCaracas, Venezuela \r\n		\r\nNotify to:\r\nJ & G FREIGHT FORWARDERS, C.A\r\nCaracas, Venezuela\r\nAttention: Jenny Lago \r\nPhone: (58212) 993-6787 / 993-0334', 'Consignee’s name and complete address (including the phone number and person in charge)\r\nFreight can be shown “AS ARRANGED” or “AS AGREED”', 'Consignee’s name and complete address (including the phone number and person in charge)\r\nFreight can be shown “AS ARRANGED” or “AS AGREED”\r\nThree (3) Originals must be sent to destination', '', '', '', 'Express Release:\r\nThere is express release in Venezuela , make sure that S/S Line used send the authorization to their agent  at destination', '', 'Express release allowed (you must send HBL in blank).\r\n		\r\nFreight can be declared “AS ARRANGED”', 'A pre-alert of a Master AWB and HAWB must be sent 24 hrs (working days) before shipment and you must wait for our green light to send the cargo\r\n\r\nPlease send all documentation by e-mail:\r\n(jennylago@jgfreight.com, jgfreight@jgfreight.com)', 'Please send all documentation by e-mail:\r\n(jennylago@jgfreight.com, jgfreight@jgfreight.com)', 'Yes, we can do this service but to clear cargo consignee must give to J & G FREIGHT FORWARDERS, C.A a power of attorney which will enable us to clear customs\r\n\r\n', 'NO transshipments allowed', 'Commercial Invoices are required by customs in order to consignee clear cargo. Shipper must always send it to consignee. Certificates only when requested by consignee.', 'Please contact case by case', 'The master MBL and AWB must sent on a Prepaid basis'),
(46, '266', '0', 'Master AWB should be consigned to: \r\nQuickflo Logistics Pte Ltd', 'Master Ocean BL should be consigned to:\r\nQuickflo Logistics Pte Ltd', 'The HAWB must be consigned to the consignee.', 'The HB/L must be consigned to the consignee.', 'No special requirements for creating a consolidation manifest. Normal manifest details will suffice. ', 'No special requirements for creating a consolidation manifest. Normal manifest details will suffice.', 'No special instructions for issuance of a MAWB - just make sure it is consigned to QUICKFLO. ', 'No special instructions for issuance of a MAWB - just make sure it is consigned to QUICKFLO. ', 'Consignee\'s contact and Telephone number must be included in HAWB. ', 'Consignee\'s contact and Telephone number must be included in HB/L. ', 'For air shipments, normal fax, or e-mail Pre-Alert will suffice.', 'To surrender the OBL at port of loading please ensure that documentation is received well in advance and before vessel arrives.', 'If shipper wants us to clear the shipment (mostly DDU shipments), we can do it for both air & sea shipments. ', 'We can handle transshipment cargo both air & sea shipments. Singapore is known as a transshipment hub for the Far East. ', 'No need for an original invoice. Fax or photostat is acceptable. We do not need Certificate of Origin in Singapore. A Certificate of Origin is at the request of consignee for their trading purposes. ', 'Dangerous Goods Procedures must be strictly adhered to. ', 'Most of our goods imported into SIN are duty free, except 4 commodities, i.e. Liquor/Wine. Tobacco, Cars & Petroleum. Importers need only to pay 7% of cif value of goods for non-duty goods. '),
(47, '78', '0', 'Shipper should be indicated as the foreign forwarder, including their address, city, and country', 'Shipper should be indicated as the foreign forwarder, including their address, city, and country', 'House Bills should be consigned from actual shipper to actual consignee, with the US Broker/forwarder listed as a notify party. ', 'House Bills should be consigned from actual shipper to actual consignee, with the US Broker/forwarder listed as a notify party. ', 'Manifest should be specific and include the following: \r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION', 'Manifest should be specific and include the following: \r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION', '', '', '', '', 'Pre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips', 'Pre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips ', 'We can do customs clearance for any air and ocean shipments. However, a Power of Attorney is required in order to clear Customs for any importer/shipper. If a Power of Attorney has been issued to another broker, then the cargo will be turned over to that broker for clearance. \r\nIMPORTANT NOTE: New security regulations make distinctions between known and unknown shippers. Shipments from unknown shippers ( essentially new clients to your HTFN partner ) are subject to special scrutiny which may delay the air routing by 7 or more days.\r\n\r\nWhen issuing an urgent routing order to your USA HTFN partner, please ask them to advise you if your routing may be subject to such delays so that you may advise your importer accordingly of the options available.', 'No special requirements ', 'No special requirements ', 'A copy of the HazMat or MSDS sheets must accompany shipments. ', ''),
(49, '278', '0', 'QINGDAO RITZY INT¡¯L CARGO TRANSPORT ANGENCY CO¡££¬LTD¡£\r\nAIRCARGO COMPANY  £¨EWT QINGDAO£©\r\nTEL£º0086-532-85759302\r\nFAX£º0086-532-85759303	\r\nATTN: Ms Tracy Sun\r\n\r\n\r\n', '\r\nRitzy Int\'l Cargo Transport Agency Co., Ltd.\r\nTELF0086-532-85789137\r\nFAXF0086-532-85728715\r\nATTNFMr.Frank Wang\r\n\r\n\r\n', 'please show the actual shipper and consignee on the HAWB whatever for air shipments. ', 'please show the actual shipper and consignee on the HAWB whatever for sea shipments. \r\nNotify Party: Ritzy Int\'l Cargo Transport Agency Co., Ltd.\r\nTELF0086-532-85789137\r\nFAXF0086-532-85728715\r\nATTNFMr.Frank ', 'The consolidation manifest consist of representative commodity name, volume, packing, weight, and measurement, the commodity name can be listed totally, the final destination should be the same one. ', 'The consolidation manifest consist of representative commodity name, volume, packing, weight, and measurement, the commodity name can be listed totally, the final destination should be the same one. ', 'The MAWB (Air) is issued to the Freight Forwarder by the Airline or Shipping Company, Firstly, must make sure the the shipment for Air and Ocean are landed on board. If the Freight is on Prepaid basis, Freight for Air must be paid before getting the MAWB (Air) ', 'TheMaster B/L is issued to the Freight Forwarder by the Airline or Shipping Company, Firstly, must make sure the the shipment for Air and Ocean are landed on board. If the Freight is on Prepaid basis, Freight for Ocean must be paid before getting the Master B/L. ', 'Only after getting the issued MAWB (Air) can the Freight Forwarder issue its HAWB (Air) House B/L (Ocean). ', '', 'Pre-alert including all shipping details for ocean freight must be faxed, e-mailed or via airmail to the destination party within 24 house hours from the vessel departure, Pre-alert for Air Freight must be faxed, e-mailed or via airmail to the destination party within 1 hours within the plane\'s departure.', 'Pre-alert including all shipping details for ocean freight must be faxed, e-mailed or via airmail to the destination party within 24 house hours from the vessel departure, Pre-alert for Air Freight must be faxed, e-mailed or via airmail to the destination party within 1 hours within the plane\'s departure. Only after geeting the issued Master B/L , can the Freight Forwarder issue its House B/L (Ocean). ', 'No. The company or enterprise must register in China Customs and must present the actual shipper or consignee\'s customs clearence consignment.', 'To make a transshipment, the shipper or consignee must make a application to the origianl or destination Customs Bureau. and must getting its approval. ', 'The commercial invoice should ge marked the shipper and consignee\'s name and address, the name of the commodity, and the value ofthe commodity. Freight item and the currency. the commercial should possess the shipper\'s signature or common seal. For the certificates of origin, the exporter should provide the ceneralized system of preferences certificate of origin (G.S.P). ', 'China Cival Aviation regulate that the Air Forwarder should not accept dangerous cargo. For ocean freight, the consignment of dangerous cargo, it must do application to the shipping company in advance, and the consignment order must mark the name of the dangerous cargo, tand all other details, and must get the shipping conmpany approval. ', ''),
