(142, '331', '0', 'Please consign MAWB for shpt to Tianjin airport  as below: \r\nHarmony International Forwarding (Tianjin) Ltd.\r\nA204-205 Transwell Bonded Warehouse, \r\nDistrict D Tianjin Binhai Airport \r\nInternational Logistics Zone, \r\nTianjin, China 300050\r\nTel: +86 22 84888556/84888559 ', 'Please consign MB/L for the shpt to Xingang as below:\r\nHarmony International Forwarding (Tianjin) Ltd.\r\nRoom 702, the Exchange Office Tower, \r\n189 Nanjing Road, Heping District, \r\nTianjin, China 300050 \r\nTel:86 22 23129888-119\r\n', 'Please indicate the full contact details of the consignee on HAWB. ', 'Please indicate the full contact details of the consignee on HB/L. ', '', '', '', '', '', '', 'Please send pre-alert for air shpt to : \r\nsara@harmony.com.cn, \r\ncopy to : bonnie_yang@harmony.com.cn \r\n          jasonchen@harmony.com.cn', 'Please send pre-alert for ocean shpt to : \r\nfionatang@harmony.com.cn \r\ncopy to : bonnie_yang@harmony.com.cn\r\n          jasonchen@harmony.com.cn', '', '', 'Please always attach the commercial invoice and packing list, certifications of origin with the pre-alert to us. ', '', 'If the goods packed in wood, it must have IPPC mark on opposite two sides of the said wood package.'),
(154, '334', '4', 'AWB to be consigned to IFL SPEDIZIONI SPA - LIMITO DI PIOLTELLO (MILANO) ITALY\r\nAWB ON PREPAID  ', 'AWB can be consigned either to IFL SPEDIZIONI SPA\r\nBRESCIA  or MILANO .... Our import offices will instruct you time by time ', 'HAWB to be consigned to final consignee as per terms and condition of sales ', 'HAWB to be consigned to final consignee as per terms and conditions of sales ', 'consolidated manifest with individual HAWBS and commercial invoices ', 'consolidated manifest with individual HAWBS and commercial invoice', 'no special instructions ', 'Whenever possible, please issue EXPRESS BILL OF LADING / SURRENDED  BL', 'eventual COLLECT CHARGES to be preadvised and HAWB should be accompanied by relative HTFN agent invoice!!  Shipping terms must be clearly indicated!', 'eventual COLLECT charges to be preadvised and HAWB should be accompanied by relative HTFN agent invoice!  Shipping terms must be clearly indicated!', 'to be sent by mail to:\r\ngiordano.formenti@iflsped.it', 'to be sent by mail to:\r\nmaria.longordo@iflsped.it \r\ngraziella.gaudenzi@iflsped.it ', 'if terms are DDP/DDU we can arrange customs clearance on behalf of shipper subject to consignee\'s acceptance', '', '', 'IMO or DGR certificate to accompany shipping documents ', ''),
(51, '47', '0', 'If ur shipping as consolidate:\r\n\r\nMAWB:\r\nROYAL CARGO DE COLOMBIA\r\nCalle 39 No. 19 -15\r\nTel: (571)2879520/ operations@royalcargo.net\r\nBogota – Colombia\r\nAtt: Angélica Guarin M\r\n\r\nIf ur shipping as direct AWB only:\r\nCnee Box:\r\nNAME & IMPORTER ADRESS / DESCARGUE DIRECTO\r\nBOGOTA\r\n\r\nAccounting info. box:\r\nNotify: Agencia de Aduanas Royal Ltda\r\nTel: 571 2881473- 2879520\r\n', '1.Arrivals through Buenaventura port as follows:\r\nConsignee:\r\nItalian Shipping\r\nNIT:830.050.593-0\r\nCalle 64 Bis No. 85J – 87\r\nTel: (572) 5449009\r\nBuenaventura- Colombia\r\nAtt: Shirley\r\n\r\n2.Arrivals through Cartagena port as follows:\r\nConsignee: \r\nCockerill Cargo NIT: 806.008.749-8\r\nBocagrande Cra 3 No.6A – 100\r\nEdificio Torre Empresarial\r\nProteccion of. 1101\r\nTel:(575)6640001\r\nCartagena – Colombia.\r\nAtt: Yoemis Pedroza.\r\n\r\n3.Arrivals through Barranquilla port as follows:\r\nConsignee: \r\nCockerill Cargo NIT: 806.008.749-8\r\nCra 54 # 70 – 196\r\nEd. Prado Office Center Local. 108A\r\nPh: (575)3694563//Fax: (575)3694560\r\nBarranquilla – Colombia\r\nAtt: Joseva Odeimer.\r\n\r\n\r\nAll notifications as follows:\r\n\r\nNotify: \r\nRoyal Cargo de Colombia Ltda.\r\nNIT: 800.013.040-3\r\nCalle 39 No. 19 -15\r\nTel: (571)2879520//Fax: (571)2885753\r\nBogota – Colombia\r\nAtt: Angélica Guarin M\r\n', 'NAME, IMPORTER ADRESS / DEPOSITO ADUANERO REPREMUNDO UNO. BOGOTA\r\n\r\n', 'CNEE BOX MUST HAVE NIT NUMBER, IF YOU DON´T KNOW IT WE WOULD GET IT FOR YOU', 'Consolidation manifest must include: \r\n- MAWB \r\n- Each HAWB including pieces, weight and commodity. ', 'Consolidation manifest must include: \r\n- MBL. Including pieces, weight, measurement and commodity. \r\n- Each HBL including pieces, weight, measurement and commodity. ', 'Master AWB must show: Consolidation ', 'Master BL must show: Consolidation ', 'Consolidation ', 'Consolidation ', 'Send Pre-Alert to our main office in Bogotá to email: operations@royalcargo.net \r\nMust Include: \r\n- MAWB \r\n- HAWB \r\n- Flight Number, icluding arriving date \r\n', 'Send Pre-Alert to our main office in Bogotá to email: operations@royalcargo.net \r\nMust Include: \r\n- Copy of MBL \r\n- Copy of HBL \r\n_ Inform us where the docs. are  \r\n- Vessel\'s Schedule\r\n_ Selling rate in order to issue customs certification\r\n_ Commercial invoice & packing list if available\r\n\r\nIN ORDER TO AVOID HIGH FINES, IT IS ABSOLUTELY NECESARY TO RECEIVE PRE ALERT 48 HOURS BEFORE VESSEL ARRIVES.\r\n\r\nWe always confirm receiving of each Pre-Alert, if you do not receive confirmation, please send it again.    ', 'We are Customs Broker licensed therefore we can do clearance import/export, air/ocean.   ', '', 'Commercial invoices must show currency, Inconterm, type of goods, quantity and unit value.\r\n\r\nFor CIF, CIP, CFR, and other Incoterms that include freight and insurance:\r\n\r\n- Goods Value \r\n- Freight Value\r\n- Insurance Value\r\n\r\nFor Certificates of Origin:\r\n- HST\r\n- Agreement number \r\n- Commercial Inovice\'s number ', 'Please follow U.N./IATA requirements. ', 'In all cases please send us your credit note indicating your profit along with the pre- alert'),
(122, '312', '2', 'To Caracas Airport (Others please consult before send the cargo)\r\n\r\nThe MAWB must be consigned to:\r\nALMACENADORA ANDROMEDA\r\nAv. Soublette Sector Cabo Blanco\r\nN.3 Maiquetia - Edo Vargas\r\nCaracas, Venezuela\r\n		\r\nNotify to:\r\nJ & G FREIGHT FORWARDERS, C.A\r\nCaracas, Venezuela\r\nAtention: Jenny Lago \r\nPhone: (58212) 993-6787 / 993-0334\r\n\r\nNotes:\r\nFreight can be shown “AS ARRANGED”\r\nFreight must always be prepaid (MAWB)', 'How to consign a Master B/L (FCL):	\r\nTO LA GUAIRA PORT:\r\nThe MBL must be consigned to:\r\nALMACENADORA ANDROMEDA\r\nZona Portuaria, Almacen No. 9, Sector\r\nVargas 6-A . La Guaira - Edo Vargas\r\nCaracas, Venezuela\r\n	\r\nThe Master B/L Should  to Say:                    \r\n “Container to be remove alongside the vessel by Almacenadora Andromeda”\r\n\r\n         \r\nTO PUERTO CABELLO PORT:\r\nThe MBL must be consigned to:\r\nALMACENADORA ANDROMEDA\r\nCaracas, Venezuela\r\n						\r\nThe Master B/L Should Say:                   \r\n“Container to be remove alongside the vessel by Almacenadora Saexport”\r\n\r\nNotify to: (for both ports)\r\nJ&G FREIGHT FORWARDERS, C.A\r\nCaracas, Venezuela\r\nAtention: Jenny Lago \r\nPhone: (58212) 993-6787 / 993-0334\r\n\r\nNotes\r\nFreight can be shown “AS ARRANGED”\r\nFreight must always be prepaid (MBL)\r\n\r\nHow to consign a Master B/L:           	\r\nLA GUAIRA  &  PUERTO CABELLO\r\nIf the shipment is sent through a Coloader (LCL-LCL)\r\nThe MAWB must be consigned to:\r\nJ & G FREIGHT FORWARDERS, C.A\r\nEntre Avenida Orinoco y Veracruz  Torre Orinoco\r\nPiso 2 - Oficina 2A   las Mercedes\r\nCaracas, Venezuela \r\n		\r\nNotify to:\r\nJ & G FREIGHT FORWARDERS, C.A\r\nCaracas, Venezuela\r\nAtention: Jenny Lago \r\nPhone: (58212) 993-6787 / 993-0334', 'Consignee’s name and complete address (including the phone number and person in charge)\r\nFreight can be shown “AS ARRANGED” or “AS AGREED”', 'Consignee’s name and complete address (including the phone number and person in charge)\r\nFreight can be shown “AS ARRANGED” or “AS AGREED”\r\nThree (3) Originals must be sent to destination', '', '', '', 'Express Release:\r\nThere is express release in Venezuela , make sure that S/S Line used send the authorization to their agent at destination', '', 'Express release allowed (you must send HBL in blank).\r\n		\r\nFreight can be declared “AS ARRANGED”', 'A pre-alert of a Master AWB and HAWB must be sent 24 hrs (working days) before shipment and you must wait for our green light to send the cargo\r\n\r\nPlease send all documentation by e-mail:\r\n(jennylago@jgfreight.com, jgfreight@jgfreight.com)', 'Please send all documentation by e-mail:\r\n(jennylago@jgfreight.com, jgfreight@jgfreight.com)', 'Yes, we can do this service but to clear cargo consignee must give to J & G FREIGHT FORWARDERS, C.A a power of attorney which will enable us to clear customs\r\n\r\n', 'NO transshipments allowed', 'Commercial Invoices are required by customs in order to consignee clear cargo. Shipper must always send it to consignee. Certificates only when requested by consignee.', 'Please contact case by case', 'The master MBL and MAWB must sent on a Prepaid basis');
INSERT INTO `ship` (`recno`, `memid`, `branch`, `cma`, `cmb`, `cha`, `chb`, `ccma`, `ccmo`, `iimawb`, `iimbl`, `iihawb`, `iihbl`, `pria`, `prio`, `cust`, `trans`, `legal`, `dang`, `special`) VALUES
(53, '284', '0', 'For Dhaka:\r\nMAWB should be consigned to:\r\nSailors Shipping Ltd\r\nTower Hamlet 4th Floor, 16 Kemal Ataturk Ave,\r\nBanani, Dhaka-1213, Bangladesh\r\nTel: 880-2-9884435, 9884438\r\nFax: 880-2-9883784\r\nEmail: sailors@global-bd.net\r\nContact: Import Department\r\n\r\nFor Chittagong:\r\nSailors Shipping Ltd\r\nTaa-Seen Valley 1st Floor, 1558 Hajipara, Agrabad, Chittagong, Bangladesh\r\nTel: 88-031-718702\r\nFax: 88-031-812946\r\nEmail: cgpcargo@bttb.net.bd\r\nContact: Import Department\r\nFreight term on MAWB should be always: PREPAID unless accepted by the authority in advance.', 'Ocean: MB/L should be consigned to:\r\nSailors Shipping Ltd\r\nTaa-Seen Valley 1st Floor, 1558 Hajipara, Agrabad, Chittagong, Bangladesh\r\nTel: 88-031-718702\r\nFax: 88-031-812946\r\nEmail: cgpcargo@bttb.net.bd\r\nContact: Import Department\r\nFreight term on MAWB should always be PREPAID unless acceptance by the authority in advance.\r\n', 'HAWB must be prepared as per L/C or Commercial invoice terms & consigned. ', 'HB/L must be prepared as per L/C or Commercial Invoice terms & consigned.', 'Consolidation manifest should be created as precise as possible so that we can use the same as pre-alert if the consignee’s as well as notify details are given on the manifest. The cargo manifest should have the usual information ie.:\r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION', 'Consolidation manifest should be created as precise as possible so that we can use the same as pre-alert if the consignee’s as well as notify details are given on the manifest. The cargo manifest should have the usual information ie:\r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION', 'No special instruction is required.', 'No special instruction is required.', 'No special instruction is required.', 'No special instruction is required.', 'The pre-alert instruction is very important & necessary for contacting consignee in advance in order to keep them happy or to prepare import documentation in advance to avoid storage, etc. We can even follow up with the carrier with a pre-alert.', 'The pre-alert instruction is very important & necessary for contacting consignee in advance in order to keep them happy or to prepare import documentation in advance to avoid storage, etc. We can even follow up with the carrier with a pre-alert. ', 'We do customs clearance for both Air & Ocean shipments.', 'Transshipment is nearly impossible or not allowed; but in any case if someone requests for trasshipment, please check with both our import & export department for a convenient operation.', 'We do need commercial invoice & packing list only. But in any case if some other documents are required, we may obtain from the consignee like copy of L/C, Import permit, VAT certificate of importer, IRC, etc. ', 'For dangerous goods, we can only confirm the requirement upon request for a specific item & at sight. We handle dangerous goods but not always except Aircraft Engine, Chemicals, etc. ', 'For any Ocean import, if we can’t identify the ultimate consignee name before arrival of VSL, the steamship line will issue IGM against our name & by end of the job, we have to pay unnecessary penalty to the port authority which is not a fix amount & it could be +/- 100U$ per consignment. As such, we need the pre-alert or manifest to identify the correct consignee.\r\nOur CENTRAL Bank is now-a-days monitoring very strictly all in & out REMITTANCE of foreign currencies. As such we need bilateral agreement with all our agents with whom we have business transaction. Once we submit the agreement copy to central Bank, they give us a permission to receive foreign currency from that company. As such, may I request you all to make a very simple agreement for us & sign as quickly as possible. '),
(55, '212', '0', 'MAWB should be consigned to Swiftair Intenational \r\nwith the respective address in Durban, Johannesburg or Cape Town. ', 'MB/L should be consigned to Swiftair Intenational \r\nwith the respective address in Durban, Johannesburg or Cape Town. ', 'HAWB should show the actual shipper and consignee, and if under L/C must reflect the bank details.', 'HB/L should show the actual shipper and consignee, and if under L/C must reflect the bank details.', 'The cargo manifest should have the usual information ie.:\r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION', 'The cargo manifest should have the usual information ie:\r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION', 'Special instructions on MAWB only required if for handling of cargo.', 'Special instructions on MBL only required if for handling of cargo. ', 'Special instruction on HAWB is COD shipment or any other instruction the shipper may require. ', 'Special instruction on HB/L is COD shipment or any other instruction the shipper may require. ', 'Pre-alert is a must on all shipments.', 'Pre-alert is a must on all shipments.', 'We can clear air/ocean shipment on instruction of consignee. Except DDU/DDP where the forwarding agents instructions are sufficient.', 'Transshipment of air/ocean shipments can be done without payment of duty or VAT and fairly simplified procedure ie In-Bond transfer. ', 'Legal requirements all shipments will require commercial invoice and packing list, Commodities subject to Preferential rate of duty will be subject to an authenticated Certificate of Origin ', 'Dangerous goods must specify trade name IMCO class and handling / storage information. ', ''),
(56, '305', '0', 'Spedycargo Transitários S.A.\r\nVia Central de Milheirós, 726\r\n4475-330 Maia\r\nPortugal\r\nTel. + 351 229 993 650 Fax: + 351 229 964 962\r\nor\r\nSpedycargo Transitários Lda\r\nEdifício 134, Piso 2 - Gab, 2119/20\r\nAeroporto da Portela\r\n1750-364 Lisboa\r\nPortugal\r\nTel. + 351 218 480 369  Fax: + 351 218 480 370\r\n', 'Same as above', 'HAWB consigned according to Shipping terms PPD/EXW. \r\nAny specific instructions must be clearly shown on the HAWB', 'Same as above', 'Company name, complete address and telephone number of the Shipper and Consignee\r\nMAWB number\r\nHAWB number\r\nExact number of pieces with gross weight shown on each HAWB\r\nDate and flight of arrival \r\nValue of freight and/or charges to collect if any\r\n', 'Company name, complete address and telephone number of the Shipper and Consignee\r\nMBL number\r\nHBL number\r\nEstimated date of arrival\r\nShipment details : Exact number of packages with gross weight shown for each AWB\r\nFlight arrival and date\r\nValue of freight and/or charges on collect shipments', 'No specific requirements', 'No specific requirements', 'No specific requirements', 'No specific requirements', 'Pre-alert by fax or email showing:\r\nMAWB number\r\nHAWB number\r\nNumber of pieces, weight and volume\r\nSHIPPER AND CONSIGNEE\r\nFLIGHT AND ARRIVAL DATE\r\nDESCRIPTION OF GOODS \r\nAMOUNT TO COLLECT, IF ANY\r\nANY OTHER INSTRUCTIONS', 'Pre-alert by fax or email showing:\r\nMBL number\r\nHBL number\r\nNumber of pieces, weight and volume\r\nSHIPPER AND CONSIGNEE\r\nFLIGHT AND ARRIVAL DATE\r\nGOODS DESCRIPTION\r\nAMOUNT TO COLLECT, IF ANY\r\nANY SPECIFIC INSTRUCTIONS', 'Commercial invoice indicating HS Code required. \r\n', 'Country of origin must be shown on AWB/BL for all shipments to be transhipped, except  those of personal effects and household goods. AWB/BL’s covering shipments not intended for imports must state \"IN TRANSIT TO...(country of destination)\" and correctly identify the nature of the goods.', 'Commercial invoice, Packing list & Certificate of Origin required', 'Standard International Rules apply', 'Gross weight shown on MAWB/MBL must be the same shown on the HAWB/HBL'),
(58, '272', '0', 'The Master AWB should be consigned to: \r\nTRANSBER SAC \r\nCalle Cadmio 129-135 \r\nUrb. Industrial Grimanesa\r\nCallao, Peru\r\nTel: (511) 572 1954 \r\nFax: (511) 572 0269 \r\nATTN: Mrs. Rosario Diaz ', 'The Master B/L should be consigned to: \r\nTRANSBER SAC\r\nCalle Cadmio 129-135 \r\nUrb. Industrial Grimanesa \r\nCallao, Peru \r\nTel: (511) 572 1954 \r\nFax: (511) 572 0269 \r\nATTN: Mrs. Rosario Diaz ', 'Should be consigned to the Customer: Exact Company Name, Bank and Address (if it is through them), please include telephone and contact person to give them arrival notice on time or check any other detail.', 'Should be consigned to the Customer: Exact Company Name, Bank and Address (if it is through them), please include telephone and contact person to give them arrival notice on time or check any other detail.', 'Should be consigned to Transber SAC, including the following information: \r\n\r\nMaster AWB \r\nHouse AWB \r\nCarrier, flight number and date \r\nConsignee including complete company name \r\nNumber of packages and gross weight \r\nDescription of goods \r\nTotal weight and number of packages consolidated', 'Must be consigned to Transber SAC including the following information: \r\n\r\nMaster B/L number \r\nHouse B/L number \r\nShipping line information, vessel number and date \r\nConsignee including complete company name \r\nNumber of packages and gross weight \r\nDescription of goods \r\nTotal weight and number of packages consolidated', 'Creation of Master AWB:\r\n\r\nCorrectly indicate the consignee (including contact information) \r\nExact weight, not to exceed +/- 5% of actual weight of shipment \r\nExact number of packages \r\nFor AIR shipments, description should read simply \"Consolidated as per attached manifest\". ', 'Creation of Master B/L:\r\n\r\nCorrectly indicate the consignee (including contact information) \r\nExact weight, not to exceed +/- 5% of actual weight of shipment \r\nExact number of packages \r\nFor OCEAN shipments, the description should specify the contents of each House B/L. \r\nFor ocean shipments please also indicate the container number, vessel section number and supervisor number. In case an inspection is required, please indicate shipment conditions for the container (FCL/FCL, LCL/LCL, etc.) ', 'Creation of House AWB, House B/L:\r\n\r\nCorrectly indicate the consignee (including contact information) \r\nExact weight of shipment \r\nExact number of packages \r\nDescription of goods ', 'Creation of House AWB, House B/L:\r\n\r\nCorrectly indicate the consignee (including contact information) \r\nExact weight, not to exceed +/- 5% of actual weight of shipment \r\nExact number of packages \r\nDescription of goods \r\nFor ocean shipments please indicate the container number, vessel section number and supervisor number. In case an inspection is required, include a notice that the container is exclusively for the listed client. ', 'It is very important to receive pre-alert after arrival of the shipment. Please send a copy of the MAWB/MBL, HAWB/HBL manifest to the following:\r\nFax Number: (511) 572 0269\r\nEmail Addresses: rdiaz@transberperu.com, mmanrrique@transberperu.com, hcordova@transberperu.com', 'In order to verify the information included in the shipping documents and to verify the arrival of cargo we must receive a pre-alert with copies of the M B/L and shipping manifest attached. ', 'We are able to do clearance and delivery for both air and ocean shipments. Peruvian Custom will require the following original documents:\r\n\r\nHB/I or HAWB\r\nCommercial invoice \r\nPacking list \r\nOriginal Certificate of origin, if a trade agreement exists.\r\nPlease provide us information prior to shipping cargo in order to check the necessary paperwork, duties and taxes.', 'Shipping documents must indicate \"Cargo en Transito\" (Master AWB, House AWB, B/L, F B/L and manifest). ', 'The commercial invoice should show the name and address of the shipper, name and address of consignee, invoice number, shipping date and complete description of goods. If the origin country has signed a trade agreement with Peru, a certificate of origin must be issued.', 'Dangerous goods must be sent with a certificate of dangerous cargo. There is a category of goods for which permission must be obtained from the Ministry of Industry before entering Peru. Please contact TRANSBER for additional information.', ''),
(148, '333', '0', 'The MAWB must be consigned to \"Gaash-customs clearing & international forwarding ltd\" to the attention of MRS. Dalia Simgi and always on a prepaid base', 'The Master B/L must be consigned to \"Gaash-customs clearing & international forwarding ltd\" to the attention of MRS. Dalia Simgi and always on a prepaid base', 'The HAWB can be consigned as shipper wants PPD/EXW & if there are special instructions it must be mentiond clearly on HAWB', 'The HB/L can be consigned as shipper wants PPD/EXW & if there are special instructions it must be mentiond clearly on HB/L', 'The following must be included:\r\nMAWB NUMBER\r\nHAWB NUMBER\r\nNUMBER OF PIECES & WEIGHT\r\nSHIPPER & CONSIGNEE\r\nFLIGHT & ARRIVAL DATE\r\nDESCRIPTION OF GOODS', 'The following must be included:\r\nMB/L NUMBER\r\nHB/L NUMBER\r\nNUMBER OF PIECES & WEIGHT\r\nSHIPPER & CONSIGNEE\r\nVESSEL & ARRIVAL DATE\r\nCONTAINER NUMBER\r\nDESCRIPTION OF GOODS', 'NO SPECIAL INSTRUCTIONS', 'NO SPECIAL INSTRUCTIONS', 'NO SPECIAL INSTRUCTIONS', 'NO SPECIAL INSTRUCTIONS', 'Always pre-alert by fax or by e-mail and the following must be included:\r\nMAWB NUMBER\r\nHAWB NUMBER\r\nNUMBER OF PIECES & WEIGHT\r\nSHIPPER & CONSIGNEE\r\nFLIGHT & ARRIVAL DATE\r\nDESCRIPTION OF GOODS\r\n\r\n', 'Always pre-alert by fax or by e-mail and the following must be included:\r\nMB/L NUMBER\r\nHB/L NUMBER\r\nNUMBER OF PIECES & WEIGHT\r\nSHIPPER & CONSIGNEE\r\nVESSEL & ARRIVAL DATE\r\nCONTAINER NUMBER\r\nDESCRIPTION OF GOODS\r\n\r\n', 'We can do customs clearance for any air & ocean shipments.', 'full details of cargo & clear instractions to move the cargo must be included.', 'for goods made in the: USA / CANADA / MEXICO \r\nif a certificate of origin attached to the invoice there are no customs dutys\'\r\nfor goods made in the EUROPE free market\r\nif a EUR1 FORM is attached to the invoice \r\nthere are no customs dutys\'\r\nfor goods made in TURKY\r\nif a certificate of origin attached to the invoice there are no customs dutys\'\r\n\r\n\r\n', 'The standard international requirements.', 'NO SPECIAL INSTRUCTIONS'),
