(176, '318', '3', 'Cairo Freight Systems, freight prepaid, description \"Consolidation as per attached cargo manifest\r\nNo value declared either on Master or on House, (NVD) & The House Label to be stickerd on the cartons having the H & MAWB#s', ' MBL to read our name as conginee, telex release or seaway bill both acceptable', ' Consingee to read as per shippers instructions:\r\nNo Value to be declared either on Master or on House (NVD), (Also to mention NVD in declared value for carriage and NCV in delcared value for customs) & AS AGREED\r\nOnly original 2 for consignee is accepted by customs and it should accompany the pouch sent as well as 2 extra carbonised copies', ' HBL as per shippers instructions', ' ', 'In case of ocean consolidation must show on MBL \"CONSOLIDATED CARGO TO BE DISTRIBUTED TO FINAL RECEIVERS BY CAIRO FREIGHT SYSTEMS.\" ', ' ', ' ', ' ', ' ', ' ', ' ', ' ', ' ', ' ', ' ', ' '),
(62, '165', '0', 'Shipper should be indicated as the foreign forwarder, including their address, city, and country.  Shipments should be consigned to:\r\nWorldBridge Logistics, Inc.\r\n22 Century Blvd., Suite 220\r\nNashville, TN  37214\r\nph  (615)885-0020\r\nfax (615)882-9498', 'Shipper should be indicated as the foreign forwarder, including their address, city, and country. Consignee should be listed as:\r\nWorldBridge Logistics, Inc.\r\n22 Century Blvd., Suite 220\r\nNashville, TN  37214\r\nph  (615)885-0020\r\nfax (615)882-9498', 'House Bills should be consigned from actual shipper to actual consignee, with the US Broker/forwarder listed as a notify party. Shipper could also consign to a banking institution depending on terms of sale.', 'House Bills should be consigned from actual shipper to actual consignee, with the US Broker/forwarder listed as a notify party. \r\nShipper could also consign to a banking institution depending on terms of sale.', 'Manifest should be specific and include the following: \r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION\r\nSHIPPER AND CONSIGNEE INFO', 'Manifest should be specific and include the following: \r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION\r\nSHIPPER AND CONSIGNEE INFO', '', '', '', '', 'Pre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips. Documents should be scanned and emailed.', 'Pre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips.  Documents should be scanned and emailed. ', 'We can do customs clearance for any air and ocean shipments. However, a Power of Attorney is required in order to clear Customs for any importer/shipper. If a Power of Attorney has been issued to another broker, then the cargo will be turned over to that broker for clearance. \r\nIMPORTANT NOTE: New security regulations make distinctions between known and unknown shippers. Shipments from unknown shippers ( essentially new clients to your HTFN partner ) are subject to special scrutiny which may delay the air routing by 7 or more days.\r\n\r\nWhen issuing an urgent routing order to your USA HTFN partner, please ask them to advise you if your routing may be subject to such delays so that you may advise your importer accordingly of the options available. ', 'No special requirements ', 'US Customs requires the country of origin be specified on the commercial invoice.\r\nCargo should be properly marked with the country of origin.  Contact us for specific requirements.', 'A copy of the HazMat or MSDS sheets must accompany shipments. ', ''),
(63, '292', '0', 'MAWB should be consigned to: \r\nWillfreight Express Cargo Services.\r\n1st Floor, Aviation House, Langata Road,Wilson Airport,\r\nP.O.BOX 47578 \r\nNAIROBI KENYA.\r\nTel: 254 2 602 841/2,\r\nFax: 254 2 609 147,\r\nCell:254 722 511055\r\nCell:254 735 511055\r\nEmail: info@willfreight.co.ke\r\n', 'The MB/L must be consigned to the Consignee with \r\nWillfreight as the notify party. MBL to be sent to Willfreight and not to the consignee\r\n', 'The HAWB must be consigned to the Consignee. ', 'The H B/L must be consigned to the Consignee.', 'No special requirements. Please include:\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION', 'No special requirements. Please include:\r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION', 'Declared value for carriage to read NVD\r\nDeclared value for Customs to read NCV ', 'No special instructions ', 'Depending on agreement\r\nDeclared value for carriage to read NVD\r\nDeclared value for Customs to read NCV', 'Depending on agreement ', 'Pre-Alerts should contain basic information such as:\r\nMAWB Number\r\nHAWB Number\r\nPieces and Weight\r\nShipper and Consignee\r\nFlight and arrival date\r\nCopy of AWB\r\nCopy of the invoice\r\nCopy of the manifest', 'Pre-alert to reach us 2-3 days after vessel departure. Pre-alert to contain the following information:\r\nShipper/ Consignee (Including Tel/ Fax No and PIC)\r\nCommodity\r\nNumber of cartons\r\nWeight\r\nCBM\r\nVessel name\r\nContainer number or info LCL\r\nRelease agent (Shipping line)\r\nETD\r\nETA', 'We can do Customs clearance for any air and ocean shipments if we have proper invoice and packing list, certificate of insurance is not essential. Duty and VAT has to be paid in advance if we do not know the customer. Customs clearance can be made only if shipment is consigned to a registered company/person in the relevant country. ', 'Depending on clients request. For all LCL shipment we need the commercial invoice 5 days before vessel arrival at the latest.', 'Commercial Invoice needs to contain: \r\n- supplier/buyer\r\n- country of origin\r\n- shipping terms (should match on the AWB)\r\n- payment terms\r\n- unit/total price\r\n- description of goods\r\n- currency\r\n- invoice date & No.\r\n- the invoice should state \"commercial invoice\" \r\n\r\nProforma Invoice should contain same  criteria for commercial invoice, except payment terms. In this case it should state:\r\n- value for customs purposes only\r\n- if samples: \"sample\"', 'Air D.G. generally accepted provided it has authenticated (signed and stamped) documents showing relevant worldwide approved test standards clearly displayed.HANDLING INSTRUCTIONS SHOULD BE CLEARLY INDICATED on\r\npackages and accompanying documents – HOWEVER CONFIRM WITH US CASE BY CASE BEFORE SHIPPING ! ', ''),
