(201, '83', '4', 'Cargo Brokers, Inc.\r\n27 Gamecock Ave -Suite 201\r\nCharleston, S.C.  29407\r\nTel: (843) 766-1005  Fax: (843) 300-4202', ' Cargo Brokers, Inc.\r\n27 Gamecock Ave -Suite 201\r\nCharleston, S.C.  29407\r\nTel: (843) 766-1005  Fax: (843) 300-4202', 'House Bills should be consigned from actual shipper to actual consignee.', 'If shipment is being delivered to third party, consignee should be a US Buyer, and the delivery address should be shown as such on the HBL.', 'Manifest should be specific and including the following: MAWB NUMBER, HAWB NUMBER, PIECES AND WEIGHT, SHIPPER AND CONSIGNEE (of HAWB)', 'Manifest should be specific and include the\r\nMB/L NUMBER, HB/L number, pieces and weight, shipper and consignee (of HB/L\'s)', 'Please use standard IATA instructions for issuing', 'All Steamship Lines calling US ports will be FMC', 'Please use standard IATA instructions for issuing AWB. HAWB should indicate actual description of cargo, not a general classification(Example: \r\n\"Aircraft parts\" or \"Spare Parts\" are NOT acceptable, but instead the HB/L should state \"Nozzle, Aircraft Part\" or \"Engine Piston\").', 'HB/L should indicate actual description of cargo not a general classification. Example: \"Air Craft Parts\" or \"Spare Parts\" are NOT acceptable, but instead the HB/L should state: \"Nozzle, \"Aircraft Parts \" or \"Engine Piston\". B/Ls used in shipments to/from the US, must be FMC Bonded Bil of Lading. * If your company does not have an FMC bond, you can use a co-loaded / NVOCC with an FMC bond, or you may contact Carsten Steinmetz at CBI to discuss the possibility of using CBI Bills of Lading.  ', 'Pre-alerts should be complete and should include a copy of the Master.  House Bill(s), along wit a copy of any commercial documentation and packing slip.  Pre-alerts should be sent to htfnchsimport@cargobrokers.com.', 'Pre-alerts should be complete and should include a copy of a Master,House Bill(s) along with a copy of any commercial documentation and packing slip.  Pre-alerts should be sent to htfnchsimport@cargobrokers.com  ', 'We can do customs clearance for any air and ocean shipments.  However, a Power of Attorney is required in order to clear Customs for any importer/shipper.  If a Power of Attorney has been issued to another broker, then the cargo will be turned over to the broker for clearance.  A Power of Attorney form is available on the Cargo Brokers website: (www.cargobrokers.com).   ', 'Terminate Master Bill at the local CBI Port (ATL,CHS,CLT,MIA). The House Bill should terminate at the final destination the port to which CBI will forward the shipment.', ' No specific requirements.', 'A copy of the HazMat Declaration or MSDS sheets must accompany shipments (and should be included in the pre-alert). ', 'IMPORTANT NOTE: (AIR EXPORTS FROM USA):\r\nNew security regulations make distinctions between known and unknown shippers.  Shipments from unknown shippers (essentially new clients to Cargo Brokers) are subject to special scrunity which may delay the air routing by 4 or more days.  When issuing an urgent routing order to Cargo Brokers, please verify with us if your routing may be subject to such delays so that you may advise your importer accordingly of the options available.  To help avoid potential delays, please provide the pick-up address of the shipment as early as possible so that we can accurately verify the known/unknown status of the shipper.  * NOTE These regulatiions apply to all US Freight Forwarders '),
