(235, '414', '0', 'Colbeck & Clarke Inc.\r\n3405 American Drive, Unit #7\r\nMississauga, ON., L4V 1T4\r\nemail: imports@colbeck-clarke.com', 'Colbeck & Clarke Inc.\r\n3405 American Drive, Unit #7\r\nMississauga, ON., L4V 1T4\r\nimports@colbeck-clarke.com', 'actual shipping and consignee information from commercial invoice, the HAWB must include a contact name, tel and email address.', ' actual shipping and consignee information from commercial invoice, the BL must include a contact name, tel and email address.', 'We can accept an air consolidation, you must provide a manifest and MAWB instructions as above. And HAWB per shipper/consignee', ' Same as Above', ' Shipper origin agent, consignee: Colbeck & Clarke Inc, as address above', ' Same as above', ' actual shipping and consignee information from commercial invoice, the HAWB must include a contact name, tel and email address.', ' actual shipping and consignee information from commercial invoice, the BL must include a contact name, tel and email address.', 'please send MAWB, HAWB, Commercial documents, packing list, freight invoice is collect to \r\nimports@colbeck-clarke.com', ' please send MBL, HBL, Commercial documents, packing list, freight invoice is collect to \r\nimports@colbeck-clarke.com', 'We will need to have a details commercial invoice, including HS Codes, country of origin, value, currency, complete corporation information on commercial invoice, packing list, \"free Trade Certificate, if applicable, CETA certificate, etc..', ' ', ' ', ' IMO or DGR certificate must always accompany shipping documents ', ' if any doubt, pls contact our import team:\r\n\r\nimports@colbeck-clarke.com'),
(85, '26', '', 'The MAWB must be consigned to Allfreight Logistics and always on a prepaid base. \r\n\r\n \r\n', 'The Master B/L must be consigned to Allfreight Logistics and always on a prepaid base.', 'The HAWB can be consigned as shipper wants PPD/EXW and if there are special instructions must be mentioned clearly on HAWB. Shipments via letter of credit,COD or CAD has to be announced in advance !', 'The HB/L can be consigned as shipper wants PPD/EXW and if there are special instructions must be mentioned clearly on the HB/L.Shipments via letter of credit,COD or CAD has to be announced in advance !', 'No Special Instructions but please include the following:\r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION', 'No Special Instructions but please include the following:\r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION\r\n', 'No Special Instructions', 'No Special Instructions', 'No Special Instructions', 'No Special Instructions', 'Always pre-alert by fax or by e-mail and please include the following:\r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION \r\n', 'Always pre-alert by fax or by e-mail and please include the following:\r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION\r\n', 'We can do customs clearance for any air and ocean shipments. ', 'Full details of cargo and clear instructions to move cargo must be included. \r\n', 'For India if a \'Form A\' is attached to shipment there are no import duties. For the rest of the world there are no special requirements', 'Standard International Requirements', 'Standard International Requirements'),
