(121, '312', '0', 'To Caracas Airport (Others please consult before send the cargo)\r\n\r\nThe MAWB must be consigned to:\r\n\r\n\r\n\r\nConsignee:	        Interglobal logistics VE 2509 C.A. \r\n        RIF: J-404117288 \r\n        Av. Juan Jose Flores Urb. Rancho Grande \r\n        C.C. Solimar Piso 2 Oficina 9 \r\n        Puerto Cabello Estado Carabobo.\r\n	                   Contact: Maura Marquez\r\n                               Phone : (+58 212) 331.3004\r\n\r\n\r\n\r\n\r\nNotify to:  		J&G Freight Forwarders, C.A.\r\n			 RIF: J-31198552-2\r\n                                   Av. Buenos Aires, Suites Profesionales \r\n                                   Los Caobos Piso 2 – 2B \r\n			Caracas, Venezuela\r\n			Contact: Mrs. Jenny Lago \r\n			Phone : (+58 212) 794.1921\r\n                       	E-mail : jgfreight@jgfreight.com\r\n\r\n\r\n\r\n* * Notes\r\n\r\n- Freight must always be prepaid (MAWB)\r\n\r\n\r\n\r\nThe HAWB must be consigned to:\r\n\r\n- Consignee’s name and complete address and RIF# (including the phone number and person in charge).\r\n- Freight must always be on prepaid basis, showing the air freight.\r\n- Originals must to be send to destination.\r\n\r\n', '\r\n2. MARITIME SHIPMENTS\r\n\r\n\r\n2.1.	FCL/LCL (Own consolidations) and FCL/FCL thru Letter or credits:	\r\n\r\n\r\n-	DESTINATION: LA GUAIRA\r\n\r\nThe MBL must be consigned to:\r\n\r\n	\r\nConsignee:		J&G Freight Forwarders, C.A.\r\n			RIF: J-31198552-2\r\n                                  Av. Buenos Aires, Suites Profesionales \r\n                                  Los Caobos Piso 2 – 2B \r\n			Caracas, Venezuela\r\n			Contact: Mrs. Jenny Lago \r\n			Phone : (+58 212) 794.1921\r\n                      		E-mail : jgfreight@jgfreight.com\r\n\r\n\r\n	\r\nNotify to: 		To the same \r\n\r\n\r\nNotes:	\r\n\r\n- Freight must always be prepaid (MBL).\r\n\r\n\r\nThe HBL must be consigned to:\r\n\r\n- Consignee’s name, complete address and RIF# (including the phone number and person in charge).\r\n- Freight must always be on prepaid basis.\r\n- Three (3) Originals must to be send  or told shipping line to print it at destination\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n-	DESTINATION: PUERTO CABELLO\r\n\r\n\r\nThe MBL must be consigned to:\r\n\r\n\r\nCnee :\r\n\r\nVENEZUELAN CARGO BROKERS VCB, C.A \r\nRIF J-29741928-4 \r\nCALLE 3 MANZANA E PARCELA 88 Y 89 \r\nEDIF CENTRO EMPRESARIAL MIRAMAR PISO 2 OFIC 2-5, \r\nURBANIZACION MIRAMAR MAIQUETIA, EDO. VARGAS - VENEZUELA\r\nPhone (+58212) 4179073 \r\n\r\nNotify to:                    \r\n\r\nJ&G Freight Forwarders, C.A.\r\nRIF: J-31198552-2\r\nAv. Buenos Aires, Suites Profesionales\r\nLos Caobos Piso 2 – 2B\r\nCaracas, Venezuela\r\nContact: Mrs. Jenny Lago\r\nPhone : (+58 212) 794.1921\r\nE-mail : jgfreight@jgfreight.com\r\n			 \r\n \r\n \r\n\r\n\r\n\r\n3.-	 CO-LOADS to LA GUAIRA or  PUERTO CABELLO\r\n\r\n\r\nThe MBL should read:\r\n\r\nConsignee:		J&G Freight Forwarders , C.A.\r\n                                    Av. Buenos Aires \r\nSuites Profesionales Los Caobos Piso 2 – 2B \r\n			Caracas, Venezuela\r\n			Contact: Mrs. Jenny Lago\r\n			Phone : (+58 212) 794.1921\r\n                           	Fax:      (+58 212) 793.5920\r\nE-Mail : jgfreight@jgfreight.com\r\n\r\n\r\nNotify to:                   to the same \r\n		\r\n\r\n\r\n', 'Consignee’s name and complete address and RIF# (including the phone number and person in charge).\r\n- Freight must always be on prepaid basis, showing the air freight.\r\n- Three (3) Originals must to be send to destination.\r\n', 'Consignee’s name and complete address (including the phone number and person in charge)\r\nFreight can be shown “AS ARRANGED” or “AS AGREED”\r\nThree (3) Originals must be sent to destination', '', '', '', 'Express Release:\r\nThere is express release in Venezuela , make sure that S/S Line used send the authorization to their agent at the destination ... TOP URGENT !! ', '', 'Express release allowed (you must send HBL in blank)\r\nFreight can be declared “AS ARRANGED”', 'A pre-alert of a Master AWB and HAWB must be sent 24 hrs (working days) before shipment and you must wait for our green light to send the cargo\r\n\r\nPlease send all documentation by e-mail:\r\n(operaciones@jgfreight.com, jgfreight@jgfreight.com)', 'Please send all documentation by e-mail:\r\n(operaciones@jgfreight.com,\r\njgfreight@jgfreight.com)', 'Yes, we can do this service but to clear cargo consignee must give to J & G FREIGHT FORWARDERS, C.A a power of attorney which will enable us to clear customs\r\n\r\n', 'NO transshipments allowed', 'Commercial Invoices are required by customs in order to consignee clear cargo. Shipper must always send it to consignee. Certificates only when requested by consignee.', 'Please contact case by case', 'The master MBL and AWB must be sent on a Prepaid basis.\r\nOther terms must be check with J&G Freight headquaters for further instructions or acceptations.'),
(101, '243', '0', 'KDS Cargo B.V.\r\nFolkstoneweg 202, 1118 LN Schiphol\r\nThe Netherlands.\r\nTel.: +31 (0)204467120\r\nFax.: +31 (0)204467171', 'KDS Cargo B.V.\r\nFolkstoneweg 202, 1118 LN Schiphol\r\nThe Netherlands\r\nTel.: +31 (0) 204467130\r\nFax.: +31 (0) 204467171', 'To final consignee or as per shipper\'s instructions', 'To final consignee or as per shipper\'s instructions', 'No Special Instructions. As commonly practiced.', 'No Special Instructions. As commonly practiced.', 'No Special Instructions. As commonly practiced.', 'No Special Instructions. As commonly practiced.', 'No Special Instructions. As commonly practiced.', 'No Special Instructions. As commonly practiced.', 'e-mail: Import@kds-cargo.com\r\nFax:    +31 20 4467105\r\nPlease e-mail or fax copies of all documents related to your consignment including following information:\r\n\r\nMAWB NUMBER;\r\nHAWB NUMBER;\r\nNUMBER OF PIECES, WEIGHT AND VOLUME;\r\nSHIPPER AND CONSIGNEE;\r\nFLIGHT NUMBERS AND DATE OF ARRIVAL;\r\nDESCRIPTION OF THE GOODS.', 'e-mail: Ocean@kds-cargo.com\r\nFax:    +31 20 4467105\r\nPlease e-mail or fax copies of all documents related to your consignment including following information:\r\n\r\nMB/L NUMBER;\r\nHB/L NUMBER;\r\nCONTAINER NUMBER;\r\nNUMBER OF PIECES, WEIGHT AND VOLUME;\r\nSHIPPER AND CONSIGNEE;\r\nVESSEL NAME AND DATE OF ARRIVAL;\r\nDESCRIPTION OF THE GOODS.', 'Fully licenced by Dutch Customs Authorities.\r\nImport, Export and Transit declarations are done  through a direct EDI link with Customs and is operated out of our own bonded warehouse.', '', 'No Special Instructions. As commonly practiced.', 'As per current IATA Dangerous Goods Regulations.', 'Life stock and perishables on request only!\r\nArrangements for health inspections need to be made 24 hours prior to arrival.'),
(130, '327', '0', 'MAWB should show the following as consignee:\r\nSTI (Deutschland) GmbH\r\nHochstrasse 190\r\n47228 Duisburg\r\nGermany\r\nPhone: +49 2065 6953216', 'MBL should show the following as consignee\r\nSTI (Deutschland) GmbH\r\nHochstrasse 190\r\n47228 Duisburg\r\nGermany\r\nPhone: +49 2065 695221', 'complete consignee adress with phone-no. and contact person', 'HBL should show actual consignee as consignee', 'manifests should show pieces, weight, volume and commercial value of each consignment, along with the terms of shipment\r\n\r\nMAWB Number\r\nHAWB Number\r\nPieces and Weight\r\nVolume\r\nCommercial Value of each consignment\r\nTerms of Shipment\r\nFlight and arrival date\r\ngoods description', 'Manifest should include:\r\nOcean MB/L number\r\nHouse B/L number\r\nPieces/Weight/Volume\r\nMarks & Numbers\r\nVessel\r\nShipper/Consignee/Notify Party\r\nContainer Number/Seal Number\r\nGoods description\r\n', '-/-', 'MBL should show STI (Deutschland) GmbH as consignee', '-/-', 'HBL should show actual consignee as consignee', 'Please send all documents (Cargo Manifest, MAWB & HAWB, etc) by E-mail to kruno.karacic@sti-fm.com or telefax +49 2065 803216 latest 24 hrs before arrival at destination airport.', 'Copy of Master B/L\r\nCopy of House B/L\r\nCopy of Cargo Manifest\r\nDebit Note / Credit Note', '1. when door to door airshipment is duty paid by shipper\r\n\r\nConsign master airwaybill to agent mentioned by STI\r\n\r\n2. when door to door airshipment is duty paid by consignee STI will instruct agent accordingly.\r\n\r\nDocuments requested:\r\nMaster bill of lading\r\nHouse Bill of lading\r\nInvoice\r\nPacking List\r\nCargo Manifest', '', 'Original Commercial Invoices & Packing list must be provided for customs entry declaration.\r\nOriginal Certificate of Origin must be provided for, photocopies of such documents will not be accepted by customs', 'DG goods will require DG certificate, certifying that goods are hazardous in nature.\r\nPorduct specification from shipper as well as MSDS (Material Safety Data Sheet) maybe required if available for customs releasing.', ''),
(103, '59', '2', 'The MAWB must be consigned Enkay Express, Dubai', 'The Master Bill of Lading should mention all the following details\r\n. SHIPPER\'S NAME & ADDRESS\r\n. CONSIGNEE\'S NAME & ADDRESS TO READ AS:\r\nEnkay Express LLC\r\nP.O Box#55393\r\nDubai, UAE\r\nTel:  +971 (4) 7034777\r\nFax:  +971 (4) 2834361\r\n. NOTIFY PARTY\'S : SAME AS CONSIGNEE\r\n. BILL OF LADING#\r\n. M/VESSEL NAME & VOYAGE NO.\r\n. PORT OF LOADING\r\n. MARKS & NUMBERS\r\n. CONTAINER & SEAL NUMBER\r\n. NUMBER & KIND OF PACKAGES\r\n. DESCRIPTION OF GOODS\r\n. GROSS WEIGHT\r\n. TARE WEIGHT\r\n. MEASUREMENT (CBM)\r\n. FREIGHT PRE PAID\r\n. PLACE & DATE OF ISSUE\r\nAll the documents related to the shipment should match each other in all respect viz. No: of packages, Gross Weight & measurement. ', 'For Back to Back shipments :\r\n1.HAWB should be consigned to the consignee mentioning CC or PP charges \r\n2.HAWB scv vvould mention if any COD cheques to be collected before releasing the Delivery Order to the consignee to enable us collect the same. \r\nFor Consolidated shipments (Consolidation) : \r\n1. Original HAWBs i.e 1 set inside the pouch & 1 along with MAWB outside the pouch showing \"As Agreed\"\r\n2. Shipments under L/C the HAWB to be consigned as follows \"Goods Dispatched to Consignee name ……..address………..mentioning the L/C number.. ', 'All Original Documents should be received 72 hours prior to vessel arrival at designated port in Dubai.\r\nFor L/C\'s we should have full set of copies by fax, 72 hrs prior to vessel arrival.\r\n1. In case of L/C, pls. specify Bank\'s full name\r\n2. In case of COD(Cash on delivery), pls. mention your instructions for COD shipment clearly in the house mentioning the amount & currency to be collected.\r\n3. In case of CAD(Cash against delivery) through Bank,Pls. mention clear instructions for freight & other charges to be collected from final consignee.\r\n*The House Bill of Lading, should mention the following details.\r\n. EXPORTERS / SUPPLIERS COMPLETE NAME & ADDRESS\r\n. FINAL CONSIGNEE\'S NAME & ADDRESS\r\n. OTHER DETAILS SAME AS IN M B/L', 'The Cargo Manifest in general should mention the following information: \r\nFROM : \r\nTO : \r\nMAWB #\r\nAirline\r\nFlight # and Dtd\r\nDeparture Airport\r\nArrival Airport\r\nDate \r\nFile Ref # \r\n_____________________________________________________________________ HAWB #, Shipper, C/nee, Destination, Pgks, G.Wt, Goods, CC \r\nIn case of Consolidation manifest the HAWB # will continue so far as how much so every shipments you have. ', 'The Cargo Manifest in general should mention the following information: \r\nFROM \r\nTO \r\nB/L No. \r\nVESSEL NAME \r\nCONTAINER No.\r\nETD \r\nETA \r\nH B/L No. , SHIPPER , CONSIGNEE, GROSS WEIGHT, VOLUME, PKG., TYPE, COMMODITY, MARKS, FREIGHT PREPAID/ COLLECT.', 'Master MAWB should be consigned to Enkay Express, showing freight terms: pre-paid \r\nOriginal documents, namely Invoice, packing list and COO a must, for clearance.', 'Master B/L should be consigned to Enkay Express, showing freight terms: pre-paid \r\nOriginal documents, namely Invoice, packing list and COO a must, for clearance.', 'HAWB to be consigned to final receiver, showing freight terms, collect, details of amount \r\nCopy of Invoice, packing list and COO to accompany the shipment.', 'HB/L to be consigned to final receiver, showing freight terms, collect, details of amount \r\nCopy of Invoice, packing list and COO to accompany the shipment.', 'Always pre-alert to be received prior to shipment arrival, indicating B/L or AWB / flight details, ETA, number of packages, shipper consignee, DGR, special handling, if any.\r\nPre-Alert should be advised prior to the shipment along with a copy of MAWB & HAWB for the following reasons : \r\n1. To check whether the shipment has been consigned as per the above instructions and if not to revert back to the agent 2. Pre-Alert is required for insurance purpose prior to shipment arrival. ', 'Always pre-alert to be received prior to shipment arrival, indicating B/L or AWB / flight details, ETA, number of packages, shipper consignee, DGR, special handling, if any.\r\nPre-Alert should be advised prior to the shipment along with a copy of MB/L & H B/L for the following reasons: \r\n1. To check whether the shipment has been consigned as per the above instructions or not to revert back to the agent.\r\n2. Pre-Alert is required for insurance purpose prior to shipment arrival.', 'Here again if you define shipper as an Agent, Yes we can custom clear the shipment in either case : \r\ni) In presence of Agency Agreement \r\nii) In absence of Agency Agreement \r\nProvided all the documents required as below accompanies the shipment.\r\n· Original Commercial Invoice duly attested from Chamber of Commerce\r\n· Certificate of Origin duly attested from Chamber of Commerce \r\n· Original Packing List\r\nDuly Signed and Stamped\r\nImportant: It is not allowed to custom clear or import from any Israeli shipper\'s product. ', '', 'AIR:\r\nCertificate of Origin (need to be attested from the chamber of commerce or legalised from the Kuwaiti Consulate) as per the agreement between the c/nee and the supplier. \r\nCommercial Invoice (need to be attested from the chamber of commerce or legalised from the Kuwaiti Consulate) as per the agreement between the c/nee and the supplier. The Invoice should mention the Currency of value mentioned. \r\nPacking list \r\nOCEAN:\r\nC/O should show manufacturer\'s name & address & country of origin. ( needs to be attested from the Chamber Of Commerce or legalized from the Kuwait Consulate) \r\nIncase of L/C , it shall be authenticated from Kuwaiti Consulate. \r\nCommercial invoice ( needs to be attested from the Chamber Of Commerce )\r\nThe invoice should mention the following:\r\n- Currency of Value \r\n- Gross Weight\r\n- Net weight\r\n- No. of packages (it should tally with M B/L)\r\n- Unit Price and total Value\r\nPacking List ', 'AIR - It is as per the TACT rules….. No special requirements. \r\nOCEAN - As per IMCO Rules & Regulations, it should be shown on the M B/L & H B/L. ', ''),
