(104, '59', '1', 'The MAWB must be consigned to ENKAY EXPRESS BAHRAIN, \r\nP O BOX 10642, BAHRAIN.\r\nFreight should be on PP Basis ', 'The MBL must be consigned to ENKAY EXPRESS BAHRAIN, \r\nP O BOX 10642, BAHRAIN.\r\nFreight should be on PP Basis \r\n', 'HAWB should be consigned to the actual consignee showing mode of freight: PP or CC.\r\n', 'HBL should be consigned to the actual consignee showing mode of freight: PP or CC.\r\n', 'Consolidation Manifest should be made as per the shipper/consignee weight, volume and pieces of the shipment\'s detail. \r\n', 'Consolidation Manifest should be made as per the shipper/consignee weight, volume and pieces of the shipment\'s detail.\r\n', 'Master MAWB should be consigned to Enkay Express, showing freight terms: Pre-paid \r\nOriginal documents, namely Shipper Invoice and Packing List a must, for clearance.\r\nOther services required at Destination should be mentioned i.e. Customs Clearance/Delivery \r\n', 'Master B/L should be consigned to Enkay Express, showing freight terms: Pre-paid \r\nOriginal documents, namely Shipper Invoice and Packing List a must, for clearance.\r\nOther services required at Destination should be mentioned i.e. Customs Clearance/Delivery ', 'HAWB to be consigned to final receiver, showing freight terms, collect, details of amount \r\nOriginal Shipper\'s Invoice and packing list to accompany the shipment.\r\nPre-Alert should be sent to us as soon as the shipment is booked or MAWB has been prepared with all details. Copy of MAWB/HAWB/ should be faxed/emailed prior to shipment arrival. Airfreight shipment on Freight collect - Two sets of HAWB should be prepared. One set of \"\"AS AGREED\"\" for customs clearance purpose and Second set \"\"As per selling rate\"\" for consignee and both sets of HAWB must be sent with the MAWB. ', 'HB/L to be consigned to final receiver, showing freight terms, collect, details of amount \r\nOriginal Shipper Invoice and Packing list to accompany the shipment.\r\nPre-Alert should be sent to us once the shipment is booked or MBL has been made with all details. Copy of MBL/HBL should be faxed prior to shipment arrival. ', 'Always pre-alert to be received prior to shipment arrival, indicating AWB / flight details, ETA, number of packages, shipper consignee, DGR, special handling, if any.\r\nPre-Alert should be sent to us as soon as shipment is booked or MAWB has been prepared with all details. Copy of MAWB/HAWB/should be faxed immediately. For Airfreight shipments on Freight collect two sets of HAWB should be made. One set \"\"AS AGREED\"\" for customs clearance purpose and Second set \"\"As per selling rate\"\" for consignee and both sets of HAWB must be sent with the MAWB. \r\nOriginal shipper\'s invoice/packing list must be sent with the MAWB & HAWB.Shipment cannot be cleared in the absence of these documents.\r\n', 'Always pre-alert to be received prior to shipment arrival, indicating B/L ,Vessel Details, ETA, number of packages, shipper consignee, DGR, special handling, if any.\r\nPre-Alert should be sent to us as soon as shipment booked or MBL has been made with all details. Copy of MBL/HBL should be faxed immediately. \r\nOriginal shipper\'s invoice/packing list must be sent with the MBL & HBL .Shipment cannot be cleared in the absence of these documents.', 'We can provide Customs Clearance services for both air and sea freight shipments on behalf of the consignee. The consignee should have a valid commercial registration certificate with the activitiy allowing him to import the required cargo.', 'If the shipment in under an L/C (Letter of Credit) Certificate of origin is required and it should be legalized by Chamber of Commerce and any Arab consulate. ', 'On the Shipper\'s Invoice and packing list the manufacturer details and origin of goods must be mentioned. ', 'Dangerous goods as per IATA or shipping lines regulation.', ''),
(185, '355', '0', 'Lynx Cargo International S.A.\r\nReconquista 365, 7th floor, Suite B\r\nC1003ABG C.A.B.A.\r\nArgentina\r\nCUIT: 30-69080663-7\r\nPH +54-11-5530-7500\r\nFX +54-11-5530-7501\r\n\r\n\r\nRemarks: otherwise customs penalties will be charged.', 'Cnee: Lynx Cargo International S.A.\r\nReconquista 365, 7th floor, Suite B\r\nC1003ABG C.A.B.A.\r\nArgentina\r\nCUIT: 30-69080663-7\r\n\r\nNotify: Lynx Cargo International S.A.\r\nPH +54-11-5530-7500\r\nFX +54-11-5530-7501\r\n', '- Cnee\'s name and address.\r\n- Phone number, email and contact person. \r\n- Importer\'s CUIT (vat) number (in \"cnee\'s name & address\").\r\n\r\n\r\nRemarks: otherwise customs penalties will be charged.', '- Cnee\'s name and address.\r\n- Phone number, email and contact person. \r\n- Importer\'s CUIT (vat) number (in \"cnee\'s name & address\" or in \"accounting information\").\r\n', '- MAWB number \r\n- HAWB number \r\n- Qty of pieces \r\n- Gross weight (in KG).\r\n- Shipper.\r\n- Cnee\r\n- Nature of goods\r\n- Flight information.', '- MBL number \r\n- hbl/s number \r\n- Qty of pieces \r\n- Total Volume (in cbm).\r\n- Gross weight (in KG). ', '- Pls apply freight prepaid.\r\n- Pls always show \"CONSOL SHIPMENT\" in \"nature & qty of goods\".\r\n- Pls show in \"handling information\" if goods need any special care (such as temperature, handling, etc). \r\n- Our CUIT number must be shown in \"handling information\" too.', '-Pls always show \"CONSOL SHIPMENT\" in description part.\r\n-description should include NCM number\r\n', '- Airfreight could be shown as \"as agreed\" but we\'ll need to know amounts of freight, due carrier and due agent in advance in order to submit the info to our Customs.\r\n- Pls show if freight is prepaid or collect.\r\n- Pls show if charges are prepaid or collect.\r\n- Original #2 (for cnee) must come inside a pouch.\r\n- Importer\'s CUIT number and HS code must be shown in \"handling information\".  In case of more than one HS code, the one with the higher value (goods value) must be shown on HAWB.\r\n\r\nRemarks: otherwise customs penalties will be charged.', '-hbl can be rated or \"as agreed\"\r\n-description should include NCM number\r\n-Express release of hbls is not allowed by Argentinian customs.', '- Pls send complete pre-alert (MAWB/HAWB/Manifest/Comm Inv/Packing List/Certifications/Etc) from 24hs to 48hs before the departure (working days).\r\n- We suggest to ask for our green light in order to avoid problems or customs penalties at destination.\r\n- Confirm if original commercial docs will be sent along with the HAWB.\r\n- Pls send your pre-alert to: bueim@lynx.com.ar', 'All new bookings should be informed to us on time, that is previous to start coordination at origin, and previous to any doc deadline. Information should include: \r\n-full booking details: vessel\'s name, deadline, etd, qty, weight, dims, commodity \r\n-shipper\'s full info: name, address, contact info \r\n-cnee\'s full info: name, address, contact info  (so we can contact them and confirm their acceptance of the new shipment) \r\n-carrier\'s info (depending on which carrier you\'ll use, consignation of mbls will be different).\r\n\r\nWe need to see drafts of hbl and mbl, at least 3 days before doc deadline at your side, in order to have them check by all parties here at Bue and receive the confirmation. Pls, send drafts and booking information to our group \"Bue Ocean Imports\": bueocim@lynx.com.ar\r\n-Pre alert should be sent after drafts are confirmed by us.\r\n-original mbls (3) and hbls (3) are needed at destination at least 1 week before vessel arrival (in order to be able to present them to customs). \r\nWe must receive full sets of original mbls (3) by courier from you. \r\ncnee needs to have original hbls before vessel arrival: we may also receive original hbls and be instructed by you to handle them to cnee. Or shipper may send orignal hbls to cnee directly.', '- Pls kindly note that Lynx Cargo International S.A. cannot act as importer/exporter of HAWB.\r\n- The local company must be duly registered as importer/exporter before our local Customs. ', ' ', '- Original commercial invoice, packing list, special certificates (if required) are needed by the local Customs in order to clear goods (customs clearance).  Shipper must always send the original commercial docs. ', 'Some DGR goods are not accepted by the Argentinian Customs or have special requirements, which should be checked in advance (before shipping out).', 'Airfreight: all pieces must be properly labeled in order to avoid problems/delays and customs penalties at destination.\r\n\r\nDDU/DDP: do not ship out without our approval, pls contact us in advance. '),
