(226, '376', '0', 'ACS Logistics GmbH & Co KG\r\nFlughafenstrasse 1\r\nA-4063 Hoersching\r\nCtc: Regina Pfaffeneder\r\nP: +43 7221 600 4386\r\n', ' Consign to:\r\nACS Logistics GmbH & Co KG\r\nFlughafenstrasse 1\r\nA-4063 Hoersching\r\nCtc: Regina Pfaffeneder\r\nP: +43 7221 600 4386', ' ', ' ', ' ', ' ', 'Freight Prepaid\r\n', ' ', ' ', ' ', 'send full set of pre-alert documents min. 24 hrs prior arrival to office@acslogistics.at ', 'send full set of pre-alert documents min. 24 hrs prior arrival to office@acslogistics.at ', 'for standard customs clearance copies of documents are good enough and usual processing time is 2-8 hrs from the time of entry / shpmt arrival', ' ', 'no special requirements', ' ', ' '),
(186, '354', '0', 'MAWB should be consigned to: \r\n\r\nRadius International \r\n580 Chelsea St. \r\nEast Boston, MA 02128 \r\nTel: (617) 561-1300 \r\nFax:(617) 561-0425 \r\n', 'Master B/L should be consigned to:\r\n\r\nRadius International \r\n580 Chelsea St. \r\nEast Boston, MA 02128 \r\nTel: (617) 561-1300 \r\nFax:(617) 561-0425 \r\n', 'House Bills should be consigned from actual shipper to actual consignee.\r\nIf shipment is being delivered to a third party, consignee should be the US Buyer, and the delivery address should be shown in the Handling or Accounting Information fields.\r\nPlease ensure a complete address is used for the consignee along with contact information. ', 'House Bills should be consigned from actual shipper to actual consignee, with the Radius International listed as a notify party.\r\nIf shipment is being delivered to a third party, consignee should be the US Buyer, and the delivery address should be shown as such on the HB/L.\r\nPlease ensure a complete address is used for the consignee along with contact information.  ', 'Manifest should be specific and include the following:\r\n\r\nMAWB NUMBER\r\nHAWB NUMBER\r\nPIECES AND WEIGHT\r\nSHIPPER AND CONSIGNEE (of HAWBs)\r\nFLIGHT AND ARRIVAL DATE\r\nGOODS DESCRIPTION (Must be the same as HAWB) ', 'Creation of an ocean manifest is not necessary. We do require that, without fail, we receive ISF (10+2) information 48 hours prior to a vessels loading date. \r\n\r\nThese 10 pieces of information are as follows:\r\n\r\n1. Manufacturer (or supplier) name and address\r\n2. Seller (or owner) name and address\r\n3. Buyer (or owner) name and address\r\n4. Ship-to name and address\r\n5. Container stuffing location\r\n6. Consolidator (stuffer) name and address\r\n7. Importer of record number/foreign trade zone applicant identification number\r\n8. Consignee number(s)\r\n9. Country of origin\r\n10.Commodity Harmonized Tariff Schedule number\r\n', 'Please use standard IATA instructions for issuing AWB', 'B/Ls used in shipments to/from the US, must be FMC bonded Bills of Lading. All Steamship Lines calling US Ports will be FMC bonded. ', 'Please use standard IATA instructions for issuing AWB\r\n\r\nHAWB should indicate an accurate description of cargo, please make sure it is detailed.', 'HB/L should indicate an accurate description of cargo, please make sure it is detailed.\r\n\r\nB/Ls used in shipments to/from the US, must be FMC bonded Bills of Lading. *If your company does not have an FMC bond, you can use a co-loader/NVOCC with an FMC bond. In rare cases you can contact Radius International and we can discuss the use of Radius OTI number and B/L. ', 'Pre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips. Air Pre-Alerts should be sent to bostonimport@radiuscargo.com', 'Pre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips. Ocean Pre-Alerts should be sent to bostonimport@radiuscargo.com \r\n\r\n*Please note that no Ocean shipment will be approved to be loaded on a vessel destined for the Untied States until the ISF (10+2) information has been received and verified.', 'Radius International is fully equipped to clear any shipment coming into the United States via Air, Ocean, Rail, and land. Please note that a Power of Attorney is required in order to clear Customs for any importer/shipper. A copy of our POA can be found on our web site www.radiuscargo.com in the \"forms\" section. ', 'We can readily handle, excecute Customs Clearance, and deliver freight anywhere in the United States. Just simply consign your Air, Ocean, Rail, or Truck shipment to:\r\n\r\nRadius International \r\n580 Chelsea St. \r\nEast Boston, MA 02128 \r\nTel: (617) 561-1300 \r\nFax:(617) 561-0425 \r\n\r\nAnd send to which ever Air/Ocean Port or Boarder Crossing best suits your ultimate consignee or delivery address. If you have any questions at all as to which POD would be best for your shipment please contact bostonimport@radiuscargo.com and we can help you determine which Port of Entry is logistically best for your shipment.\r\n\r\n ', 'All Commercial Invoices, Packing Lists, C/O\'s, and other shipping documents should be compliant with all US Customs regulations found in CFR 19 Section 141.86.  ', 'A copy of the HazMat Declaration or MSDS sheets must accompany shipments (and should be included in the pre-alert). We MUST be made aware that a shipment is DG when requesting rates or services. ', 'IMPORTANT NOTE (AIR EXPORTS FROM USA):\r\nNew security regulations make distinctions between known and unknown shippers. Shipments from unknown shippers are subject to special scrutiny and can fly on Cargo Aircraft only, which may delay the air routing by 4 or more days.\r\nWhen issuing an urgent routing order to Radius International, please verify with us if your routing may be subject to such delays so that you may advise your importer accordingly of the options available.\r\nTo help avoid potential delays, please provide the pick-up address and full company name of the shipment as early as possible so that we can accurately verify the known/unknown status of the shipper. We can also process a shipper and make them known, please email bostonexport@radiuscargo.com for details on how we would be able to do this. Also note that starting in August 2010 TSA regulations will require that 100% of all Air Cargo must be screened pre-flight and this could cause additional delays to any Air Shipments. You can email bostonexport@radiuscargo.com for details on this as well.\r\n\r\n*Note these regulations apply to all US Freight Forwarders.  '),
(150, '333', '4', 'The MAWB must be consigned to \"Gaash-customs clearing & international forwarding ltd\" to the attention of MRS. Dalia Simgi and always on a prepaid base\r\n', 'The Master B/L must be consigned to \"Gaash-customs clearing & international forwarding ltd\" to the attention of MRS. Dalia Simgi and always on a prepaid base\r\n', 'The HAWB can be consigned as shipper wants PPD/EXW & if there are special instructions it must be mentiond clearly on HAWB', 'The HB/L can be consigned as shipper wants PPD/EXW & if there are special instructions it must be mentiond clearly on HB/L\r\n', 'The following must be included: \r\nMAWB NUMBER \r\nHAWB NUMBER \r\nNUMBER OF PIECES & WEIGHT \r\nSHIPPER & CONSIGNEE \r\nFLIGHT & ARRIVAL DATE \r\nDESCRIPTION OF GOODS', 'The following must be included: \r\nMB/L NUMBER \r\nHB/L NUMBER \r\nNUMBER OF PIECES & WEIGHT \r\nSHIPPER & CONSIGNEE \r\nVESSEL & ARRIVAL DATE \r\nCONTAINER NUMBER \r\nDESCRIPTION OF GOODS\r\n', '', '', '', '', 'Always pre-alert by fax or by e-mail and the following must be included: \r\nMAWB NUMBER \r\nHAWB NUMBER \r\nNUMBER OF PIECES & WEIGHT \r\nSHIPPER & CONSIGNEE \r\nFLIGHT & ARRIVAL DATE \r\nDESCRIPTION OF GOODS', 'Always pre-alert by fax or by e-mail and the following must be included: \r\nMB/L NUMBER \r\nHB/L NUMBER \r\nNUMBER OF PIECES & WEIGHT \r\nSHIPPER & CONSIGNEE \r\nVESSEL & ARRIVAL DATE \r\nCONTAINER NUMBER \r\nDESCRIPTION OF GOODS \r\n', 'We can do customs clearance for any air & ocean shipments', 'full details of cargo & clear instractions to move the cargo must be included.', 'for goods made in the: USA / CANADA / MEXICO \r\nif a certificate of origin attached to the invoice there are no customs dutys\' \r\nfor goods made in the EUROPE free market \r\nif a EUR1 FORM is attached to the invoice \r\nthere are no customs dutys\' \r\nfor goods made in TURKY \r\nif a certificate of origin attached to the invoice there are no customs dutys\' ', 'The standard international requirements.\r\n', '