(153, '334', '0', 'AWB must be consigned to IFL SPEDIZIONI SPA - Limito di Pioltello (MILANO) ITALY \r\nAWB on PREPAID basis \r\n                       ', 'The Master B/L must be consigned to IFL SPEDIZIONI SPA - Limito di Pioltello (MILANO) \r\nB/L on PREPAID basis ', 'HAWB to be consigned to final consignee as per terms and condition of sales!!! Eventual C.O.D. terms must be clearly indicated on HAWB and relative prealert should indicate it! ', 'B/L to be consigned to final consignee as per terms and condition of sales!!! Eventual C.O.D. terms must be clearly indicated on HBL and relative prealert should indicate it!', 'Consolidated manifest with individual HAWB with commercial invoices (clearly specifying exact shipping terms) + HTFN invoice for eventual freight transportation to be collected ', 'consolidated manifest with individual HBL with commercial invoices ', 'no special instructions ', 'Whenever possible, pls issue EXPRESS BILL OF LADING / SURRENDED  BL', 'HAWB should clearly show exact shipping terms and export supplier invoice must matched such informations !Pls always try to indicate a contact person and cnee phone number ', 'HBL should clearly show exact shipping terms and export supplier invoice must matched such informations! Please try always to indicate a contact person and phone number of cnee ', 'prealert to be sent to giordano.formenti@iflsped.it\r\nit should include AWB/HAWB/Export shipper invoice', 'prealert to be sent to\r\nmaria.longordo@iflsped.it \r\nit should include B/L + HBL + export shipper invoice ', 'in case of DDU/DDP we can arrange customs clearance on behalf of shipper subject to cnee\'s acceptance', '', '', 'IMO or DGR certificate must always accompany shipping documents ', ''),
(155, '334', '3', 'AWB should be consigned to IFL SPEDIZIONI SPA - LIMITO DI PIOLTELLO (MILANO) on PREPAID basis \r\nOnly if authorised by our import dept, AWB can be consigned to IFL SPEDIZIONI SPA - GENOVA ', 'B/L should be consigned to IFL SPEDIZIONI SPA - LIMITO DI PIOLTELLO (MILANO) \r\nOnly if authorised by our import dept, B/L can be consigned to IFL SPEDIZIONI SPA - GENOVA', 'HAWB must be consigned to the final consignee as per terms and condition of sale ', 'HBL must be consigned to final consignee as per terms and condition of sale ', 'consolidation manifest with individual HAWBS and export commercial invoices ', 'consolidation manifest with individual HBL and export commercial invoices ', 'AWB must be on PREPAID BASIS ', 'MBL must be on PREPAID BASIS \r\nWhenever possibble please issue EXPRESS BILL OF LADING / SURRENDERED ', 'HAWB must clearly show exact shipping terms \r\nIn case of COLLECT shipment, HAWB must be accompanied by HTFN agent invoice for freight transportation ', 'HBL must clearly show exact shipping terms \r\nIn case of COLLECT shipments, HAWBS must be accompanied by HTFN agent invoice for freight transportation ', 'prealert to be sent by mail to:\r\ngiordano.formenti@iflsped.it\r\nmarina.grillo@iflsped.it ', 'prealert to be sent by mail to:\r\nmaria.longordo@iflsped.it\r\nmarina.grillo@iflsped.it ', 'if terms are DDP/DDU we can arrange customs clearance on behalf of shipper subject to consignee\'s acceptance ', '', '', 'IMO or DGR certificate to be attached to shipping docs ', ''),
