(169, '165', '1', 'Shipper should be indicated as the foreign forwarder, including their address, city, and country. Shipments should be consigned to: \r\nV. Alexander & Co., Inc.\r\n3286 N. Park Blvd., Suite D\r\nAlcoa, TN 37701\r\nTel: (865) 970-7461\r\nFax: (865) 970-7490\r\n', 'Shipper should be indicated as the foreign forwarder, including their address, city, and country. Consignee should be listed as: \r\nV. Alexander & Co., Inc.\r\n3286 N. Park Blvd., Suite D\r\nAlcoa, TN 37701\r\nTel: (865) 970-7461\r\nFax: (865) 970-7490', 'House Bills should be consigned from actual shipper to actual consignee, with the US Broker/forwarder listed as a notify party. Shipper could also consign to a banking institution depending on terms of sale.', 'House Bills should be consigned from actual shipper to actual consignee, with the US Broker/forwarder listed as a notify party. \r\nShipper could also consign to a banking institution depending on terms of sale.\r\n', 'Manifest should be specific and include the following: \r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION \r\nSHIPPER AND CONSIGNEE INFO\r\n', 'Manifest should be specific and include the following: \r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION \r\nSHIPPER AND CONSIGNEE INFO\r\n', ' ', ' ', ' ', ' ', 'Pre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips. Documents should be scanned and emailed.', 'Pre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips. Documents should be scanned and emailed. ', 'We can do customs clearance for any air and ocean shipments. However, a Power of Attorney is required in order to clear Customs for any importer/shipper. If a Power of Attorney has been issued to another broker, then the cargo will be turned over to that broker for clearance. \r\nIMPORTANT NOTE: New security regulations make distinctions between known and unknown shippers. Shipments from unknown shippers ( essentially new clients to your HTFN partner ) are subject to special scrutiny which may delay the air routing by 7 or more days. \r\n\r\nWhen issuing an urgent routing order to your USA HTFN partner, please ask them to advise you if your routing may be subject to such delays so that you may advise your importer accordingly of the options available. \r\n', 'No special requirements ', 'US Customs requires the country of origin be specified on the commercial invoice. \r\nCargo should be properly marked with the country of origin. Contact us for specific requirements.\r\n', 'A copy of the HazMat or MSDS sheets must accompany shipments. ', ' '),
(170, '165', '2', 'Shipper should be indicated as the foreign forwarder, including their address, city, and country. Shipments should be consigned to: \r\nV. Alexander & Co., Inc.\r\n6555 Quince Road, Suite 201\r\nMemphis, TN 38119\r\nTel: (901) 795-7761\r\nExport Fax: (901) 794-7906\r\nImport Fax: (901) 363-1054\r\n', ' Shipper should be indicated as the foreign forwarder, including their address, city, and country. Cosnignee should be listed as: \r\nV. Alexander & Co., Inc.\r\n6555 Quince Road, Suite 201\r\nMemphis, TN 38119\r\nTel: (901) 795-7761\r\nExport Fax: (901) 794-7906\r\nImport Fax: (901) 363-1054\r\n', 'House Bills should be consigned from actual shipper to actual consignee, with the US Broker/forwarder listed as a notify party. Shipper could also consign to a banking institution depending on terms of sale.', 'House Bills should be consigned from actual shipper to actual consignee, with the US Broker/forwarder listed as a notify party. \r\nShipper could also consign to a banking institution depending on terms of sale.\r\n', 'Manifest should be specific and include the following: \r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION \r\nSHIPPER AND CONSIGNEE INFO\r\n', 'Manifest should be specific and include the following: \r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE \r\nVESSEL \r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION \r\nSHIPPER AND CONSIGNEE INFO\r\n', '', ' ', ' ', ' ', ' \r\nPre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips. Documents should be scanned and emailed.\r\n', 'Pre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips. Documents should be scanned and emailed. ', 'We can do customs clearance for any air and ocean shipments. However, a Power of Attorney is required in order to clear Customs for any importer/shipper. If a Power of Attorney has been issued to another broker, then the cargo will be turned over to that broker for clearance. \r\nIMPORTANT NOTE: New security regulations make distinctions between known and unknown shippers. Shipments from unknown shippers ( essentially new clients to your HTFN partner ) are subject to special scrutiny which may delay the air routing by 7 or more days. \r\n\r\nWhen issuing an urgent routing order to your USA HTFN partner, please ask them to advise you if your routing may be subject to such delays so that you may advise your importer accordingly of the options available. \r\n', 'No special requirements ', 'US Customs requires the country of origin be specified on the commercial invoice. \r\nCargo should be properly marked with the country of origin. Contact us for specific requirements.\r\n', 'A copy of the HazMat or MSDS sheets must accompany shipments. ', ' '),
(171, '83', '1', 'For shipments to Florida (MIA, JAX, TPA, MCO), please consign MAWB to:\r\nCargo Brokers International, Inc.\r\n10880 NW 27th Street\r\nSuite 100\r\nMiami, FL 33172 United States\r\nTel:  +1 (305) 477-3990 / Fax:  +1 (305) 477-4290', 'For shipments to Florida (Miami, Port Everglades, Jacksonville, Tampa), please consign MB/L to: \r\nCargo Brokers International, Inc.\r\n10880 NW 27th Street\r\nSuite 100\r\nMiami, FL 33172 United States\r\nTel:  +1 (305) 477-3990 / Fax:  +1 (305) 477-4290', 'House Bills should be consigned from actual shipper to actual consignee.  \r\nIf shipment is being delivered to a third party, consignee should be the US Buyer, and the delivery address should be shown in the Handling or Accounting Information fields.', 'House Bills should be consigned from actual shipper to actual consignee, with the US Broker/forwarder listed as a notify party. \r\nIf shipment is being delivered to a third party, consignee should be the US Buyer, and the delivery address should be shown as such on the HB/L.\r\n', 'Manifest should be specific and include the following: \r\n\r\nMAWB NUMBER \r\nHAWB NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE (of HAWBs)\r\nFLIGHT AND ARRIVAL DATE \r\nGOODS DESCRIPTION (Must be the same as HAWB)\r\n', 'Manifest should be specific and include the following: \r\n\r\nMB/L NUMBER \r\nHB/L NUMBER \r\nPIECES AND WEIGHT \r\nSHIPPER AND CONSIGNEE (of HB/Ls)\r\nVESSEL AND VOYAGE\r\nCONTAINER NUMBER \r\nGOODS DESCRIPTION (Must be the same as HB/L)', 'Please use standard IATA instructions for issuing AWB', 'B/Ls used in shipments to/from the US, must be FMC bonded Bills of Lading.  All Steamship Lines calling US Ports will be FMC bonded.  ', 'Please use standard IATA instructions for issuing AWB\r\n\r\nHAWB should indicate actual description of cargo, not a general classification\r\n(Example: “Air Craft Parts” or “Spare Parts” are NOT acceptable, but instead the HAWB should state “Nozzle, Aircraft part” or “Engine Piston”)', 'HB/L should indicate actual description of cargo, not a general classification\r\n(Example: “Air Craft Parts” or “Spare Parts” are NOT acceptable, but instead the HB/L should state “Nozzle, Aircraft part” or “Engine Piston”)\r\n\r\nB/Ls used in shipments to/from the US, must be FMC bonded Bills of Lading.  *If your company does not have an FMC bond, you can use a co-loader/NVOCC with an FMC bond, or you may contact Carsten Steinmetz at CBI to discuss the possibility of using CBI Bills of Lading.', 'Pre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips.  Pre-alerts should be sent to htfnmiaimport@cargobrokers.com', 'Pre-Alerts should be complete and should include a copy of the Master, House Bill(s), along with a copy of any commercial documentation and packing slips.  Pre-alerts should be sent to htfnmiaimport@cargobrokers.com  ', 'We can do customs clearance for any air and ocean shipments. However, a Power of Attorney is required in order to clear Customs for any importer/shipper. If a Power of Attorney has been issued to another broker, then the cargo will be turned over to that broker for clearance. \r\n\r\nA Power of Attorney form is available on the Cargo Brokers website (www.cargobrokers.com).', 'Terminate Master Bill at the local CBI Port (ATL, CLT, or MIA).  \r\nThe House Bill should terminate at the final destination (the port to which CBI will forward the shipment.  ', 'No special requirements ', 'A copy of the HazMat Declaration or MSDS sheets must accompany shipments (and should be included in the pre-alert).  ', 'IMPORTANT NOTE (AIR EXPORTS FROM USA):\r\nNew security regulations make distinctions between known and unknown shippers. Shipments from unknown shippers ( essentially new clients to Cargo Brokers ) are subject to special scrutiny which may delay the air routing by 4 or more days. \r\nWhen issuing an urgent routing order to Cargo Brokers, please verify with us if your routing may be subject to such delays so that you may advise your importer accordingly of the options available.\r\nTo help avoid potential delays, please provide the pick-up address of the shipment as early as possible so that we can accurately verify the known/unknown status of the shipper.  \r\n\r\n*Note these regulations apply to all US Freight Forwarders.  ');
