(222, '2', '6', 'Sydney:\r\nScorpion International\r\nC/O GP Logistics South Pacific Pty Ltd\r\n16 Anderson Street, Botany\r\n02 9316 4074\r\nCode - GB43N\r\nEmail: sydimport@gplogistics.com.au\r\nEmail: freight@scorpioninternational.com', 'Sydney:\r\nScorpion International\r\n16/5-7 Channel Road, Mayfield West NSW 2304\r\nEmail: emma@scorpioninternational.com\r\n', 'Shipper - Consignee (full details including contact names and number)\r\n', 'Shipper - Consignee (full details including contact names and number)\r\n', ' ', ' ', 'Per above advice', 'Per above advice', 'Per above advice', 'Per above advice', 'freight@scorpioninternational.com\r\n& sydimports@gplogistics.com.au', 'freight@scorpioninternational.com', 'Commercial Invoice: From shipper to Consignee, cargo description, value, shipping terms & currency.\r\nCertificate of Origin: Official Free Trade Agreement origin certs & AUS/USA FTA declarations required  to be able to clear as duty free goods.\r\nAQIS packing declarations required for all imports into Australia.', ' ', 'Commercial Invoice: From shipper to Consignee, cargo description, value, shipping terms & currency.\r\nCertificate of Origin: Official Free Trade Agreement origin certs & AUS/USA FTA declarations required  to be able to clear as duty free goods.\r\nAQIS packing declarations required for all imports into Australia.\r\n', 'Dangerous goods requirements – MSDS & MO41 required', 'For shipments controlled by the Scorpion Branch and routed to another state/city, i.e.: Melbourne, Victoria, please email freight@scorpioninternational.com for instructions BEFORE dispatching the shipment.'),
